INSERT INTO `sl_collection_content` VALUES('698','6','1','1','http://www.iface.com.cn/article/10141/','激光洗眉美容2006-06-02','array (\n  \'title\' => \'激光洗眉美容\',\n  \'time\' => \'1401428561\',\n  \'content\' => \'		  　在人们追求容颜的美丽而求助于纹眉术的过程中，由于各种主、客观 因素影响或随时间的推移、自身年龄的增长、社会审美观念的变迁所造成的纹眉效果的不理想时常发生。最常见的有：眉色的不理想，两侧纹眉形状位置的不对称，眉型与脸型、眼型、年龄、发色等不协调，过黑、过粗、过细，甚至出现一些令人啼笑皆非的怪眉。这些情况的发生，使得纹眉不但不能增添美感，反而丑容，给人们带来烦恼和痛苦。 <BR>　　 那么，如何才能彻底去除不理想的纹眉（洗眉）呢？人们尝试了各种各样的方法：用药物进行化学性剥脱，物理性的磨削，冷冻处理及掩盖性纹眉等等。但结果往往都不能完全去除纹眉，而且可能遗留难看的疤痕。 <BR>　　 经过\r</p>        \',\n)');
