INSERT INTO `sl_collection_content` VALUES('700','6','1','1','http://www.iface.com.cn/article/10103/','纹眉自然吗?2006-06-02','array (\n  \'title\' => \'纹眉自然吗?\',\n  \'time\' => \'1401428561\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 纹眉、纹眼线现在颇流行，观察身旁的人不难发现有些人的眉毛纹得很成功，眉形俏丽逼真，再对嘴唇施以口红，一个简便而又醒目的化妆就使人精神和美化了好多。 <BR>&nbsp;<BR>&nbsp;&nbsp;&nbsp; 然而，并非每一个人都适应纹眉。一般来说，医生只对以下的状况建议纹眉：1．年龄较大者，2．手部颤抖或残障者，3．视力障碍者，4．常运动或流汗，化妆品易脱落者，5．先天没有眉毛或瘢痕性脱毛者。 </P><P>&nbsp;&nbsp;&nbsp; 纹眉是将色素刺入真皮层，以近代的医疗科技，纵然是\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('701','6','1','1','http://www.iface.com.cn/article/10102/','绣眉－眉毛文绣2006-06-02','array (\n  \'title\' => \'绣眉－眉毛文绣\',\n  \'time\' => \'1401428561\',\n  \'content\' => \'		  <P>　　文绣，也叫文眉或绣眉。文绣是个细致活儿，好比在眉毛上绣花一样，一笔一笔，隐忍着疼痛却仍然要执拗地追求美丽，有种古典的感觉。在一些潮流女孩大呼小叫地千变万化时，文绣，仿佛还如处子守护的湖泊，沉稳而安静。但越看越忘不了，印度美女大多也就是这样造出来了，潮流开始反其道而行。&nbsp; </P><P>　　照顾每一根眉毛，立体仿真 </P><P>　　文绣，先要给眉毛设计一个适合的眉形。把杂毛刮掉。然后用文眉机或者绣眉针一点点地按眉形顺文路来文。色料就从针脚慢慢被带入真皮。做好后，感觉眉毛上是立体的，实际上那是一根根地画出来的。 </P><P>　　现在的文绣，比以往的手法更好，用的色料也更好。以往是文成一片一片的，色料整个覆盖住眉毛，这样总是显得眉毛不是很自然，有些生硬。现在的手法是文成一根一根的\r</p>        \',\n)');
