INSERT INTO `sl_collection_content` VALUES('707','6','1','1','http://www.iface.com.cn/article/9855/','如何确定适合眉型2006-05-31','array (\n  \'title\' => \'如何确定适合眉型\',\n  \'time\' => \'1401428559\',\n  \'content\' => \'		  <P>　　眉毛最富于性格特点，画眉时如果能将眉型与个性气质，脸型特点和化妆定位结合在一起，就能使你的妆容呈现独有的个性。俗话说，眉毛的形状决定女人的容貌。不少人因为改变眉型而变得更美。 </P><P>　　最标准的眉型应是自眼首开始，至眼眉及\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('708','6','1','1','http://www.iface.com.cn/article/9841/','种植睫毛安全吗2006-05-31','array (\n  \'title\' => \'种植睫毛安全吗\',\n  \'time\' => \'1401428558\',\n  \'content\' => \'		  &nbsp;&nbsp;&nbsp;&nbsp; 新华网银川１月１２日专电（杨薇）拥有浓密的睫毛，可为眼睛增添不少神采，于是，一种人工“增长”睫毛的方式－－接睫毛（也称“种睫毛”）成为都市爱美女性的选择。然而，市场上出现越来越多的美睫店，其卫生、安全是否能过关，令人生疑。 <BR>　　<BR>&nbsp;&nbsp;&nbsp;&nbsp; 近日，在银川市新华商城里有十来家接睫毛的小店，这些小店规模不等，大都标着“韩国美睫，惊喜价”的字样，\r</p>        \',\n)');
