INSERT INTO `sl_collection_content` VALUES('714','6','1','1','http://www.iface.com.cn/article/9714/','预防眼袋贴心建议2006-05-30','array (\n  \'title\' => \'预防眼袋贴心建议\',\n  \'time\' => \'1401428556\',\n  \'content\' => \'		  <P>1.眼睛周围的皮肤极之薄弱， 化妆或卸妆的时候，动作要轻柔，切忌用力拉扯皮肤。 </P><P>2.画下眼线时以不拉动眼皮为原则，可以用乾粉扑轻按在面上来稳定手的位置，这便不会画错位置了。 </P><P>3.洗面时，用棉花抹洗眼睛周围的皮肤，比用粗糙的毛巾好。 </P><P>4.配戴隐形眼镜的时候，不要拉下眼皮，如果想方便地戴上镜片，可轻轻拉高上眼皮。 </P><P>5.不要养成擦眼睛、眯眼睛、眨眼睛的坏习惯；阳光猛烈的时候要戴上太阳眼镜。 </P><P>6.切忌减肥、节食，以致营养不良或体重突然下降的现象出现，因为\r</p>        \',\n)');
