INSERT INTO `sl_collection_content` VALUES('716','6','1','1','http://www.iface.com.cn/article/9712/','预防眼袋浮肿的方法2006-05-30','array (\n  \'title\' => \'预防眼袋浮肿的方法\',\n  \'time\' => \'1401428555\',\n  \'content\' => \'		  <P>1.眼睛周围的皮肤极之薄弱，化妆或卸妆的时候，动作要轻柔，切忌用力拉扯皮肤。 </P><P>2.画下眼线时以不拉动眼皮为原则，为求方便，可以用乾粉扑轻按在面上来稳定手的位置，这便不容易画错位置了。 </P><P>3.洗面时，用棉花抹洗眼睛周围的皮肤，比用粗糙的毛巾好。 </P><P>4.配戴隐形眼镜的时候，不要拉下眼皮，如果想方便地戴上镜片，可轻轻拉高上眼皮。 </P><P>5.不要养成擦眼睛、眯眼睛、眨眼睛的坏习惯；阳光猛烈的时候要戴上太阳眼镜。 </P><P>6.切忌减肥、节食，以致营养不良或体重突然下降的现象出现，因为\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('717','6','1','1','http://www.iface.com.cn/article/9678/','用眼膜消除黑眼圈2006-05-30','array (\n  \'title\' => \'用眼膜消除黑眼圈\',\n  \'time\' => \'1401428555\',\n  \'content\' => \'		  <P>　　眼膜，眼部肌肤问题的急救措施，但眼膜究竟该怎么用才能令效用升值？市面上的眼膜哪种更好用？我们在这里为你解密——</P><P>　　一、敷眼膜前需要彻底清洁肌肤</P><P>　　不要管眼睛上是否化了彩妆，彻底地清洁肌肤都是非常必要的，卸妆油这个步骤绝不能跳过。</P><P>　　二、将眼膜雪藏</P><P>　　冰冰的眼膜会令浮肿的眼睛得到绝对的舒缓。</P><P>　　三、敷眼膜之前先热敷</P><P>　　敷眼膜之前，最好能够先用热毛巾热敷一下眼睛，这样再敷上冰冰的眼膜时，对于眼部的循环会更理想。</P><P>　　四、敷眼膜要有方向感</P><P>　　对于布式的眼膜来说，要从眼头向眼尾的方向敷，而乳状的眼膜，也要从眼头涂向眼尾，千万不可以来回涂。</P><P>&nbsp;</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
