INSERT INTO `sl_collection_content` VALUES('720','6','1','1','http://www.iface.com.cn/article/9607/','眼袋预防与修护2006-05-29','array (\n  \'title\' => \'眼袋预防与修护\',\n  \'time\' => \'1401428554\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; “巧笑倩兮，美目盼兮”是《诗经》里描写我国古代美女眼神的名句。眼睛是五官中最引人注目的焦点，也是整个脸部中最娇柔脆弱的部分，稍不留神，\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('721','6','1','1','http://www.iface.com.cn/article/9606/','眼睛保湿方法2006-05-29','array (\n  \'title\' => \'眼睛保湿方法\',\n  \'time\' => \'1401428554\',\n  \'content\' => \'		  &nbsp;&nbsp;&nbsp; 近些年来，由于空气污染和空调的普及，干眼症有逐渐增加的趋势，尤其是配戴隐形眼镜者，“网虫”以及学生，由于用眼过度，极易出现干眼症。健康的眼睛主、副泪腺会自然分泌泪液，润滑眼球；若气候干燥，眼睛里水分蒸发得很快。环境污染、空调的使用以及过度用眼的工作，都会加重泪液流失，使得干眼症患者大增。在眼科门诊中，每五个人中就有一个经常抱怨眼睛干涩，痛痒，有灼热感、疲劳感，这些都是干眼症的典型症状，而患者又以学生、电脑工作人员、上班族、开车族居多。隐形眼镜因容易吸附水分，常常使得眼球表面容易脱水，加重干眼症状。隐形眼镜族更要随时保持眼睛湿润，干燥时要随时点用护理液保持隐形眼镜湿润，以免隐形眼镜干燥变形，磨损角膜。如果角膜上皮细胞经常破皮或角质化，后果不堪设想。要做好眼睛保湿，切忌“目不转睛”，不妨频繁眨动眼睛，注意空调不要吹得太久，房间里应使用加湿器，使空气中湿度加大，亦有助于眼睛保持滋润。&nbsp; <BR>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
