INSERT INTO `sl_collection_content` VALUES('643','6','1','1','http://www.iface.com.cn/article/11913/','助长睫毛生长妙方2006-06-19','array (\n  \'title\' => \'助长睫毛生长妙方\',\n  \'time\' => \'1401428582\',\n  \'content\' => \'		  <P>　　每根睫毛都有各自的生存周期，即6个月生长期，继之为休止期而睫毛自毛根分离，以利于毛囊内新的睫毛形成。每日清洗或磨擦都有几根睫毛脱落，这一点往往不被人们所注意。营养不良或长期患病亦可导致睫毛和眉毛脱落，一般，于康复后能再生。另外，有人希望睫毛长得长密而将睫毛刮掉，但并不能如愿。</P><P>　　以下方法能助长睫毛生长：</P><P>　　1、蓖麻油或橄榄油</P><P>　　夜晚，用一种油涂擦，能促进睫毛生长，浓密。这是一古老方法，效果虽缓慢，但确实。此外，在小油瓶内加入柠檬皮碎片，每日涂擦，能使睫毛更华美。</P><P>　　2、液体蛋白是一种辅助食品，每日晚间涂抹，能增强睫毛的强度和长度。</P><P>　　3、凡士林每晚和早晨涂擦，有助于防止或纠正睫毛碎断。</P><P>　　4、维生素D每晚剪开一粒维生素D胶丸，轻拍于眼脸和睫毛，连用3个月，能产生明显效果。<BR>&nbsp;<BR></P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
