INSERT INTO `sl_collection_content` VALUES('645','6','1','1','http://www.iface.com.cn/article/11911/','纹眉的艺术2006-06-19','array (\n  \'title\' => \'纹眉的艺术\',\n  \'time\' => \'1401428581\',\n  \'content\' => \'		  <P>　　十几年前，妇女对眉毛的处理并不讲究，顶多出门前将眉毛画深，只有年纪较长的女性才会去纹眉。 </P><P>　　现在的女性不一样了，为了让自己看起来有精神，年轻女孩会考虑纹眉。空中小姐或销售员因为工作上的需要，必须天天化妆，她们也会考虑纹眉，节省画眉的时间，让化妆变得方便容易。 </P><P>　　但是如果纹眉拙劣，会感觉突兀。有些妇人腊黄着脸，眼神无精打采，上面却顶着两道粗浓蓝绿色的假眉。如何纹得自然柔和，且安全健康？爱美的女性要注意哪些事情？ </P><P>　　安全卫生最重要 </P><P>　　纹眉是刺青的一种，纹眉的染料，大多不易引起过敏。但是纹眉安全与否，最大关键在于可能传染某些传染病，如B型肝炎或C型肝炎。也有因为血液而感染的疾病，像梅毒或爱滋病。因为刺青或纹眉是用针或枪，将颜料送入真皮层。 </P><P>　　国内并没有相关研究指出，因为纹眉所引起的B型肝炎或C型肝炎有多少？但曾有一份研究显示，的确有因为刺青而感染梅毒。相较于纹眉的女性族群，刺青的人口和场所比较复杂，感染传染性疾病的机会也比较大。</P><P>　　医生建议，使用一次性针头或确定纹眉器械是否经过无菌高温消毒，才是避免上述传染病的最好方法。 </P><P>　　专业\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('646','6','1','1','http://www.iface.com.cn/article/11910/','据眉毛特点塑眉形窍门2006-06-19','array (\n  \'title\' => \'据眉毛特点塑眉形窍门\',\n  \'time\' => \'1401428581\',\n  \'content\' => \'		  <P>　　眉毛过于平直：过于平直的眉毛可将眉毛的上缘剃去，使眉毛形成柔和的弧度。</P><P>　　眉毛高而粗：这种眉毛可剃去上缘，使眉毛与眼睛之间的距离拉近些。</P><P>　　眉毛太短：这种眉毛可将眉尾修得尖细而柔和，再用眉笔将眉毛画长些。</P><P>　　眉毛太长：太长的眉毛可剃去过长的部分、眉尾不宜粗钝，宜剃眉尾的下线，使之逐渐尖细。</P><P>　　眉毛稀疏：稀疏之眉可利用眉笔描出短羽状的眉毛，以假乱真，再用眉刷轻刷，使其柔和自然。这种眉形不宜将眉毛画的过于平板。</P><P>　　眉毛太弯：眉毛太弯可剃去上缘，以减轻眉拱的弯度。</P><P>　　眉头太接近：眉头太接近时，可剃去鼻梁的附近的眉毛，使眉头与眼角对齐。</P><P>　　眉头太远：眉头太远时，可利用眉笔将眉头描长，以缩小两眉之间的距离。 <BR></P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('647','6','1','1','http://www.iface.com.cn/article/11909/','纹眉vs画眉哪个适合你2006-06-19','array (\n  \'title\' => \'纹眉vs画眉哪个适合你\',\n  \'time\' => \'1401428581\',\n  \'content\' => \'		  <P>　　爱美是女人的天性，但对于美每个人都有自己不同的理解与认识。怎样才能美？怎样才算美？这是女性最为关心的话题。今天我们的\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('648','6','1','1','http://www.iface.com.cn/article/11848/','眼部皮肤保养方法2006-06-19','array (\n  \'title\' => \'眼部皮肤保养方法\',\n  \'time\' => \'1401428580\',\n  \'content\' => \'		  <P>什么保护眼部皮肤很重要? </P><P>拥有一双年轻、美丽和动人的眼睛是每个人都向往的。然而，眼睛却是\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('649','6','1','1','http://www.iface.com.cn/article/11774/','去黑眼圈用眼膜2006-06-16','array (\n  \'title\' => \'去黑眼圈用眼膜\',\n  \'time\' => \'1401428580\',\n  \'content\' => \'		  <P>　　眼膜，眼部肌肤问题的急救措施，但眼膜究竟该怎么用才能令效用升值？市面上的眼膜哪种更好用？我们在这里为你解密—— </P><P>　　一、敷眼膜前需要彻底清洁肌肤 </P><P>　　不要管眼睛上是否化了彩妆，彻底地清洁肌肤都是非常必要的，卸妆油这个步骤绝不能跳过。 </P><P>　　二、将眼膜雪藏 </P><P>　　冰冰的眼膜会令浮肿的眼睛得到绝对的舒缓。 </P><P>　　三、敷眼膜之前先热敷 </P><P>　　敷眼膜之前，最好能够先用热毛巾热敷一下眼睛，这样再敷上冰冰的眼膜时，对于眼部的循环会更理想。 </P><P>　　四、敷眼膜要有方向感 </P><P>　　对于布式的眼膜来说，要从眼头向眼尾的方向敷，而乳状的眼膜，也要从眼头涂向眼尾，千万不可以来回涂。 </P><P>　　五、敷眼膜的位置要精准 </P><P>　　眼膜到底敷在哪里呢？建议的最佳距离是眼睛下面3毫米的地方，而且只限于下眼。因为上眼的肌肤比较薄，对营养的吸收能力比较有限。如果要敷在上眼，只限于对抗眼睛浮肿。 </P><P>　　六、敷眼膜的时间 </P><P>　　这要看每一种眼膜的不同要求，但不可以敷过长的时间，否则恐怕会适得其反。 </P><P>　　七、眼霜是眼膜的亲密伙伴 </P><P>　　不是说敷了眼膜就足够了，一定要在敷眼膜之后搽上眼霜，这样才能让眼部肌肤得到更好的滋润，如果单单靠敷眼膜，取下后眼部肌肤会有紧绷感，反倒会催生细纹。 </P><P>　　八、敷眼膜的最佳时机 </P><P>　　a．生理周期后一周——体内雌性激素分泌旺盛，这时敷，最有效 </P><P>　　b．泡澡时——借着热气，加速循环 </P><P>　　c．睡觉前——让养分在你睡觉的时候发挥作用 </P><P>　　九、眼膜不能每天敷 </P><P>　　如果每天敷，会长油脂粒的！此外，更不能敷着眼膜睡觉，否则一旦眼膜中的精华液全部挥发了，会带走肌肤中的水分。 </P><P>　　十、眼膜的多重功效 </P><P>　　你额头的表情纹、眼角的小细纹、干纹都逃不过它的魔力。 </P><P>　　眼睛是最容易说出女人年龄秘密的部位，要好好对待它哦，小心泄密. </P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('650','6','1','1','http://www.iface.com.cn/article/11736/','什么是纹眉术2006-06-16','array (\n  \'title\' => \'什么是纹眉术\',\n  \'time\' => \'1401428579\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp;&nbsp; 由于并非所有的人都具有一对自然完美的眉毛，大多需要修饰才富有魅力，于是纹眉术便应运而生。&nbsp; </P><P>&nbsp;&nbsp;&nbsp;&nbsp; 纹眉术是医学\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('651','6','1','1','http://www.iface.com.cn/article/11713/','眼角皮肤保养方法2006-06-16','array (\n  \'title\' => \'眼角皮肤保养方法\',\n  \'time\' => \'1401428579\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 所谓“鱼尾纹”就是眼外眦角皮肤（外眼角皮肤）的皱纹增多而形成的。无论是男性还是女性，在进入40岁以后，一般都会或多或少地出现“鱼尾纹”。“鱼尾纹”的出现容易使人看起来显得衰老，并且影响美观。调查发现，\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('652','6','1','1','http://www.iface.com.cn/article/11636/','去除黑眼圈十方法2006-06-15','array (\n  \'title\' => \'去除黑眼圈十方法\',\n  \'time\' => \'1401428579\',\n  \'content\' => \'		  <P>　　眼膜，眼部肌肤问题的急救措施，但眼膜究竟该怎么用才能令效用升值？市面上的眼膜哪种更好用？我们在这里为你解密—— </P><P>　　一、敷眼膜前需要彻底清洁肌肤 </P><P>　　不要管眼睛上是否化了彩妆，彻底地清洁肌肤都是非常必要的，卸妆油这个步骤绝不能跳过。 </P><P>　　二、将眼膜雪藏 <BR>六、敷眼膜的时间 </P><P>　　这要看每一种眼膜的不同要求，但不可以敷过长的时间，否则恐怕会适得其反。 </P><P>　　七、眼霜是眼膜的亲密伙伴 </P><P>　　不是说敷了眼膜就足够了，一定要在敷眼膜之后搽上眼霜，这样才能让眼部肌肤得到更好的滋润，如果单单靠敷眼膜，取下后眼部肌肤会有紧绷感，反倒会催生细纹。 </P><P>　　八、敷眼膜的最佳时机 </P><P>　　a.生理周期后一周——体内雌性激素分泌旺盛，这时敷，最有效 </P><P>　　b.泡澡时——借着热气，加速循环 </P><P>　　c.睡觉前——让养分在你睡觉的时候发挥作用 </P><P>　　九、眼膜不能每天敷 </P><P>　　如果每天敷，会长油脂粒的！此外，更不能敷着眼膜睡觉，否则一旦眼膜中的精华液全部挥发了，会带走肌肤中的水分。 </P><P>　　十、眼膜的多重功效 </P><P>　　你额头的表情纹、眼角的小细纹、干纹都逃不过它的魔力。 </P><P>　　眼睛是最容易说出女人年龄秘密的部位，要好好对待它哦，小心泄密。</P><P><BR>　　冰冰的眼膜会令浮肿的眼睛得到绝对的舒缓。 </P><P>&nbsp;</P><P>　　三、敷眼膜之前先热敷 </P><P>　　敷眼膜之前，最好能够先用热毛巾热敷一下眼睛，这样再敷上冰冰的眼膜时，对于眼部的循环会更理想。 </P><P>　　四、敷眼膜要有方向感 </P><P>　　对于布式的眼膜来说，要从眼头向眼尾的方向敷，而乳状的眼膜，也要从眼头涂向眼尾，千万不可以来回涂。 </P><P>　　五、敷眼膜的位置要精准 </P><P>　　眼膜到底敷在哪里呢？建议的最佳距离是眼睛下面3毫米的地方，而且只限于下眼。因为上眼的肌肤比较薄，对营养的吸收能力比较有限。如果要敷在上眼，只限于对抗眼睛浮肿。 <BR>&nbsp;<BR></P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('653','6','1','1','http://www.iface.com.cn/article/11572/','切眉的后遗症2006-06-15','array (\n  \'title\' => \'切眉的后遗症\',\n  \'time\' => \'1401428579\',\n  \'content\' => \'		  <P>不知从何时起，“切眉”也成了一种时尚，很多年轻小姐趋之若鹜。“切眉”是将眉毛全部或部分切除，而在本该长眉的地方留下了条暗红色的疤痕。很多人在回答为什么做“切眉”时，答案竟然是时髦。有些广告宣传更是把“切眉”和“韩流”联系起来。</P><P>专家观点：“切眉”既非时尚也非“韩流”，而是一种对纹眉失败以及洗眉留下疤痕的一种矫正和补救措施，对于眉形不佳、纹眉过宽、色不正、上睑皮肤下垂松弛及眉周皱纹、眼角鱼尾纹均有良好的效果。如果把“切眉”当作一种时尚，那将为此付出沉重代价：其一，“切眉”后会留有细的瘢痕；其二，如果是为了赶时髦，过两年时尚风标一转，这种眉型不流行了，但因毛囊已经被破坏，没有再生功能，将不可恢复。</P><P><BR>弊害曝光：眉毛被部分或全部切除后，就失去了立体感，并且会损害眉毛原本具有的阻断汗液及异物对于眼睛伤害的功能。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
