INSERT INTO `sl_collection_content` VALUES('657','6','1','1','http://www.iface.com.cn/article/11568/','种植睫毛容易脱落2006-06-15','array (\n  \'title\' => \'种植睫毛容易脱落\',\n  \'time\' => \'1401428577\',\n  \'content\' => \'		  <P>哪个女孩不想拥有一双美丽动人的双眸呀，眨着忽闪忽闪的眼睛，尤为可爱。于是，“美眼”一族每天不惜花上1—2小时在眼睛上涂涂抹抹，眼线、眼影、睫毛膏轮番登场，一个也不能少。但是一些廉价睫毛膏总是难以达到想象中的效果，不但看上去不自然，而且涂抹时不是睫毛会粘在一起，就是不小心碰到水，糊成一团，搞不好就变成熊猫眼，这无不成一些“美眼”美眉的遗憾。 </P><P><BR>“种植”睫毛成为\r</p>        \',\n)');
