INSERT INTO `sl_collection_content` VALUES('659','6','1','1','http://www.iface.com.cn/article/11466/','提眉切眉美容手术2006-06-14','array (\n  \'title\' => \'提眉切眉美容手术\',\n  \'time\' => \'1401428577\',\n  \'content\' => \'		  <P>针对纹眉失败（过宽、过深、过直、颜色泛蓝、形状不佳或不对称等），眉型不佳，眉毛过粗或粗细不匀、洗眉不净遗留疤痕，上睑皮肤下垂松弛、眉周皱纹及眼角鱼尾纹等患者,可采用提眉切眉术,在眉部切口分离额部皱纹，切除部分额肌，可明显减少额部皱纹。对于眉形不佳，纹眉过宽、过深、色不正，上脸皮下垂松弛、眉周皱纹及眼角鱼尾纹等均可通过提眉术来纠正，使\r</p>        \',\n)');
