INSERT INTO `sl_collection_content` VALUES('661','6','1','1','http://www.iface.com.cn/article/11391/','预防眼袋九方法2006-06-14','array (\n  \'title\' => \'预防眼袋九方法\',\n  \'time\' => \'1401428576\',\n  \'content\' => \'		  <P>　　1.眼睛周围的皮肤极之薄弱，化妆或卸妆的时候，动作要轻柔，切忌用力拉扯皮肤。 </P><P>　　2.画下眼线时以不拉动眼皮为原则，为求方便，可以用乾粉扑轻按在面上来稳定手的位置，这便不容易画错位置了。 </P><P>　　3.洗面时，用棉花抹洗眼睛周围的皮肤，比用粗糙的毛巾好。 </P><P>　　4.配戴隐形眼镜的时候，不要拉下眼皮，如果想方便地戴上镜片，可轻轻拉高上眼皮。 </P><P>　　5.不要养成擦眼睛、眯眼睛、眨眼睛的坏习惯；阳光猛烈的时候要戴上太阳眼镜。 </P><P>　　6.切忌减肥、节食，以致营养不良或体重突然下降的现象出现，因为\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('662','6','1','1','http://www.iface.com.cn/article/11389/','去除眼角皱纹2006-06-14','array (\n  \'title\' => \'去除眼角皱纹\',\n  \'time\' => \'1401428574\',\n  \'content\' => \'		  <P>　　两分钟除皱按摩消除眼下皱纹</P><P>　　两分钟除皱按摩消除眼下皱纹(1分钟)：先在眼周涂上眼霜，然后将双手的食指按压在双眼两侧，用力朝太阳穴方向拉，直至眼睛感到绷紧为止。双眼闭张6次，然后松手，重复做4遍。 </P><P>消除眼角皱纹</P><P>　　消除眼角皱纹(1分钟)：食指和中指按在双眼两侧，慢慢推揉眼侧皮肤，同时闭眼。当眼皮垂下时，手指缓缓地朝耳朵方向拉，从1数到5，然后松手。重复做6遍。 </P><P>　　如何去除油脂粒 </P><P>　　眼周的油脂粒最好待其自然恢复，不要自行去除。如果特别需要处理，建议到专业的\r</p>        \',\n)');
