INSERT INTO `sl_collection_content` VALUES('669','6','1','1','http://www.iface.com.cn/article/11265/','怎样治疗黑眼圈2006-06-13','array (\n  \'title\' => \'怎样治疗黑眼圈\',\n  \'time\' => \'1401428572\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1.保持充足的睡眠及正确的仰卧睡姿，胜过多种护理方法。</P><P>　　2.改正不良的饮食习惯，勿摄入过咸的食物和刺激性过大的食物，勿过多抽烟、喝酒。</P><P>　　3.及时治疗所存在的慢性疾病，加强营养，适当补充维他命C、A、E。</P><P>　　4.穴位按摩：黑眼圈是因为血液循环不佳而造成的，穴位按摩有助于打通血脉；在眼周皮肤上涂上眼部按摩霜或眼部营养霜。用无名指按压童子廖(在眼尾处)、球后(下眼眶中外1/3处)、四白(下眼眶中内1/3处)、睛明(内眦角内上方)、鱼腰(眉正中)、迎香(\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('670','6','1','1','http://www.iface.com.cn/article/11231/','眼线液使用方法2006-06-13','array (\n  \'title\' => \'眼线液使用方法\',\n  \'time\' => \'1401428572\',\n  \'content\' => \'		  <P>眼线液的使用步骤&nbsp; </P><P>　　step1：使用一般的眼线液或是用眼线笔蘸眼线液，从眼头开始描绘出细细的眼线线条。&nbsp; </P><P>　　step2：在眼睫毛根部往眼中描绘，如同填满睫毛根部般的连结出线条，尽量靠近眼皮的边缘才能让眼线如同隐形般漂亮。&nbsp; </P><P>　　step3：眼尾部分要往上拉，且要略为超出眼睛轮廓，如此一来，眼睛轮廓会更加明显，可以从眼尾往眼中部分画回来。 </P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('671','6','1','1','http://www.iface.com.cn/article/11169/','女性眼袋去除方法2006-06-12','array (\n  \'title\' => \'女性眼袋去除方法\',\n  \'time\' => \'1401428572\',\n  \'content\' => \'		  <P>　　很早以前，有个美丽的农妇，为了摆脱恶霸的纠缠，把镪水泼在脸上，毁了自己的容貌。除了这种极端的例子外，很少听说一个人愿意自己变得难看。</P><P>　　实际上，大多数人，尤其是女性，都曾在一生中的某个时期做过那个农妇的举动，她们像那个农妇一样无助的时候，就把痤疮点缀在脸上，或者用忧郁的暗色画上一对黑眼圈，还可能垂下一付疲惫的\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('672','6','1','1','http://www.iface.com.cn/article/11159/','熬夜女人黑眼圈调理2006-06-12','array (\n  \'title\' => \'熬夜女人黑眼圈调理\',\n  \'time\' => \'1401428571\',\n  \'content\' => \'		  <P>最佳答案 <BR>有什么快速便捷的方法去除黑眼圈呢？答案就是就地取材，利用食物外敷都有散瘀及促进血液循环，不妨一试。 </P><P>版本一、 </P><P>1.冰敷 </P><P>用冰垫或冰冻了的毛巾敷在眼睛上，令眼睛周围的血管收缩，帮助眼周肌肤消肿，也能抑制充血。 </P><P>&nbsp;</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
