INSERT INTO `sl_collection_content` VALUES('678','6','1','1','http://www.iface.com.cn/article/10570/','彻底告别熊猫眼2006-06-06','array (\n  \'title\' => \'彻底告别熊猫眼\',\n  \'time\' => \'1401428569\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp;&nbsp; 眼部周围的肌肤构造比较细致、脆弱，容易受外界刺激发生敏感现象。而眼周毛细血管的循环也较差，养分及氧气供给能力较弱，如果睡眠不足，外加过分劳累，血液循环不好的情况雪上加霜，就很容易形成黑眼圈现象。</P><P>&nbsp;&nbsp;&nbsp; 由于劳累以及睡眠不足是导致黑眼圈的主要原因，因此要想迅速消除黑眼圈，根本的方法还需调整作息时间，逐渐向规律的生活习惯过渡。但是也有一些速效的方法可以暂时消除黑眼圈。</P><P>&nbsp;&nbsp;&nbsp; 速效对策：</P><P>&nbsp;&nbsp;&nbsp; * 做好基础保养；</P><P>&nbsp;&nbsp;&nbsp; * 黑眼圈四周抹上遮瑕膏；</P><P>&nbsp;&nbsp;&nbsp; * 扑上一层蜜粉；</P><P>&nbsp;&nbsp;&nbsp;&nbsp; * 呈现明亮的延伸；</P><P>&nbsp;&nbsp;&nbsp; 注意：</P><P>&nbsp;&nbsp;&nbsp; * 液状遮瑕膏彩妆：要遮盖眼周这细致的肌肤部位，首先第一要领就是使用质地轻盈的液状遮瑕膏。由于眼周肌肤皮薄，厚度只有面颊皮肤的1/4厚，所以若选择了浓稠的膏状类修饰产品，会显得不自然。</P><P>&nbsp;&nbsp;&nbsp; * 上妆时注意：脸部清洁完毕，依序执行保养肌肤三步骤(清洁-化妆水-乳液)，做好妆前打底准备。粉底妆均匀打好之后，使用液状遮瑕膏所负的海棉棒沾取适量点在黑眼眶四周。义无名指腹轻轻推匀，再扑上一层透明蜜粉定妆。</P><P>&nbsp;&nbsp;&nbsp; * 暗沉的眼部神情，也可以靠液状遮瑕膏使用在眼皮层上，达到明亮的改变效果。</P><P>&nbsp;&nbsp;&nbsp; * 由根本开始做起：此外适度的眼部按摩，对黑眼圈的改善也有帮助。以中指及无名指使用适当力道，由内往外轻轻按摩下眼眶，对于末梢血液循环有改善的功效。每天耐心的按摩一分钟，可以重展双眸魅力。至于敷眼膜、擦眼霜，供给眼周丰富的滋养成分，也有非常好的功效!</P><P>&nbsp;&nbsp;&nbsp; 美目保养小秘方</P><P>&nbsp;&nbsp;&nbsp; * 暂时性眼部的充血、肿胀，冰敷可以让动脉收缩，达到消肿的目的。以茶包各泡一杯热茶，先享受几分钟放松的品茶心情，之后取出已凉的润湿茶包，在双眼各铺一个，安静的平躺五分钟左右，对疲劳的双眼很有帮助。</P><P>&nbsp;&nbsp;&nbsp; * 太浓的眼部彩妆会增加眼皮负担，让肌肤透不过气，不但加速老化，黑眼圈会更明显，应避免化太浓的妆。多摄取纤维质，有利血液循环，油炸食物少碰为妙。以温热的毛巾覆盖双眼，可以促进眼部的血液循环，再以轻柔的动作作简单的眼部按摩，可以改善黑眼圈。<BR>&nbsp; <BR></P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('679','6','1','1','http://www.iface.com.cn/article/10512/','眼膜护肤功效2006-06-06','array (\n  \'title\' => \'眼膜护肤功效\',\n  \'time\' => \'1401428569\',\n  \'content\' => \'		  <P>　　眼膜，眼部肌肤问题的急救措施，但眼膜究竟该怎么用才能令效用升值？市面上的眼膜哪种更好用？我们在这里为你解密——<BR>　　●10种方式令眼膜升值<BR>　　＊敷眼膜前需要彻底清洁肌肤<BR>　　不要管眼睛上是否化了彩妆，彻底地清洁肌肤都是非常必要的，卸妆油这个步骤绝不能跳过。<BR>　　＊将眼膜冷藏</P><P>　　冰冰的眼膜会令浮肿的眼睛得到绝对的舒缓。</P><P>　　＊敷眼膜之前先热敷</P><P>　　敷眼膜之前，最好能够先用热毛巾热敷一下眼睛，这样再敷上冰冰的眼膜时，对于眼部的循环会更理想。</P><P>　　＊敷眼膜要有方向感</P><P>　　对于布式的眼膜来说，要从眼头向眼尾的方向敷，而乳状的眼膜，也要从眼头涂向眼尾，千万不可以来回涂。</P><P>　　＊敷眼膜的位置要精准</P><P>　　眼膜到底敷在哪里呢？建议的最佳距离是眼睛下面3毫米的地方，而且只限于下眼。因为上眼的肌肤比较薄，对营养的吸收能力比较有限。如果要敷在上眼，只限于对抗眼睛浮肿。</P><P>　　＊敷眼膜的时间</P><P>　　这要看每一种眼膜的不同要求，但不可以敷过长的时间，否则恐怕会适得其反。</P><P>　　＊眼霜是眼膜的亲密伙伴</P><P>　　不是说敷了眼膜就足够了，一定要在敷眼膜之后搽上眼霜，这样才能让眼部肌肤得到更好的滋润，如果单单靠敷眼膜，取下后眼部肌肤会有紧绷感，反倒会催生细纹。</P><P>　　＊敷眼膜的最佳时机</P><P>　　a、生理周期后一周——体内雌性激素分泌旺盛，这时敷，最有效</P><P>　　b、泡澡时——借着热气，加速循环</P><P>　　c、睡觉前——让养分在你睡觉的时候发挥作用</P><P>　　＊眼膜不能每天敷</P><P>　　如果每天敷，会长油脂粒的！此外，更不能敷着眼膜睡觉，否则一旦眼膜中的精华液全部挥发了，会带走肌肤中的水分。</P><P>　　＊眼膜的多重功效</P><P>　　你额头的表情纹、眼角的小细纹、干纹都逃不过它的魔力。&nbsp; <BR></P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
