INSERT INTO `sl_collection_content` VALUES('682','6','1','1','http://www.iface.com.cn/article/10459/','眼角肌肤保养2006-06-06','array (\n  \'title\' => \'眼角肌肤保养\',\n  \'time\' => \'1401428567\',\n  \'content\' => \'		  <P>　　眼角是最早出现皱纹的地方，应特别关注眼角的护理。皮肤衰老最先表现在眼角。因为大家知道，眼睛周围的皮肤要比脸上其它部分的皮肤薄10倍，而我们每天却要大约眨 12000次眼睛。因此，皮肤专家认为，一般从25岁起，眼角就应该得到特殊的呵护了。 </P><P>　　由于眼角专用的护肤品一般很细腻，不会象普通的护肤品一样对眼睛产生刺激。平时女性使用化妆品时，常常不忘将营养面霜涂抹于眼部周围，其实这样很不科学。 </P><P>　　第一，营养面霜一般含有较多油性成分，而眼睛周围皮肤吸收力较强，久而久之，营养油脂过剩便会沉积在皮下，形成\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('683','6','1','1','http://www.iface.com.cn/article/10456/','找到适合自己眼霜2006-06-06','array (\n  \'title\' => \'找到适合自己眼霜\',\n  \'time\' => \'1401428567\',\n  \'content\' => \'		  <P>　　眼霜选错了，反而会弄巧成拙，以下是几种眼霜和运用范围： </P><P>　　滋润眼霜：具有较强的保湿功能，尤适宜秋冬季节和空调间工作的女性使用。 </P><P>　　抗老化眼霜：具有抗皱及防晒功能。适合夏季和视屏工作者使用。 </P><P>　　紧实眼霜：富含滋养成份，油性成份配比高于滋润眼霜，适于黑眼圈，皮肤衰老及干性肤质的女性。 </P><P>　　抗敏眼霜：适宜敏感性、问题性肤质的女性。 </P><P>　　眼部面膜：有各种不同配方的眼膜，最好在\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('965','6','1','1','http://www.iface.com.cn/article/1903/','眼圈黑是肾虚吗2006-01-10','array (\n  \'title\' => \'眼圈黑是肾虚吗\',\n  \'time\' => \'1401428457\',\n  \'content\' => \'		  <P>　&nbsp; 有的人看上去眼圈黑，身体没觉得有什么不舒服，便说是\"肾虚\"。肾虚是中医医学学术语。肾虚泛指腰酸、肢冷、腿软、性功能减退、耳鸣、经期异常、白带稀薄及闭经等。其实单纯眼圈黑不是病态，用不着担惊害怕，乱吃补药。只要精神愉快，多活动锻炼身体，充足睡眠，少则3~5天，多则1~2周，黑眼圈随后也就消失了</P><P>　　黑眼圈常常是疾病的苗头，按现代医学来看，许许多多慢性病影响微循环会出现不同程度黑眼圈，当然还会伴随一些显而易见的病象，不仅仅是肾虚而涉及心、肝、脾、肺，任何器官有病有时都会表现出黑眼圈。诸如肝脏病时，肝硬化病人；肾炎，肾功能衰竭、呼吸衰竭时；血液病如再生障碍性贫血、血小板减少性紫瘢病等也有黑眼圈出现；一些内分泌紊乱性疾病如甲状腺功能减退、柯兴氏综合片等，都会出现黑眼圈，另外，人的眼睑(眼皮)及其周围组织很薄，如劳累、失眠后，眼睑长时间收缩，引起结缔组织血管充血，血流不畅，微循环障碍，眼圈也会发黑。</P><P>　　因此，当眼圈黑又不无其他症状，体片伴随时，不要害怕。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('952','6','1','2','http://www.iface.com.cn/article/1916/','预防和治疗黑眼圈2006-01-10','array (\n  \'title\' => \'预防和治疗黑眼圈\',\n  \'time\' => \'1401428463\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 1、保持充足的睡眠及正确的仰卧睡姿，胜过多种护理方法。 </P><P>　　2、改正不良的饮食习惯，勿摄入过咸的食物和刺激性过大的食物，勿过多抽烟、喝酒。 </P><P>　　3、及时治疗所存在的慢性疾病，加强营养，适当补充维他命C、A、E。 </P><P>　　4、穴位按摩：黑眼圈是因为血液循环不佳而造成的，穴位按摩有助于打通血脉；在眼周皮肤上涂上眼部按摩霜或眼部营养霜。用无名指按压童子廖(在眼尾处)、球后(下眼眶中外1/3处)、四白(下眼眶中内1/3处)、睛明(内眦角内上方)、鱼腰(眉正中)、迎香(\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('960','6','1','2','http://www.iface.com.cn/article/1908/','五种食物吃掉黑眼圈2006-01-10','array (\n  \'title\' => \'五种食物吃掉黑眼圈\',\n  \'time\' => \'1401428459\',\n  \'content\' => \'		  　&nbsp; 通宵达旦看碟、彻夜不眠加班……第二天一早，两只熊猫眼就成了“鉴证实录”的铁证。就算抹上厚厚的粉底，还是欲盖弥彰，令人苦不堪言。<BR>　　 <BR>　　正所谓“知己知彼，百战不殆”，想要彻底“歼灭”黑眼圈，就应该从其成因着手。据了解，黑眼圈大致可分为两种，一种是血管型黑眼圈，是由于眼眶周围的皮肤特别薄，而皮下的组织又少，一旦血液循环不佳或血管扩张，就形成了黑眼圈；另一种是色素型黑眼圈，是指因色素沉淀在眼眶周围而产生的黑眼圈。<BR>　　 <BR>　　形成上述两种黑眼圈的成因很多，除了体质遗传导致眼睛周围的皮肤天生黑色素较深外，吸烟饮酒、情绪低沉、思考过度或是熬夜引起睡眠不足等都会引起黑眼圈。此外，过敏性鼻炎等病患或眼部卸妆不彻底的色素沉淀和缺乏体育锻炼，使血液循环不良等日常生活上的其他因素，也会使人不知不觉产生“熊猫眼”。而，要将“熊猫眼”扼杀在萌芽状态之中，除了保证充足的睡眠、进行适量的有氧运动之外，均衡合理的饮食也是有效良方。<BR>　　 <BR>　　这里推荐五种食物，可以让你省却因购买昂贵奢侈的眼霜、眼膜而“大出血”，仅需在日常饮食中增加其摄入量，就能使你和黑眼圈轻松说拜拜了！<BR>　　 <BR>　　鸡蛋<BR>　　 <BR>　　由于鸡蛋中富含优质蛋白质，而蛋白质又能促进细胞再生，因此经常食用鸡蛋，增加蛋白质的摄入，对于缓解黑眼圈的形成是有一定功效的。但因人体每日最多只能吸收两个鸡蛋所含的营养，因此食用鸡蛋不宜超过两个。有些人习惯食用生鸡蛋，事实上，生鸡蛋极不易消化，还含有细菌，因此建议大家食用白煮蛋为最佳。此外，瘦肉、禽蛋、水产等也富含优质蛋白质，经常食用此类食物也有助于减少黑眼圈的形成，但由于鸡蛋的蛋白质组成和人体的最接近，所以吸收效果最好。<BR>　　 <BR>　　芝麻<BR>　　 <BR>　　芝麻乌发的作用人尽皆知，但其消除黑眼圈的功效可能就鲜人知晓了。芝麻富含对眼球和眼肌具有滋养作用的维生素E，从而能缓解黑眼圈的形成。既能使秀发乌黑靓丽，又能消除黑眼圈，一举两得，难怪有人将芝麻视为神奇的“魔法食物”。除了芝麻，富含维生素E的其他食物还有花生、核桃、葵花子等。<BR>　　 <BR>　　胡萝卜<BR>　　 <BR>　　除了维生素E能对眼球和眼肌有滋养作用外，维生素A也有此般功效。胡萝卜就是增加维生素A摄入量的不二选择，它能维持上皮组织正常机能，改善黑眼圈。此外，胡萝卜中所含的维生素A还有助于增进视力，尤其是黑暗中的视力。其他蕴含维生素A的食物还有动物肝脏、奶油、禽蛋、苜蓿、杏等。<BR>　　 <BR>　　海带<BR>　　 <BR>　　由于铁质是构成血红蛋白的核心成分。因此，补充适量的铁质能够促使血红蛋白的增加，从而增强其输送氧分和营养成分的能力，而海带富含铁质，所以经常服用海带，也能缓解黑眼圈的困扰。其他含铁质丰富的食物还有动物肝、瘦肉等。<BR>　　 <BR>　　绿茶<BR>　　 <BR>　　经常使用电脑者可饮用绿茶，补充特异性植物营养素，消除因电脑辐射引起的黑眼圈。绿茶所含有的浓缩多酚，能抑制自由基对皮肤支持纤维造成破坏，是今日一致公认最有效的抗自由基因子。多喝低咖啡因的绿茶不仅能消除黑眼圈，其含有的儿茶素，既能帮助身体\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('1352','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/659.html','打造芭比女神 电力十足睫毛妆俘获他的心','array (\n  \'title\' => \'打造芭比女神 电力十足睫毛妆俘获他的心\',\n  \'time\' => \'1401852389\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>　　曲卷翘的睫毛就如同小扇子，搭配优雅的妆容，甜美的笑容，让你在和他约会时也能大眼放电，如同芭比，快快俘获他的心!想在和男友约会时电力十足吗?快来学习接下来的羽睫芭比小妙招，做个芭比女孩吧!</p><p>　　1.轻薄底妆</p><p>　　冬天室内的暖气或空调都非常足，所以在室内约会其实有可能会比较热，所以清透的底妆，能在你出汗的时候防止晕妆，并且补妆的时候也会很方便。</p><p>　　2.假睫毛不能忘</p><p>　　让眼睛大有的时候不一定要用眼线!相反，约会的时候眼线太粗会适得其反，给他大浓妆的印象，所以一副让眼睛变大的假睫毛必不可少，根据自己的眼影修剪﹑粘贴，能够让眼妆的效果完美化。</p><p>　<strong>　Step by Step超细节步骤讲解中</strong></p><p>　　Step 1 轻薄无瑕底妆</p><p>　　使用粉底刷涂抹粉底，这样能让底妆更加轻薄。之后在T区﹑C区以及下巴部分，选用带有细腻珠光粒子的散粉进行提亮。</p><div style=\"text-align: center; \"><img src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112630563.jpg\" width=\"597\" border=\"0\" height=\"244\" alt=\"\" /></div><p>　　Step 2 眼部打底</p><p>　　整个眼妆的眼影部分，只需要这一步，选用大地色眼影，涂抹在整个眼窝。</p><div style=\"text-align: center; \"><img src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112630944.jpg\" width=\"598\" border=\"0\" height=\"190\" alt=\"\" /></div><p>　　Step 3 描绘细眼线</p><p>　　选择黑色眼线液，紧贴睫毛根部勾勒眼线，眼尾稍稍向上延伸上翘。</p><p>　　Step 4 比量假睫毛</p><p>　　因为每个人的眼睛长度都不一样，所以一副假睫毛开始用之前，一定要根据自己的眼长进行修剪，首先取下来后，先和自己的眼睛进行对比，确认长度。</p><div style=\"text-align: center; \"><img src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112631456.jpg\" width=\"591\" border=\"0\" height=\"237\" alt=\"\" /></div><p>　　Step 5 剪假睫毛</p><p>　　记住假睫毛的长度，用小剪刀去掉眼头和眼尾多余的部分。</p><p>　　Step 6 弯曲假睫毛</p><p>　　在睫毛的透明梗上均匀涂抹睫毛胶，眼头眼尾可以多涂一些，防止眼头眼尾起翘。捏住两头两尾，弯曲睫毛保持几秒钟，使它更为柔软，更好佩戴，更加贴合你的眼睛弧度。</p><p>　　Step 7 戴假睫毛</p><p>　　等睫毛胶稍稍有了一些黏度以后，佩戴假睫毛。之后轻刷睫毛膏。</p><p>　　Step 8 轻扫腮红</p><p>　　轻轻微笑，让苹果肌突出，并在其上轻轻涂抹粉色腮红。</p><p>　　Step 9 涂抹唇彩</p><p>　　选择裸粉色，涂抹在双唇，打造亮泽立体的嘟嘟唇。</p><p>　　Step 10 最后定妆</p><p>　　用大号散粉刷，选择透明散粉，整脸定妆，让妆容能够保持得更久。</p><p>　　武汉中翰整形中翰\r成为您的私人美丽医生，为您管理360天的美丽与青春，完美提升您的魅力之姿与生活品质。一次选择，美丽终身!文/豆浆\r</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1353','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/640.html','“黄金剩女”志玲羡慕王力宏闪婚 暗示明年要脱单','array (\n  \'title\' => \'“黄金剩女”志玲羡慕王力宏闪婚 暗示明年要脱单\',\n  \'time\' => \'1401852389\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　39岁林志玲出席知名婚纱旗舰店开幕活动，吸引大批媒体采访，现场已是人山人海，但仍有疯狂粉丝成功突围冲入店内，当众对林志玲大喊&ldquo;我爱你&rdquo;、&ldquo;我们是前世今生的一对&rdquo;，场面一度混乱，林志玲亦被粉丝行为吓到，主持立即叫保安驱散粉丝，志玲EQ高，她说：&ldquo;好久没有人告白了，没关系不要阻止他，听一下也好!&rdquo;化解尴尬场面。</p><p>　　除了疯狂粉丝外，还有一名小男童献花告白，亦令林志玲又惊又喜。刚刚过了39岁生日的志玲，恋情告吹后表示希望在今年能遇到合适人选，不过现在似乎仍是单身。距离年底已经不足30天，她同自己说要多多加油。被传媒封为&ldquo;黄金剩女&rdquo;的志玲无奈地说：&ldquo;就剩我了!&rdquo;而近日更有算命师预测，称林志玲如果过了40岁，可能无法再找到另一半，她也点头说：&ldquo;宁可信其有，我会听的!&rdquo;</p><p>　　近日演艺圈喜事接二连三，身在国外工作的志玲，听到王力宏(微信号：wlhmusicman) 已经成家立室也显得惊讶，他表示之前完全没到听到消息，也令她羡慕，并憧憬能有一个可以陪伴活到老的人出现，不过现在还很享受单身，笑言可能要去多写微博，看会不会有好事发生。</p><p>　　俗话说的好&ldquo;干的好不如嫁得好&rdquo;，对于女人来说，美满的婚姻是女人一生的幸福。但是现在大龄剩女越来越多，幸福指数越来越低。如何能很快的把自己嫁出去呢，情感专家说，首先要花点时间，扮靓自己，成为最好的自己，才能遇上那个他。</p><p>　　武汉中翰整形中翰\r成为您的私人美丽医生，为您管理360天的美丽与青春，完美提升您的魅力之姿与生活品质。一次选择，美丽终身!文/豆浆\r</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1354','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/570.html','美联臣去眼袋手术术后护理全攻略','array (\n  \'title\' => \'中翰\r去眼袋手术术后护理全攻略\',\n  \'time\' => \'1401852386\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　眼睛出现了眼袋就会显得没精神，爱美人士最不愿看到的就是自己有了眼袋，那么如何消除眼袋呢?目前最有效的消除眼袋的方法就是利用眼睛整形美容手术。但是去眼袋手术毕竟是一种手术，是会对眼部肌肤造成创伤的，所以我们在术后一定要做好护理保证手术的顺利恢复才会获得好的手术效果。下面小编就给大家介绍一下全面的去眼袋术后护理方法，让手术效果发挥的更好。</p><center><img border=\"1\" alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112627493.jpg\" width=\"360\" height=\"522\" /></center><p>　　1、刚刚做完眼袋后皮下的麻药还是有一部分，会有一些肿胀可能会感觉眼睛有酸胀感，这些都是正常现象一般两小时过后就可以恢复正常。可以适当的说一下冰敷，消肿效果会更好，而且还可以有效的防止淤血的形成，也可口服云南白药放置淤血和肿胀。</p><p>　　2、去眼袋术后当天尽量平卧休息。可以适当将头部垫高，这样有利于眼部消肿。48小时内尽量冰敷适当压迫，一般15分钟为宜，每天4-5次。做眼袋术后眼睛的分泌物较多，可配合氯霉素眼药水每天三次，每次2-3滴清洁眼部这样有利于恢复。</p><p>　　3、术后忌食海鲜、鸡蛋、牛羊肉以及辛辣刺激性食物。生的葱、姜、蒜尽量避免。合理膳食，适量补充蛋白质，有利于创面的恢复。适当吃些水果，补充维生素。</p><p>　　4、避免剧烈运动。因为眼袋属于软组织，运动后血液循环加快容易造成眼部的淤血、血肿以及球后出血的现象。除不能运动外还要避免提拉重物，正常行走，下蹲动作时动作幅度一定要小，尽量要缓慢。做眼袋术后千万不要服用阿司匹林类抗凝血的药物，这也会引起眼袋的淤血。</p><p>　　5、另外，去眼袋术后同双眼皮手术一样48小时候可以适当的热敷。促进眼周的血液循环，散去淤血，帮助眼袋消肿。恢复的过程中心情也是很主要的，保持良好的心态，不要担心恢复期时的肿胀，一般一周后基本都可以恢复正常。</p><p>　　去眼袋手术术后护理事项，通过介绍您知道了吧。这就是去眼袋手术术后护理的一些重要事项。虽然通过眼睛整形美容是最好的消除眼袋的方法，但是我们平时也不能忽略眼部的护理，只有全面的预防和治疗眼袋，才能保证不再出现这种眼部问题。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1355','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/571.html','激光去眼袋的效果好不好呢？','array (\n  \'title\' => \'激光去眼袋的效果好不好呢？\',\n  \'time\' => \'1401852386\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　激光祛眼袋(去眼袋)的效果好吗?大家都知道，祛眼袋手术在当下已经是非常风靡的一项眼部整形美容方式了。它可以有效的解决我们的眼袋状况，让我们的眼睛看起来更明亮有神。那么，激光祛眼袋的效果好吗?下面，我们就一起来看看武汉中翰整形美容医院\r的专家是怎么说的吧。</p><center><img border=\"1\" alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112627860.jpg\" width=\"360\" height=\"358\" /></center><p>　　激光祛眼袋的效果好吗?武汉中翰整形美容医院\r的专家表示，激光去眼袋，就是利用超高能、超频率的脉冲激光瞬间气化眼袋脂肪，激光去眼袋不开刀，术中不出血、不缝针、不包扎、不拆线、不留疤痕，不影响工作，不受性别、年龄、季节限制，一次见效，所以说激光去眼袋的效果是很好的。专家还说，激光去眼袋手术时间短，并且术中无出血。术后恢复快，不会为求美者带来任何痛苦。因此，它受到了很多都市白领的喜爱与青睐。</p><p>　　激光祛眼袋的效果好吗?通过上面的介绍，现在大家对这个问题是不是都有了一定的了解了呢?如果您还有不明白的问题需要咨询，欢迎在线咨询武汉中翰整形美容医院\r的专家。我们会竭诚为您服务。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1356','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/569.html','盘点去眼袋手术的四大疑问','array (\n  \'title\' => \'盘点去眼袋手术的四大疑问\',\n  \'time\' => \'1401852386\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　眼袋的形成原因是什么?</p><p>　　在手术去眼袋临床研究中，眼袋的形成是由多种因素造成，如遗传、眶隔松弛造成眶隔脂肪由于重力作用脱垂而促使眼袋产生，用眼疲劳也会导致眼袋出现。年轻人的眼袋主要是遗传因素，中老年人则多由皮肤自然松弛而引起，但总的说来，在形成机理上是差别不大的。</p><p>　　眼袋与肥胖有何关系?</p><p>　　眼球位于眼眶内，四周均有脂肪组织衬垫，起保护和缓冲作用，便于眼球活动。即使最肥胖或最消瘦的人，眼球周围的脂肪量是没有明显差别的，所以眼袋与肥胖无关。</p><p>　　两种手术进路有何不同?</p><p>　　经结膜进路的手术有一最大的优点即外面一点都没有手术痕迹，但由于是从眼内手术，一则损伤眼球的可能性增大了，二则其不能对眼轮匝肌和皮肤进行处理，所以该手术只是针对只有脂肪膨手术去眼袋隆的年轻人。</p><p>　　去除的眼袋不会反弹，是这样吗?</p><p>　　的确，首先去除移位的脂肪，只要手术医生去得彻底，眼袋便再也不会反弹。因为眼袋的脂肪不会再生，如果会再生做眼袋手术就没有什么意义了。脂肪去除后让下眼睑皮肤、肌肉以及其他组织减除压力，然后充分自然恢复，不会造成变形与外翻。但是90%以上的人去除脂肪后暂时不需要去皮，皱纹也不会明显增加，如果你的皮肤弹性好反而会减少皱纹。不过随着年龄增长皮肤会松弛，但是要比没去脂肪前明显松弛慢得多，皱纹也形成少。做手术去眼袋时须知，眼袋形成后去脂肪越早，需要去除皮肤越晚，去脂肪越晚需要去皮肤越早，因为皮肤撑松回缩差。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1357','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/568.html','详解水泡眼形成的7大原因','array (\n  \'title\' => \'详解水泡眼形成的7大原因\',\n  \'time\' => \'1401852386\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　在水泡眼矫正术的治疗临床上，眼球突出可用眼球突出计测量。我国正常人眼球突出度约为12-14毫米，两眼相差一般为0.5-2毫米。如果差数过大，即为病态。双眼骨性眶外缘之间距称为眶距，正常者平均为95毫米。</p><p>　　眼球突出的七大原因如下：</p><p>　　1、外伤性：外伤性眼球突出症常见于外伤后眼眶内出血或眼眶气肿。</p><p>　　2、内分泌性：这是眼球突出最常见的原因，又可分为甲状腺素性眼球突出和促甲状腺素性眼球突出。前者为甲状腺功能亢进引起，后者是指垂体分泌的促甲状腺素分泌过多而发生的显著性眼球突出。</p><p>　　3、眼眶肿瘤性：由于肿瘤在眼眶内逐渐长大，占据眼眶的位置而将眼球推挤向前。水泡眼矫正术临床研究发现，眼眶肿瘤大多数原发于眶内，少部分由附近的副鼻窦蔓延而来，极少由全身转移而来。</p><p>　　4、炎症性：一种是由眼眶急性炎症引起的眼球突出，如眼球筋膜炎、眼眶蜂窝组织炎、海绵窦血栓静脉炎等。另一种是由眼眶的慢性炎症如炎症细胞的浸润、纤维组织的增生等，临床表现与肿瘤相似，故称假瘤。</p><p>　　5、间歇性：这种眼球突出在低头并用力屏气时，或压迫眼球颈静脉时，多见于眼眶静脉曲张患者，当抬头或松气时，眼球又复位。</p><p>　　6、搏动性：由于颈内动脉破裂而与海绵窦相沟通所引起，常见于外伤颅底骨折、颈动脉粥样硬化、动脉瘤等。</p><p>　　7、先天性因素导致的眼球突出。</p><p>　　水泡眼即眼球突出症的分类：</p><p>　　1、眼球突出可分为单侧性和双侧性。单侧突出者则常为眶内和颅内疾病所致，但全身疾病如白血病、淋巴瘤等也可引起。双侧性突出多为全身性疾病所致。</p><p>　　2、眼球突出可分为假性和真性两种。假性眼球突出多为眼球本身疾患而引起的眼球增大，如角膜葡萄肿、轴性高度近视和先天性青光眼等。在水泡眼矫正术临床上，真性眼球突出从病因方面讲，可分为炎症性、内分泌性、血管性、肿瘤性、外伤性及少见的寄生虫性。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1358','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/567.html','三种方法轻松去眼袋','array (\n  \'title\' => \'三种方法轻松去眼袋\',\n  \'time\' => \'1401852385\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　每天早上醒来，最让人接受不了的就是看到镜子中的自己眼睛浮肿，重重的眼睛好像怎么也睁不开，看起来格外沧桑。应该怎么办?眼袋怎么去除才最有效呢?下面小编帮你总结几种好方法，快速摆脱眼袋困扰!</p><p>　　一、日常改善眼袋的方法</p><p>　　1、充足的睡眠</p><p>　　睡眠的长期不足，是过早出现眼袋加重的重要原因。现代研究证明，良好的睡眠，可明显改善眼睑组织的血液循环，可使眼周各层组织保持良好的活力，从而有效地防止眼袋的发生与加重，如果长期睡眠不足，则使眼周组织慢性疲劳，血运障碍，使得各层组织退行性衰老改变，再加以重力的作用，使得眼袋过早出现，并迅速加大加重。</p><p>　　2、良好的饮食习惯</p><p>　　在日常饮食中，应该多吃山药、赤小豆、芡实、茯苓、莲子、薏米、豇豆等食物，如果您想通过花卉来调理，可以选择茉莉花、葛花、白扁豆花等，这些花都具有芳香化湿、醒脾和胃的功效，既可以用来熬粥，也可以泡茶，而且它们的功效也不是单一的，像茉莉花不仅能化湿，还能清肝明目、清新口气;葛花素有&quot;千杯不醉葛藤花&quot;的美誉，常用来解酒;白扁豆花还有祛暑、治女性白带过多的功效。</p><p>　　二、胶原蛋白消除眼袋</p><p>　　如果你属于松弛性眼袋眼袋，补充胶原蛋白是最佳缓解眼袋的方式。由于松弛性眼袋是皮肤松弛造成。所以提升皮肤紧致度是主要的改善途径。补充胶原蛋白可以直接紧致肌肤，对缓解眼袋具有一定的作用。目前比较理想的方式是口服胶原蛋白或采用含有胶原蛋白成分的眼膜。</p><p>　　三、激光消除眼袋</p><p>　　目前最成熟的激光去眼袋技术因其时间短、恢复快、无出血、痛苦小等优势，受到众多求美者的青睐。它采用新型的高能超脉冲激光，从睑板内侧结膜处切一约0.3CM的切口，然后从切口处依次取出内，中，外三块脂肪团，再使用激光气化收缩真皮组织，整个手术过程只需20分钟左右。</p><p>　　对于膨陲外观明显，再加以有较深的颊睑沟者，近年开始采用&quot;眶隔释放法&quot;进行矫治。此手术可采用结膜面入路，也可采用下睑缘切口入路，手术将眶隔膜完全打开，将眶隔脂肪释放，并将其固定缝合于颊睑沟处，这样就将膨陲样外观消除，同时也将颊睑填充起来，恢复年轻的自然过渡，此种术式效果确实可靠，但掌握较困难，医师必须具备较丰富的临床经验。</p><p>　　激光法的优点是出血少，缺点是做手术的过程中有明显的烧焦味。同时强烈的光可能灼伤眼睛，因此做的同时必须保护好眼睛。此外，激光去眼袋对皮肤表面无损伤，适应范围广，一般保持2-5年。但是需要注意的是，激光对深层次的眼袋没有效果。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1359','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/538.html','美联臣专家研指出内双眼也能做双眼皮','array (\n  \'title\' => \'中翰\r专家研指出内双眼也能做双眼皮\',\n  \'time\' => \'1401852385\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　每个人的眼睛都不是十全十中翰\r专家针对内双眼，更是研究出具有针对性的手术方案，让内双女性也可以做双眼皮。</p><p>　　双眼皮手术虽然可以实现内双眼女性的梦，但是也并不是所有人都适合这项手术，只有符合手术指标才可以进行手术。中翰\r专家根据内双眼的仔细研究制定出以下双眼皮手术方案。</p><p>　　内变双手术一般方案</p><p>　　内双的人群，眼皮皱褶的位置比较低，所以不会像正常双眼皮那样明显，我们可以通过且割双眼皮来实现内变双的手术目的。一般手术就是将皮上睑肌和腱膜在正常的位置割开，使其跟眼睑皮肤形成粘连，形成正常的褶皱。这样就实现了内变双的手术目的。</p><p>　　内变双手术方案选择</p><p>　　存在肿眼泡的人群，实现双眼皮，不能进行埋线手术，这种手术只适合眼部皮肤较薄的人群。眼睑皮肤比较松弛的人群，只能是先切开双眼皮，然后去除多余的皮肤，这样割双眼皮才能取得很好的效果。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1360','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/537.html','双眼皮宽窄不一适合不同人群','array (\n  \'title\' => \'双眼皮宽窄不一适合不同人群\',\n  \'time\' => \'1401852384\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　很多进行双眼皮手术的求美者，术后并不是满世界清一色的双眼皮，整形医生会根据受术者的职业特点与整个脸型，整体来设计双眼皮的宽度，从而让求美者不仅仅拥有双眼皮，更要拥有漂亮的双眼皮。</p><p>　　很多眼部整形正规医院，对于前往进行咨询的求美者，都要问其职业特点，了解辛格特点以及个人要求。根据以上几点为求美者设计完美双眼皮。</p><p>　　1、较窄双眼皮</p><p>　　较窄的双眼皮宽度一般在4-5mm，一般这些人属于保守派女性，想要拥有明媚双眸，却又不想过于招摇，所以会选择较窄一些，不容易被人看出进行过双眼皮手术。</p><p>　　2、较宽双眼皮</p><p>　　较宽的双眼皮宽度在1cm以上，这种适合脸型方正或者哪些一个是明星，可以无只限的炫耀自己的美。</p><p>　　3、适中双眼皮</p><p>　　适中双眼皮宽度在7-8mm，这种宽度适合很多人，很多人乐于接受的。</p><p>　　4、全长一致双眼皮</p><p>　　双眼皮的皱褶与睑缘的距离适中，并且两者长度保持一致。这种双眼皮让眼睛变得温柔、明快，适合眼裂细长的人群。</p><p>　　5、外宽内窄双眼皮</p><p>　　双眼皮皱褶与睑缘的距离在睑缘的外1/3部较宽(大于7-8mm)，在内1/3部较窄(小于7-8mm)。这种适合于脸型长方。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1361','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/536.html','避免走进双眼皮手术误区','array (\n  \'title\' => \'避免走进双眼皮手术误区\',\n  \'time\' => \'1401852384\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　自从双眼皮手术诞生以来，单眼皮女生，再也不用为自己的单眼皮而烦恼了，只需通过一个小小的手术，眼睛就可以实现由单变双。不要轻看这个小小的双眼皮手术，如果缺乏专业知识，受术者很容易走进误区，从而导致手术的失败。</p><p>　　通过中翰\r专家介绍，我们全面剖析一下，众多单眼皮女生容易走进的手术误区。</p><p>　<strong>　手术以后才能看到效果</strong></p><p>　　很多单眼皮朋友都很想尝试一下双眼皮手术，但是由于并不晓得双眼皮是否适合自己，总是按兵不动，其实方法很简单。如果想立马出小手术效果，只需双眼皮胶，给自己粘出一个双眼皮即可呈现双眼皮手术效果。或者可以到整形医院请求医生做一个小小的测试即可。</p><p>　<strong>　老年人不能进行双眼皮手术</strong></p><p>　　爱美女性不仅仅是年轻女性的团队，很多中老年朋友也踊跃参加进来。但是对于双眼皮手术，大家还是盲目认为，并不适合中老年人。出于老年人皮肤弹性差，眼睑下垂等，这些考虑也并不是没有道理，但是现在的双眼皮手术根据不同年龄段的单眼皮女性，有不同的手术方案，针对老年朋友，可以在割双眼皮的同时，改善眼睑下垂，让老年朋友一样可以体会双眼皮的美丽。</p><p>　<strong>　割双眼皮不需要时间太久</strong></p><p>　　双眼皮手术虽然仅是个小手术，但并不像人们所想的，术后效果立竿见影。双眼皮手术是一个创伤性手术，伤口愈合也需要一定的时间。术后注意保护伤口不受感染，一周后伤口愈合，整个手术也就大功告成了。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1362','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/535.html','切开法和埋线法双眼皮如何选择','array (\n  \'title\' => \'切开法和埋线法双眼皮如何选择\',\n  \'time\' => \'1401852382\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　对于希望变成大眼睛双眼皮的人来说，选择什么样的手术方式也颇费一番脑筋。在切开法和埋线法中举棋不定，那么究竟哪种重睑术更好更安全效果更佳呢?其实医生要告诉你的是，选择适合自己的才是最好的。不盲从，不跟风，正确认识自己的眼睛条件，适合哪种哪种对你来说就是好的。</p><p>　　切开法适用人群</p><p>　　1、上睑皮肤松弛或脂肪过多的人。</p><p>　　2、老年性皮肤松弛眼睑臃肿的人。</p><p>　　3、外眼角松弛导致三角眼的人。</p><p>　　埋线法适用人群</p><p>　　1、眼睑不厚而较薄的人。</p><p>　　2、单眼皮的眼睛做成双眼皮的人。</p><p>　　3、用双眼皮胶带形成线条的人。</p><p>　　4、用很多双眼皮线条反复形成线条的人。</p><p>　　5、眼睑下垂较轻的人。</p><p>　　6、想做双眼皮，但不敢用切开法的人</p><p>　　综上所述，切开法适用于眼睑较厚或脂肪较多的单眼皮，两个眼睛大小不一致或上睑下垂的单眼皮。与埋线法相比有手术时间长、恢复期长的缺点，但一般5-7天就可恢复了。</p><p>　　埋线法适用于眼睑皮肤较薄且眼轮匝肌较薄的单眼皮、没有蒙古皱纹且眼睑皮肤没有下垂的单眼皮，很多人图方便不顾中翰\r专家提醒做这样手术后不久，因眼睑下垂不得不进行二次手术。埋线双眼皮手术的缺点是保持的时间短。切开法和埋线法各有自己的特点，选择适合自己的才是最好的。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1363','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/441.html','真人案例 林慧梓整形日记（原创）','array (\n  \'title\' => \'真人案例 林慧梓整形日记（原创）\',\n  \'time\' => \'1401852382\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　我，林慧梓，90后双鱼座，今年大学刚刚毕业。一直对自己的双眼皮很是不满意，一侧是双眼皮，可是另一侧是多层的双眼皮，看起来眼睛暗淡无神!感觉眼睛就该大大的、忽闪忽闪的，特想像韩国明星那样，即使不戴美瞳也能双眼闪亮、电力十足!</p><center><img border=\"1\" alt=\"手术前的我，一侧是双眼皮，可是另一侧是多层的双眼皮，看起来眼睛暗淡无神！\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112622294.jpg\" width=\"363\" height=\"246\" /></center><p>　　手术前的我，一侧是双眼皮，可是另一侧是多层的双眼皮，看起来眼睛暗淡无神!</p><p>　　为了实现这个中翰\r会给我一双美丽的双眼!</p><p>　　下面就是要约定做双眼皮手术了，在和有韩国整形之父之称的黄寅守教授交流后，惊喜的是黄教授中文很好，我们沟通一点障碍都没有!黄教授说之所以建议我做埋线，是因我双眼长度不够长，因此做埋线的是很精细的，并且比较自然的小双眼皮，就是双眼皮宽度比较窄的那种，出来的效果生动自然!当黄教授设计好我的双眼皮的形状后，我就被领进入7层手术室。此刻我的内心还是有一点点小紧张!这是我有生以来第一次做手术!医生看到我这样紧张，于是就安慰我说：&ldquo;别担心，打了麻药后就一点也不疼了!&rdquo;于是，我躺在手术台上，医生帮我消好毒后，就用布盖住了脸，只留下眼睛这一部分。医生的动作真的很麻利，还没来得及我害怕，她就已经把麻药打好了。感觉就像打针一样，就疼那么一下，完全可以忍受。打完麻药后，两只眼睛都感觉麻掉了。医生便开始了埋线。具体是怎样的过程我也不太清楚，只感觉眼球被人一按一按的，倒是不疼。做完左边的眼睛后就开始做右边的眼睛，医生大概怕我疼，又帮我在右边的眼睛补了一些麻药。整个手术过程大概持续了30分钟，除了打麻药以外都不会有疼痛的感觉。</p><p>　　当我做完眼皮出来，我照了一下镜子，感觉还真不错哦。虽然还有些肿，但是双眼皮的弧度真是很漂亮，韩国专家就是不一样!难怪韩剧中那么多美女呢!!黄教授又对我说了一些术后禁忌，不可以吃刺激的食物，不可以总照镜子(因为照镜子时会不自觉地抻动眼皮，会把线给扯掉的)，多点些消炎的眼药水或者吃些消肿药，术后按时回来复查!</p><center><img border=\"1\" alt=\"术后2周双眼皮的弧度真是很漂亮，韩国专家就是不一样！\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112623835.jpg\" width=\"500\" height=\"750\" /></center><p>　　术后2周双眼皮的弧度真是很漂亮，韩国专家就是不一样!</p><p>　　因为我皮肤基础还不错，大概第三天的时候就消了。现在已经微现美丽的雏形了，我简直太高兴了，哈哈。今天是第五天，我已经可以毫无顾忌地去逛街了，而且也不会觉得不自然。哈哈，所以和我一样想变成  双眼皮的mm们，你们还在等什么?赶快行动起来吧，相信下一个变漂亮的就是你啦!</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1364','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/440.html','北京美联臣无痕双眼皮 极致美感','array (\n  \'title\' => \'武汉中翰\r无痕双眼皮 极致美感\',\n  \'time\' => \'1401852381\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　双眼皮在外形上比单眼皮更具有立体感，尤其对于爱中翰\r专家来说说。</p><p>　　双眼皮比单眼皮更好看，这几乎是每个人都认可的事实。于是很多单眼皮的女生，选择割双眼皮来给自己的眼睛加分，可是割双眼皮疼吗?</p><p>　　眼睛是人面部最漂亮最传神的部位，眼皮则给眼睛起着重要的点缀作用。双眼皮可以延长眼睛周围区域的高度，让眼睛显得更大更亮。而单眼皮的眼睛看起来就比较小，不够传神，整个人也显得迷迷糊糊不够机灵。于是很多单眼皮的女生，选择割双眼皮来给自己的眼睛加分，可是割双眼皮疼吗?</p><p>　　割双眼皮疼吗?这要从割双眼皮的方法来说起。目前割双眼皮的方法有两种，一种是埋线法割双眼皮，是采用埋线的方法让皮肤和皮下脂肪粘连，进而形成双眼皮的样子。另一种是切开法割双眼皮，是通过切除少量的皮肤和部分脂肪来形成双眼皮。</p><p>　　这两种方法都不会疼，因为在手术前，医生会给爱美人士先打一针麻醉针，让眼睛附近区域局部麻醉，然后再进行双眼皮手术。由于手术对皮肤切口非常微小，加上一些愈合措施，伤口会很快就能完全愈合，连痕迹也消失不见。</p><p>　　有的人认为割双眼皮会疼，这是因为对双眼皮手术不够了解导致的。做过双眼皮的人都知道，整个过程不会有什么疼痛，尤其是在专业正规的整形美容医院，爱美女士可以在醉人的音乐中，轻松舒适地变为双眼皮美女，因此，各位爱美的女士可以放心地做双眼皮手术。</p><p>　　中翰\r无痕双眼皮针对个人的眼形、面部五官比例及整体气质，精确地掌握双眼皮的宽度,弧度,量身设计个性化的双眼皮形态。无痕双眼皮继承了以往双眼皮手术方法的所有优点，同时采用先进的微创手法术后不留痕迹。一次手术，永久性拥有美丽眼睛。无痕双眼皮不但可以抽取脂肪，使得眼睫毛略微上翘，达到了双目有神，风情万种的效果，还可以拉紧皮肤，使形成的双眼皮非常自然，达到一种很完美的效果。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1365','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/439.html','美联臣无痕双眼皮 成就立体大眼','array (\n  \'title\' => \'中翰\r无痕双眼皮 成就立体大眼\',\n  \'time\' => \'1401852381\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　时下最有效的改变方法是选择双眼皮手术 ，以前常见的双眼皮手术方法都是采用缝线法。但是随着医学技术的发展，逐渐缝线法被切开法以及埋线法取代。</p><p>　　单眼皮的眼睛看起来总是缺少灵气，因此单眼皮的朋友都想改变此现状。时下最有效的改变方法是选择双眼皮手术  ，双眼皮手术发展的时间非常悠久，以前常见的双眼皮手术方法都是采用缝线法。但是随着医学技术的发展，逐渐缝线法被切开法以及埋线法取代，现在正规的整形美容医院基本都取消这种缝线法，只有一些小诊所才会使用这种传统手术法，因此大家在选择医院的时候一定要谨慎。</p><p>　　目前韩式双眼皮手术是最受欢迎的，韩式双眼皮整形采用微创技术，手术效果自然美观。韩式双眼皮手术主要采用韩式微创技术，跟据黄金分割的指数、爱美者自身的五官搭配比例来确定终眼部整形方案。使细小的眼睛变大，臃肿的上眼皮变薄，重睑线流畅自然。这其实也取决于医院的选择，正规的医院，设备先进，医生水平高，能为你降低风险，让你安全获得美丽。</p><p>　　武汉中翰\r&mdash;&mdash;韩式无痕双眼皮好选择</p><p>　　中翰\r无痕双眼皮针对个人的眼形、面部五官比例及整体气质，精确地掌握双眼皮的宽度,弧度,量身设计个性化的双眼皮形态。无痕双眼皮继承了以往双眼皮手术方法的所有优点，同时采用先进的微创手法术后不留痕迹。一次手术，永久性拥有美丽眼睛。</p><p>　　武汉中翰\r无痕双眼皮不但可以抽取脂肪，使得眼睫毛略微上翘，达到了双目有神，风情万种的效果，还可以拉紧皮肤，使形成的双眼皮非常自然，达到一种很完美的效果。</p><p>　　通过以上信息的介绍，您对双眼皮手术有所了解了吗。如果你想了解更多信息，可网上咨询武汉中翰\r在线专家，他们会为你提供更多专业的服务，以及合理的建议。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1366','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/438.html','开双眼皮后注意事项有哪些','array (\n  \'title\' => \'开双眼皮后注意事项有哪些\',\n  \'time\' => \'1401852380\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　总有些想着单眼皮想着变成双眼皮，切开双眼皮就是其中的一个方法，而且切开双眼皮手术是保持效果最久的技术，不过害怕疼的人会犹豫不敢做，因为听到切开双眼皮是需要动刀子的，害怕疼，那么切开双眼皮手术疼不疼,做了双眼皮要注意什么事项?</p><p>　　开双眼皮后注意事项有哪些?今天武汉中翰整形美容医院\r为大家详细的介绍双眼皮手术后五点注意事项：</p><p>　　1：疤痕增生，手术后几个月内会有可能出现手术疤痕增生，所以这个时期，不可使用含有重金属的化妆护肤品，这样有害健康!</p><p>　　2：预防伤口出血、淤血或血肿：很多在手术中出了意外，会损伤了小血管止血不彻底，激烈运动等都会引起伤口出血、淤血或血肿，这样的话术后一旦发生出血不止和严重血肿，应及  时到医院复诊。</p><p>　　3：加强眼部肌肉的运动：手术后要做睁眼运动，才能促使眼睛肌肉和周围组织的血液循环，减轻并逐渐消除手术部位的肿胀，促进手术淤血的早日吸收。</p><p>　　4：不可随便用止痛药：开双眼皮手术后会出现疼痛，但会逐渐减轻。不要急于吃去痛片，会加重伤口血。</p><p>　　5：安静舒适的环境休养：手术后室内空气要保持通风，空气流通清新在饮食上增加蛋白质的摄取量，同时多吃水果和新鲜蔬菜。</p><p>　　武汉中翰整形中翰\r在线专家.</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1367','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/437.html','割双眼皮最佳时间是什么时候？','array (\n  \'title\' => \'割双眼皮最佳时间是什么时候？\',\n  \'time\' => \'1401852380\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　美丽的大眼睛是多少女孩子都希望的，可是又有多少人因为小眼睛，单眼皮而烦恼，失去异性的吸引，而现在人们找了新的方法可以改变这样的症状，就是开双眼皮，这样能够达到理想的大眼睛效果，武汉中翰整形美容医院\r专家说到开双眼皮又称为重睑术，对爱美的女孩子来说是个非常重要的手术，可割双眼皮最佳时间是什么时候?</p><p>　　秋冬气温不高、空气干爽，被不少整形专家认为是利于手术修复的季节。武汉中翰整形美容医院\r的微孔双眼皮手术3天即可恢复，所以季节的变换并不构成对手术的制约，季节因素对割双眼皮没有影响，比这更重要的是应考虑手术对自己的生活所带来的影响。</p><p>　　割双眼皮最佳时间是什么时候?武汉中翰整形美容医院\r专家指出：割双眼皮的最佳时间主要是看个人的时间安排以及个人习惯了。可以悠闲地休息  2-3周左右的时候，所以若是学生就可以利用假期，而若是上班族就最好选择在年假或平时休假期间进行。</p><p>　　针对现在割双眼皮的效果，我们必须要认真的考虑自己的问题，然后根据自己的情况采取合适的治疗，割双眼皮一定考虑正规的医院，保证安全才能保证效果，技术自然也是人们的理想!如还有什么疑问,请咨询中翰\r专家会给你一个详细的解答。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1368','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/436.html','学生适合做双眼皮手术吗？','array (\n  \'title\' => \'学生适合做双眼皮手术吗？\',\n  \'time\' => \'1401852380\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　现在天气已经逐渐凉快了，特别是秋季在武汉中翰\r专家来告诉你吧!</p><p>　　武汉中翰整形美容医院\r专家指出：一般来说身体健康、精神正常、主动要求手术而又无禁忌证的单睑者，都可施行重睑成形术，所以对于学生来说也是可以的!</p><p>　　韩式双眼皮手术是现在非常流行的一个技术，&ldquo;韩式&rdquo;强调持久的自然美，就双眼皮这一眼部整形而言，&ldquo;韩式双眼皮手术&rdquo;也有其创新独到之处。</p><p>　　传统双眼皮手术通常采用埋线法或缝线结扎法，术后有淡淡的疤痕。而韩式双眼皮手术只在上睑两端各开一个小孔式切口，抽取脂肪、拉紧皮肤，能形成自然双眼皮，术后不留痕迹。</p><p>　　学生适合做双眼皮手术吗?不过我们要清楚有些人是不能做的，通常是身体有疾病的人：有先天弱视、慢性结膜炎、红眼病、急性感染等眼科疾患的单睑患者，;面神经瘫痪且不能闭眼的患者;因各种原因而有眼球突出的人，慎重做手术，尤其不能做宽了，这些人都不能做双眼皮手术!</p><p>　　其实学生做双眼皮手术是可以的，不过最好是到了十八周岁以后在进行手术，另外同学想做双眼皮可以最好到医院进行手术，千万不能因为自己是学生贪图便宜，造成不必要的情况发生!如果还有什么疑问，请联系武汉中翰\r专家!</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1369','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/435.html','双眼皮失败修复术的效果','array (\n  \'title\' => \'双眼皮失败修复术的效果\',\n  \'time\' => \'1401852380\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　我们现在的爱中翰\r专家为大家详细介绍。</p><p>　　专家介绍，双眼皮失败的情况是常见的，尤其对上睑原本就比较松弛或者肿胀的病人更加明显。针对这样的情况，可以进行二次重睑手术。也可以采取切开法重新手术，在手术中可以去除松弛的皮肤和多余的脂肪，效果会比较明显。二次手术对医生的要求比较高，手术后的恢复时间会稍长一点，但大部分患者经过重新手术，都能够取得良好的效果。</p><p>　　假如您以前做双眼皮采用的是非手术的方法，如果您觉得双眼皮不理想，那么可以还原，恢复到原来的状态，不留任何痕迹。当然这还要根据您的基础。如果采用切开双眼皮法，则要根据重睑的宽度及您个人的眼睑部情况，如果有较充足的眼睑组织，则双眼皮修复的可能性较大。反之则效果不尽人意。所以第一次做双眼皮的人，要和医生充分交流，制定合理的手术方案，一定要选择正规的医疗机构和有权威的专业医生。</p><p>　　双眼皮失败修复术后要注意保持伤口清洁，防止感染。不能抽烟喝酒，不能吃辛辣刺激海鲜;可以增加蛋白质的摄取量，同时多吃水果和新鲜蔬菜。术后1周内不要看电视、报纸，卧床休息时最好高枕，以免眼睛过度疲劳或头部位置过低而加重伤口肿胀。还要做好眼睑组织的保湿和软化，切不可使用含有重金属的化妆护肤品。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1370','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/433.html','重睑修复术的方法有哪些','array (\n  \'title\' => \'重睑修复术的方法有哪些\',\n  \'time\' => \'1401852379\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　自己的眼睛自然是越美丽越好，眼睛大而且是双眼皮的最好了。但是天生单眼皮怎么办呢?很多爱美的女性就会通过重睑手术来让自己单睑变重睑，变的更加的美丽。但任何手术都是存在风险的，失败的重睑固然可以经过重睑修复术解决。那么重睑修复术的方法有哪些呢?下面请听专家介绍。</p><p>　　以下是失败的重睑修复术有的两大方法：</p><p>　　1、靠自身组织伸展来补充组织的缺失和粘连。</p><p>　　重睑修复术特点：采纳移植经凝胶培养基处理的自身筋膜脂肪，以填补缺失的组织。这种方法的脂肪成活率高达</p><p>　　2、以各种展异物填充，来填补因手术造成的组强缺失和粘性。</p><p>　　重睑修复术特点：易出现排异反应、感染、手术凹凸不平有疤痕及形态不自然等问题。</p><p>　　重睑手术后如不满足，应在术后1周内马上进行重睑修复术。如果超过1周，且缝线已拆，术后2个月之内是组织修复期，组织脆性增强，若此时进行重  睑修复术组织易被缝线撕裂，并易使瘢痕增生。因此，术后1周内未修复者，应在术后3个月或更长一段时期后再行重睑修复术。在等待阶段要对受术者做好说明工作;若将就病人过早修复，往往得不到好的效果。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1371','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/432.html','重睑修复术后如何护理','array (\n  \'title\' => \'重睑修复术后如何护理\',\n  \'time\' => \'1401852379\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　眼部，不管是哪一个方面，大家都是非常的关注的。随着科学技术的发展，手术整形受到了大家的欢迎，而对于眼部整形受到了大家的关注，眼部整形的治疗是很重要的，手术可以使求美者变得更加美丽。下面就让我们一起了解一下重睑修复术后如何护理的。</p><p>　　重睑修复术的方法主要靠自身的组织延伸来补充组织的缺失和粘连的方法和展异物进行填充两种方法，自身的组织延伸来补充组织的缺失和粘连的方法主要是  采用移植经过凝胶培养处理的自身筋膜脂肪，来填充缺失的组织。用展异物进行填充，来弥补缺失的组织，这种方法可以会出现排异或感染等现象，也可能会出现手术凹凸不平的疤痕的现象等。手术后要保持伤口的清洁，防止伤口的感染，手术后要忌口不得吃辛辣及海鲜等刺激性的食物，不可抽烟喝酒，您应该多吃一下水果和  新鲜的蔬菜。</p><p>　　手术后要让眼部充分的休息，不要看电视、报纸避免眼睛过于疲劳。在手术后的当日伤口会有些疼痛，不必担心慢慢会逐渐恢复。针对不同的现象重睑  修复的方法也是不同的，不过不管哪种方法都可以保证手术后效果可以达到患者满意的程度。重睑修复术一般在手术后的4-5天才进行拆线，在一周到10天左右  可以消除浮肿的现象。手术的效果明显，手术是没有痛苦，所以您可以放心的进行修复。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1372','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/430.html','割双眼皮前先认清单睑与重睑','array (\n  \'title\' => \'割双眼皮前先认清单睑与重睑\',\n  \'time\' => \'1401852378\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　在人们的观念中，单睑与重睑的差别是显而易见的，就是眼皮单层和双层的不同而已;而事实上，两者间存在着美学的差异、形态学的区别及解剖学的差别。人类的单睑、重  睑与遗传有关，一般终生不变。但也有少数人随年龄增长而有所变化。有的是随年龄增长到成年时，单睑逐渐变为重睑;有的是随着步入老龄，眼睑皮肤松弛下垂，将原来重睑的皱襞遮盖，而给人以单睑的外观印象。</p><p>　　人类的双上睑形态一般是对称的，但约有2.85%-8.89%的人双上睑形态不一致，表现一侧单睑，一侧为重睑。就东方民族来说，单睑和重睑是两种不同眼睑形态，从生理角度来看，两者都属正常，基本无差别。但从美学角度来看，单睑往往给人以眼睛较小，&quot;欠美&quot;的感觉。在功能上，也没有重睑那样更富于情感的表达和明眸的显露。因此重睑美容术除能增添美感以外，在某种意义上讲尚有一定的功能意义，这也是重睑术开展的主要理由。</p><p>　　从形态学的角度来看，单睑与重睑的差别，除在上睑有无横行皱襞的区别外，单睑者整个上睑的皮肤较厚，并显得较为臃肿，皮肤轻度下垂，遮盖睑缘，平视时，睫毛的根部不可见;重睑者上睑皮肤较薄，而显清秀，上睑的皮肤不下垂，睑缘全部可见。单睑者睑裂较短、狭细;而重睑者睑裂较长、宽。单睑的睫毛较短、稀疏，平视时，睫毛多向下倾斜，有时，睫毛还会遮盖瞳孔，影响视野和视力。重睑者的睫毛较长，平视时睫毛稍稍向上翘。单睑者的内眦角由于多伴有内眦赘皮，呈圆顿状;而重睑者内眦一般呈尖角状，一般无内眦赘皮。</p><p>　　由于单、重睑的发生受种族、地区、遗传、年龄等因素的影响，形态上有显著差别，因而其解剖结构上也存在着明显的差别。单睑的皮肤较厚，皮下组织较高，眼轮匝肌比较发达，眼轮匝肌后的脂肪较多;单睑者的睑板薄而窄小，睁眼的肌肉&mdash;&mdash;提上睑肌不发达;而重睑者则正好相反。单睑者的眶隔位置一般偏低，而眶隔脂肪可脱垂于睑板上缘或睑板前，而重睑的眶厢位置较高，也无眶隔脂肪脱垂于睑板上缘或睑板前。基于解剖结构基础，单睑在睁眼时，睑板前的皮肤和眼轮匝肌不能跟随睑板一同上提，因而上睑不能形成皱襞表现为单眼皮。而重睑在睁眼时，睑板前重睑线以下的皮肤和眼轮匝肌能和睑板一同上提，因而上睑出现皱襞，表现为双眼皮。</p><p>　　从单、重睑几个方面的差别来看，人们常提起的重睑术，实际是据美学原理，通过手术手段，将单睑的解剖结构进行修改、重组，最后成形为双眼皮的外观形态。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1373','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/424.html','三种方法轻松去眼袋 美联臣整形','array (\n  \'title\' => \'三种方法轻松去眼袋 中翰\r整形\',\n  \'time\' => \'1401852378\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　每天早上醒来，最让人接受不了的就是看到镜子中的自己眼睛浮肿，重重的眼睛好像怎么也睁不开，看起来格外沧桑。应该怎么办?眼袋怎么去除才最有效呢?下面小编帮你总结几种好方法，快速摆脱眼袋困扰!</p><p>　　一、日常改善眼袋的方法</p><p>　　1、充足的睡眠</p><p>　　睡眠的长期不足，是过早出现眼袋加重的重要原因。现代研究证明，良好的睡眠，可明显改善眼睑组织的血液循环，可使眼周各层组织保持良好的活力，从而有效地防止眼袋的发生与加重，如果长期睡眠不足，则使眼周组织慢性疲劳，血运障碍，使得各层组织退行性衰老改变，再加以重力的作用，使得眼袋过早出现，并迅速加大加重。</p><p>　　2、良好的饮食习惯</p><p>　　在日常饮食中，应该多吃山药、赤小豆、芡实、茯苓、莲子、薏米、豇豆等食物，如果您想通过花卉来调理，可以选择茉莉花、葛花、白扁豆花等，这些花都具有芳香化湿、醒脾和胃的功效，既可以用来熬粥，也可以泡茶，而且它们的功效也不是单一的，像茉莉花不仅能化湿，还能清肝明目、清新口气;葛花素有&quot;千杯不醉葛藤花&quot;的美誉，常用来解酒;白扁豆花还有祛暑、治女性白带过多的功效。</p><p>　　二、胶原蛋白消除眼袋</p><p>　　如果你属于松弛性眼袋眼袋，补充胶原蛋白是最佳缓解眼袋的方式。由于松弛性眼袋是皮肤松弛造成。所以提升皮肤紧致度是主要的改善途径。补充胶原蛋白可以直接紧致肌肤，对缓解眼袋具有一定的作用。目前比较理想的方式是口服胶原蛋白或采用含有胶原蛋白成分的眼膜。</p><p>　　三、激光消除眼袋</p><p>　　目前最成熟的激光去眼袋技术因其时间短、恢复快、无出血、痛苦小等优势，受到众多求美者的青睐。它采用新型的高能超脉冲激光，从睑板内侧结膜处切一约0.3CM的切口，然后从切口处依次取出内，中，外三块脂肪团，再使用激光气化收缩真皮组织，整个手术过程只需20分钟左右。</p><p>　　对于膨陲外观明显，再加以有较深的颊睑沟者，近年开始采用&quot;眶隔释放法&quot;进行矫治。此手术可采用结膜面入路，也可采用下睑缘切口入路，手术将眶隔膜完全打开，将眶隔脂肪释放，并将其固定缝合于颊睑沟处，这样就将膨陲样外观消除，同时也将颊睑填充起来，恢复年轻的自然过渡，此种术式效果确实可靠，但掌握较困难，医师必须具备较丰富的临床经验。</p><p>　　激光法的优点是出血少，缺点是做手术的过程中有明显的烧焦味。同时强烈的光可能灼伤眼睛，因此做的同时必须保护好眼睛。此外，激光去眼袋对皮肤表面无损伤，适应范围广，一般保持2-5年。但是需要注意的是，激光对深层次的眼袋没有效果。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1374','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/412.html','四类人做人工双眼皮反彰其丑','array (\n  \'title\' => \'四类人做人工双眼皮反彰其丑\',\n  \'time\' => \'1401852377\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　在双眼皮大受推崇的时代，注重眼睛魅力的单眼皮姑娘常常选择去做双眼皮整形，为自己&quot;创造&quot;一个人工双眼皮。的确，很多人昨晚双眼皮整形后，显得精神、漂亮  ，平添几分自信;但也有一些人割了双眼皮之后效果不佳，给人以生硬的感觉，失去原有的韵味。于是，美容达人们归结出了不适合做人工双眼皮的人群。</p><p>　　1、圆脸型者。有些单眼皮&quot;苹果脸&quot;的姑娘笑起来双眼微咪，如果五官搭配合适，就会给人以甜美的感觉。显然，即使是不做双眼皮手术，这种美感依然存在，做双眼皮反而多此一举，甚至会带来终生遗憾。</p><p>　　2、圆眼睛者。圆眼睛本身并不给人以眼睛很小的感觉，其上下宽度超出一般人眼睛的上下宽度，若做双眼皮很可能给人以&quot;吊眼&quot;的感觉。</p><p>　　3、&quot;肿眼泡&quot;者。&quot;肿眼泡&quot;是因眼部皮下组织沉积过厚而给人以浮肿感。这类眼睛本身就不美，若再加做一道眼皮，则使&quot;肿眼泡&quot;更添赘余之感，倒不如顺其自然。</p><p>　　4、&quot;金鱼眼&quot;者。&quot;金鱼眼&quot;的人其眼球外凸，若做双眼皮，必然使人觉得眼球愈加外突，反彰其丑，得不偿失。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1375','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/411.html','双眼皮 让眼睛多一道“窗帘”','array (\n  \'title\' => \'双眼皮 让眼睛多一道“窗帘”\',\n  \'time\' => \'1401852377\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　一双明媚有神的大眼能为你的美丽增添不少色彩，试想一下，  双瞳剪水的大眼睛多么勾人心魄，如果美丽的外表配上不起眼的单眼皮，那该是多么煞风景。那么现在流行的双眼皮手术效果怎么样?安全吗?我们一起来看一下专家的解说。</p><p>　　●随意&quot;克隆&quot;效果难尽如人意</p><p>　　双眼皮的设计因人而异，医生要根据求美者的面型、性格、职业等情况综合考虑，设计出重睑相应的各项参数。但是，在临床工作中，医生经常会遇到不少人拿着明星照片，指着明星的眼睛要求美容医生&quot;依样画葫芦&quot;。除此之外，也有些人要求参照西方美女的样子做成&quot;欧式眼&quot;。在这里我们要强调的是，不管明星眼也好，欧式眼也罢，受术者若无潜在的解剖基础，做出来的效果是不尽如人意的。对于隆鼻等其他面部美容术，也必须遵守这一原则。</p><p>　　所谓欧式眼，指的是欧美人那种双眼皮薄而大、瞳人深而蓝的眼睛。平心而论，这种眼睛富有立体感，看上去很有神，有一种特殊的美丽。但这一切是建立在欧美人高额头、高鼻梁、长脸形、尖下巴、深眼窝、面部立体感强的基础上的，这样搭配才会有一种和谐的美感。而东方人往往是额头较平、鼻梁较低、眼睛较小、下巴钝，面部立体感稍弱，这种解剖结构一般不太适合欧式眼。东方人有东方人的美丽与风韵，若强行要求按照西方人的标准来做，效果可能会过于夸张，从而丧失东方人原有的文静温柔的容貌。</p><p>　　要在典型的东方人眼睛上做出欧式双眼皮并不存在技术问题，但效果可能会不伦不类，而且再通过手术纠正会十分困难，失败率相当高。不过，确实有一小部分东方女性潜在着一些西方女性的特质，如果对其进行适当发掘，的确有可能变得更好看。例如，有的女性长脸形、高额头、高鼻梁、深眼窝，惟独单眼皮使其美中不足，这就可根据其本人意愿，为其做一副欧式双眼皮。</p><p>　　●&quot;高分子双眼皮&quot; 纯属文字游戏</p><p>　　现在很多消费者都有一种迷信高科技的倾向，有些美容院便利用人们这种心理，贴出&quot;高分子双眼皮&quot;的广告，说什么高分子双眼皮不开刀，无痛苦，永不失效，不理想时能恢复原状&hellip;&hellip;这些纯属欺人之谈。所谓&quot;高分子双眼皮&quot;，说穿了就是埋线法双眼皮。埋线法双眼皮用的缝线有丝线和尼龙线之分，尼龙线的确属于高分子材料，但它也是医院里最普通最常用的缝合材料。由这些所谓的高分子材料缝线做双眼皮手术有什么可炫耀之处呢?这实在是跟不懂医学、不明真相的善良的人们做文字游戏，达到骗取求术者钱财的目的。埋线法双眼皮要注射麻醉药，也要缝针，并且有缝线松脱的可能，如效果不满意，不通过手术是不可能复原的。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1376','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/410.html','双眼皮手术失败的四个矫正方案','array (\n  \'title\' => \'双眼皮手术失败的四个矫正方案\',\n  \'time\' => \'1401852376\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　做双眼皮手术让我们有好看的眼睛，但是手术也有意外，由于受到各种因素的影响，个别人做的双眼皮可能不是很满意，我们可以通过双眼皮矫正来改变。各种双眼皮术后可能会出现的情况我们列出来了，希望大家看后能有跟更深入的了解。</p><p>　　双眼皮做的不好没关系可以矫正</p><p>　　●三角眼：重睑线中断，连续性差，中间过高。重睑线内侧过高，睁眼时内侧不能与睑缘一同提起。</p><p>　　矫正方法：重新设计重睑线，加宽重睑线中断及外侧的宽度。沿原重睑线切开，将切口上缘中段及外侧的上睑皮肤去除一部分，使内外侧的宽度协调一致。</p><p>　　●重睑过窄：指双眼皮绝对宽度过窄，小于5毫米，出现隐双。患者相对于受术者的脸形及眼裂宽度而言，双眼皮宽度过窄，双眼皮不协调。这与设计及缝合有关，设计者  包括事先受术者的要求)设计过窄，或是缝合时缝合位置过低形成。</p><p>　　矫正方法：沿原切口切开，充分剥离重睑线以下皮肤，并尽可能剥离到上睑下缘的灰线，尽可能去除睑板前的眼轮匝肌及睑板前组织。缝合充分利用上睑皮肤伸展性，将切口上提缝合以达到增加重睑的宽度  可增加宽度1毫米～3毫米)。此种方法对于年轻者，可适当使睫毛上翘，增加美感。另外重睑线下皮下组织的去薄，使手术后双眼皮更加自然逼真。</p><p>　　●重睑过宽：表现为重睑宽度大于8毫米，或相对于脸形  小而圆者)其宽度过宽。常见于欧式眼的追求者。其重睑宽度过宽，且重睑线上及眶骨下的上睑皮下组织及眶隔脂肪去除太多而出现凹陷，术后外形极不佳。</p><p>　　矫正方法：对于一般重睑线相对过宽而非欧式眼受术者相对好修整，只要将切口重新设计在6毫米～  8毫米范围，并将原切口一同去除，其效果良好。对于欧式眼受术者，修整难度较大。手术分两步进行。除设计将切口降低外，还必须用真皮脂肪瓣，游离脂肪颗粒，或者人工生物材料包括膨体聚乙烯填充上睑凹陷。依据情况分一期或分两期进行手术。</p><p>　　●上睑皮肤多层皱折：俗称三眼皮，重睑术后出现两条重睑线 比重睑多一至两个皱折)。可以整个出现三眼皮或者部分  内侧或外侧)出现。成因为未按弧度设计重睑线，手术剥离重睑线与睑缘之间皮肤不均匀，去除组织不均匀，内眼角去除皮肤过多，切口线以上皮下组织去除过多，形成皮肤与睑板多处粘连，另外错位缝合及未按弧度缝合。</p><p>　　矫正方法：轻度早期三眼皮，可等消肿后消失，也可用手牵拉切口上缘皮肤2～3月，将其松弛下垂遮盖粘多余重睑线;重者应按原切口切开，剥离及松解皱折，将切口下缘皮肤向上超过原睑板与皮肤粘连处缝合。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1377','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/409.html','双眼皮术后保养全攻略','array (\n  \'title\' => \'双眼皮术后保养全攻略\',\n  \'time\' => \'1401852376\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　双眼皮整形是当前流行的整形美容方式之一，但由于每个人的眼睑结构和形态不一样，所以单眼皮变双眼皮时，手术的方式也不一样。那么双眼皮手术应该注意什么呢?下面小编带大家了解一下!</p><p>　　1、能不能做?</p><p>　　一般人都可以做双眼皮手术，女生要避开月经期。但上睑下垂的人，高度近视且眼睛很外突的、甲亢突眼的不适合做，</p><p>　　2、怎么做?</p><p>　　可以埋线、三点、一点、切开，每个手术都有不同的优缺点，建议和你的医生仔细沟通，选择适合你的方法。</p><p>　　3、要不要开内眼角?</p><p>　　一般来说，亚洲人都有轻重不同的内疵赘皮，开眼角会显得双眼皮更宽更长，眼睛也会大一点点，可以开，但是内眼角容易留疤，特别是在半年内比较明显，慢慢才能淡下去。平时喜欢化妆的mm可以大胆开内眼角。</p><p>　　4、要不要开外眼角?</p><p>　　不建议，手术效果不理想。</p><p>　　双眼皮手术前应该注意的事项：</p><p>　　1、双眼皮手术前要做常规检查，比如血常规、凝血四项等，最主要的是专科检查;</p><p>　　2、眼睛有急性炎症的人不能做双眼皮手术;</p><p>　　3、双眼皮手术前不要吃活血化淤的药物;</p><p>　　4、女性做双眼皮手术要避开月经期;</p><p>　　5、做双眼皮手术前禁止抽烟喝酒。</p><p>　　双眼皮手术恢复的快慢，除了个体差异外，个人生活中的护理细节也是至关重要的。</p><p>　　一、保持伤口清洁，防止感染</p><p>　　术后的伤口清洁是很重要的，如果伤口不干净，很容易发生感染，导致伤口疤痕的形成。所以术后洗脸时注意不要打湿伤口。</p><p>　　二、不可随便服用止痛药</p><p>　　手术当日伤口会有些疼痛，但随着时间的推移会逐渐减轻。病人不要急于吃去痛片，因为阿斯匹林类药物会加重伤口血。</p><p>　　三、手术伤口出血、淤血或血肿的防治</p><p>　　如果手术中损伤了小血管或术中止血不彻底，术后眼睛遭到外部撞击，激烈运动或变化无常的情绪都会引起伤口出血、淤血或血肿。为防止上述并发症的发生，可对局部伤口加压包扎或用冰袋冷敷，但压力不宜大，以免损伤眼睛。术后一旦发生出血不止和严重血肿，应及时到医院复诊。</p><p>　　四、注意加强眼部肌肉的运动</p><p>　　双眼皮手术一般需覆盖切口一天，术后第二天就要揭去覆盖的纱布，早日做睁眼运动。只有不断加强睁大眼睛的运动，才能促使眼睛肌肉和周围组织的血液循环，减轻并逐渐消除手术部位的肿胀，促进手术淤血的早日吸收。</p><p>　　五、预防手术部位的疤痕增生</p><p>　　手术后三到六个月内是手术疤痕的增生期，在这个时期，切不可使用含有重金属的化妆护肤品。</p><p>　　六、术后应有安静舒适的环境休养</p><p>　　室内空气要清新流通并保持一定温度。在饮食上增加蛋白质的摄取量，同时多吃水果和新鲜蔬菜。避免眼睛过度疲劳。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1378','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/408.html','什么方法做双眼皮比较好呢','array (\n  \'title\' => \'什么方法做双眼皮比较好呢\',\n  \'time\' => \'1401852375\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　一个完美的女人，美丽的眼睛和漂亮和谐的眉毛二者缺一不可。只要对眼睛做些细微的变化，就能改变眼部的外观。有很多朋友眼裂过小会严重损害一个人的容貌，从而导致个人形象也大打折扣。不过朋友们不用担心，随着整形美容技术的发展，眼裂过小的人都可以通过手术的方式加以矫正。</p><p>　　埋线双眼皮  美丽不是梦。上睑眶脂肪堆积较少、皮肤薄，双眼皮不明显的朋友者，非常适合做埋线双眼皮手术。将睑板组织或板前筋膜组织很好的缝合，有效的形成双眼皮，让爱美的你更美。优点是手术安全、自然、效果好。</p><p>　　埋线双眼皮手术的原理是通过缝线或由缝线引起的创伤及炎性反应将上睑皮肤与上睑提肌腱膜或睑板造成粘连以形成重睑。埋线双眼皮手术一般二、三天可以消肿，一周左右就可以恢复了。另外，埋线双眼皮手术几天能消肿还跟患者的体质有关。埋线双眼皮手术采用是小切口形式，把特制的线埋在眼皮下面，这样就形成了埋线双眼皮。埋线双眼皮手术适合眼部脂肪不多皮肤较薄的年轻人。</p><p>　　通过上文的介绍，相信大家对什么方法做双眼皮比较好有了一定的了解，如有其它疑问，可咨询中翰\r在线专家，武汉中翰\r专家会给您满意的答复。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1379','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/407.html','双眼皮术后如何消肿','array (\n  \'title\' => \'双眼皮术后如何消肿\',\n  \'time\' => \'1401852375\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　双眼皮移植是大家喜欢和青睐的对象，也为&ldquo;心灵之窗&rdquo;增加了不少得魅力指数。有一部分女性在术后会出现肿胀的情况，双眼皮手术后眼部肿胀的情况是很正常的.但是做些什么可以让双眼皮快速消肿呢?</p><p>　　一、注意做好眼睑组织的保湿和软化。不少人术后切口已完全恢复正常了,可是手术部位依然有种紧绷绷的感觉,这种现象是手术后的正常现象.只要做好局部的保湿和软化,紧绷绷的感觉会相应减轻.</p><p>　　二、注意预防发炎。最好仰着头,坐在舒服的椅子上休息;睡觉时也要枕高头部,这有助于尽快消肿.</p><p>　　三、预防手术部位的疤痕增生。含有重金属的化妆护肤品有可能加重手术切口的疤痕增生,如果是疤痕体质的人,更会雪上加霜.手术后三到六个月内切不可使用含有重金属的化妆护肤品.</p><p>　　四、注意加强眼部肌肉的运动。只有不断加强睁大眼睛的运动,才能让眼睛肌肉和周围组织的血液循环,使手术部位的肿胀减轻,让手术淤血早日被吸收.双眼皮手术后的姿势暂时也需要注意,例如,低头看书或趴着,就会加重肿胀,所以最好仰着头,坐在舒服的椅子上休息;睡觉时也要枕高头部,这有助于尽快消肿.</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1380','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/406.html','北京做双眼皮手术价格是多少','array (\n  \'title\' => \'武汉做双眼皮手术价格是多少\',\n  \'time\' => \'1401852374\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　武汉中翰整形美容医院\r专家做下详细的介绍，希望让爱美的您有所了解。</p><p>　　武汉中翰整形美容医院\r专家指出武汉\r双眼皮手术价格是多少受到以下因素影响：</p><p>　　一、做双眼皮需要多少钱与个人情况有关</p><p>　　做双眼皮手术必须因人而异，不能强求一致，应根据各人的脸型、眼型、眼窝的大小、眼窝与眼球的相对位置，上眼睑的宽窄，以及皮肤的厚薄质地来决定手术，所以做双眼皮手术前应与医生充分讨论协商，对手术后的外形有个正确判断。</p><p>　　二、做双眼皮需要多少钱与方法有关</p><p>　　不同的割双眼皮方法，其价格也不一样。目前做双眼皮的手术方法很多，归纳起来大致分为两类。切开上睑皮肤方法：这种手术适用于上睑脂肪多的人，或上睑皮肤松弛比较严重的人，切开皮肤后，去除脂肪和皮肤，再形成双眼皮。</p><p>　　韩式双眼皮成形术讲究自然、无手术痕迹。专家依据人体面部美学黄金分割的指数、顾客自身的五官搭配比例来确定眼部整形方案。在上眼睑皮肤的合适位置，轻柔地打两个小孔，去掉部分脂肪和多余皮肤，并将真皮层与眼睑进行三点缝合，确保恢复时间比传统手术快，术后水肿轻。选择不同的手术方法，做双眼皮需要多少钱是不一样的。</p><p>　　三、做双眼皮需要多少钱与医院条件有关</p><p>　　正规的整容医院割双眼皮价格不会太高，做双眼皮需要多少钱一般都是大家能够接受的。同样的医院，不同的整容医生做，做双眼皮需要多少钱也存在一定的差异。</p><p>　　武汉中翰整形美容医院\r拥有国际先进的无菌手术室，并引进了国际先进的整形设备和技术，采用精雕翘睫双眼皮手术，对个人面部特性进行分析并结合人体美学标准，术前由于根据求美者的眼部形态、五官特征以及整体气质设计，并采用最先进的显微镜下手术，能够仔细观察到眼部的情况，保持眼皮的静脉，缝合完美精细，术后不留疤痕，恢复快，不影响正常的生活和工作。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1381','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/405.html','重睑术不简单 “单眼皮”不能随便割','array (\n  \'title\' => \'重睑术不简单 “单眼皮”不能随便割\',\n  \'time\' => \'1401852374\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　在美容整形方面，俗称&quot;拉双眼皮&quot;的重睑手术颇为求美者所青睐，也是岁末很多人送给自己的新年礼物。提醒你可千万别小瞧这个手术，否则会给身体、精神带来双重伤害。</p><p>　　术前设计和手术同等重要</p><p>　　适合做重睑美容整形术的，主要为身体健康的单眼皮或上眼睑皮肤松弛、臃肿的患者。眼睑局部有炎症、眼病、眼部肌肉瘫痪、眼球突出以及其他身体条件不符合的患者，不适宜做这类手术。</p><p>　　每个人眼睑形态不一，有些不专业医生只重视手术操作而忽视术前设计，导致做成的双眼皮形态没有自然美感。因此，提醒患者术前最好将想法详细与医生沟通，如：希望双眼皮位置在什么高度，弧度是什么样，弧度适合平行还是外翘等。双眼皮的设计要以眼睛为基础，医生会结合每个人的情况，设计出最适合的手术方案。</p><p>　　当心感染、长期肿胀等并发症</p><p>　　重睑美容整形术的方法可分为两种，缝合法和切开法。缝合法是用缝线将皮肤的真皮和睑板或上睑提肌腱膜缝合在一起，或直接在睑板上缘行皮肤和结膜的贯穿结扎，依靠其手术创伤所形成的疤痕粘连而形成重睑。该方法适用于上睑皮肤较薄者和年轻人;切开法是在上睑皮肤的适当位置切开皮肤，切除部分眼轮匝肌或眶隔脂肪，将皮肤切口和睑板或上睑提肌腱膜缝合在一起。该方法适用于任何年龄人，特别适用于年龄较大、上睑皮肤松弛和臃肿的患者。</p><p>　　此外还有微创手术，切口愈合后几乎看不到痕迹，很受年轻女孩的喜爱。但手术时间长，手术处理过程相比较麻烦，很考验医生的水平。</p><p>　　重睑成形术一般可在门诊手术室完成，术后病人可以回家休息，24小时可将伤口上敷料祛除，术后做好冰敷与热敷。切开法重睑术后5-7日可将术区缝线全部拆除。虽然重睑不是一个大手术，但也可能出现并发症，如充血、感染、长期肿胀、睁眼困难、三眼皮、重睑线消失等。所以提醒您要到正规的美容医疗机构由专业的整形医生操作，避免严重并发症的出现。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1382','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/404.html','割双眼皮禁忌人群有哪些','array (\n  \'title\' => \'割双眼皮禁忌人群有哪些\',\n  \'time\' => \'1401852373\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　武汉中翰整形美容医院\r的眼部整形专家介绍，割双眼皮，是现在临床上最常见的眼部整形手术，因其效果非常的好，被众多爱美人士所喜欢。但是，毕竟它是手术，存在有一定风险。下面我们就来一起看看，割双眼皮禁忌人群有哪些?</p><p>　　中翰\r专家介绍说：眼睛，是心灵的窗户，对人，起着至关重要的作用。割双眼皮手术，是在眼睑之上进行，所以，为了保证手术的安全，割双眼皮，对受术者的要求也是很高的，它的禁忌人群如下：</p><p>　　1.女性在月经期内身体的抵抗力相对较弱，所以不适合做双眼皮手术，处于孕期和哺乳期的女性更是禁止做割双眼皮手术，因为这可能会危害婴儿的健康。</p><p>　　2.存在严重瘢痕体质的人不适合做割双眼皮手术。</p><p>　　3.因为割双眼皮手术前后要用药，所以存在严重过敏体质的患者避免做割双眼皮手术。</p><p>　　4.全身或者面部存在感染或者炎症者应在控制后再进行割双眼皮手术。</p><p>　　5.不满十六岁，并且未经家人允许者禁止做割双眼皮手术，如果父母同意，要进行签字之后再手术。</p><p>　　武汉中翰整形中翰\r专家，详细为您解答。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1383','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/403.html','北京韩式双眼皮禁忌症有什么','array (\n  \'title\' => \'武汉韩式双眼皮禁忌症有什么\',\n  \'time\' => \'1401852373\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　武汉中翰整形美容医院\r的眼部整形专家介绍，韩式双眼皮，是现在非常受欢迎的双眼皮手术之一，但是，并不是所有人都适合这种方式。下面我们就来一起了解一下，武汉\r韩式双眼皮禁忌症有什么?</p><p>　　中翰\r专家介绍说：任何手术，都有其本身针对的人群，也有其本身所固有的禁忌症，韩式双眼皮也不例外，它的禁忌患者主要有以下几种：</p><p>　　1.患病者。为了防止交叉感染的出现，韩式双眼皮术前要进行一系列的检查，有传染病或者糖尿病者无法进行手术。另外，存在皮肤病及严重的肾、心、脑病者也无法进行手术。</p><p>　　2.眼睑特殊者。年龄过大之后，如果有严重的上睑下垂，不适合做韩式双眼皮，医生会根据情况来制定新的美眼方案。</p><p>　　3.眼部疾病者。韩式双眼皮的原则，是美丽的同时必须健康，如果眼睛有先天性弱视或者急慢性眼病，必须治好之后在进行。此外，眼球过于突出也不适合做韩式双眼皮，因为这种眼型术后会让眼球更加突出，影响面部美观。</p><p>　　4.家人不支持者。未成年球求美者因为还在发育，所以不能做韩式双眼皮，成年人家庭不支持者，医生也要酌情处理，此外，疤痕体质者也不适合做韩式双眼皮。</p><p>　　武汉中翰整形美容医院\r，拥有国际齐步的先进设备，具有专业理论基础和丰富临床经验的专家团队，国际标准的层流净化手术室，整形美容临床示范基地，全套整形手术设备严格执行医学标准--在这里，您可以放心求美。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1384','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/368.html','做开眼角手术双眼变的更迷人','array (\n  \'title\' => \'做开眼角手术双眼变的更迷人\',\n  \'time\' => \'1401852373\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　开眼角手术是很多爱美者都很喜欢的手术，因为它可以让双眼变大，可以让整个人的气质得到很大的提升，让人有整体变靓的感觉。不过，很多爱美者在选择做开眼角手术之前都会对开眼角手术价格异常关注，专家提醒大家，除了关注手术价格之外，一些注意事项也要了解。</p><p>　　开眼角手术价格影响因素：</p><p>　　1、地消费水平不同，开眼角费用也不同。一般来说，一线城市的开眼角手术价格是比较高的，而二线城市的开眼角手术价格则稍微低廉。</p><p>　　2、不同整形，手术价格不同。整形决定开眼角手术价格开眼角手术价格高低还由整形档次决定，一些小整形、小美容院等是不够资质的，不过他们常常以低价来吸引顾客，这就需要大家擦亮眼睛，选择正规、专业的整形，以确保手术的安全和效果。</p><p>　　3、选择了不同医生对开眼角价格也有影响。某些专家头衔的医生，资历广，口碑好，自然收费要稍高，而寻求普通资历的医生，所花的价格就稍微低些。但是开眼角未必一定要找权威、有精湛医术和丰富经验的专家爱，才可以放爱美者放心接受手术。</p><p>　　在了解完开眼角手术费用之后，想必大家还要考虑到几个很现实的问题，就是&ldquo;自己适合做开眼角手术吗?&rdquo;、&ldquo;开眼角手术有什么注意事项&rdquo;&ldquo;如何最安全做开眼角手术&rdquo;等等，下面就给大家介绍一下吧!</p><p>　　做开眼角手术的一些注意事项：</p><p>　　1、内眦赘皮是内眼角的一块垂直皮肤皱折，由于这块皮肤会影响眼睛的大小和双眼皮的形状，所以需要做开内眼角手术。这里要强调的是内眦赘皮是一块多余的皮肤，开内眼角目地就是去掉这块多余的皮肤。</p><p>　　2、开外眼角要谨慎，内眼角看情况做。开眼角手术是把多余的皮肤切掉，外眼角没有多余的皮肤，所以千万不要动。不是所有的都要开内眼角，轻度的没有必要做，中、重度的才可以考虑开。同时还要注意两眼间距情况，手术后会不会好看等。</p><p>　　3、帮你做开眼角手术的医生一定要够专业。大家都不希望在做完开眼角手术之后出现疤痕的问题，因为疤痕体开眼角后，眼部多作的皮肤被割掉了，也就会让疤痕修复显得很困难。因此，在此提醒广大爱美者，一定要选择大型的正规整形，选择有专业经验的医师来为你做手术，保证一次性塑造一个完美的大眼。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1385','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/367.html','开眼角手术怎么做才能更好看','array (\n  \'title\' => \'开眼角手术怎么做才能更好看\',\n  \'time\' => \'1401852373\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　开眼角手术怎么做才是最漂亮的?眼角变大最好的手术方式就是内眼角开大术，不仅能够解决内眦赘皮的情况，也能够使得眼睛的视野更加开阔，让往日无神的眼睛充满神采。</p><p>　　开眼角手术怎么做才是最漂亮的?</p><p>　　开外眼角是手术是比较热门的眼部整形项目之一，开外眼角手术可以直接有效地扩大眼睛的尺寸，开外眼角手术通过切开眼外眦，拉长横向眼裂来进行，因切开眼外侧粘膜部分，不用担心瘢痕即可拉长眼睛。术后约可拉长2～3mm程度，但仅以此长度也可获得充分的效果。</p><p>　　中翰\r的专家说;所谓开内眼角，它并不是真正的打开内眼角，只是把挡在内眼角前面的内眦赘皮打开，露出里边的眼角结构。所以根本伤害不到眼睛。</p><p>　　开内眼角手术可以缩小两眼间距、改善面容;改善双眼皮起点和内侧的形态;美化双眼皮;增加眼睛横向跨度显得眼睛更长;配合双眼皮还可以使眼睛更大;增大视野、改善视角。</p><p>　　我们经常说的开眼角手术一般是指开内眼角手术，但每个人的眼部状况都不同，所以一部分人更适合开外眼角手术，实际上开外眼角手术也是一项简单而有效的眼部整形美容项目。</p><p>　　开眼角手术怎么做才是最漂亮的?</p><p>　　开外眼角手术在局麻下行外眦角切开，切口长短根据睑裂需要放大的程度，用钝头剪刀从切口插入，在球结膜下作潜行剥离。上下均剥离达穹隆部，剥离范围应包括整个外眦部，使结膜充分松动，可以在无张力情况下拉至外眦角创口。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1386','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/366.html','精致开眼角，放大你的眼睛','array (\n  \'title\' => \'精致开眼角，放大你的眼睛\',\n  \'time\' => \'1401852372\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　眼部美学设计理念中，眼睛美，体现在结构美、形态美、眼神美、动态美之中，因此，要想眼睛生动迷人，仅仅一项双眼皮手术并不能达到最终目的。眼部美学专家指出：东方女性的眼部状况除了单眼皮、内双外，往往还伴有内眦赘皮、两眼间距过宽眼等问题，这些眼部缺陷需要通过内眦去皮手术来弥补。</p><p>　　开眼角手术可治疗小眼症、内眦赘皮、眼裂狭窄、眼睛不对称等，可以有效拓宽眼形，还能避免狐狸眼，更可以掩饰鼻梁过塌的缺点。通过开眼角的手术方法，可以使睑裂获得永久性放大，有效拉长眼睛形状，在视觉上使我们的眼睛看起来更大，眼睛长度变大后更显得明亮有神。</p><p>　　上睑下垂矫正，还原眼部神采</p><p>　　上睑下垂会造成眼皮遮住部分瞳孔，不能看清东西，视物疲惫，长期如此，会影响人的心情，使人情绪低落，不愿与人交往。上睑下垂会使眼睛常常呈现出眼皮沉重，张不开的状态，留给人则是熬夜或打牌之后无精打采的感觉。东方人眉毛下脂肪及皮下脂肪比西方人丰富，所以在年纪轻轻就感觉上眼皮浮肿松弛下垂者不在少数。可以通过上睑下垂手术矫正，手术能提紧皮肤，显露全部睑缘，同时能使睫毛上翘，眼裂增宽、增长。不但给人以清秀的美感，同时能增大视野，有利于情感的表达和明眸的显露，给人们带来好心情!</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1387','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/365.html','什么是韩式开眼角?做纯天然大眼美女','array (\n  \'title\' => \'什么是韩式开眼角?做纯天然大眼美女\',\n  \'time\' => \'1401852372\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　爱美者想让眼睛变得更大更有神，而且美的自然，美的精致，美的无痕，只需要通过韩式开眼角手术即能达到理想的效果，什么是韩式开眼角?如何才能达到术后的理想效果，做个纯天然的大眼美女。下面是武汉中翰整形美容医院\r专家的介绍。</p><p>　　什么是韩式开眼角?</p><p>　　韩式开眼角手术后切口隐蔽，外人一般无法察觉，其微创无痕的特点受到很多爱美人士的青睐。据知美专家介绍，韩式开眼角还能有效解决眼角下垂、倒睫、双眼皮松弛等眼部问题，让眼睛呈现出自然的美丽。</p><p>　　韩式无痕开眼角手术有单纯缝合术和Fucks法睑裂缩短术。单纯缝合术适合于单纯轻度睑裂过大者，韩式无痕开眼角手术操作简单，但术后易复发，目前临床上已很少采用。Fucks法睑裂缩短术适用于麻痹性睑外翻所致睑裂过大者，亦可适用于因眼球缺如、眼睑皮肤松弛，无法支持义眼者，目前Fucks法睑裂缩短术在临床上运用较多，效果亦较好。</p><p>　　如何才能达到术后的理想效果，做个纯天然的大眼美女?</p><p>　　韩式无痕开眼角手术虽然十分先进，但是要想达到理想的效果，做韩式无痕开眼角时也有很多方面需要大家了解。韩式无痕开眼角手术前两周内，请勿服用含有阿斯匹林的药物，因为阿司匹林会使得血小板凝固的功能降低;患有高血压和糖尿病的患者，应该在初诊时向医生告知病情，以便应诊医生确认韩式无痕开眼角手术方案;韩式无痕开眼角手术前确定身体健康，无传染性疾病或其他身体炎症;手术前不要化妆;女性要避开月经期进行韩式无痕开眼角手术;男性手术要提前戒烟一周。</p><p>　　韩式开眼角主要是根据爱美者的自身状况和具体情况，制定出个性化的手术方案，利用皮瓣整形的原理，改变蒙古皱褶的位置，使内侧眼皮的褶缝形成与双眼皮皱褶一致的方向，让深藏的粉色泪阜完美展现，达到小眼睛瞬间放大的效果。</p><p>　　开眼角想要达到理想的手术效果，必须选择适合自己的手术方式，开眼角手术操作要精细，只有选择了正规的整形医院，选择专业的、临床经验丰富的、具有良好审美能力的整形医生，才能保证术后拥有自然迷人的明眸大眼!</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1388','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/364.html','魅惑双眸，点亮生命魅力','array (\n  \'title\' => \'魅惑双眸，点亮生命魅力\',\n  \'time\' => \'1401852369\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　水剪双眸雾剪衣，当筵一曲媚春辉。</p><p>　　螓首蛾眉，巧笑倩兮，美目盼兮。</p><p>　　眼明正似琉璃瓶，心荡秋水横波清。</p><p>　　看过很多形容美人的古诗词，眼睛总是诗人最着笔描述的闪亮之处。眼睛是心灵的窗户，漂亮的眼睛能&ldquo;回眸一笑百媚生&rdquo;那怎样的眼形才算是完美的媚眼呢?中国权威美眼专家介绍，完美的眼部形状有如下特点：一是动人双眼皮，二是长而浓密的睫毛，三是浓淡适宜的眉毛，四是无眼袋。&mdash;&mdash;你的眼形完美吗?</p><p>　　拥有一双漂亮的电眼，是古往今来所有爱中翰\r医疗美容医院韩式大眼术，让你拥有魅惑双眸。</p><center><img border=\"1\" alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112610263.jpg\" width=\"400\" height=\"298\" /></center><p>　　中翰\r大眼术 优势盘点</p><p>　　1、美学之道：整形艺术与个性设计的完美结合</p><p>　　中翰\r眼部手术视为技术与艺术的结合，借鉴韩国眼部整形的先进理念，将隐藏的大眼完全显露出来，睫毛自然上翘，小眼瞬间放大，俏丽可人!</p><p>　　2、精细之道：采用精细显微镜，精准定位毫米以下，安全专业</p><p>　　眼部是人体最柔软最脆弱地方，开眼角手术是在皮下进行，只增加眼裂长度，手术范围极小，不会影响到眼球与视力。中翰\r采用精细显微镜，数百倍放大病灶组织，对微小部位的微创手术进行精准导航，精确到毫米以下，确保手术安全。</p><p>　　3、技艺之道：韩国专家与国际专家团队，打造国际尖端技术</p><p>　　中翰\r权威专家亲诊，借鉴韩国眼部整形的先进理念，术中操作细腻精准，他们丰富的临床经验、精湛的技艺和成功的手术案例，成就您最完美的眼型。</p><p>　　4、无痕之道：精细操作 全程麻醉 真正实现无痕无痛</p><p>　　开眼角所有的切口与皮肤褶皱重叠或是隐藏在眼角凹陷阴影中，几乎没有人可以发现任何的痕迹，真正做到精细无痕。手术在麻醉下进行，没有疼痛感，不知不觉中成就美丽变身。</p><center><img border=\"1\" alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112611200.jpg\" width=\"400\" height=\"270\" /></center><p>　　小编在此提醒大家，想要拥有魅力双眸，一定要到正规的整形美容医院找专业的医生手术。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1389','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/322.html','黑眼圈眼袋手术一般多少钱','array (\n  \'title\' => \'黑眼圈眼袋手术一般多少钱\',\n  \'time\' => \'1401852369\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　繁忙的工作、沉重的生活压力、无休止的夜生活&hellip;&hellip;给很多人带来了眼袋，眼袋是眼睛显得很没精神，对人的第一印象很不好。通过现在医疗手段已经可以轻松的将眼袋去除，那么去眼袋的价格是多少呢?下面我们就请专家给大家介绍一下吧。</p><center><img border=\"1\" alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112609333.jpg\" width=\"523\" height=\"109\" /></center><p>　　去眼袋手术的价格和手术方法有关</p><p>　　而目前它主要有两种，一种内开刀，另一种外开刀。外开刀法做法就是在下睑睫毛根部下1毫米处切开皮肤，剥离皮肤与眼轮匝肌间隙，切开打开眶隔，拉出眼袋脂肪并切除。内开刀就是翻开眼皮在眼睛内作一个切口，打开眶隔，拉出眼袋脂肪并切除，不过开刀法风险比较大，所以如果你想要找到安全的方式，那么激光祛眼袋绝对是大家最好的选择。</p><p>　　去眼袋手术的价格和医生的技术水平有关</p><p>　　医生的技术水平也会对价格产生影响，大多数的医疗机构的祛眼袋手术医师都是普通医师完成的，他们不如专业眼部整形医师，尽管价格便宜但其手术效果也会大打折扣。</p><p>　　去眼袋手术的价格和医院资质有关</p><p>　　医院的资质包括手术室的环境、医疗设备也会影响祛眼袋价格。</p><center><img border=\"1\" alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112610956.jpg\" width=\"400\" height=\"229\" /></center><p>　　通过中翰\r专家以上的介绍，相信大家已经了解了去眼袋的价格没有一个固定的价位，有着很多因素的影响，但是专家建议求美者一定要到正规的整形医院接受治疗，才能确保手术的安全和效果。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1390','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/321.html','手术祛眼袋 年长年轻大不同','array (\n  \'title\' => \'手术祛眼袋 年长年轻大不同\',\n  \'time\' => \'1401852365\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　随着生活水平提高，生活节奏也出现了凌乱跳动的现象，&quot;日出而作日入而息&quot;早已不复存在，颠倒黑白过日子在年轻人当中也屡见不鲜，难怪越来越多的年轻人也加入了祛眼袋的行列。</p><p>　　眼袋系下睑皮肤，皮下组织，肌肉及眶膈松弛，眶后脂肪肥大，突出形成袋状突起称眼袋。眼袋常见于40岁左右的中老年人，不论男女均可发生，它是人体开始老化的早期表现之一。当然，随着人们物质、文化生活水平的提高和科学的发展，延缓眼袋的发生是可能的。一般来讲，成年人，尤其是女性，在25～30岁之间就会生出眼袋。这多半是脂肪堆积的结果。最好的解除办法，就是将其彻底去除。</p><p>　　年轻人的眼袋如何祛除</p><p>　　眼袋形成的原因主要是由于眶内脂肪堆积过多或下睑支持结构薄弱而使原平衡改变时，眶内脂肪突破下睑的限制，突出于眶外所致。年轻人的眼袋多为原发性的，往往有家族遗传史，眶内脂肪过多为其主要原因。由于年轻人下眼睑皮肤较坚实，可以考虑内切法祛除，即在眼睛的结膜(下眼皮内)作一个小口子，从中将眼眶中的脂肪去除，既消除了眼袋，而外表眼皮却无伤痕。</p><p>　　年长者如何去眼袋</p><p>　　年龄较大眼袋明显伴鼻唇沟深的人应该选择外切法，以便在去除或填平眶脂的同时，去除多余皮肤，提紧局部组织，使眼周粗大皱纹消失;还可通过下睑切口，分离、提升下垂的颧肌，使鼻唇沟变浅，显得更加年轻。眼袋手术是整形外科手术中最精细的，要求手术医生要准确判断眼睑皮肤的多余量，做到既能消除大部分明显皱纹，提紧松弛皮肤，又不致于影响眼睑边缘的位置、睫毛方向。稍有不慎多切了皮肤，就会造成你所说的眼睑外翻，严重的可以导致流泪、结膜充血，并因此而引起其它的眼病。但有时切除的量恰当，而局部肿胀严重，会引起暂时的外翻，这种情况待水肿消退后，就会恢复了，总之眼袋手术宁愿保守些，也不要做得过分，以免无法回复，有经验的美容外科医师会避免发生术后下睑外翻现象的。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1391','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/320.html','未成年人适宜做双眼皮手术吗？','array (\n  \'title\' => \'未成年人适宜做双眼皮手术吗？\',\n  \'time\' => \'1401852365\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　也许在未成年眼里，割双眼皮不是一个手术，而是一种魔术，可以变得和偶像一样。所谓&ldquo;无知者无惧&rdquo;，心智未成熟的青少年对整形认知还不深，自然想得不全面，轻松一个小手术，就能和偶像拥有一样漂亮的大眼睛，何乐而不为呢?但是专家表示，未成年人还是要谨慎割双眼皮。</p><p>　　一般说来，身体没有重要的内脏器官疾病和精神异常，没有眼疾和明显瘢痕体质的人，都可以做双眼皮手术，但尚处青春期的人最好别做。这是由青春期身体正在发育期，而眼睑在此后仍有可能变化，不少人成年后会出现单眼皮变成双眼皮的情况，所以割双眼皮手术年龄不宜过早，待成年后再开始考虑手术较好。</p><p>　　双眼皮手术的过程中，需要在局部麻醉的状态下根据医师的指示重复地睁眼和闭眼，而如果连提起打针都胆战心惊的青少年，很少能具备充分的心理素质承受割双眼皮这一过程。</p><p>　　因此，割双眼皮最好等成年后，至少应该在具备了足够识别能力和心理素质之后再割双眼皮，且必须在监护人的认可下方能进行。</p><p>　　小编有话说：针对未成年人想要割双眼皮效仿偶像的现象，在整形手术专业知识上的告知是必要的;但是小编认为，更重要的，是引导孩子们正确的审美观和价值观，而不是盲目效仿。作为祖国的未来，应该在内在上多塑造自己，而非过早地沉迷于对表象的追求。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1392','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/319.html','三番五次想整容的优秀男人 上睑下垂怎么办？','array (\n  \'title\' => \'三番五次想整容的优秀男人 上睑下垂怎么办？\',\n  \'time\' => \'1401852364\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　今年28岁的李先生，整体相貌还算不错，自己白手起家创建了一个连锁集团，事业蒸蒸日上。按理说他风华正茂，应该是满面春风的，可熟悉他的人都知道，他私下里满怀心事，甚至传闻说他三番五次想到医院整容。</p><p>　　空穴来风，未必无因。原来李先生的左眼看起来比右眼小，不是很对称，有碍美观，他的女友也抱怨他大小眼，时常跟他闹别扭，使原本应该很美满的生活蒙上了一层阴影。经过反复的思考和咨询，李先生终于鼓起勇气走进医院的大门。了解事情的原委后，杨教授给小李做了个小小的手术，结果李先生离开医院的时候，眨着一双对称明亮的大眼睛，自信地走向他的女友。</p><p>　　其实，李先生的烦恼都是&quot;上睑下垂&quot;惹的祸。正常人双眼平视前方时，上眼睑(眼皮)覆盖角膜不超过2毫米。但有一些人上眼睑会遮住部分或全部瞳孔，这种情况在医学上称为&quot;上睑下垂&quot;。上睑下垂分先天性及后天性两种。先天性上睑下垂是由于上眼睑内的肌肉发育不全，或支配它的运动神经不全引起的，多为双侧，有时可与内眦赘皮、眼裂小、眼睑狭窄、斜视等情况同时存在。后天性者，多为单侧，见于外伤后，眼睑肌肉本身或动眼神经受损所致。</p><p>　　上睑下垂不是什么大毛病，但它会给人们的生活带来极大的不便和烦恼，如上面提到的李先生，甚至有些患者因此给人留下不好的印象，自信心遭受打击。先天性双侧上睑下垂的小孩，由于视物障碍，逐渐养成头部后仰、蹙额等不良姿势，总要仰头皱额才能看到周围的人和物，小小年纪，就像小老头那样额头形成深重的皱纹，极不美观。因此眼睛大小不对称、眼皮耷拉的人要警惕是否患有上睑下垂，如有，应尽早到正规医院检查治疗。</p><p>　　治疗上睑下垂主要采用手术治疗，如上睑提肌缩短等，可由有经验的医生根据不同的病情选择不同的术式。通过手术治疗，都能达到满意的治疗效果。</p><p>　　注意事项</p><p>　　术前注意事项：</p><p>　　1、手术前两周内，请勿服用含有阿斯匹林的药物，因为阿司匹林会使得血小板凝固的功能降低;</p><p>　　2、患有高血压和糖尿病的患者，应该在初诊时翔实向医生告知病情，以便应诊大夫确认手术方案;</p><p>　　3、手术前确定身体健康，无传染性疾病或其他身体炎症;</p><p>　　4、术前不要化妆;</p><p>　　5、女性要避开月经期。</p><p>　　术后注意事项：</p><p>　　1、术后7天之内尽量避免手术部位沾水;</p><p>　　2、保证手术部位清洁;</p><p>　　3、避免进食刺激性食物如辣椒等;</p><p>　　4、严格遵守医生嘱咐服药及复诊。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1393','8','1','1','http://www.mlcbj.com/zxmrs/mrdy/318.html','抽脂去眼袋不当 眼眶凹陷更显老','array (\n  \'title\' => \'抽脂去眼袋不当 眼眶凹陷更显老\',\n  \'time\' => \'1401852364\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　眼睑皮肤是人体最薄的皮肤之一，处于人体最显眼的位置，所以，眼睑皮肤的老化最容易被察觉并且备受重视。每个人出现眼袋的塬因有所不同，衰老、遗传、睡眠不足、熬夜疲劳等都可能成为眼袋形成的因素。</p><p>　　一旦出现眼袋，不仅看起来没有精神，还让人显得老气横秋。更糟的是，眼袋下的&quot;泪沟&quot;，让人看起来比实际年龄老了十岁。这对于爱美的人士来说，是令人十分苦恼的问题。</p><p>　　为什么会出现眼袋呢?整形专家说，在下眼皮的皮肤和肌肉(眼轮匝肌)后方，有一层筋膜(眼膈膜)，其作用可防止下眼窝脂肪往外凸出。当脂肪过度堆积，或这层薄膜的强度变弱，或下眼眶骨后缩时，脂肪便会膨出，使下眼皮看起来像袋子一样鼓出来，这就是所谓的&quot;眼袋&quot;。</p><p>　　一般来说，眼袋多发生在40岁以上人群，但有部分20岁左右的年轻人出现眼袋，这多与先天遗传有关。</p><p>　　眼袋可分两种</p><p>　　1、先天性</p><p>　　眼袋在二十岁时即出现，大多是下眼眶骨后缩，导致下眼窝脂肪在很年轻时就膨出。因这类患者较年轻，通常不会有皮肤松弛的情况。</p><p>　　2、后天性</p><p>　　除了遗传因素，大多数在整形医院做眼袋治疗的是因为衰老的原因。因为皮肤、肌肉和结缔组织老化松弛，无法阻止眼窝脂肪外凸，这就导致在中年后出现眼袋，这种情况通常还会合併有以下问题───</p><p>　　(1)因下眼皮松弛，在眼角产生皱纹。</p><p>　　(2)在眼眶下缘的皮下脂肪因老化及重力作用而逐渐往下移位，使眼袋周围产生一圈凹陷，这就是&quot;泪沟&quot;。</p><p>　　(3)因为韧带松弛，很容易造成眼白外露，甚至下眼睑外翻，上了年纪的人群较易有这种现象。</p><p>　　抽脂不可取，后果越来越严重</p><p>　　眼袋脂肪该怎么处理呢?有人说，将这些&quot;多余&quot;的脂肪抽出来就好了。然而，整形医生却表示，眼袋的脂肪越抽可能越严重。</p><p>　　45岁的林女士，这几年开始有眼袋的迹象，加上经常熬夜、生活不规律，现在既有黑眼圈和眼袋，还有细纹。实际上，林女士在去年就已经做过抽脂去眼袋，结果不仅没有做好，眼袋部位不平整，反而让皮肤更加松弛了，甚至下眼眶凹陷更加严重，反而显得更老了。</p><p>　　其实，如果衹是单纯的眼眶内脂肪增多膨出(这种情况多见于年轻人)，衹要选择&quot;眼内经结膜入路&quot;祛除增多的眶内脂肪就可以了，也就是人们所说的&quot;抽脂&quot;手术。对于上了年纪的人来说，祛眼袋也决非一个简单的抽脂手术能解决。因为单纯地取出脂肪，并不能根本解决眼袋的问题，而必须从眼睛的膈膜及肌肉的松弛上着手解决问题。一旦将眼袋脂肪抽取出来，将无法解决眼窝凹陷所造成的问题。</p><p>　　目前，最新的眼袋治疗观点是：将眼袋多余的脂肪保留下来，移至泪沟处后固定，把塬本泪沟凹陷处填饱满。这样不但可以使眼袋消失，也让眼眶下方的脸颊更饱满，改善脸中部有凹陷消瘦的感觉。最最重要的是，这种做法可以避免眼袋復发的问题。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1394','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/278.html','双眼皮手术后的自我护理你知道多少？','array (\n  \'title\' => \'双眼皮手术后的自我护理你知道多少？\',\n  \'time\' => \'1401852363\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　 &nbsp;现在有不少的求美者会通过双眼皮手术来让自己拥有一双漂亮的大眼睛，双眼皮手术虽说是个小手术，但由于是涉及到眼部周围，所以要十分的谨慎。</p><p>　　割双眼皮手术术后自我护理也是重睑手术能否成功的重要一环。合理恰当的自我护理可减少术后并发症的发生，加速伤口的愈合。可以从以下几个方面着手：</p><p>　　双眼皮手术护理一、保持伤口清洁，防止感染。重睑术后的伤口清洁是很重要的，如果伤口不干净，很容易发生感染，导致伤口疤痕的形成。所以术后洗脸时注意不要打湿伤口。手术后1～2天可摘掉眼睛上包扎的敷料，如果伤口上有血痂或分泌物，可用无菌盐水或医用酒精擦拭。</p><p>　　双眼皮手术护理二、注意加强眼部肌肉的运动。重睑手术一般需覆盖切口一天，术后第二天就要揭去覆盖的纱布。早期48小时内可用冰袋局部冷敷。冰袋可减轻术后疼痛，还有止血和消肿的作用。早日加强睁大眼睛的运动，促使眼睛肌肉和周围组织的血液循环，减轻并逐渐消除手术部位的肿胀，促进手术淤血的早日吸收。</p><p>　　双眼皮手术护理三、预防手术部位的疤痕增生。一些人在重睑手术后仍然使用一些含有重金属如汞之类的除皱防晒用品。这些含有重金属的化妆护肤品有可能加重手术切口的疤痕增生，如果是疤痕体质的人，更会雪上加霜。所以，手术后三到六个月内是手术疤痕的增生期，在这个时期，切不可使用含有重金属的化妆护肤品。</p><p>　　双眼皮手术护理四、注意做好眼睑组织的保湿和软化。重睑手术的切口完全愈合后，就可以使用一些正规厂家生产的保湿、软化组织及不含重金属的护肤化妆品。</p><p>　　如果您对双眼皮手术感兴趣，可以点击咨询中翰\r的专家会给您更加详尽的解答。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1395','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/277.html','影响双眼皮手术价格的因素有哪些','array (\n  \'title\' => \'影响双眼皮手术价格的因素有哪些\',\n  \'time\' => \'1401852363\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　埋线双眼皮手术的价格的主要影响因素有哪些?眼睛是心灵的窗户，而且每一个人都希望拥有美丽迷人的双眼皮，大眼睛。现在的美容技术埋线双眼皮手术可以让您快速的实现自己的梦想。不过，埋线双眼皮价格成为大家议论的焦点。毕竟现在人们倡导得到是理性消费，下面我们就来看看吧。</p><p>　　埋线双眼皮手术的价格的主要影响因素，主要有以下几点：</p><p>　　1、割双眼皮手术价格与治疗专家有关</p><p>　　割双眼皮做的美不美观，术前定制方案和实施手术最为关键，因此不同的专家由于技术和经验的不同，割双眼皮手术价格也就不同。</p><p>　　2、割双眼皮手术价格与治疗医院有关</p><p>　　医院不同，割双眼皮手术价格自然也就不一样。只要您选择了正规的医疗机构和权威专家来割，割双眼皮手术价格和安全都是可以放心的。</p><p>　　3、割双眼皮价格与成本的选择有关</p><p>　　割双眼皮医院价格的成本，在市场上并没有统一的标准。据了解，割双眼皮医院在所有的美容整形手术中的收入大约占25%的比例。当然，也可能是中国人单眼皮比较多，所以在各大美容整形机构中双眼皮医院的人数也占了主要比例。手术的成本也要综合考虑的呀。更多请咨询整形美容专家。</p><p>　　如果您对割双眼皮手术的价格有疑问，可以随时点击中翰\r的专家会给您更加详尽的解答。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1396','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/276.html','双眼皮手术后十大注意事项','array (\n  \'title\' => \'双眼皮手术后十大注意事项\',\n  \'time\' => \'1401852363\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　双眼皮整形前注意事项有哪些?双眼皮能让眼睛灵动有神。漂亮灵动的大眼睛是每个人都想拥有的，这也是很多爱美女性梦寐以求的愿望。为了能让自己的眼睛变得漂亮有神采，很多爱美人士都会去做双眼皮手术，那么韩式双眼皮手术术前有哪些注意事项?</p><p>　　做双眼皮手术注意事项有：</p><p>　　(1)双眼皮整形手术后可用冰袋冷敷一小时以防出现血肿。</p><p>　　(2) 双眼皮整形手术是面部最常见的美容手术，决不可轻率不加分析地作简单的切开与缝合。</p><p>　　(3)双眼皮整形手术前要听取患者的要求，了解其心理和精神状态。不符合做双眼皮整形手术要求的，应予说明。</p><p>　　47)缝线法的线可于术后5-7日拆除;埋线法无须拆线;切开法的线可于术后大约3&mdash;5日拆除。</p><p>　　(5)缝线法也适用于上睑较紧、眼皮稍厚、不愿做手术的年轻人，可在皮肤皱折处做小切口。埋线法适用于眼皮薄、无明显内眦赘皮的患者。</p><p>　　(6)缝线结扎前先打成活结，观察重睑的自然弧度及两侧的对称情况，并作必要的调整，满意后再打紧方结，涂眼药膏，盖一薄层纱布。</p><p>　　(7)作缝线法时，加垫结扎松紧度必须恰当，以使皮肤眶隔筋膜与睑扳或上睑提肌筋膜直接粘连;作埋线法时，线必须要带有上睑板或上睑提肌筋膜，结扎的线结须深埋以防出现皮下结节，要从原针眼回针。</p><p>　　(8)作完重睑的睫毛宜稍上翅，要根据不同情况选用不同术式。设计两侧重睑线必须对称，长度宜与睑缘一致。术中必须使上睑皮肤、眶隔筋膜流畅地固定于睑板或上睑提肌筋膜上，如超越此高度也须一致，以防术后出现三角眼、多眼皮、两侧重睑不对称。</p><p>　　(9)缝线法和埋线法双眼皮整形手术，有时可能会自行消失，日后还能作切开法，术前宜让患者了解。切开法疗效肯定、持久，并可去除过多的皮肤、皮下脂肪、眼轮匝肌和眶脂肪，但切除各层组织量必须恰当，勿将泪腺当作眶脂肪;勿切断上睑提肌筋膜。</p><p>　　(10)须修改的重睑可于术后一周内进行或待组织完全恢复后再行修复，一般多需术后约3-6个月左右。</p><p>　　如果您对双眼皮整形感兴趣可以点击咨询中翰\r的专家会给您更加详尽的解答。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1397','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/275.html','男人也爱美 美型男也需要一双个性电眼','array (\n  \'title\' => \'男人也爱美 美型男也需要一双个性电眼\',\n  \'time\' => \'1401852363\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　眼睛代表着从少年到中年期的运气，一般来说，大眼睛的人个性较豁达，在运势及人缘上会比小眼睛的人来得好一些。随着时下偶像剧的大流行，造就了许多非常有个性的美型男，从师奶杀手到电眼少男无不所向披靡，许多男性索性跑到整形医院要求医生依样画葫芦般地赐予自己一双偶像的眼睛。</p><p>　　据统计，目前，眼部整形术是男性整形最流行的项目之一，很多男性也希望通过眼部整形来增加自身的魅力。武汉中翰整形美容医院\r眼部综合整形专家盛主任讲到：眼部整形与女性不同的是，男生如果想衬托出眼睛的运势，尚须与眉相相配合，也就是男生在选择眼部整形时，需要更具个性化的术前设计。</p><p>　　武汉中翰\r眼部整形术不是单单一个双眼手术，它是对睛眼的整体综合的整体打造。眼部综合整形效果特点在于其妙不可言的眼型设计，男生双眼皮手术必须根据自身的五官、脸型等设计属于自己独有的眼型。采用韩国独特缝合技术，5天左右拆线(其它方法1周拆线)，术后无青紫、轻微肿胀，轻松拥有无比心动的自然双眼皮，使男士的眼部魅力发掘到极致。</p><p>　　中翰\r美眼手术还包括开内外眼角、上睑抽脂、调整眼角位置、解决睁眼费力等等。微创显微双眼皮，以其独到的切口轨迹以及超级精细的术式要求，保证了几乎与天生双眼皮一样的外观效果，自然无痕。即使你闭上双眼，也没有疤痕的烦恼。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1398','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/274.html','选择自己适合的韩式双眼皮手术','array (\n  \'title\' => \'选择自己适合的韩式双眼皮手术\',\n  \'time\' => \'1401852362\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;韩式双眼皮手术</strong>会根据您个人的要求，根据你的眼睛外形的客观条件、性别、年龄、职业等，因人制宜，唯美设计，充分按照眼睑的动静态美感的要求，提高手术的美学效果，施行微创双眼皮手术。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>韩式双眼皮手术打破传统，经过多年的临床经验演变而成，手术术后无痕，恢复时间快，倾心塑造面部和谐美!这种双眼皮手术是按照个人的眼皮情况制定好的手术方案，这种手术要在在上眼皮上进行三点切割，通过创口，把多余的上眼皮脂肪吸出，然后在伤口出进行埋线。目的是为了让上眼皮新产生出褶皱，形成双眼皮。由于手术过程极为细致，手术操作时间比较长，手术后的效果自然逼真，几乎看不见伤口。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>韩式双眼皮手术过程极佳创伤小、手术时间短，韩式双眼皮是一项很小的微创手术，运用韩式精细专业整形器械、针、线，融合眼部动静态立体设计，&ldquo;解剖复位法&rdquo;高精缝合，创伤极小。整个手术过程只需30分钟手术即可完成。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>做韩式埋线双眼皮术后怎么护理?</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>1)在接受双眼皮后应用抗菌素，如红霉素等，3～5天，以做到良好的恢复效果。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>2) 保持伤口清洁、干燥、拆线前不宜洗脸、洗头等，以免污染伤口致术区感染。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>3) 手术后第二天到医院换垚，清理伤口，双眼皮术后第六天拆线。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>4) 双眼皮术后适当休息，减少眼部运动。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>温馨提示：武汉中翰整形美容医院\r专家团队博采众长，精深钻研中外整形手术论著，积极吸取最新整形理念，注重个体差异，不断创新，不断改进。从东西两大整形领域总结出丰富的经验，与前沿医疗整形技术完美结合，打造出高质量、优性价、零失误的美容整形特色。<br />&nbsp;</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1399','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/228.html','哪些情况不能做去眼袋手术?','array (\n  \'title\' => \'哪些情况不能做去眼袋手术?\',\n  \'time\' => \'1401852362\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　很多朋友到了一定的年龄，由于工作或者生活压力，很早就有了眼袋，现在去眼袋手术也非常方便了，能够解决眼袋的问题，可是有一些情况是不能做去眼袋手术的，那么，哪些情况下不能做去眼袋手术呢?</p><p>　　1、有明显心血管系、血液、内分泌等系统疾病者，如患高血压、心脏病，血友病、血小板减少，糖尿病、甲亢等患者。</p><p>　　2、老年性下睑松弛、睑外翻溢泪者。</p><p>　　3、眼球突出或下眼白外露明显者。</p><p>　　4、局部有炎症者。</p><p>　　5、月经期者。</p><p>　　6、出、凝血障碍者不能做祛眼袋手术。</p><p>　　7、有传染病的患者不能做祛眼袋手术。</p><p>　　8、严重的瘢痕体质者不主张做祛眼袋手术。</p><p>　　9、感冒、发烧都不适宜做祛眼袋手术。</p><p>　　10、心理不健康者、精神病者不应做，否则可能引起祛眼袋手术效果与想象不符的冲突 。</p><p>　　出现以上这些情况的时候不能去做去眼袋手术，如果您对去眼袋手术感兴趣，可以点击咨询中翰\r的专家会给您更加详尽的解答。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1400','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/227.html','去眼袋适用于哪些情况','array (\n  \'title\' => \'去眼袋适用于哪些情况\',\n  \'time\' => \'1401852361\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　　什么是去眼袋?</p><p>　　人的眼睛由上下眼睑覆盖。眼睑由皮肤、皮下组织、肌肉、睑板和眼结膜组成。随着年龄的增长，下眼睑可能发生皮肤、眼轮匝肌松弛和脂肪突出的症状,常在下睑及其下方形成眼袋。一般来说，眼睑皮肤和肌肉松弛、眶隔脂肪膨出和睑板松弛常为年龄因素所致，但眼轮匝肌肥厚和眶隔脂肪膨出可为先天性因素所致。先天性因素所致眼袋的手术年龄一般较早，为20岁左右，而年龄性因素所致的松弛性畸形则常在25-30岁以后。眼袋的形成是皮肤老化的一种表现。说明人开始进入中老年了。眼袋发生的年龄不尽相同，与每个人的生活环境、习惯、营养、休息、职业、遗传等多种因素有关。  眼袋一旦形成，唯一的解决办法就是手术治疗。到目前为止，尚没有一种有效的非手术方法来消除眼袋，所做的一些辅助治疗如皮肤保养，面部按摩等方法只能是减缓眼袋的加重，而对消除眼袋几乎没有什么效果。通过手术，眼睑平整，无皱纹，皮肤光泽，而且皮肤切口一般也不会有手术痕迹，少数病人早期会有切口发红，轻度瘢痕增生，一般1-3个月左右即可消失。</p><p>　　去眼袋适用于哪些情况?</p><p>　　1、下睑皮肤松弛型：主要表现为下眼睑皮肤松弛并出现皱褶，眶隔脂肪不突出，有时反较萎缩而呈轻度的凹陷状态。</p><p>　　2、下睑眼轮匝肌肥厚型(假性眼袋)：系下睑眼轮匝肌肥厚所致，多与家族遗传有关。</p><p>　　3、 眶隔脂肪突出型：眶隔膨出所致，为典型的眼袋。无下眼睑皮肤松弛与皮肤皱褶</p><p>　　4、 混合型：系1，3型的混合表现，主要表现为眶隔脂肪膨出，同时伴有不同程度的下眼睑皮肤松弛与皮肤皱褶。</p><p>　　去眼袋副作用有哪些</p><p>　　1眼部组织神经损伤。</p><p>　　2渗血及肿胀。</p><p>　　3头部的血压突然的升高而发生术区的出血。</p><p>　　去眼袋手术过程</p><p>　　依手术方法不同，眼袋整形手术可分为两种，各种方法适应于不同类型的眼袋。</p><p>　　1.  外切口法眼袋整形术：即传统的标准去眼袋手术方法。手术时切口沿下睑睫毛下缘至外眦沟，经切口分离后切除膨出的眼袋脂肪。同时拉紧下睑皮肤，切除多余的下睑皮肤，去除下睑皮肤皱纹。该法切口隐蔽，愈后1～2月较难看出切口痕迹。该法主要适用于1.2.4型眼袋</p><p>　　2.  内切口法眼袋整形术：即眼袋抽脂术，为近年来流行的眼袋整形术，手术时经下睑结膜囊内小切口抽除眼袋脂肪，因而皮肤表面无任何切口痕迹。深受患者欢迎。该法主要适用于3型眼袋。</p><p>　　如果您对去眼袋手术感兴趣，可以点击咨询中翰\r的专家会给您更加详尽的解答。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1401','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/225.html','去眼袋的常识及护理','array (\n  \'title\' => \'去眼袋的常识及护理\',\n  \'time\' => \'1401852361\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>　　去眼袋术前进行哪些准备?</p><p>　　1、受术者与医生应作全面深入的术前交谈，了解手术的大小、步骤、痛苦程度、恢复的快慢、可能达到的效果;可能存在的风险;医生应了解患者面部的情况，手术的动机，对手术的期望是否符合实际等。</p><p>　　2、身体健康状况的检查：除外可能存在的心、肺、肝、血液等内科疾病， 既往的手术史，用药史，过敏史等。</p><p>　　3、手术前一周停止饮酒，停用阿司匹林、维生素E及其他扩血管药物。</p><p>　　4、术前3天每天洗头一次;术前一夜可适当服用安眠药物，术前半小时酌情应用镇静、止痛药;根据麻醉术式，决定是否需要禁食。</p><p>　　去眼袋术后如何护理?</p><p>　　术后常见眼周淤血水肿，术后两天局部冷敷，第三天后改为热敷，可减轻淤血水肿程度，有助于水肿消退。外切口法眼袋整形术术后因眼轮匝机松弛，失去正常张力，术后一个短时期中，发生轻度外翻，这种情况一般在术后2～3月能恢复正常。</p><p>　　去眼袋后遗症有哪些?</p><p>　　1、切口平整无明显瘢痕。</p><p>　　2、切除的皮肤宽窄适当双侧对称无眼睑外翻。</p><p>　　3、无明显的感染血肿等并发症。</p><p>　　4、去除的眶隔脂肪适当去除过小效果欠佳;去除过多又会引起下睑凹陷畸形。</p><p>　　5、去眼袋手术损伤小恢复快一周左右基本消除肿涨淤血</p><p>　　手术使眼袋明显者摆脱了眼袋的困扰，也同时使你的眼睛更加的明亮和炯炯有神，也使你的生活更加的自信和幸福。如果您对去眼袋手术感兴趣，可以点击咨询中翰\r的专家会给您更加详尽的解答。</p></div>		\',\n)');
