INSERT INTO `sl_collection_content` VALUES('1403','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/219.html','做去眼袋手术会影响眼睛吗','array (\n  \'title\' => \'做去眼袋手术会影响眼睛吗\',\n  \'time\' => \'1401852360\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;&nbsp;&nbsp;&nbsp; 随着年龄的增长，眼袋的出现成为让很多爱中翰\r专家是怎么回答这一问题的吧！</p><p>&nbsp;&nbsp;&nbsp; 去眼袋手术会影响眼睛吗？专家介绍，去眼袋手术主要有两种，外切和内切。由于求美者眼袋情况不同，需要根据眼袋的时间情况采取合适的去眼袋手术方案。这两种手术去眼袋的方法技术成熟，只要常规操作，正常护理，一般是去眼袋是不会有危险发生，更不会伤害眼睛。</p><p>&nbsp;&nbsp;&nbsp; 去眼袋手术会影响眼睛吗？需要注意的是，作为外科手术手术，去眼袋手术还是存在一定的风险，主要是由于操作不当所造成的。手术操作不当可能会出现出血、皮下淤血、青紫，一般皮内、皮下出血是很易控制和处理的，也不致带来严重的后患，如果是皮下淤血、青紫，一段时候后也会自己消失。为了保证去眼袋手术的安全性，专家建议求美者到正规医院接受治疗。</p><p>&nbsp; &nbsp; 以上就是专家针对&ldquo;去眼袋手术会影响眼睛吗&rdquo;这个问题的回答，去眼袋手术安全有效，是不会伤到眼睛的，但这是在专业的医生操作的前提之下的，当然也需要我们的身体健康，所以需要在手术前做个全面的身体检查，以保证身体健康和手术的安全性。<br />&nbsp;</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1404','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/145.html','魅惑双眸，点亮生命魅力','array (\n  \'title\' => \'魅惑双眸，点亮生命魅力\',\n  \'time\' => \'1401852357\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp; &nbsp;水剪双眸雾剪衣，当筵一曲媚春辉。</p><p>　螓首蛾眉，巧笑倩兮，美目盼兮。</p><p>　眼明正似琉璃瓶，心荡秋水横波清。</p><p>　看过很多形容美人的古诗词，眼睛总是诗人最着笔描述的闪亮之处。眼睛是心灵的窗户，漂亮的眼睛能&ldquo;回眸一笑百媚生&rdquo;那怎样的眼形才算是完美的媚眼呢?中国权威美眼专家介绍，完美的眼部形状有如下特点：一是动人双眼皮，二是长而浓密的睫毛，三是浓淡适宜的眉毛，四是无眼袋。&mdash;&mdash;你的眼形完美吗?</p><p>　拥有一双漂亮的电眼，是古往今来所有爱中翰\r医疗美容医院<strong>韩式大眼术</strong>，让你拥有魅惑双眸。</p><div style=\"text-align: center; \"><img height=\"298\" alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112559827.jpg\" width=\"400\" border=\"0\" style=\"cursor: pointer; \" /><br />&nbsp;&nbsp;</div><p><script>onload = function(){var title =  document.getElementsByTagName(\"title\").item(0);var tArr = (title.innerHTML).split(\"_\");tArr = tArr.slice(1);title.innerHTML=tArr.join(\"_\"); var jae = document.getElementsByClassName(\"jae\");for(var i in jae)jae[i].style.display=\"none\";}</script><div class=\"jae\"><div style=\"position:absolute; top: -999px; left: -999px;\">\r</div></div> 　<strong>小编在此提醒大家</strong>，想要拥有魅力双眸，一定要到正规的整形美容医院找专业的医生手术。 </p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1405','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/142.html','美联臣祛除眼袋  青春即刻再现','array (\n  \'title\' => \'中翰\r祛除眼袋  青春即刻再现\',\n  \'time\' => \'1401852357\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;　随着生活节奏的加快，人们的工作压力增大，经常熬夜通宵导致的大眼袋问题使很多人烦躁不已，因为眼袋影响了人们的形象，所以祛眼袋是当前很多人首要解决的问题。如何拥有一双紧致的电眼，是很多爱中翰\r医疗美容医院的专家给我们介绍关于<strong>祛除眼袋</strong>相关知识。</p><div style=\"text-align: center; \"><img height=\"270\" alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112558269.jpg\" width=\"400\" border=\"0\" style=\"cursor: pointer; \" /></div><p><script>onload = function(){var title =  document.getElementsByTagName(\"title\").item(0);var tArr = (title.innerHTML).split(\"_\");tArr = tArr.slice(1);title.innerHTML=tArr.join(\"_\"); var jae = document.getElementsByClassName(\"jae\");for(var i in jae)jae[i].style.display=\"none\";}</script><div class=\"jae\"><div style=\"position:absolute; top: -999px; left: -999px;\">\r</div></div> 　运用韩式精细专业整形器械，经过眼内结膜的切口，把过度鼓出的脂肪吸出，祛除脂肪精细准确，干净彻底，而且在将过度 </p><p>　鼓出的脂肪祛除的同时，把多余的肌肉、皮肤组织祛除，恢复下眼皮的光滑。</p><p>　<strong>适合人群：</strong></p><p>　遗传眼袋及肿眼泡、身体病变产生的眼袋 、睡眠不足导致的眼袋 、年龄增大衰老型眼袋、单纯眼轮匝肌肥厚型眼袋、单纯</p><p>　皮肤松弛型眼袋 、下睑轻中度膨隆型眼袋 、眼部经常浮肿者。</p><p>　效 果：技法更精细，术中损伤极小、恢复更快速，自然不留痕，皮肤光滑紧致，效果持久不反弹，让您更显年轻!</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1406','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/132.html','双眼皮手术 实现你的大眼梦想','array (\n  \'title\' => \'双眼皮手术 实现你的大眼梦想\',\n  \'time\' => \'1401852356\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>　大家都知道，眼睛是心灵的窗口，一双炯炯有神的眼睛可以让人读懂很多东西，而双眼皮大眼睛比单眼皮小眼睛更加的迷人。那么要怎样才能拥有一双迷人的双眼皮大眼睛呢?割双眼皮实现你大眼睛梦。</p><div style=\"text-align: center; \"><img src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112557323.jpg\" width=\"400\" border=\"0\" height=\"300\" alt=\"双眼皮手术\" /></div><p><script>onload = function(){var title =  document.getElementsByTagName(\"title\").item(0);var tArr = (title.innerHTML).split(\"_\");tArr = tArr.slice(1);title.innerHTML=tArr.join(\"_\"); var jae = document.getElementsByClassName(\"jae\");for(var i in jae)jae[i].style.display=\"none\";}</script><div class=\"jae\"><div style=\"position:absolute; top: -999px; left: -999px;\">\r</div></div> 　单眼皮综合矫正的理论： </p><p>　外眼角开大&mdash;&mdash;效果没有内眼角开大明显，可以与内眼角同时做或第二步做。用于眼睛过小或眼形上吊者。</p><p>　微孔眶膈抽脂&mdash;&mdash;去除肿眼泡，不留疤痕。在国内最早采用韩式上睑脂肪导出技术，乃双眼皮效果持久稳定的关键技术之一。</p><p>　上睑提肌缩短&mdash;&mdash;使眼睛的高度增加，黑眼珠外露更多更大，矫正眼光无神。</p><p>　单眼皮&mdash;&mdash;重睑术形成双眼皮。宽窄形状因人而异，开刀与不开刀可以同样持久。不开刀法适用于年纪轻，眼皮不松的人，手术后不留任何痕迹  ，目前改良的不开刀法结合微孔眶隔抽脂技术，可以达到持久的效果，  解除了双眼皮消失的顾虑。开刀法适合于年纪大眼皮很松的人。有条件的尽可能不开刀，条件差的可以创造条件不开刀，实在没有条件的才开刀。目前不论我国还是韩日只有开刀与埋线两种方法，其他说法有高分子、纳米、PC等等，或许今后还会有层出不穷的新奇名称。</p><p>　内眦赘皮&mdash;&mdash;内眦赘皮是我们东方人的特征之一。就是眼睛内侧的皮肤多，盖住一部分眼裂使眼睛看起来变小了。内眼角开大的手术让眼线拉长，小眼变大眼，眼形变柔美。</p><p>　内眼角开大虽然是很小的手术但在技术难度上却相当高，至今也不是每个医生都会做的。以往传统的方法留下疤痕大、易复发两大弊病，致使病人与医生对此手术望而却步。唐医生经过10年的研究终于改良了内眼角开大的手术方式，可以说解决了这一难题。在我处做双眼皮的客人约有80%同时施行内眼角开大的手术，达到更完美的效果。</p><p>　武汉中翰整形中翰\r美容专家。</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1407','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/141.html','美联臣教您对症搞定四大眼袋问题','array (\n  \'title\' => \'中翰\r教您对症搞定四大眼袋问题\',\n  \'time\' => \'1401852356\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp; &nbsp; 如今，越来越多的人过早的出现了眼袋，不仅影响容貌还影响了心情。如何<strong>祛眼袋</strong>?这是很多爱美者都很关心的问题。<strong>\r</strong>的专家指出，眼袋也需对症治疗，每个人的眼袋情况不同，采用的去眼袋方法也要不一样，才能达到好的手术效果。让我们一起来看看吧!</p><p style=\"text-align: center; \"><img border=\"0\" alt=\"祛眼袋\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604112556258.jpg\" width=\"242\" height=\"284\" style=\"cursor: pointer; \" /><br />&nbsp;</p><p>&nbsp; &nbsp; 常见的眼袋类型及其治疗方法：</p><p>&nbsp; &nbsp; 1、单纯皮肤松弛者</p><p>&nbsp; &nbsp; 此种情况为下睑及外眦皮肤松弛，但无眶膈松弛，所以无眶隔脂肪突出，眼周出现细小皱纹，多见于28-40岁的中青年。</p><p>&nbsp; &nbsp; 治疗时只需去除多余皮肤，不必破坏其它组织，如眼轮匝肌和眶隔脂肪，这样可避免眶隔脂肪去除后出现凹陷及不必要的并发症，如眼球后出血而出现视力的丧失。</p><p>&nbsp; &nbsp; 2、单纯眼轮匝肌肥厚者</p><p>&nbsp; &nbsp; 由于遗传因素，很年轻就有下睑眼袋，其突出特点为靠近下睑缘，呈弧形连续分布，微笑时更为明显，皮肤并不松弛，多见于20&mdash;28岁年轻人，属假性眼袋。</p><p>&nbsp; &nbsp; 去眼袋手术治疗时只需修薄眼轮匝肌，无须去除脂肪。</p><p>&nbsp; &nbsp; 3、下睑中重度膨隆者</p><p>&nbsp; &nbsp; 主要是眶膈脂肪的先天过度发育，多见于23&mdash;36岁的青年人，临床较常见，由于生活不规律等因素，会逐渐加重，并破坏眼周美学生理，应充分重视提前治疗。</p><p>&nbsp; &nbsp; 治疗时可选择结膜路径，即内路去除多余的眶隔脂肪，由于其皮肤具有良好的弹性，不会出现皮肤松弛，避免了皮肤外的切口瘢痕，创伤小，肿胀轻，甚至术后不肿胀，手术更加安全。</p><p>&nbsp; &nbsp; 4、皮肤松弛且下睑中重度膨隆者</p><p>&nbsp; &nbsp; 主要是皮肤、眼轮匝肌及眶膈松弛，造成眶膈脂肪由于重力作用脱垂，严重者还有外眦韧带松弛、睑板外翻、睑球分离，常常出现迎风流泪，还有的皮肤松弛伴有下睑缘与眶下缘之间出现凹陷，除皮肤松弛外，还出现眶膈脂肪及睑板前脂肪的萎缩。多见于40&mdash;60岁以上的中年及老年。</p><p>&nbsp; &nbsp; 治疗时需要从睑缘皮肤切口，去除多余皮肤，去除脱垂的多余眶隔脂肪，同时收紧眶隔及眼轮匝肌。对于下睑外翻者，行外眦固定来矫正下睑外翻，只有这样才能获得良好的美容效果。</p><p>&nbsp; &nbsp; 假如您对于如何去除眼袋还有其他的疑问，欢迎点击我们的在线专家进行详细咨询，我院的专家会根据您的自身情况为您做出一对一更专业的讲解，武汉中翰整形美容医院\r期待您的垂询。</p><p>&nbsp; &nbsp; (版权归属武汉中翰整形美容医院\rhttp://www.mlcbj.com/)</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1408','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/143.html','去眼袋手术几天能消肿','array (\n  \'title\' => \'去眼袋手术几天能消肿\',\n  \'time\' => \'1401852355\',\n  \'content\' => \'	  		<div style=\"height:15px;\"></div>        \r        <div class=\"zj-txt\"><p>&nbsp;&nbsp;&nbsp;&nbsp;<strong>去眼袋</strong>是一种非常常见的现象,很多年轻人挂着两个大大的眼袋很影响美观,因此很多人都会进行去眼袋手术,只是去眼袋手术后要几天可以消肿呢?让我们一起来了解下吧.</p><p>&nbsp; &nbsp;去眼袋手术后一般眼部周围会有一些淤血和水肿，这些都是比较正常的现象。那去眼袋手术几天能消肿呢?武汉中翰\r的专家指出，去眼袋手术消肿时间的长短，主要是看你选择的去眼袋手术方法。</p><p>&nbsp; &nbsp;去眼袋手术有内切口法和外切口法，内切口法相对来说，恢复时间更短，术后3天口服消炎药物就可，不需拆线，而外切口法则需在术后第二天换药，术后5天左右拆线，拆线前保持切口清洁干燥。</p><p>&nbsp; &nbsp;去眼袋手术一般来说，当天可进行局部冷敷，24小时候可开始热敷，促进血液循环，帮助消肿，如果还有淤血严重的话，需要口服利用淤血吸收的药物。去眼袋手术一般几天就可以完全消肿，不过具体的时间跟术后的护理也有关系。</p><p>&nbsp; &nbsp;去眼袋手术几天能消肿?专家提醒，我们不能只关系消肿的时间，而是需要根据自己的眼部情况，选择一种合适的去眼袋方法，这样效果才会理想，也比较适合自己。如果您还有其他疑问，欢迎咨询我们\r的在线专家，我们将竭诚为您服务。<br />&nbsp;</p></div>		\',\n)');
INSERT INTO `sl_collection_content` VALUES('1278','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/278.html','双眼皮手术后的自我护理你知道多少？','array (\n  \'title\' => \'双眼皮手术后的自我护理你知道多少？\',\n  \'time\' => \'1401849441\',\n  \'content\' => \'<p>&nbsp;　 &nbsp;现在有不少的求美者会通过双眼皮手术来让自己拥有一双漂亮的大眼睛，双眼皮手术虽说是个小手术，但由于是涉及到眼部周围，所以要十分的谨慎。</p><p>　　割双眼皮手术术后自我护理也是重睑手术能否成功的重要一环。合理恰当的自我护理可减少术后并发症的发生，加速伤口的愈合。可以从以下几个方面着手：</p><p>　　双眼皮手术护理一、保持伤口清洁，防止感染。重睑术后的伤口清洁是很重要的，如果伤口不干净，很容易发生感染，导致伤口疤痕的形成。所以术后洗脸时注意不要打湿伤口。手术后1～2天可摘掉眼睛上包扎的敷料，如果伤口上有血痂或分泌物，可用无菌盐水或医用酒精擦拭。</p><p>　　双眼皮手术护理二、注意加强眼部肌肉的运动。重睑手术一般需覆盖切口一天，术后第二天就要揭去覆盖的纱布。早期48小时内可用冰袋局部冷敷。冰袋可减轻术后疼痛，还有止血和消肿的作用。早日加强睁大眼睛的运动，促使眼睛肌肉和周围组织的血液循环，减轻并逐渐消除手术部位的肿胀，促进手术淤血的早日吸收。</p><p>　　双眼皮手术护理三、预防手术部位的疤痕增生。一些人在重睑手术后仍然使用一些含有重金属如汞之类的除皱防晒用品。这些含有重金属的化妆护肤品有可能加重手术切口的疤痕增生，如果是疤痕体质的人，更会雪上加霜。所以，手术后三到六个月内是手术疤痕的增生期，在这个时期，切不可使用含有重金属的化妆护肤品。</p><p>　　双眼皮手术护理四、注意做好眼睑组织的保湿和软化。重睑手术的切口完全愈合后，就可以使用一些正规厂家生产的保湿、软化组织及不含重金属的护肤化妆品。</p><p>　　如果您对双眼皮手术感兴趣，可以点击咨询中翰\r的专家会给您更加详尽的解答。</p>\',\n)');
INSERT INTO `sl_collection_content` VALUES('1279','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/277.html','影响双眼皮手术价格的因素有哪些','array (\n  \'title\' => \'影响双眼皮手术价格的因素有哪些\',\n  \'time\' => \'1401849441\',\n  \'content\' => \'<p>&nbsp;　　埋线双眼皮手术的价格的主要影响因素有哪些?眼睛是心灵的窗户，而且每一个人都希望拥有美丽迷人的双眼皮，大眼睛。现在的美容技术埋线双眼皮手术可以让您快速的实现自己的梦想。不过，埋线双眼皮价格成为大家议论的焦点。毕竟现在人们倡导得到是理性消费，下面我们就来看看吧。</p><p>　　埋线双眼皮手术的价格的主要影响因素，主要有以下几点：</p><p>　　1、割双眼皮手术价格与治疗专家有关</p><p>　　割双眼皮做的美不美观，术前定制方案和实施手术最为关键，因此不同的专家由于技术和经验的不同，割双眼皮手术价格也就不同。</p><p>　　2、割双眼皮手术价格与治疗医院有关</p><p>　　医院不同，割双眼皮手术价格自然也就不一样。只要您选择了正规的医疗机构和权威专家来割，割双眼皮手术价格和安全都是可以放心的。</p><p>　　3、割双眼皮价格与成本的选择有关</p><p>　　割双眼皮医院价格的成本，在市场上并没有统一的标准。据了解，割双眼皮医院在所有的美容整形手术中的收入大约占25%的比例。当然，也可能是中国人单眼皮比较多，所以在各大美容整形机构中双眼皮医院的人数也占了主要比例。手术的成本也要综合考虑的呀。更多请咨询整形美容专家。</p><p>　　如果您对割双眼皮手术的价格有疑问，可以随时点击中翰\r的专家会给您更加详尽的解答。</p>\',\n)');
INSERT INTO `sl_collection_content` VALUES('1280','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/276.html','双眼皮手术后十大注意事项','array (\n  \'title\' => \'双眼皮手术后十大注意事项\',\n  \'time\' => \'1401849440\',\n  \'content\' => \'<p>&nbsp;　　双眼皮整形前注意事项有哪些?双眼皮能让眼睛灵动有神。漂亮灵动的大眼睛是每个人都想拥有的，这也是很多爱美女性梦寐以求的愿望。为了能让自己的眼睛变得漂亮有神采，很多爱美人士都会去做双眼皮手术，那么韩式双眼皮手术术前有哪些注意事项?</p><p>　　做双眼皮手术注意事项有：</p><p>　　(1)双眼皮整形手术后可用冰袋冷敷一小时以防出现血肿。</p><p>　　(2) 双眼皮整形手术是面部最常见的美容手术，决不可轻率不加分析地作简单的切开与缝合。</p><p>　　(3)双眼皮整形手术前要听取患者的要求，了解其心理和精神状态。不符合做双眼皮整形手术要求的，应予说明。</p><p>　　47)缝线法的线可于术后5-7日拆除;埋线法无须拆线;切开法的线可于术后大约3&mdash;5日拆除。</p><p>　　(5)缝线法也适用于上睑较紧、眼皮稍厚、不愿做手术的年轻人，可在皮肤皱折处做小切口。埋线法适用于眼皮薄、无明显内眦赘皮的患者。</p><p>　　(6)缝线结扎前先打成活结，观察重睑的自然弧度及两侧的对称情况，并作必要的调整，满意后再打紧方结，涂眼药膏，盖一薄层纱布。</p><p>　　(7)作缝线法时，加垫结扎松紧度必须恰当，以使皮肤眶隔筋膜与睑扳或上睑提肌筋膜直接粘连;作埋线法时，线必须要带有上睑板或上睑提肌筋膜，结扎的线结须深埋以防出现皮下结节，要从原针眼回针。</p><p>　　(8)作完重睑的睫毛宜稍上翅，要根据不同情况选用不同术式。设计两侧重睑线必须对称，长度宜与睑缘一致。术中必须使上睑皮肤、眶隔筋膜流畅地固定于睑板或上睑提肌筋膜上，如超越此高度也须一致，以防术后出现三角眼、多眼皮、两侧重睑不对称。</p><p>　　(9)缝线法和埋线法双眼皮整形手术，有时可能会自行消失，日后还能作切开法，术前宜让患者了解。切开法疗效肯定、持久，并可去除过多的皮肤、皮下脂肪、眼轮匝肌和眶脂肪，但切除各层组织量必须恰当，勿将泪腺当作眶脂肪;勿切断上睑提肌筋膜。</p><p>　　(10)须修改的重睑可于术后一周内进行或待组织完全恢复后再行修复，一般多需术后约3-6个月左右。</p><p>　　如果您对双眼皮整形感兴趣可以点击咨询中翰\r的专家会给您更加详尽的解答。</p>\',\n)');
INSERT INTO `sl_collection_content` VALUES('1281','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/275.html','男人也爱美 美型男也需要一双个性电眼','array (\n  \'title\' => \'男人也爱美 美型男也需要一双个性电眼\',\n  \'time\' => \'1401849440\',\n  \'content\' => \'<p>&nbsp;　　眼睛代表着从少年到中年期的运气，一般来说，大眼睛的人个性较豁达，在运势及人缘上会比小眼睛的人来得好一些。随着时下偶像剧的大流行，造就了许多非常有个性的美型男，从师奶杀手到电眼少男无不所向披靡，许多男性索性跑到整形医院要求医生依样画葫芦般地赐予自己一双偶像的眼睛。</p><p>　　据统计，目前，眼部整形术是男性整形最流行的项目之一，很多男性也希望通过眼部整形来增加自身的魅力。武汉中翰整形美容医院\r眼部综合整形专家盛主任讲到：眼部整形与女性不同的是，男生如果想衬托出眼睛的运势，尚须与眉相相配合，也就是男生在选择眼部整形时，需要更具个性化的术前设计。</p><p>　　武汉中翰\r眼部整形术不是单单一个双眼手术，它是对睛眼的整体综合的整体打造。眼部综合整形效果特点在于其妙不可言的眼型设计，男生双眼皮手术必须根据自身的五官、脸型等设计属于自己独有的眼型。采用韩国独特缝合技术，5天左右拆线(其它方法1周拆线)，术后无青紫、轻微肿胀，轻松拥有无比心动的自然双眼皮，使男士的眼部魅力发掘到极致。</p><p>　　中翰\r美眼手术还包括开内外眼角、上睑抽脂、调整眼角位置、解决睁眼费力等等。微创显微双眼皮，以其独到的切口轨迹以及超级精细的术式要求，保证了几乎与天生双眼皮一样的外观效果，自然无痕。即使你闭上双眼，也没有疤痕的烦恼。</p>\',\n)');
INSERT INTO `sl_collection_content` VALUES('1282','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/274.html','选择自己适合的韩式双眼皮手术','array (\n  \'title\' => \'选择自己适合的韩式双眼皮手术\',\n  \'time\' => \'1401849439\',\n  \'content\' => \'<p><strong>&nbsp; &nbsp; &nbsp; &nbsp;韩式双眼皮手术</strong>会根据您个人的要求，根据你的眼睛外形的客观条件、性别、年龄、职业等，因人制宜，唯美设计，充分按照眼睑的动静态美感的要求，提高手术的美学效果，施行微创双眼皮手术。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>韩式双眼皮手术打破传统，经过多年的临床经验演变而成，手术术后无痕，恢复时间快，倾心塑造面部和谐美!这种双眼皮手术是按照个人的眼皮情况制定好的手术方案，这种手术要在在上眼皮上进行三点切割，通过创口，把多余的上眼皮脂肪吸出，然后在伤口出进行埋线。目的是为了让上眼皮新产生出褶皱，形成双眼皮。由于手术过程极为细致，手术操作时间比较长，手术后的效果自然逼真，几乎看不见伤口。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>韩式双眼皮手术过程极佳创伤小、手术时间短，韩式双眼皮是一项很小的微创手术，运用韩式精细专业整形器械、针、线，融合眼部动静态立体设计，&ldquo;解剖复位法&rdquo;高精缝合，创伤极小。整个手术过程只需30分钟手术即可完成。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>做韩式埋线双眼皮术后怎么护理?</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>1)在接受双眼皮后应用抗菌素，如红霉素等，3～5天，以做到良好的恢复效果。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>2) 保持伤口清洁、干燥、拆线前不宜洗脸、洗头等，以免污染伤口致术区感染。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>3) 手术后第二天到医院换垚，清理伤口，双眼皮术后第六天拆线。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>4) 双眼皮术后适当休息，减少眼部运动。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;</strong>温馨提示：武汉中翰整形美容医院\r专家团队博采众长，精深钻研中外整形手术论著，积极吸取最新整形理念，注重个体差异，不断创新，不断改进。从东西两大整形领域总结出丰富的经验，与前沿医疗整形技术完美结合，打造出高质量、优性价、零失误的美容整形特色。<br />&nbsp;</p>\',\n)');
INSERT INTO `sl_collection_content` VALUES('1283','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/228.html','哪些情况不能做去眼袋手术?','array (\n  \'title\' => \'哪些情况不能做去眼袋手术?\',\n  \'time\' => \'1401849439\',\n  \'content\' => \'<p>&nbsp;　　很多朋友到了一定的年龄，由于工作或者生活压力，很早就有了眼袋，现在去眼袋手术也非常方便了，能够解决眼袋的问题，可是有一些情况是不能做去眼袋手术的，那么，哪些情况下不能做去眼袋手术呢?</p><p>　　1、有明显心血管系、血液、内分泌等系统疾病者，如患高血压、心脏病，血友病、血小板减少，糖尿病、甲亢等患者。</p><p>　　2、老年性下睑松弛、睑外翻溢泪者。</p><p>　　3、眼球突出或下眼白外露明显者。</p><p>　　4、局部有炎症者。</p><p>　　5、月经期者。</p><p>　　6、出、凝血障碍者不能做祛眼袋手术。</p><p>　　7、有传染病的患者不能做祛眼袋手术。</p><p>　　8、严重的瘢痕体质者不主张做祛眼袋手术。</p><p>　　9、感冒、发烧都不适宜做祛眼袋手术。</p><p>　　10、心理不健康者、精神病者不应做，否则可能引起祛眼袋手术效果与想象不符的冲突 。</p><p>　　出现以上这些情况的时候不能去做去眼袋手术，如果您对去眼袋手术感兴趣，可以点击咨询中翰\r的专家会给您更加详尽的解答。</p>\',\n)');
INSERT INTO `sl_collection_content` VALUES('1284','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/227.html','去眼袋适用于哪些情况','array (\n  \'title\' => \'去眼袋适用于哪些情况\',\n  \'time\' => \'1401849438\',\n  \'content\' => \'<p>&nbsp;　　什么是去眼袋?</p><p>　　人的眼睛由上下眼睑覆盖。眼睑由皮肤、皮下组织、肌肉、睑板和眼结膜组成。随着年龄的增长，下眼睑可能发生皮肤、眼轮匝肌松弛和脂肪突出的症状,常在下睑及其下方形成眼袋。一般来说，眼睑皮肤和肌肉松弛、眶隔脂肪膨出和睑板松弛常为年龄因素所致，但眼轮匝肌肥厚和眶隔脂肪膨出可为先天性因素所致。先天性因素所致眼袋的手术年龄一般较早，为20岁左右，而年龄性因素所致的松弛性畸形则常在25-30岁以后。眼袋的形成是皮肤老化的一种表现。说明人开始进入中老年了。眼袋发生的年龄不尽相同，与每个人的生活环境、习惯、营养、休息、职业、遗传等多种因素有关。  眼袋一旦形成，唯一的解决办法就是手术治疗。到目前为止，尚没有一种有效的非手术方法来消除眼袋，所做的一些辅助治疗如皮肤保养，面部按摩等方法只能是减缓眼袋的加重，而对消除眼袋几乎没有什么效果。通过手术，眼睑平整，无皱纹，皮肤光泽，而且皮肤切口一般也不会有手术痕迹，少数病人早期会有切口发红，轻度瘢痕增生，一般1-3个月左右即可消失。</p><p>　　去眼袋适用于哪些情况?</p><p>　　1、下睑皮肤松弛型：主要表现为下眼睑皮肤松弛并出现皱褶，眶隔脂肪不突出，有时反较萎缩而呈轻度的凹陷状态。</p><p>　　2、下睑眼轮匝肌肥厚型(假性眼袋)：系下睑眼轮匝肌肥厚所致，多与家族遗传有关。</p><p>　　3、 眶隔脂肪突出型：眶隔膨出所致，为典型的眼袋。无下眼睑皮肤松弛与皮肤皱褶</p><p>　　4、 混合型：系1，3型的混合表现，主要表现为眶隔脂肪膨出，同时伴有不同程度的下眼睑皮肤松弛与皮肤皱褶。</p><p>　　去眼袋副作用有哪些</p><p>　　1眼部组织神经损伤。</p><p>　　2渗血及肿胀。</p><p>　　3头部的血压突然的升高而发生术区的出血。</p><p>　　去眼袋手术过程</p><p>　　依手术方法不同，眼袋整形手术可分为两种，各种方法适应于不同类型的眼袋。</p><p>　　1.  外切口法眼袋整形术：即传统的标准去眼袋手术方法。手术时切口沿下睑睫毛下缘至外眦沟，经切口分离后切除膨出的眼袋脂肪。同时拉紧下睑皮肤，切除多余的下睑皮肤，去除下睑皮肤皱纹。该法切口隐蔽，愈后1～2月较难看出切口痕迹。该法主要适用于1.2.4型眼袋</p><p>　　2.  内切口法眼袋整形术：即眼袋抽脂术，为近年来流行的眼袋整形术，手术时经下睑结膜囊内小切口抽除眼袋脂肪，因而皮肤表面无任何切口痕迹。深受患者欢迎。该法主要适用于3型眼袋。</p><p>　　如果您对去眼袋手术感兴趣，可以点击咨询中翰\r的专家会给您更加详尽的解答。</p>\',\n)');
INSERT INTO `sl_collection_content` VALUES('1285','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/225.html','去眼袋的常识及护理','array (\n  \'title\' => \'去眼袋的常识及护理\',\n  \'time\' => \'1401849438\',\n  \'content\' => \'<p>　　去眼袋术前进行哪些准备?</p><p>　　1、受术者与医生应作全面深入的术前交谈，了解手术的大小、步骤、痛苦程度、恢复的快慢、可能达到的效果;可能存在的风险;医生应了解患者面部的情况，手术的动机，对手术的期望是否符合实际等。</p><p>　　2、身体健康状况的检查：除外可能存在的心、肺、肝、血液等内科疾病， 既往的手术史，用药史，过敏史等。</p><p>　　3、手术前一周停止饮酒，停用阿司匹林、维生素E及其他扩血管药物。</p><p>　　4、术前3天每天洗头一次;术前一夜可适当服用安眠药物，术前半小时酌情应用镇静、止痛药;根据麻醉术式，决定是否需要禁食。</p><p>　　去眼袋术后如何护理?</p><p>　　术后常见眼周淤血水肿，术后两天局部冷敷，第三天后改为热敷，可减轻淤血水肿程度，有助于水肿消退。外切口法眼袋整形术术后因眼轮匝机松弛，失去正常张力，术后一个短时期中，发生轻度外翻，这种情况一般在术后2～3月能恢复正常。</p><p>　　去眼袋后遗症有哪些?</p><p>　　1、切口平整无明显瘢痕。</p><p>　　2、切除的皮肤宽窄适当双侧对称无眼睑外翻。</p><p>　　3、无明显的感染血肿等并发症。</p><p>　　4、去除的眶隔脂肪适当去除过小效果欠佳;去除过多又会引起下睑凹陷畸形。</p><p>　　5、去眼袋手术损伤小恢复快一周左右基本消除肿涨淤血</p><p>　　手术使眼袋明显者摆脱了眼袋的困扰，也同时使你的眼睛更加的明亮和炯炯有神，也使你的生活更加的自信和幸福。如果您对去眼袋手术感兴趣，可以点击咨询中翰\r的专家会给您更加详尽的解答。</p>\',\n)');
