INSERT INTO `sl_collection_content` VALUES('1287','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/219.html','做去眼袋手术会影响眼睛吗','array (\n  \'title\' => \'做去眼袋手术会影响眼睛吗\',\n  \'time\' => \'1401849438\',\n  \'content\' => \'<p>&nbsp;&nbsp;&nbsp;&nbsp; 随着年龄的增长，眼袋的出现成为让很多爱中翰\r专家是怎么回答这一问题的吧！</p><p>&nbsp;&nbsp;&nbsp; 去眼袋手术会影响眼睛吗？专家介绍，去眼袋手术主要有两种，外切和内切。由于求美者眼袋情况不同，需要根据眼袋的时间情况采取合适的去眼袋手术方案。这两种手术去眼袋的方法技术成熟，只要常规操作，正常护理，一般是去眼袋是不会有危险发生，更不会伤害眼睛。</p><p>&nbsp;&nbsp;&nbsp; 去眼袋手术会影响眼睛吗？需要注意的是，作为外科手术手术，去眼袋手术还是存在一定的风险，主要是由于操作不当所造成的。手术操作不当可能会出现出血、皮下淤血、青紫，一般皮内、皮下出血是很易控制和处理的，也不致带来严重的后患，如果是皮下淤血、青紫，一段时候后也会自己消失。为了保证去眼袋手术的安全性，专家建议求美者到正规医院接受治疗。</p><p>&nbsp; &nbsp; 以上就是专家针对&ldquo;去眼袋手术会影响眼睛吗&rdquo;这个问题的回答，去眼袋手术安全有效，是不会伤到眼睛的，但这是在专业的医生操作的前提之下的，当然也需要我们的身体健康，所以需要在手术前做个全面的身体检查，以保证身体健康和手术的安全性。<br />&nbsp;</p>\',\n)');
INSERT INTO `sl_collection_content` VALUES('1288','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/145.html','魅惑双眸，点亮生命魅力','array (\n  \'title\' => \'魅惑双眸，点亮生命魅力\',\n  \'time\' => \'1401849435\',\n  \'content\' => \'<p>&nbsp; &nbsp;水剪双眸雾剪衣，当筵一曲媚春辉。</p><p>　螓首蛾眉，巧笑倩兮，美目盼兮。</p><p>　眼明正似琉璃瓶，心荡秋水横波清。</p><p>　看过很多形容美人的古诗词，眼睛总是诗人最着笔描述的闪亮之处。眼睛是心灵的窗户，漂亮的眼睛能&ldquo;回眸一笑百媚生&rdquo;那怎样的眼形才算是完美的媚眼呢?中国权威美眼专家介绍，完美的眼部形状有如下特点：一是动人双眼皮，二是长而浓密的睫毛，三是浓淡适宜的眉毛，四是无眼袋。&mdash;&mdash;你的眼形完美吗?</p><p>　拥有一双漂亮的电眼，是古往今来所有爱中翰\r医疗美容医院<strong>韩式大眼术</strong>，让你拥有魅惑双眸。</p><div style=\"text-align: center; \"><img height=\"298\" alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604103717951.jpg\" width=\"400\" border=\"0\" style=\"cursor: pointer; \" /><br />&nbsp;&nbsp;\',\n)');
INSERT INTO `sl_collection_content` VALUES('1289','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/142.html','美联臣祛除眼袋  青春即刻再现','array (\n  \'title\' => \'中翰\r祛除眼袋  青春即刻再现\',\n  \'time\' => \'1401849435\',\n  \'content\' => \'<p>&nbsp;　随着生活节奏的加快，人们的工作压力增大，经常熬夜通宵导致的大眼袋问题使很多人烦躁不已，因为眼袋影响了人们的形象，所以祛眼袋是当前很多人首要解决的问题。如何拥有一双紧致的电眼，是很多爱中翰\r医疗美容医院的专家给我们介绍关于<strong>祛除眼袋</strong>相关知识。</p><div style=\"text-align: center; \"><img height=\"270\" alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604103715281.jpg\" width=\"400\" border=\"0\" style=\"cursor: pointer; \" />\',\n)');
INSERT INTO `sl_collection_content` VALUES('1290','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/132.html','双眼皮手术 实现你的大眼梦想','array (\n  \'title\' => \'双眼皮手术 实现你的大眼梦想\',\n  \'time\' => \'1401849433\',\n  \'content\' => \'<p>　大家都知道，眼睛是心灵的窗口，一双炯炯有神的眼睛可以让人读懂很多东西，而双眼皮大眼睛比单眼皮小眼睛更加的迷人。那么要怎样才能拥有一双迷人的双眼皮大眼睛呢?割双眼皮实现你大眼睛梦。</p><div style=\"text-align: center; \"><img src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604103714154.jpg\" width=\"400\" border=\"0\" height=\"300\" alt=\"双眼皮手术\" />\',\n)');
INSERT INTO `sl_collection_content` VALUES('1291','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/141.html','美联臣教您对症搞定四大眼袋问题','array (\n  \'title\' => \'中翰\r教您对症搞定四大眼袋问题\',\n  \'time\' => \'1401849433\',\n  \'content\' => \'<p>&nbsp; &nbsp; 如今，越来越多的人过早的出现了眼袋，不仅影响容貌还影响了心情。如何<strong>祛眼袋</strong>?这是很多爱美者都很关心的问题。<strong>\r</strong>的专家指出，眼袋也需对症治疗，每个人的眼袋情况不同，采用的去眼袋方法也要不一样，才能达到好的手术效果。让我们一起来看看吧!</p><p style=\"text-align: center; \"><img border=\"0\" alt=\"祛眼袋\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604103714634.jpg\" width=\"242\" height=\"284\" style=\"cursor: pointer; \" /><br />&nbsp;</p><p>&nbsp; &nbsp; 常见的眼袋类型及其治疗方法：</p><p>&nbsp; &nbsp; 1、单纯皮肤松弛者</p><p>&nbsp; &nbsp; 此种情况为下睑及外眦皮肤松弛，但无眶膈松弛，所以无眶隔脂肪突出，眼周出现细小皱纹，多见于28-40岁的中青年。</p><p>&nbsp; &nbsp; 治疗时只需去除多余皮肤，不必破坏其它组织，如眼轮匝肌和眶隔脂肪，这样可避免眶隔脂肪去除后出现凹陷及不必要的并发症，如眼球后出血而出现视力的丧失。</p><p>&nbsp; &nbsp; 2、单纯眼轮匝肌肥厚者</p><p>&nbsp; &nbsp; 由于遗传因素，很年轻就有下睑眼袋，其突出特点为靠近下睑缘，呈弧形连续分布，微笑时更为明显，皮肤并不松弛，多见于20&mdash;28岁年轻人，属假性眼袋。</p><p>&nbsp; &nbsp; 去眼袋手术治疗时只需修薄眼轮匝肌，无须去除脂肪。</p><p>&nbsp; &nbsp; 3、下睑中重度膨隆者</p><p>&nbsp; &nbsp; 主要是眶膈脂肪的先天过度发育，多见于23&mdash;36岁的青年人，临床较常见，由于生活不规律等因素，会逐渐加重，并破坏眼周美学生理，应充分重视提前治疗。</p><p>&nbsp; &nbsp; 治疗时可选择结膜路径，即内路去除多余的眶隔脂肪，由于其皮肤具有良好的弹性，不会出现皮肤松弛，避免了皮肤外的切口瘢痕，创伤小，肿胀轻，甚至术后不肿胀，手术更加安全。</p><p>&nbsp; &nbsp; 4、皮肤松弛且下睑中重度膨隆者</p><p>&nbsp; &nbsp; 主要是皮肤、眼轮匝肌及眶膈松弛，造成眶膈脂肪由于重力作用脱垂，严重者还有外眦韧带松弛、睑板外翻、睑球分离，常常出现迎风流泪，还有的皮肤松弛伴有下睑缘与眶下缘之间出现凹陷，除皮肤松弛外，还出现眶膈脂肪及睑板前脂肪的萎缩。多见于40&mdash;60岁以上的中年及老年。</p><p>&nbsp; &nbsp; 治疗时需要从睑缘皮肤切口，去除多余皮肤，去除脱垂的多余眶隔脂肪，同时收紧眶隔及眼轮匝肌。对于下睑外翻者，行外眦固定来矫正下睑外翻，只有这样才能获得良好的美容效果。</p><p>&nbsp; &nbsp; 假如您对于如何去除眼袋还有其他的疑问，欢迎点击我们的在线专家进行详细咨询，我院的专家会根据您的自身情况为您做出一对一更专业的讲解，武汉中翰整形美容医院\r期待您的垂询。</p><p>&nbsp; &nbsp; (版权归属武汉中翰整形美容医院\rhttp://www.mlcbj.com/)</p>\',\n)');
INSERT INTO `sl_collection_content` VALUES('1292','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/143.html','去眼袋手术几天能消肿','array (\n  \'title\' => \'去眼袋手术几天能消肿\',\n  \'time\' => \'1401849432\',\n  \'content\' => \'<p>&nbsp;&nbsp;&nbsp;&nbsp;<strong>去眼袋</strong>是一种非常常见的现象,很多年轻人挂着两个大大的眼袋很影响美观,因此很多人都会进行去眼袋手术,只是去眼袋手术后要几天可以消肿呢?让我们一起来了解下吧.</p><p>&nbsp; &nbsp;去眼袋手术后一般眼部周围会有一些淤血和水肿，这些都是比较正常的现象。那去眼袋手术几天能消肿呢?武汉中翰\r的专家指出，去眼袋手术消肿时间的长短，主要是看你选择的去眼袋手术方法。</p><p>&nbsp; &nbsp;去眼袋手术有内切口法和外切口法，内切口法相对来说，恢复时间更短，术后3天口服消炎药物就可，不需拆线，而外切口法则需在术后第二天换药，术后5天左右拆线，拆线前保持切口清洁干燥。</p><p>&nbsp; &nbsp;去眼袋手术一般来说，当天可进行局部冷敷，24小时候可开始热敷，促进血液循环，帮助消肿，如果还有淤血严重的话，需要口服利用淤血吸收的药物。去眼袋手术一般几天就可以完全消肿，不过具体的时间跟术后的护理也有关系。</p><p>&nbsp; &nbsp;去眼袋手术几天能消肿?专家提醒，我们不能只关系消肿的时间，而是需要根据自己的眼部情况，选择一种合适的去眼袋方法，这样效果才会理想，也比较适合自己。如果您还有其他疑问，欢迎咨询我们\r的在线专家，我们将竭诚为您服务。<br />&nbsp;</p>\',\n)');
INSERT INTO `sl_collection_content` VALUES('1293','8','1','2','http://www.mlcbj.com/zxmrs/mrdy/144.html','做去眼袋手术安全吗','array (\n  \'title\' => \'做去眼袋手术安全吗\',\n  \'time\' => \'1401849432\',\n  \'content\' => \'<p>&nbsp; &nbsp; 在日常生活中，很多人由于睡眠质量不好或是睡眠不足，常常会导致眼袋的出现，眼袋使人看起来显得疲惫，没有活力，严重影响了人们的外在形象，因此很多人选择通过去眼袋手术进行改善。那么，<strong>去眼袋手术</strong>安全吗？一起来了解一下吧！</p><div style=\"text-align: center; \"><img src=\"http://www.whzhzxmr.com/uploadfile/2014/0604/20140604103712259.jpg\" width=\"400\" border=\"0\" height=\"300\" alt=\"\" />\',\n)');
