INSERT INTO `sl_collection_content` VALUES('1069','7','1','1','http://www.xisimr.com/zxmrzx/gailian/qgzx/10858.html','颧骨整形具体是怎么操作的？','array (\n  \'title\' => \'颧骨整形具体是怎么操作的？\',\n  \'time\' => \'1401772232\',\n  \'content\' => \'      <p>	　　脸部流畅完美的曲线是每个爱美者都非常重视的，但是并不是每个人都拥有完美的轮廓，特别是有的人\r。颧骨整形大概要1-2小时，恢复期1-3个月，期间避免暴力压迫和打击，一般2周可以正常工作，这种手术要到正规的整形医院做手术，专业整形外科医生和指导。</p><p>	　　中翰\r医疗美容医院是美国哥伦比亚大学医疗美容协作医院、北京大学整形美容EMBA教学医院、CCTV高级合作伙伴;是集整形美容、形象美体、养颜养生、时尚形象设计、美容咨询等服务于一体的顶级医疗美容医疗机构，融合全球医疗美容之资源，集百家之长，兼容海外，中西贯通;它名医荟萃、流派纷坛，不仅保留传统，又不断变化创新，它是中国近现代医疗美容科学发展的缩影和集大成者。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1070','7','1','1','http://www.xisimr.com/zxmrzx/gailian/qgzx/10856.html','颧骨整形失败表现及修复事项','array (\n  \'title\' => \'颧骨整形失败表现及修复事项\',\n  \'time\' => \'1401772231\',\n  \'content\' => \'      <p>	　　\r。</p><p>	　　颧骨整形失败修复术需要注意以下几点:</p><p>	　　一、术前仔细观察受术者颧骨整形的缺陷，并结合实际来制定最理想的颧骨修复方案。</p><p>	　　二、修复时确保假体植入腔准确无误，使其与面部结构相吻合，矫正原有缺陷。</p><p>	　　三、颧骨修复的术后护理要到位，避免逆行感染和假体移位</p><p>	　　通过上述对&ldquo;颧骨整形失败修复术需要注意什么?&rdquo;，相信你对颧骨整形有了进一步的认识，如果您还想了解更多颧骨整形的问题，您可以在线咨询中翰\r专家，或拨打热线与专家咨询。我们不论何时都愿倾听您的烦恼，我们愿意为您找到最好的颧骨整形方案，我们确保为每一位求美者量身制定、精心雕琢，为您打造完美的脸型。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1071','7','1','1','http://www.xisimr.com/zxmrzx/gailian/qgzx/10544.html','颧骨整形的恢复时间有多长?','array (\n  \'title\' => \'颧骨整形的恢复时间有多长?\',\n  \'time\' => \'1401772231\',\n  \'content\' => \'      <p>	　　想要\r专家吧!</p><p>	　　</p><center>	<img alt=\"亚韩颧骨整形的恢复时间要多长?\" height=\"262\" src=\"http://www.xisimr.com/uploads/allimg/131130/15463163D-0.jpg\" width=\"253\" /></center><p>	&nbsp;</p><p>	　　中翰\r面部整形专家介绍，颧骨整形恢复时间针对不同的人是会有区别的,因为每个人在体质上存在着差异.通常，颧骨整形术后3-4天为软组织肿胀最明显的时候,此段时间内每天都必须冰敷,且只能喝冷的流质食物,直到确定伤口愈合后,才可吃软性食物.经过这段时间之后软组织肿胀会明显消退,一星期以后就会完全消退,不会留下任何痕迹，一般不会影响学习和工作。</p><p>	　　颧骨整形手术的恢复期的长短还和爱美者在颧骨整形手术前准备是否充分，颧骨整形手术后是否做好的会工作有着密切的关系。特别是颧骨整形手术后的护理工作，影响重大，所以想要颧骨整形手术能够快速的恢复，就要做好颧骨整形手术的术后护理工作。</p><p>	　　你是不是还在担心颧骨整形会影响到正常的生活与工作呢?想要颧骨整形能够快速恢复，颧骨整形手术后的护理工作有哪些呢?更多美丽信息欢迎致电中翰\r美丽热线或者点击我们的在线咨询。</p>\r\',\n)');
