INSERT INTO `sl_collection_content` VALUES('1075','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/10394.html','颧骨整形术 让面部圆滑和善','array (\n  \'title\' => \'颧骨整形术 让面部圆滑和善\',\n  \'time\' => \'1401772228\',\n  \'content\' => \'      <p>	　　高高的\r?</p><p>	　　打磨颧骨在颅颌面外科中属于相对简单的手术，但也不是普通人想象中依靠专业锉刀打磨那么容易，降低颧骨手术主要包括颧骨凿低术和截骨降低术两大类：颧骨凿低术适用于单纯颧骨体前突或单纯颧弓突出且程度较轻者，优点是伤害小，容易操作;截骨降低术适用于颧骨前突伴有颧弓过高者，优点是可同时将颧骨与颧弓降低，且不破坏颧突的自然形态，适用于较严重的病例，但对整形机构的技术要求较高。</p><p>	　　3、打磨颧骨术前一定要先咨询</p><p>	　　做这种颌面部的骨性手术，不但要有合格的整形外科医生，还要有一个工作团队，打磨颧骨术前做好准备、打磨颧骨术中做好配合、打磨颧骨术后帮助康复才能达到最佳的效果。因此，做这种手术应到具备卫生部门认可的有整形美容资质的专业机构进行。</p><p>	　　在颧骨整形中，方法很多，打磨颧骨就是一种，通过上面的介绍，大家已经有所了解。中翰\r专家介绍，颧骨整形术不是一项小手术，因此在选择做时，一定要慎重，调整好心态，选择一家正规的医院进行。</p>\r\',\n)');
