INSERT INTO `sl_collection_content` VALUES('1077','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/10179.html','颧骨整形会导致两侧颧骨不对称吗?','array (\n  \'title\' => \'颧骨整形会导致两侧颧骨不对称吗?\',\n  \'time\' => \'1401772227\',\n  \'content\' => \'      <p>	　　很多人对自己的\r百年底蕴世界连接美容机构，在华南地区拥有极好的口碑，是你选择美丽的最佳选择。如果您还有其他的疑问，可以直接咨询我院的在线专家或拨打美丽热线。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1078','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/9946.html','颧骨整形 打造圆润亲善脸型','array (\n  \'title\' => \'颧骨整形 打造圆润亲善脸型\',\n  \'time\' => \'1401772226\',\n  \'content\' => \'      <p>	　　高\r?</p><p>	　　打磨颧骨在颅颌面外科中属于相对简单的手术，但也不是普通人想象中依靠专业锉刀打磨那么容易，降低颧骨手术主要包括颧骨凿低术和截骨降低术两大类：颧骨凿低术适用于单纯颧骨体前突或单纯颧弓突出且程度较轻者，优点是伤害小，容易操作;截骨降低术适用于颧骨前突伴有颧弓过高者，优点是可同时将颧骨与颧弓降低，且不破坏颧突的自然形态，适用于较严重的病例，但对整形机构的技术要求较高。</p><p>	　　3、打磨颧骨术前一定要先咨询</p><p>	　　做这种颌面部的骨性手术，不但要有合格的整形外科医生，还要有一个工作团队，打磨颧骨术前做好准备、打磨颧骨术中做好配合、打磨颧骨术后帮助康复才能达到最佳的效果。因此，做这种手术应到具备卫生部门认可的有整形美容资质的专业机构进行。</p><p>	　　在颧骨整形中，方法很多，打磨颧骨就是一种，通过上面的介绍，大家已经有所了解。高高的颧骨让我们很没有自信，但借助颧骨整形术就可以轻松让我们的脸型圆润起来。不过打磨颧骨是一项动刀动骨的手术，在选择做时，一定要慎重，调整好心态非常重要，同时要在自己身体条件最好的时候去做。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1079','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/9872.html','颧骨比例失衡要怎么办呢?','array (\n  \'title\' => \'颧骨比例失衡要怎么办呢?\',\n  \'time\' => \'1401772226\',\n  \'content\' => \'      <p>	　　\r，天衣无缝，不留痕迹。</p><p>	　　通过以上的介绍，相信您已经了解颧骨比例失衡要怎么办了，如果对于自己的颧骨不满意，可以在正规的医院进行颧骨整形，并注意做好术后的保养工作。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1080','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/9870.html','颧骨增高术 让脸型更完美','array (\n  \'title\' => \'颧骨增高术 让脸型更完美\',\n  \'time\' => \'1401772225\',\n  \'content\' => \'      <p>	　　如何让脸型更完美?随着\r专家关于&ldquo;颧骨整形&rdquo;的介绍，相信大家已经了解了。颧骨整形能改善面部缺陷，让女性面部更协调，提升面部立体感。不过中翰\r专家提醒做颧骨整形不是随便医院能做的，一定要去正规医院进行。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1081','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/9726.html','哪些脸型需要磨骨瘦脸？','array (\n  \'title\' => \'哪些脸型需要磨骨瘦脸？\',\n  \'time\' => \'1401772225\',\n  \'content\' => \'      <p>	　　精致的瓜子脸能使你看起来更上镜，瘦脸成为女性朋友们最喜欢的\r整形专家告诉你吧。</p><p style=\"text-align: center\">	<img alt=\"\" src=\"http://www.xisimr.com/uploads/allimg/131108/57-13110Q63J2633.jpg\" style=\"width: 272px; height: 369px\" /></p><p>	　　哪些脸型需要磨骨瘦脸：</p><p>	　　圆方形</p><p>	　　脸型特征：属短形脸(即下巴较短)，脸型宽但线条较平缓，没有突出的棱角。</p><p>	　　正方形</p><p>	　　脸型特征：属短形脸，脸型不宽但线条强烈，骨感较强，下巴短而尖端轻微上扬。</p><p>	　　角方形</p><p>	　　脸型特征：属典型国字脸，脸型宽而线条强烈，下颚角甚至往后突出，给人感觉咀嚼肌部位特别发达。</p><p>	　　磨骨瘦脸术先对求美者的下颌骨先进行三维立体雕塑，确定对下颌骨磨削范围及骨去除的量，再利用专门的磨切骨头的器械，将此部分的骨头切除或磨钝至圆弧曲线，达到改善外观，瘦脸的效果。重庆整形专家建议：磨骨瘦脸前最好先进行术前设计。</p><p>	　　专家推荐：华美微精改脸型</p><p>	　　以上就是武汉中翰\r医疗美容医院专家针对不同脸型如何完善的介绍，相信您已经了解了，中翰\r专家，不断改进和钻研，秉承韩式整形精雕细琢，融合微创整形手术精华，对手术部位进行精确切割、磨削，不损伤神经和血管，改脸后面廓线条流畅，浑然天成，是你选择完善面部的最佳选择。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1082','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/9698.html','颧骨整形的恢复时间是多久?','array (\n  \'title\' => \'颧骨整形的恢复时间是多久?\',\n  \'time\' => \'1401772224\',\n  \'content\' => \'      <p>	　　\r专家吧!</p><p style=\"text-align: center\">	<img alt=\"\" src=\"http://www.xisimr.com/uploads/allimg/131107/57-13110GHP92W.jpg\" style=\"width: 216px; height: 296px\" /></p><p>	　　武汉中翰\r专家介绍，颧骨整形恢复时间针对不同的人是会有区别，因为每个人在体质上存在着差异，通常颧骨整形术后3-4天为软组织肿胀最明显的时候，因为颧骨整形术后有一个伤口肿胀期，从外观上看面部宽度改变并不明显，有的甚至会更宽，这个时期一般会持续半个月至一个月左右，随着肿胀的消退，手术效果会在术后一到三个月开始逐渐显现出来。</p><p>	　　想要让颧骨整形恢复得更快就必须做好术后护理工作，具体的颧骨整形恢复时间与求美者的护理情况有关，如果护理的到位恢复起来会更快些，下面就为大家介绍一下。</p><p>	　　颧骨整形的护理措施以便缩短颧骨整形手术恢复周期：</p><p>	　　1、颧骨整形术后头面罩加压包扎5至7天，中途如无特殊情况不能拆开，如拆开后应及时包扎，注意检查有无压坏皮肤。</p><p>	　　2、注意饮食在我们的保养和护理之中也是十分重要的，由于刺激性比较大的食物会使得我们的切口位置肌肤愈合受到影响，所以在恢复期间要注意避免食用刺激的食物，多吃有营养的清淡食物。</p><p>	　　3、颧骨整形术后6小时开始用漱口液漱口至拆线，术后吃流食至第五天，且三个月内尽量避免用力咬较硬东西，颧骨整形术后7天拆线，这个时候需要少食辛辣刺激食物，尽量半流食。</p><p>	　　以上就是武汉中翰\r医疗美容医院专家关于&ldquo;如何缩恢复颧骨整形时间?&rdquo;的介绍，任何一项手术都是有恢复期的，我们想要快速恢复，术后护理是很重要的，我们一定要遵从医生的建议，做好术后护理工作，这样有利于手术的效果和节约时间。如果您还有其它疑问可以在线咨询我们的专家。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1083','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/9560.html','颧骨整形手术安全性怎么样?','array (\n  \'title\' => \'颧骨整形手术安全性怎么样?\',\n  \'time\' => \'1401772224\',\n  \'content\' => \'      <p>	　　\r专家就来讲解一下。</p><p style=\"text-align: center\">	<img alt=\"\" height=\"246\" src=\"http://www.xisimr.com/uploads/allimg/131104/57-1311041FS4Z5.jpg\" style=\"width: 325px; height: 263px\" width=\"335\" /></p><p>	　　武汉中翰\r医疗美容医院专家介绍，手术的安全性受到许多客观因素影响，例如，整形医师的水平，医院的医疗设备与环境。颧骨整形手术是手术之前对脸部轮廓的设计很重要，在手术之前对脸部轮廓的设计不到位的话会导致手术之后脸部轮廓无改善的现象，因此在手术之前我们应该跟医生进行良好的沟通，听取一些医生的意见。</p><p>	　　同时需要注意颧骨整形手术不是单纯的把突出来的颧骨磨平就可以的，它通常是把皮肤切开把骨骼磨下来或者是推进去，这时特别要注意不能损伤周围的神经，所以专家的技术水平非常关键，选择临床经验丰富的专家能保证手术的安全。</p><p>	　　颧骨整形手术安全性怎么样?颧骨整形是指用外科手段对颧骨进行整形，以达到整复畸形或改善面容的目的。颧骨整形又分为颧骨缩小整形，颧弓缩小术以及颧部填充增高术。颧骨分别决定了两个重要的视觉角度，也影响了脸形的美观与否，手术后不但脸颊缩减幅度大，视觉效果明显，而且手术完全是在口腔内进行，减少了伤口。</p><p>	　　颧骨整形手术也有一定并发症发生的可能，颧骨内有鼻窦，外侧较表浅处有面神经，施行该项手术的医师，首先对解剖要有充分的了解，而且应是经验丰富的整形外科医师，方能驾轻就熟，使风险降至最小。当然医师的审美观点，也是求美者决定选择的重要因素。所以，一定要选择一家正规的整形医院找经验丰富的专家进行颧骨整形手术，这样才能确保安全和效果。如果您还有其他疑问可以在线咨询我们的专家。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1084','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/8880.html','颧骨整形常用方法有哪些?','array (\n  \'title\' => \'颧骨整形常用方法有哪些?\',\n  \'time\' => \'1401772222\',\n  \'content\' => \'      <p>	　　\r专家一起来了解一下吧。</p><p style=\"text-align: center\">	<img alt=\"\" src=\"http://www.xisimr.com/uploads/allimg/131014/57-131014102Q1C9.jpg\" style=\"width: 309px; height: 331px\" /></p><p>	　　颧骨整形常用方法主要有以下几种：</p><p>	　　1、颧骨增高术：此项颧骨整形方法适合部分患者由于先天或后天疾病等原因造成的颧骨发育不良或缺损而导致的面中部局部凹陷，或者双侧颧部不对称，均可以通过自体组织移植或假体材料充填颧部的颧骨增高术来进行治疗，以达到改善容貌的目的。</p><p>	　　2、颧骨凿削术： 这种颧骨整形方法适合于面部前外侧突出的患者，常采用口内切口，在骨膜下分离暴露颧骨，应用特殊的器械将术前设计拟去除的颧骨部分凿去削薄，从而缩小面部外轮廓，改善面型。</p><p>	　　3、颧骨三维截骨术：该项手术难度大，适合于颧弓突出的患者。除了口内切口外，通常还要在发际内隐蔽部位作辅助切口，或者单作头皮内冠状切口，骨膜下分离暴露整个颧骨后，按照计算机三维模拟设计的需要截除特定大小的骨块，再运用专业的整形材料将分离的骨用转换也块重新连接和塑形，是最大限度地改变整个面部轮廓和面型的颧骨整形方法。</p><p>	　　以上就是武汉中翰\r医疗美容医院专家关于&ldquo;颧骨整形常用方法&rdquo;的介绍，相信你对颧骨整形方法已经有了一定的了解吧，中翰\r专家提示：在做颧骨整形时，一定要到正规的整形医院进行。如果你还有疑问和需要请咨询我们的在线专家!</p>\r\',\n)');
