INSERT INTO `sl_collection_content` VALUES('1086','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/8271.html','颧骨整形 打造面部亲和力','array (\n  \'title\' => \'颧骨整形 打造面部亲和力\',\n  \'time\' => \'1401772221\',\n  \'content\' => \'      <p>	　　\r专家就来讲解一下。</p><p style=\"text-align: center\">	<img alt=\"\" src=\"http://www.xisimr.com/uploads/allimg/130925/57-130925114921I8.jpg\" style=\"width: 243px; height: 256px\" /></p><p>	　　武汉中翰\r医疗美容医院专家介绍，手术的安全性受到许多客观因素影响，例如，整形医师的水平，医院的医疗设备与环境。颧骨整形手术是手术之前对脸部轮廓的设计很重要，在手术之前对脸部轮廓的设计不到位的话会导致手术之后脸部轮廓无改善的现象，因此在手术之前我们应该跟医生进行良好的沟通，听取一些医生的意见。</p><p>	　　同时需要注意颧骨整形手术不是单纯的把突出来的颧骨磨平就可以的，它通常是把皮肤切开把骨骼磨下来或者是推进去，这时特别要注意不能损伤周围的神经，所以专家的技术水平非常关键，选择临床经验丰富的专家能保证手术的安全。</p><p>	　　颧骨整形手术安全吗?颧骨整形是指用外科手段对颧骨进行整形，以达到整复畸形或改善面容的目的。颧骨整形又分为颧骨缩小整形，颧弓缩小术以及颧部填充增高术。颧骨分别决定了两个重要的视觉角度，也影响了脸形的美观与否，手术后不但脸颊缩减幅度大，视觉效果明显，而且手术完全是在口腔内进行，减少了伤口。</p><p>	　　颧骨整形手术也有一定并发症发生的可能，颧骨内有鼻窦，外侧较表浅处有面神经，施行该项手术的医师，首先对解剖要有充分的了解，而且应是经验丰富的整形外科医师，方能驾轻就熟，使风险降至最小。当然医师的审美观点，也是求美者决定选择的重要因素。所以，一定要选择一家正规的整形医院找经验丰富的专家进行颧骨整形手术，这样才能确保安全和效果。如果您还有其他疑问可以在线咨询我们的专家。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1087','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/7622.html','颧骨整形 打造面相亲和力','array (\n  \'title\' => \'颧骨整形 打造面相亲和力\',\n  \'time\' => \'1401772221\',\n  \'content\' => \'      <p>	　　每一个爱美人士都希望能够拥有一张精致小脸，但在生活中却经常看到很多人因为\r来实现，它主要包括两种方法：一种是通过单纯的磨削来缩小颧骨体的外轮廓;另一类为三维截骨，通过骨块的短缩和移动达到颧骨弓的缩小。颧骨磨削术一般适合于面部前外侧突出的患者，常采用口内切口，在骨膜下分离暴露颧骨，应用特殊的器械将术前设计拟去除的颧骨部分进行磨削，从而缩小面部外轮廓，改善面型。</p><p>	　　除了颧骨缩小术外，对于部分求美者由于先天或后天疾病等原因造成的颧骨发育不良或缺损而导致的面中部局部凹陷，或者双侧颧部不对称，也可以通过自体组织移植或假体材料充填颧部的颧骨增高术来进行矫正，以达到改善容貌的目的。</p><p>	　　以上就是武汉中翰\r医疗美容医院专家关于&ldquo;颧骨整形&rdquo;的介绍，中翰\r专家提醒，虽然颧骨整形是最直接有效的办法，但也并非术后马上就能看到效果。因为术后会有一个持续3个月左右的肿胀期，随着肿胀的消退，手术效果才会逐渐显现出来。如果您还有其它疑问可以在线咨询我们的专家。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1088','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/4189.html','磨骨改脸型 丑小鸭变天鹅','array (\n  \'title\' => \'磨骨改脸型 丑小鸭变天鹅\',\n  \'time\' => \'1401772220\',\n  \'content\' => \'      <p>	　　大家有没有看到屏幕上的明星，个个都长得那么完美，都是完美的&ldquo;瓜子脸&rdquo;，难道她们是天生的明星命?不是的，她们的&ldquo;瓜子脸&rdquo;大都是靠磨骨\r弧度美丽，效果比较理想，是最受欢迎的手术方法。</p><p>	　　柳教授介绍，磨骨有专用的器械，它带有自动保护装置和冷光源系统，使得手术可以在口内3cm的小切口内对骨骼进行磨除，由于视野清楚，骨骼暴露好，出血很少，所以可以精心塑型，又不会损伤面神经和面动脉，同时由于多余的骨质是磨去的，所以磨骨面非常流畅，术后脸型自然，口外无痕迹。对于各种严重的下颌骨宽大问题都能从根本上予以解决，轻松实现脸部两侧外观缩窄明显。</p><p>	　　中翰\r柳大烈&ldquo;V&rdquo;弧明星脸突破传统术式众多弊端，由&ldquo;中韩磨骨第一人&rdquo;武汉中翰\r医疗美容医院的院长柳大烈教授独创的，他把连续弧线与磨骨两大技术合二为一，手术在显微镜下操作可精细到毫米，创伤小、恢复快，术后脸型线条流畅自然，表情生动确保面部线条圆润完美，精雕细琢，让您轻松拥有明星脸！</p><p>	　　柳大烈&ldquo;V&rdquo;弧明星脸并不是一味的以小为标准，而是以黄金比例法则，融汇中国传统的&quot;四凸三凹&quot;学说，追求个性艺术审美观念。术前通过3D立体分析，通过电脑分析个体脸部骨骼构造、肌肉、脂肪分布状况，获取数据信息，并由顾浩教授根据个人脸型特点、气质、年龄、职业等情况摒弃雷同、模式化的改脸型方案，多角度全方位个性化设计，达到全面、立体且个性化变美的目的，让更多的丑小鸭变天鹅。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1089','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/4577.html','不同脸型该如何选择瘦脸方法','array (\n  \'title\' => \'不同脸型该如何选择瘦脸方法\',\n  \'time\' => \'1401772220\',\n  \'content\' => \'      <p>	　　随着\r专家特意提醒爱美的朋友，瘦脸整形一定要到正规的医院进行，以规避风险的出现。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1090','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/4253.html','颧骨整形出现后遗症该怎么办？','array (\n  \'title\' => \'颧骨整形出现后遗症该怎么办？\',\n  \'time\' => \'1401772219\',\n  \'content\' => \'      <p>	　　柳大烈教授，&ldquo;中韩磨骨第一人&rdquo;\r手术方面有自己独到的见解。<br />	&nbsp;</p><p style=\"text-align: center\">	<img alt=\"\" src=\"http://www.xisimr.com/uploads/allimg/130306/6-13030616453LH.jpg\" /></p><p>	<br />	　　柳教授介绍说，目前颧骨整形有三种比较好的方法：1、颧骨前内骨折手术，是将颧突切割，取下一小段欲缩减的骨头，再将剩余的颧突向内折入，使用骨钉固定，颧弓部分则完全保留原状。它适合于不算太宽的脸型。2、颧骨后内骨折手术，是以磨骨的方法适当减小颧突体积，但保留在原始位置;在耳朵前方开一小口，将颧弓打断并向内折入。适合于：脸型宽阔、太阳穴处有一定凹陷感的人。3：颧骨内缩手术，是将颧突与颧弓都打断，并去除部分欲缩减的骨头，整个颧骨向内移，进行重组。适合于正面及侧面都宽大突出的面型。</p><p>	　　什么原因导致出现颧骨整形后遗症</p><p>	　　1、面神经损伤：此种情况较少发生，只要颧骨整形（整容）术中维持分离层次正确、清楚，在骨膜下及颧深筋膜浅层深面分离即可幸免面神经损伤。</p><p>	　　2、眶上神经或眶下神经损伤：三叉神经Ⅱ、Ⅲ支解剖位置较恒定，隆颧骨术术中骨膜下剥离范围不超过眶缘中线内侧即可幸免。</p><p>	　　3、感染，假体排出：供血丰富，颧骨整形（整容）术中注意止血，隆颧骨术术后可靠包扎。引流通畅，一般不易发生感染。发生感染后，应用大剂量抗生素治疗，守旧治疗无效者，有时不得不将假体取除。</p><p>	　　4、出血：头皮血官丰富，但只要维持隆颧骨术手术层次正确，一般不会有大量出血，切缘可用头皮夹止血。于颞颧深筋膜浅层深面分离时易损伤颞中静脉可至出血应注意幸免。若移植腔渗血，以盐水纱布填塞即可操控。</p><p>	　　5、外形不对称：颧骨整形（整容）术术前认真检察两侧颧骨突度是否有明显差异，设计假体形态须考虑此因素，颧骨整形（整容）术中假体安放位置正确即可对称。颧骨整形（整容）术后明显不对称者，须要再次手术矫治。</p><p>	　　柳教授解释说：手术都是有风险的，颧骨整形手术也不例外，术后可能发生感染、出血、双侧不对称、上颌窦穿通、球结膜出血、面神经损伤等。所以选择正规熟练经验的医生手术是尽量避免这些手术风险最好的方法。想要尽可能幸免这些颧骨整形手术风险就要选择正规的医院和经验丰富的医生进行手术，这样不仅能保证手术效果，也可以最大限度的幸免手术风险。</p><p>	　　最后，柳教授建议：首先要注意选对适合自己的方法，一般颧骨向前为主的人，采纳口内切口的颧骨手术;以颧弓侧方为主的，采纳口内退路和耳前切口，或采取发际内冠状切口。采纳口内切口做颧骨手术的话，为防止术后感染，术后两天内禁食，主要靠输液维持生理须要;术后48小时后开始进流食。72小时后可以进半流食，以后逐渐过渡到正常饮食。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1091','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/4100.html','希思专家解读磨颧骨手术适应症','array (\n  \'title\' => \'中翰\r专家解读磨颧骨手术适应症\',\n  \'time\' => \'1401772219\',\n  \'content\' => \'      <p>	　　\r肥大而导致的双侧面部膨隆肥大，即通常说的三角脸型者。</p><p>	　　5、面颊臃肿、颏下脂肪堆积者导致面颊肥大者。</p><p>	　　6、颏部短小或後缩，与上、中面部比例失调，使得下面部感觉较宽大者。</p><p>	　　柳教授提醒：追求美丽是每个人的权利，先天不足，后天来补。在这个&ldquo;以貌取人&rdquo;的社会环境中，你不改变，就无法改变别人对你的看法，整形在韩国和众多发达国家已经非常普遍了，它就像一件美丽的衣服修饰着你的外表。所以当你的外表不被重视的时候，不要灰心不要丧气，磨颧骨手术是你美脸的不错选择。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1092','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/3716.html','太阳穴不饱满 自体脂肪来填充','array (\n  \'title\' => \'太阳穴不饱满 自体脂肪来填充\',\n  \'time\' => \'1401772217\',\n  \'content\' => \'      <p>	　　自体脂肪丰太阳穴，完美打造2013属于你的完美脸廓。有的人太阳穴有着一定的凹陷使得整个脸型十分难看。随着医学水平不断的提高，人们对自身的要求也越高，大家也开始关注太阳穴，自体脂肪丰太阳穴，可以有效改善凹陷太阳穴。<br />	&nbsp;</p><p style=\"text-align: center\">	<img alt=\"\" src=\"http://www.xisimr.com/uploads/allimg/130219/6-1302191F24DH.jpg\" style=\"width: 345px; height: 350px\" /></p><p>	<br />	　　自体脂肪丰太阳穴是将人体脂肪较丰厚的部位，如腹、臀、大腿或上臂等处的脂肪，用\r医生通过真空吸脂、高度提纯、多层次注射，成活率高;自体组织优于任何假体材料，让你100%无排斥过敏。</p><p>	　　自体脂肪丰太阳穴，采用身体多余的脂肪注射到颞部，不会有排异反应，也不用在面部做切口，而且注射一定量的自体脂肪，效果是持久的。</p><p>	　　整形专家表示，为了让自体脂肪丰太阳穴更安全，我们还需要注意以下几点：</p><p>	　　1、术前进行体检，确保自身身体健康、精神正常，并能正确看待自体脂肪丰太阳穴手术效果，且无严重器官疾病、无出凝血疾病、无糖尿病及免疫性疾病及神经运动功能障碍;</p><p>	　　2、施行自体脂肪丰太阳穴手术部位无局部感染病灶;</p><p>	　　3、术前半月禁服无抗凝血药物及阿斯匹林;</p><p>	　　4、女性患者尽可能避免月经期行自体脂肪丰太阳穴手术，术前洗澡，保持清洁。</p><p>	　　5、自体脂肪丰太阳穴术后24小内，尽可能减少活动，不要触碰术区，但无须卧床休息;</p><p>	　　6、遵照医嘱自体脂肪丰太阳穴手术后口服消炎药3～5天。</p><p>	　　追求美丽是每个人的权利，先天不足，后天来补。在这个&ldquo;以貌取人&rdquo;的社会环境中，你不改变，就无法改变别人对你的看法，整形在韩国和众多发达国家已经非常普遍了，它就像一件美丽的衣服修饰着你的外表。因此，自体脂肪丰太阳穴是你拥有饱满太阳穴的最好选择。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1093','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/3715.html','自体脂肪丰太阳穴 打造完美脸廓','array (\n  \'title\' => \'自体脂肪丰太阳穴 打造完美脸廓\',\n  \'time\' => \'1401772217\',\n  \'content\' => \'      <p>	　　自体脂肪丰太阳穴，完美打造2013属于你的完美脸廓。有的人太阳穴有着一定的凹陷使得整个脸型十分难看。随着医学水平不断的提高，人们对自身的要求也越高，大家也开始关注太阳穴，自体脂肪丰太阳穴，可以有效改善凹陷太阳穴。<br />	&nbsp;</p><p style=\"text-align: center\">	<img alt=\"\" src=\"http://www.xisimr.com/uploads/allimg/130219/6-1302191A542Z0.jpg\" style=\"width: 244px; height: 350px\" /></p><p>	<br />	　　自体脂肪丰太阳穴是将人体脂肪较丰厚的部位，如腹、臀、大腿或上臂等处的脂肪，用\r依托创新的思维模式，始终追求以人为本的服务宗旨、先进的整容技术、高端的科技设备、高水平的专家人才。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1094','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/3580.html','希思额部填充术 饱满的天庭不是神话','array (\n  \'title\' => \'中翰\r额部填充术 饱满的天庭不是神话\',\n  \'time\' => \'1401772216\',\n  \'content\' => \'      <p>	　　上睑下垂给很多朋友带来了极大的烦恼,会使你的眼睛也变得很小，这影响到很多朋友的形象,所以很多朋友想进行\r让你重新找回自信！</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1095','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/3379.html','希思颧骨整形手术 脱胎换骨的感觉','array (\n  \'title\' => \'中翰\r颧骨整形手术 脱胎换骨的感觉\',\n  \'time\' => \'1401772216\',\n  \'content\' => \'      　　\r的院长柳大烈教授（中韩磨骨第一人）独创的中翰\r颧骨整形手术可以轻松解决你颧骨所带来的烦恼。<br /><br /><div style=\"text-align: center\">	<img alt=\"\" src=\"http://www.xisimr.com/uploads/allimg/130128/6-13012QF206300.jpg\" style=\"width: 297px; height: 400px\" />　<br />	&nbsp;\r　&nbsp;&nbsp;&nbsp; 柳大烈教授经过多年的临床经验，针对不同的颧骨现状，总结得出了颧骨整形手术有以下三种方法。<br />　　1.颧骨前内骨折手术，它是通过将颧突切割，取下一小段欲缩减的骨头，再将剩余的颧突向内折入，使用骨钉固定，颧弓部分则完全保留原状。比较适合脸型不算太宽，但正面部突出明显。<br />　　2.颧骨后内骨折手术，这种手术是以磨骨的方法适当减小颧突体积，但保留在原始位置;在耳朵前方开一小口，将颧弓打断并向内折入。比较适合脸型宽阔、太阳穴处有一定凹陷感。<br />　　3.颧骨内缩手术，这种手术是将颧突与颧弓都打断，并去除部分欲缩减的骨头，整个颧骨向内移，进行重组。比较适合正面及侧面都宽大突出的面型。<br />　　柳大烈教授介绍，中翰\r颧骨整形手术的优点：首先是能够全方位改变整个脸形，获得圆润、姣美的脸蛋，以给人舒适感、美感。颧骨整形手术后7天拆线，肿胀消煺一般需要一个月，但不影响工作生活，完全恢复则需3-6个月。<br />　　颧骨整形手术后磨骨面线条流畅，脸型自然，口外无痕迹，恢复也相当迅速，第一天肿胀已不明显，第二天即可饮食，第三天便可上班，能大大降低术后恢复期的苦恼。且手术切口在口腔内，只有3mm，术中出血很少，能达到外表无痕的效果。手术全程无痛，我们会严格保证面部左右两边对称，且术后不影响咀嚼功能。<br />　　武汉中翰\r医疗美容医院的院长柳大烈教授认为，追求美丽是每个人的权利，先天不足，后天来补。在这个&ldquo;以貌取人&rdquo;的社会环境中，你不改变，就无法改变别人对你的看法，整形在众多发达国家已经非常普遍了，它就像一件美丽的衣服修饰着你的外表，勇敢的去追求属于自己的美丽人生！<br />&nbsp;<br />\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1096','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/3377.html','颧骨整形失败修复术需要注意什么？','array (\n  \'title\' => \'颧骨整形失败修复术需要注意什么？\',\n  \'time\' => \'1401772215\',\n  \'content\' => \'      　　很多爱美者为了让自己的更加的接近完美，于是进行了\r方案。<br />　　二、修复时确保假体植入腔准确无误，使其与面部结构相吻合，矫正原有缺陷。<br />　　三、颧骨修复的术后护理要到位，避免逆行感染和假体移位<br />　　通过上述对&ldquo;颧骨整形失败修复术需要注意什么？&rdquo;，相信你对颧骨整形有了进一步的认识，如果您还想了解更多颧骨整形的问题，您可以在线咨询中翰\r专家，或拨打热线与专家咨询。我们不论何时都愿倾听您的烦恼，我们愿意为您找到最好的颧骨整形方案，我们确保为每一位求美者量身制定、精心雕琢，为您打造完美的脸型。<br />&nbsp;<br />\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1097','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/3375.html','希思削骨改脸型 丑女也能变美女','array (\n  \'title\' => \'中翰\r削骨改脸型 丑女也能变美女\',\n  \'time\' => \'1401772215\',\n  \'content\' => \'      　　人对于面部的追求逐步趋向于更高的完美，但是由于颌骨、牙齿及其周围组织的比例关系不正常，会对我们面部和谐美观造成阻碍。由于颌骨畸形而破坏了这种和谐比例关系可引起容貌美观明显缺陷，直接影响生存质量。部分患者可产生心理上的损伤和精神上的变态，性情孤僻，情绪低落，甚至厌世轻生。颌骨畸形除了影响美观外，还会出现咀嚼功能障碍，下颌关节紊乱，以及龋病及牙周病发生。所以削骨\r和颧弓的手术是在肌肉下操作的，可以避免血管，神经的损伤。手术医生的技术和经验是关键，加上手术前后的正确处理，可以避免风险。我中心开展本项手术已有较长的时间和大量的病例，均达到了良好的效果和安全性。<br />　　追求美丽是每个人的权利，先天不足，后天来补。在这个&ldquo;以貌取人&rdquo;的社会环境中，你不改变，就无法改变别人对你的看法，整形在韩国和众多发达国家已经非常普遍了，它就像一件美丽的衣服修饰着你的外表。所以当你的外表不被重视的时候，不要灰心不要丧气，中翰\r削骨改脸型是你丑女也能变美女逆袭的最好选择！<br />&nbsp;<br />\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1098','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/2452.html','颧骨整形 拥有娇小瓜子脸','array (\n  \'title\' => \'颧骨整形 拥有娇小瓜子脸\',\n  \'time\' => \'1401772214\',\n  \'content\' => \'      <p>	　　脸部流畅完美的曲线是每个爱美者都非常重视的，但是并不是每个人都拥有完美的轮廓，特别是有的人\r。颧骨整形大概要1-2小时，恢复期1-3个月，期间避免暴力压迫和打击，一般2周可以正常工作，这种手术要到正规的整形医院做手术，专业整形外科医生和指导。<br />	&nbsp; &nbsp; 中翰\r医疗美容医院是美国哥伦比亚大学医疗美容协作医院、北京大学整形美容EMBA教学医院、CCTV高级合作伙伴;是集整形美容、形象美体、养颜养生、时尚形象设计、美容咨询等服务于一体的顶级医疗美容医疗机构，融合全球医疗美容之资源，集百家之长，兼容海外，中西贯通;它名医荟萃、流派纷坛，不仅保留传统，又不断变化创新，它是中国近现代医疗美容科学发展的缩影和集大成者。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1099','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/2255.html','颧骨太高太宽怎么办才好？','array (\n  \'title\' => \'颧骨太高太宽怎么办才好？\',\n  \'time\' => \'1401772214\',\n  \'content\' => \'      <p>	　　拥有完美脸型沉鱼之貌，一直是女性朋友们是梦寐以求的。但是我们却无法选择自己出生，无法逃避自己天生的缺陷，如\r手术是一种效果很好的整形方式，主要是将传统的口内手术切口改为曲线切口，主要是由口腔内切开5-6公分，另外在发线旁或是发线以内的皮肤再切一个1.5至2公分的伤口，将嘴巴撑开来做削骨手术，受术者在改善颧骨太宽后不需住院，这种方法改善颧骨太宽简便，损伤少，采用这种方法改善颧骨太宽痛苦小，不会损伤面神经，并且这种方法改善颧骨太宽比较安全。</p><p>	　　颧骨整形手术非常受欢迎，该手术通常是把皮肤切开把骨骼磨下来或者是推进去，这时特别要注意不能损伤周围的神经。所以要跟有丰富临床经验的专门医生相谈做颧骨整形手术。但也需要注意，虽然颧骨太宽，但最直接的治疗方法是颧骨整形手术;可能不会在改善颧骨太宽后马上就能看到效果。因为手术解决颧骨太宽后有一个伤口肿胀期，从外观上看面部宽度改变并不明显，有的甚至会更宽。这个时期一般会持续3个月左右，随着肿胀的消退，手术改善颧骨太宽的效果才会逐渐显现出来。</p><p>	　　关于颧骨太宽了怎么办，大家都知道了吧?但是手术是一个整体，我们不仅仅只是知道它的手术原理是什么样的，还要对颧骨宽整形后的注意事项有所了解，也一定要宁记在心，这样可以避免引起因护理不当，而造成的更为严重的后果。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1100','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/1947.html','如何让颧骨变低变漂亮？','array (\n  \'title\' => \'如何让颧骨变低变漂亮？\',\n  \'time\' => \'1401772213\',\n  \'content\' => \'      <p>	　　\r和颧骨磨削术两大类：</p><p style=\"text-align: center;\">	<img alt=\"\" src=\"http://www.xisimr.com/uploads/allimg/121212/2-1212121AU0119.jpg\" style=\"width: 245px; height: 333px;\" /></p><p>	　　1、颧骨缩小术：一般适合于面部前外侧突出的患者，常采用口内切口，在骨膜下分离暴露颧骨，应用特殊的器械将术前设计拟去除的颧骨部分凿去削薄，从而缩小面部外轮廓，改善面型，最终让你过高的颧骨低一点。</p><p>	　　2、颧骨磨削术：采用专业的磨骨专用器械，在口内做小切口对骨骼进行磨除，出血少，精心塑型，且不会损伤面神经和面动脉。由于多余的骨质是磨去的，所以颧骨磨削面非常流畅，颧骨磨削术后脸型自然，无任何手术痕迹。</p><br /><p>	　　为了让颧骨变小做颧骨整形手术，不但要求高水平的医生，还要求医院配备高规格的手术环境，确保颧骨整形手术无菌操作，预防双侧不对称、面神经损伤、术后发生血肿、感染等并发症，所以选择正规医院是非要有必要的。中翰\r医疗美容医院是您不错的选择！</p><br /><br />\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1101','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/1913.html','脸上颧骨大怎么办？','array (\n  \'title\' => \'脸上颧骨大怎么办？\',\n  \'time\' => \'1401772213\',\n  \'content\' => \'      <p>	　　\r。</p><p>	　　颧骨整形能有效改善面部轮廓的，它是针对于颧骨高的人群设计的。颧骨整形手术首先融进了面部美学假想尺度，遵照每个人的实际环境，从整体角度出发为广大颧骨凸出人士塑造一张完美协调的脸型，手术之后脸部线条优美，流畅有型。所以颧骨整形手术是一种非常不错的改善脸上的方法，而且现在整形技术也很完善，不用担心会出现危险。</p><br /><p>	　　颧骨整形手术方法很多，而选对方法，选对整形机构，是手术获得最佳效果的有力保障。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1102','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/1870.html','脸部颧骨突出怎么办？','array (\n  \'title\' => \'脸部颧骨突出怎么办？\',\n  \'time\' => \'1401772212\',\n  \'content\' => \'      <p>	　　每个爱美者都渴望拥有完美的脸型，可以让自己看起来美美的。但是由于种种因素的影响，使得很多爱美者脸部\r手术。对于颧骨过高或过低者，完全可以通过手术方法降低或增高颧骨，重塑一个美丽动人的面容。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1103','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/1814.html','颧骨高额头窄脸型怎么办？','array (\n  \'title\' => \'颧骨高额头窄脸型怎么办？\',\n  \'time\' => \'1401772212\',\n  \'content\' => \'      <p>	　　标准的美女不仅要有尖尖的下巴，还要有完美的\r，天衣无缝，不留痕迹。</p><p>	　　而截骨就不一样了，这个手术的难度则大大增加，解决颧弓高出的问题。</p><p>	　　在矫正额头窄颧骨高时除了口内切口外，通常还要在发际内隐蔽部位作辅助切口，或者单作头皮内冠状切口，骨膜下分离暴露整个颧骨后，按照计算机三维模拟设计的需要截除特定大小的骨块，再利用钛钉等特殊材料将分离的骨块重新连接和塑形，这样就能最大限度地改变整个面部轮廓和面型，甚至让患者达到&ldquo;脱胎换骨&rdquo;的效果。</p><p>	<strong>　　额头窄颧骨高手术的注意事项：</strong></p><p>	　　1、专业的医师在术中会避免损伤到支配局部感觉的感觉神经-颧面神经，术后会出现轻度局部麻木感，一般术后1-3个月后逐渐恢复。</p><p>	　　2、尽量避免或少损伤颧肌和上唇方肌的起止点。</p><p>	　　3、应绝对避免损伤支配面部表情肌的运动神经-面神经</p><p>	&nbsp; &nbsp; 通过中翰\r专家的介绍，相信你对窄额头高颧骨的整形方法一定非常了解了，希望大家能够通过这种方式拥有完美的脸型。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1104','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/1777.html','颧骨整形效果怎么样？','array (\n  \'title\' => \'颧骨整形效果怎么样？\',\n  \'time\' => \'1401772211\',\n  \'content\' => \'      <p>	　　很多东方女性都希望拥有一张柔美吉祥的圆形或椭圆面型，但横突的\r专家的介绍，你应该知道了吧。颧骨整形的效果是非常好的，不管是因为你的美丽，还是因为别人嫌弃的眼神，你都可以通过颧骨整形术来美化自己的。爱美丽，爱自己。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1105','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/1743.html','磨颧骨手术有风险吗？','array (\n  \'title\' => \'磨颧骨手术有风险吗？\',\n  \'time\' => \'1401772211\',\n  \'content\' => \'      <p>	　　磨\r其实主要是在我们的头部的隐蔽的地方做一个小切口然后将我们的过于突出的颧骨根据在手术之前结合我们脸部的轮廓设计好的脸型对颧骨进行削磨达到设计之后的脸型之后再讲切口进行缝合就可以了。</p><p style=\"text-align: center;\">	<img alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0603/20140603011011890.jpg\" style=\"width: 300px; height: 450px;\" /></p><p>	　　在手术的过程中对于医生技术的要求是非常的严格的，而磨颧骨手术安全吗就是根据医生的技术来定的。此外此手术是需要在无菌的情况下进行的，因此对于医院的环境以及专业设施等等都要相对应的注意。在手术之后的护理其实也相当的重要，在手术之后脸部会有一些肿胀，因此我们需要进行冷敷来进行缓解，而在手术之后的短时间内我们尽量的不要进行脸部的运动，在发现有剧烈的疼痛或者是出血不止的情况下一定要与医生及时的取得联系切不可在家私自的处理。<br />	<br />	　　通过中翰\r医疗美容医院的介绍，相信大家已经有所了解。磨颧骨手术主要是针对颧骨过宽或过高的症状来改善脸型，使脸型变得更加柔和优美。手术风险性很小，只要求美者选择正规的大品牌整形医院，就可以保证手术的安全和效果。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1106','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/1703.html','磨颧骨手术安全吗？','array (\n  \'title\' => \'磨颧骨手术安全吗？\',\n  \'time\' => \'1401772209\',\n  \'content\' => \'      <p>	　　\r手术风险是肯定会有的，因为任何一项手术我们都不能完全排除手术风险，而颧骨整形手术又是比较复杂的整形手术，所以其手术风险也肯定是存在的。要尽可能避免颧骨整形手术风险就要选择正规的医院和经验丰富的医生进行手术，这样不仅能保证手术效果，也可以最大限度的避免手术风险。</p><p>	　　其次，颧骨整形手术后的护理也可以保证颧骨整形手术安全。术后注意口腔清洁。术后第2天可以进流食，如：牛奶、果汁、肉汤等。后可以逐渐进半流食，如：酸牛奶、鸡蛋羹、烂面汤、稀饭等。以后逐渐过渡到正常饮食。但不要喝酒、抽烟及吃辛辣食物。注意要和主治医生随时沟通。</p><p>	　　一般而言在正规的医院进行磨颧骨手术，磨颧骨后遗症出现的几率是非常小的，所以大家不用担忧。重点是求美者一定要选择正规的大医院进行这种高技术难度的手术，才能为安全买保障。中翰\r医疗美容医院是您不错的选择！</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1107','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/1677.html','希思全面揭秘 磨颧骨手术过程','array (\n  \'title\' => \'中翰\r全面揭秘 磨颧骨手术过程\',\n  \'time\' => \'1401772209\',\n  \'content\' => \'      <p>	　　\r专家一起来了解一下磨颧骨的手术过程。</p><p>	　　<strong>颧骨磨骨术第一步：</strong><br />	&nbsp; &nbsp; &nbsp; &nbsp; 麻醉：分局部麻醉和全身麻醉。从手术效果本身来说，两种麻醉都可以完成手术，但是在切口和进行手术的时候，局部麻醉的术者可以感觉到机器的振动等，并因此产生恐惧感。所以，如果术者想完全感受不到手术过程，医生建议使用全身麻醉。</p><p style=\"text-align: center;\">	<img alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0603/20140603011010734.jpg\" style=\"width: 338px; height: 450px;\" /></p><p>	　　<strong>颧骨磨骨术第二步：</strong><br />	&nbsp; &nbsp; &nbsp; &nbsp; 切口：在口腔内侧接近下颚角或者颧骨的位置切开，从口腔内将整个面部皮肤和肌肉翻开，将肌肉与骨膜进行分离，把需要手术的骨头部位暴露出来，再进行手术。</p><p>	　　<strong>颧骨磨骨术第三步：&nbsp;</strong><br />	&nbsp; &nbsp; &nbsp; &nbsp; 止血：止血效果的好坏不仅影响到手术过程中术者的安全，也是出现术后血肿的重要因素。如果选择削骨手术，除了在将肌肉与骨膜分离时需要止血外，切除骨头后还要在骨头的伤口处涂上骨蜡，这是为了在止血的同时帮助骨头自身恢复。</p><p>	　　<strong>颧骨磨骨术第四步：&nbsp;</strong><br />	&nbsp; &nbsp; &nbsp; &nbsp; 手术：根据需要选择适当的手术方式。值得注意的是，在手术过程中，掉下来的来骨质成分一定要用盐水冲洗干净，因为这些粉末沾在切口的创面，待肌肉回复原位时，又会和骨头贴合在一起继续存活生长。</p><p>	　　<strong>颧骨磨骨术第五步：&nbsp;</strong><br />	&nbsp; &nbsp; &nbsp; &nbsp; 咀嚼肌处理：手术后，由于咀嚼肌的骨骼承托结构发生变化，医生会根据术者咀嚼肌的肥大情况进行处理。如果属过于肥大者，则可从后侧切除部分肌肉，以适应新的骨骼结构;如果不是太肥大，因为手术后肌肉本身会有一定萎缩，则不需要做额外调整。</p><p>	　　<strong>颧骨磨骨术第六步：</strong><br />	&nbsp; &nbsp; &nbsp; &nbsp; 缝合引流：在缝合伤口的同时安放引流管，以清除淤血，一般手术后第二天可以将引流管拔除。</p><br /><p>	　　磨颧骨的手术过程是怎样的，通过中翰\r专家的介绍，你应该知道了吧。术前了解多点知识，做好心理准备也是非常不错的，这样也会让手术更加顺利一点。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1108','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/1565.html','希思颧骨整形 打造东方美女','array (\n  \'title\' => \'中翰\r颧骨整形 打造东方美女\',\n  \'time\' => \'1401772208\',\n  \'content\' => \'      <p>	　　在中国的传统观念里面，\r一直受到人们的需求，可以改善你的面部，改善你在老人心中的形象。</p><p style=\"text-align: center\">	<img alt=\"\" src=\"http://www.xisimr.com/uploads/allimg/121126/3-121126155552641.jpg\" style=\"width: 300px; height: 412px\" /></p><p>	　　中翰\r专家介绍，颧骨位于面中1/3的两侧，是构成面部轮廓的主要框架结构。其位置和形态决定了人的面型和面貌是否具有美感。由于东方人多为中面型，立体感差，颧骨过于突出，影响面貌的曲线美;颧弓过于突出，则形成菱形脸，影响面型美观。因此，不论是颧骨突出，还是以颧弓突出，都应通过手术进行改善。</p><p>	　　颧骨整形是指用外科手段对颧骨进行整形，以达到整复畸形或改善面容的目的的一种手术方式，主要针对颧骨高、颧骨宽、颧骨突出等现象进行改善。颧骨整形的基本方法一般分为磨削法和截骨法两种方法。</p><p>	　　磨削法适合于颧骨骨质较厚者，磨削去除部分向前向外隆凸的骨质达到颧骨缩小的目的，直接将颧骨体及颧弓外侧皮质骨凿去，缩小颧骨复合体。该术式虽然凿骨量有限，但可从口内、耳前、下睑、外眦等局部入路，创面小，对于单纯颧骨体突出明显的患者仍不失为一种有效术式。</p><p>	　　截骨法适合于颧骨颧弓向前向外隆凸颧骨后间隙增宽者，截骨后颧骨颧弓向后向内移位达到颧骨缩小的目的。通过截骨将突出的颧骨及颧弓离断并移位，使颧骨复合体退缩，颧面宽缩小特别明显，非常适宜于颧骨体及颧弓十分突出的肥大者。</p><p>	　　颧骨整形是一种非常常见的整形方式，可以帮助人们提升面部曲线，打造一个完美脸型。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1109','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/1588.html','希思颧骨整形术 打造精致脸型','array (\n  \'title\' => \'中翰\r颧骨整形术 打造精致脸型\',\n  \'time\' => \'1401772208\',\n  \'content\' => \'      <p>	　　相信作为女性朋友都非常在意自己的\r，可放心去做。</p><p>	　　2、颧骨整形术后脸型流畅自然：颧骨整形术联合截骨降低术在降低面正面高度和面侧面宽度的同时，依照个人年龄，可适当提升面部软组织，防止软组织因失去骨性支撑而松垂变形。使得脸部流畅自然。</p><p>	　　3、不损伤面部神经和血管：做颧骨整形手术的成功率非常高，其它手术方法在几年后有不同比例的面中部塌陷，对表情及张口可能带来的影响，该手术方式从根源上解决了这一问题，并已于多例相关修复手术中得到证实不损伤面部神经和血管。</p><p>	　　颧骨高不高并没有一个明确的判断标准，只是颧骨的高度、宽度要和整个面部轮廓和五官更加协调，看上去美观即可。面部轮廓如果一眼看上去颧骨就显得非常突兀，那就说明颧骨长的过于宽大得了。采用骨整形的方法可有效改善面部轮廓，颧骨整形手术操作精准，不会损伤面神经和血管，手术磨除适量的颧骨，让磨骨面变得流畅，而且手术不会在面部留下任何疤痕，可以很好的改善面部轮廓缺陷，让面部线条更加流畅，面部轮廓流更加美观，完美凸显女性的柔美。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1110','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/1525.html','颧骨整形失败 希思解救你','array (\n  \'title\' => \'颧骨整形失败 中翰\r解救你\',\n  \'time\' => \'1401772206\',\n  \'content\' => \'      <p>	　 &nbsp;生活中很多人都是凭着面相来打分的，所以很多人都希望让自己的面部给人以喜悦、可爱、和蔼和亲之感，但是很多人都会发现在我们轮廓中，\r术可以帮助求美者摆脱颧骨整形失败所带来的困扰。一旦颧骨整形失败，求美者要掌握好最佳修复时机，一般选择在第一次术后半年到一年的时间内进行颧骨失败修复手术。</p><p style=\"text-align: center;\">	<img alt=\"\" src=\"http://www.whzhzxmr.com/uploadfile/2014/0603/20140603011007685.jpg\" style=\"width: 300px; height: 450px;\" /></p><p>	<strong>　　颧骨整形失败修复术：</strong></p><p>	　　1、医生要仔细观察爱美人士的具体颧骨整形失败情况，并结合求美者个人脸型特征，设计合理的颧骨整形失败修复手术方案。</p><p>	　　2、医师务必认真雕刻颧骨模型，使其与面部吻合，矫正原有缺陷。</p><p>	　　3、颧骨整形失败修复时确保假体植入腔准确无误，正确植入假体。</p><p>	　　4、颧骨整形失败修复后，护理要到位，避免逆行感染和假体移位。</p><p>	　　颧骨在我们整个面部起着尤为关键的作用，它牵动着这个面部的协调性，不仅如此颧骨高的人给我们带来凶恶的感觉。 颧骨高一般我们使用的方法都是目前比较流行的削骨颧骨整形手术，削骨颧骨整形手术可以将我们突出的部分削除，这样的方式可以增加我们整个面部的美观感，整体的协调性。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1111','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/1521.html','希思开运整形男女有别大不同','array (\n  \'title\' => \'中翰\r开运整形男女有别大不同\',\n  \'time\' => \'1401772206\',\n  \'content\' => \'      <p>	　　从星相角度看，人的运势有先天和后天之分，即使是先天确定了的，经过后天的努力也可以调整和弥补。开运\r为女性开运整形的另一热门。</p><br /><p>	　　经过面部整形以后，相貌变的容光焕发，神采奕奕，不但能给别人带来美的享受与视觉快乐，而且也能给自己带来自信与勇气，从而影响到心理情绪，带来深层次的心境转变，实现人生运气的良好转折。</p>\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1112','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/502.html','颧骨整形适用于那些人?','array (\n  \'title\' => \'颧骨整形适用于那些人?\',\n  \'time\' => \'1401772206\',\n  \'content\' => \'      　　\r术后特点：</strong><br />　　颧部由骨组织、肌肉、皮下组织和皮肤组成，其外形的支撑部分主要是骨组织。颧骨的最高点在颧骨的中下1/3交界处，即颧突点。它的高度决定的是面部向前方伸展的突起度，而不是向侧面延伸的宽度。<br />　　<strong>颧骨整形适用于那些人?</strong><br />　　磨颧骨适用于单纯颧骨局部比较高而颧弓不突出也不高者，由于颧弓位于面部的侧方和颧弓本身厚度所限，对于高颧弓者不适于行磨骨。颧骨下角对于维持人体面部正常形态起有非常重要的作用，所以磨颧骨时禁忌将颧骨下角全部磨除。还有一些人仅从面部45度角切线斜位看颧骨确有一些显得突出，由于这些人要求完美和有特殊心理需求，通过手术确实会得到改善美观的结果。<br />　　通过上面的介绍之后，如果你还有什么疑问，欢迎咨询中翰\r国际在线免费专家，中翰\r专家会用最专业的的知识为您提供满意的服务。\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1113','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/496.html','颧骨过高该怎么办','array (\n  \'title\' => \'颧骨过高该怎么办\',\n  \'time\' => \'1401772206\',\n  \'content\' => \'      　　\r项目，受到万千求美者的喜爱!<br />　<strong>　颧骨过高该怎么办?虽然颧骨缩小术是一种非常安全的手术形式，但是在进行手术之前下列准备工作您也不能疏忽哦!</strong><br />　　1. 术前要做口腔检查，确保无口腔感染源，因为口腔炎症会直接导致头部伤口感染哦。<br />　　2. 术前要详细告知医生身体是否健康，有无重要脏器的器质性病变，如：无心脏病，无肝炎、肾炎、肺炎等疾病。这对手术能否安全完成有重要的影响。<br />　　3. 还应作术前血、尿的常规化验检查，胸透和心电图等常规健康检查。<br />　　4. 女性手术应避开月经期。因为月经期人体造血功能会紊乱。<br />　　通过以上的介绍，对于颧骨过高该怎么办这个问题大家已经都非常清楚了，为了达到最好的治疗效果，大家一定要选择正规医院进行治疗，如果还有想要了解的可以咨询在线专家。\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1114','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/497.html','磨骨多少钱','array (\n  \'title\' => \'磨骨多少钱\',\n  \'time\' => \'1401772204\',\n  \'content\' => \'      　　面部美观对人们的整体美影响是很大的，通过磨骨手术可以使求美者的脸型变得更好看，那么，磨骨多少钱?相信会有爱美者关系这个问题，下面，一起来看专家的介绍吧。<br /><div style=\"text-align: center\">	<br />	<img alt=\"\" src=\"http://www.xisimr.com/uploads/allimg/121015/6-121015143025O2.jpg\" style=\"width: 286px; height: 400px\" /><br />	&nbsp;\r　　专家指出，磨骨多少钱这个问题并不是唯一固定的，手术的费用受多方面因素的影响，如大家选择的\r部位的不同，手术操作的难度也不同，费用也是不相同的。<br />　　关于磨骨多少钱的问题，专家还说，说，手术之后建议大家要注意按照医生的建议进行伤口的护理，有效的预防伤口的感染，在允许的情况下适当的用一些消炎药，减轻术后的疼痛感。<br />　　通过专家的介绍，大家对磨骨多少钱这个问题有了一定的认识了吧。中翰\r国际专家提醒，进行磨骨，一定要选择专业正规医院，以保证手术的效果及安全。如果您还有其他疑问，可咨询我院的在线专家，专家会给你最为专业的回答的。\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1115','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/498.html','磨颧骨失败应当如何避免','array (\n  \'title\' => \'磨颧骨失败应当如何避免\',\n  \'time\' => \'1401772204\',\n  \'content\' => \'      　　任何一种手术失败都是大家最不愿意看到的，对于施术于面部的\r手术的具体介绍：</strong><br />　　<strong>1、颧骨颧弓整形术切口</strong><br />　　(1)口内切口。双侧上颌尖牙到第一恒牙之问切开前庭沟部粘骨膜。<br />　　(2)头皮冠状切口。从一侧耳轮脚前经顶部发际内8。Ocm冠状切开头皮及帽状腱膜至另一侧耳轮脚前结束。<br />　<strong>　2、颧骨颧弓整形术的剥离、暴露</strong><br />　　(1)经口内切口：贴上颌骨表面向后、上、外方行骨膜下剥离，注意保护眶下神经，暴露颧骨外表面。颧骨颞突根部上缘(即靠近颧额缝部)应暴露清楚。继而，在颧颌缝下缘部进入颧骨内表面骨膜下剥离直抵颧骨颞突根部上缘。<br />　　(2)经头皮切口：中部在帽状腱膜深层，两侧在颞浅筋膜深层向下剥离掀起头皮，至眶上缘上2.Ocm处切开骨膜，行骨膜下剥离，在两侧切开颞深筋膜浅层，于其深面剥离。显露眶缘，游离眶上神经。在眶外侧继续向下做骨膜下剥离，暴露眶外缘、颧骨上缘及下缘。在颧骨内表面剥离骨膜，暴露颧骨颞突根部内侧面。<br />　　<strong>3、颧骨颧弓整形术之截骨</strong><br />　　从颧颌缝下端到颧骨颞突根部上缘部，用来复锯截断颧骨。近眶侧的截骨创面与近眶侧的颧骨外表面相交成角应为钝角，这样既可确保锯片不能进入眼眶又利于向外扩展颧骨。<br />　<strong>　4、颧骨颧弓整形术的植骨、固定</strong><br />　　颧骨截断后，颧弓即呈现出一定的活动度。利用颧弓的弹性，将一窄骨凿楔人截骨缝，缓慢稳健地旋转及撬顶远中骨块，使颧骨颧弓向前外侧扩展。骨断面间形成问隙可以植自体骨或羟基磷灰石等。用钛板坚固固定。颧弓弹性有限，不能过分外展以免发生骨折。植骨厚度在5～6mm以内是比较安全的。<br />　　<strong>5、颧骨颧弓整形术的缝合及术后处理</strong><br />　　检查外形满意两侧对称，即可冲洗创面，直接缝合粘骨膜或头皮。冠状切口头皮下置负压引流24～48h，10天后拆线，口内7～9天拆线。术后加压包扎3天，常规抗菌治疗。<br />　　中翰\r国际颧骨整形专家指出：磨颧骨手术一定要选择具有极高专业水准、经验丰富的手术专家来进行，这样才能避免磨颧骨失败。<br />　　其实做任何一项手术都是存在一定风险的，避免出现风险最好的方法就是在手术前选择一家正规的整形美容医院和一位有责任感的专业整形医师，同时做好术前术后准备，多跟医师交流把自己的想法跟医师交流好。这样才能保证手术安全手术效果万无一失!现如今整形医院及专家教授非常多，我们便会有种箩里挑花 越拣越花的情况。在这里呢本网站会争取以我们多年的丰富经验及最新行业内了解的情况为广大爱美者梳理出一个头绪：教你如何选择整形医院，进而确定适合自己的整形专家进行手术，保证手术的安全和效果。\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1116','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/500.html','磨颧骨价格与哪些因素有关','array (\n  \'title\' => \'磨颧骨价格与哪些因素有关\',\n  \'time\' => \'1401772203\',\n  \'content\' => \'      　　中翰\r专家介绍，磨\r中更加鼓励使用的是在口腔内进行小切口并对骨骼进行磨除，不会伤及面神经和面动脉，并且可以多余的骨质进行磨除，口外无手术痕迹。因此，根据自身情况的不同，需要制定的磨颧骨的方法有所差异，自然对于磨颧骨费用是多少有所差异。<br />　<strong>　二、磨颧骨机构的不同。</strong><br />　　不同的医疗机构所拥有的专业设备、专业医生都存在不同的差距。自然进行磨颧骨手术的设备越先进，专家的医疗水平越专业，对进行磨颧骨手术的效果就越好。那么自然在磨颧骨的成本上要贵于一般的医疗机构。<br /><strong>　　三、地域的不同。</strong><br />　　地域的不同，直接影响到磨颧骨费用的多少。如一线城市本身消费水平就高于其他城市，那么自然进行磨颧骨的费用要比二、三线城市的价格高。通常一线城市磨颧骨的技术也要略高于二、三线城市，那么自然对于磨颧骨费用要有所影响。<br />　　以上就是关于磨颧骨价格与哪些因素有关的相关介绍，相信大家有了更多的了解，如果您还有其他疑问，欢迎在线咨询中翰\r在线专家或拔打我们的热线电话。\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1117','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/501.html','何为完美的颧骨整形？','array (\n  \'title\' => \'何为完美的颧骨整形？\',\n  \'time\' => \'1401772203\',\n  \'content\' => \'      　　女子美不美，关键就在一张脸。拥有一个完美的脸型，每个求美者的梦想，就到\r专家。\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1118','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/503.html','咬肌肥大的三种手术方法简介','array (\n  \'title\' => \'咬肌肥大的三种手术方法简介\',\n  \'time\' => \'1401772202\',\n  \'content\' => \'      　　咬肌肥大一般与人咀嚼习惯和饮食习惯有关，咬肌肥大多伴有\r专家为大家介绍咬肌肥大的三种方法。<br />　　<strong>1、药物注射法去咬肌</strong><br />　　是较为简单有效的方法，咬肌内注射肉毒素，使咬肌部分萎缩，但不影响咬肌的基本生理功能。注射后最佳效果在1～3个月显现，效果可持续1～2年。<br />　<strong>　2、剥离法去咬肌</strong><br />　　通过剥离咬肌的附着点及改变附着面积，3个月后肌肉开始发生重建性萎缩，6个月左右软硬组织再建轮廓与曲线稳定。<br />　<strong>　3、摘除法去咬肌</strong><br />　　对部分咬肌进行摘除。<br />　　上面的这些就是关于去除咬肌的介绍，现在大家对其有一定的了解了吧，希望通过对去除咬肌的介绍可以帮助大家更好的了解，同时提醒大家为了保证去除咬肌的效果一定要到正规的整容医院进行。\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('1119','7','1','2','http://www.xisimr.com/zxmrzx/gailian/qgzx/505.html','改脸型包括哪些项目？','array (\n  \'title\' => \'改脸型包括哪些项目？\',\n  \'time\' => \'1401772202\',\n  \'content\' => \'      　　\r术，主要通过口内微创手术方法，去除脸部增大的骨质和肥厚的咬肌，使下颌角的轮廓曲线变得柔和、顺畅;切口一般在口腔内，术后看不见伤疤，具有很高的安全度，并且是一次成型。充填凹陷部位采用国际公认先进的整形材料，柔软、逼真、不透光、安全可靠，更有利于面部两侧形成完美、迷人的曲线。<br />　　<strong>改脸手术 适合自己的才是最好的</strong><br />　　改脸手术不是画画，想画成谁就是谁。每个人的骨骼肌肉条件都不一样，手术要根据当事人的基础条件来进行改善和修饰。要知道，整形美容不仅要做到单个器官的美丽，还要做到整体的协调，放在别人脸上美丽的形状，放在你脸上未必协调。总之，适合自己的才是最好的。\r\',\n)');
INSERT INTO `sl_collection_content` VALUES('971','6','1','2','http://www.iface.com.cn/article/1897/','改善黑眼圈有妙计2006-01-10','array (\n  \'title\' => \'改善黑眼圈有妙计\',\n  \'time\' => \'1401428454\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 皮肤状态：混合型偏干，红血丝，黑眼圈　　</P><P>　　为徐榕槟拍照时，大家都赞叹她的体态凹凸有致，身上的肌肤紧实光洁，令人羡慕。她本身也是极爱美的，非常注重保养，可令她困惑的是，“明明护肤已经很到位了，为什么肌肤还是会有各种问题呢？”</P><P>　　纠正小错误改善大问题</P><P>　　“每天早上我先用洁面乳洗脸，接着使用柔肤水、除皱眼霜和含SPF值的面霜，然后再用一层防晒霜加强防晒。晚上呢，洁面乳洗脸后，用柔肤水和补水眼霜，然后用防治红血丝的护理产品，最后用晚霜。特别护理：一般每周用一次保湿面膜，一次美白面膜，两次眼膜(过夜)。每天还坚持吃维他命C、维他命E片。”听起来，徐榕槟的护肤程序无可多挑剔，可她仍然觉得肌肤总是差口气，一些问题始终存在，比如红血丝、黑眼圈、\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('974','6','1','1','http://www.iface.com.cn/article/1894/','呵护眼部肌肤赶走细纹2006-01-10','array (\n  \'title\' => \'呵护眼部肌肤赶走细纹\',\n  \'time\' => \'1401428451\',\n  \'content\' => \'		  <P>　&nbsp;&nbsp; 不用多说，你也知道一双美丽有神的眼睛有多大魅力，水汪汪抑或黯淡无光，左右着别人对你的第一印象。属于你自己的，除了天赋条件，后天的护理更加重要。所谓笨鸟先飞，早晚两次的基本护理少不了，一周下来的重点修护不可缺少。想要魅惑动人，总得付出点代价。 </P><P>　　重点狙击———眼膜 </P><P>　　·急救效果明显·睡前敷用最奏效 </P><P>　　·营养丰富，不建议天天使用 </P><P>　　如果说眼霜是每天必备的护理功课，那么眼膜就是每周必经的小考，只有通过这些繁复的考验，我们才能在期末大考里获得理想成绩，拥有一双电力十足的美目。眼膜的形式有很多种，但现在坊间特别流行一种高滋养片状护理面膜，它们是针对容易干燥及产生皱纹的眼角、嘴边肌肤所设计的，以面膜的方式补给丰富的营养，针对性比较强，效果也更加明显。如SK-II活肤抗皱眼膜和资生堂莉薇质纯防皱眼膜，就是近期比较热门的产品，其滋润效果备受推崇。连常青玉女周慧敏也认为，眼膜让她感觉眼部皮肤特别滋润，连细纹都看不见了，而且急救效果比较好，能够帮她消除眼睛水肿的问题。不少\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('976','6','1','2','http://www.iface.com.cn/article/1892/','熬夜注意预防眼病2006-01-10','array (\n  \'title\' => \'熬夜注意预防眼病\',\n  \'time\' => \'1401428450\',\n  \'content\' => \'		  <P>　　经常熬夜工作的中青年男性请高度注意！当您结束一整夜的工作后，很可能遭到一种眼病的“奇袭”，突然感到眼前一片模糊，视野中心仿佛飘着一团黑雾，且看到的东西都是变形、缩小的。 <BR>高发人群：25岁~50岁视力正常男性 </P><P>　　这种专挑通宵工作的中青年男性“下手”的眼病有个冗长的名字， <BR>叫做“特发性中心性浆液性脉络膜视网膜病变”。经常熬夜、过度疲劳、工作紧张、长期用皮质类固醇药物等都是其诱发因素。 </P><P>　　据广州军区广州总医院眼科易魁先副主任医师介绍，“特发性中心性浆液性脉络膜视网膜病变”主要发生在黄斑区，黄斑区是视网膜的一个重要区域，主要与精细视觉及色觉等视功能有关。和其他黄斑病变不同，这种病最常见于25~50岁的男性，仅有少部分是50岁以上的男性患者，女性则极少患病。由于相当多的患者身为公司、企业的高级管理人员或是掌舵人，它又被通俗地称为“老板病”。 </P><P>　　易魁先指出，“特发性中心性浆液性脉络膜视网膜病变”早在1866年就已被人发现，但过去普遍认为是由视网膜血管痉挛引起，直到130多年后才发现病变和视网膜的色素上皮渗漏有关。不过，医学界至今仍未找出色素上皮发生渗漏的真正原因，对此病的病理基础也不明了。 </P><P>　　常见症状：视力突然下降眼前有黑影 </P><P>　　患者发病时除了视力模糊、视野中心有黑影，视物变形、缩小外，视力也会骤降，下降幅度最低可至0.1,隔着两三米连人伸出几根手指都看不清，而且单眼或双眼都可出现症状。 </P><P>　　一般来说，50岁以上的患者逐渐表现出上述症状，但中青年男性往往会在通宵熬夜之后突然发病。更奇怪的是，大多数的中青年患者平时视力正常，甚至视力绝佳。广州某宾馆一位不到40岁的老总就是一个典型例子。他是一名退伍军人，发病前视力一直保持2.0,没想到却在一夜之间视力大幅度下降。这些年来，他的病情时好时坏，有时视力恢复正常，但只要一熬夜，便马上复发。　 </P><P>　　主要诱因：熬夜过度疲劳工作紧张等 </P><P>　　为什么这种病会和熬夜工作如影随形？易魁先表示，熬夜工作的人往往平时的工作压力很大，生活也不规律，常常过度疲劳。再加上熬通宵时，人处于长时间的焦虑紧张状态，毛细血管随之发生痉挛，引起供氧不足。由于眼睛的黄斑区是全身耗氧量最大的地方，因此最先受到影响。 </P><P>　　此外，长期用皮质类固醇药物也可诱发色素上皮屏障破坏。国内各地都曾出现过因肾炎、视神经炎等疾病而大量应用皮质类固醇治疗，结果诱发中心性浆液性视网膜病变的病例。如果对已经发生这种视网膜病变的患者使用皮质类固醇治疗，其病情也会迅速恶化。 </P><P>　　许多疾病来临前都有迹可寻，可引起患者的警惕。然而，这种特殊眼病来袭前毫无征兆，且常规眼科检查很难找到一丁点“危险信号”。在检眼镜下，很难从病情复发的患者的眼底表现里发现异常，而且病变程度和患者视力的好坏表现也不一致，因此只能采用荧光血管造影检查来了解病情究竟是复发活跃还是萎缩稳定。 </P><P>　　危险之处：病情严重者可近乎失明 </P><P>　　易魁先指出，此病的一大特点是大部分患者视力不经治疗也能恢复到较好的水平，但复发率非常高。据统计，约1／3或半数的病例可以复发，10％病例可以多次复发，50％病例经过一年左右才会复发，更有甚者，病情暂时“休眠”的时间可长达10年。在此过程中，眼部病变范围逐渐扩大，色素上皮萎缩严重。多次发作后，神经上皮功能衰退，最终造成视力蒙受永久性损害，严重者视力降至接近盲人水平。 </P><P>　　需要特别注意的是，初次发作后通常会有“好转”的假象，也就是进入慢性迁延期。这时，许多患者以为自己已经不治而愈，或者把最初的发病当成是一般的视力下降而置之不理，以致丧失延误治疗时间。 </P><P>　　据介绍，“假象”分为三种。一是患者视力明显进步，甚至恢复。这是因为急性渗漏暂停，但实际上色素损害的范围反而继续增大。二是病情得到一定控制后，患者视力保持良好状态，但突然毫无先兆地卷土重来。有的患者5年间3次发作，发病点却是同一位置。据介绍，80％的复发患者，发病位置在最初位置1毫米范围以内，而精确到0.5毫米的病例则占65％。也有的患者新的发病点出现了转移。三是每次复发，病情都会稍许加重，时间一长视力损害便很难恢复，因此复发次数越多的患者，视力只会越来越差。 </P><P>　　由于这种特殊眼病的确切发病原因不明，因而目前缺乏针对性的有效药物治疗。据介绍，对其疗效相对较好的是采取\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('977','6','1','2','http://www.iface.com.cn/article/1891/','眼部美容十分钟去除黑眼圈2006-01-10','array (\n  \'title\' => \'眼部美容十分钟去除黑眼圈\',\n  \'time\' => \'1401428450\',\n  \'content\' => \'		  <P>　&nbsp;&nbsp;&nbsp; 也许是因为天气影响了睡眠、也许是最近工作比较累、也许是昨晚开夜车的缘故，总之今天的镜子里你模样可憎，眼睛下面青乌一片活脱脱的一只大熊猫。而你早晨只有30分钟宝贵的时间化妆，能不能赶走“熊猫眼”就看你的本事了。&nbsp; <BR>&nbsp;<BR>　　对付黑眼圈最立竿见影的办法就是化妆。利用粉底、遮掩膏、眼影、腮红等使\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('978','6','1','2','http://www.iface.com.cn/article/1890/','彻底赶走黑眼圈2006-01-10','array (\n  \'title\' => \'彻底赶走黑眼圈\',\n  \'time\' => \'1401428450\',\n  \'content\' => \'		  　　&nbsp;在睡梦中对脆弱的眼部补充养分，让眼晴休息的同时补充维生素。本款眼罩通过对眼睛周围的适量压力，可以让疲劳的双眼重现光彩，也可以对容易暴露出年龄的眼部周围的皮肤进行保养，效果非常明显。其秘诀，就是接触肌肤的一面采用肌肤触感极佳并且经过维他命加工的纱制面料。在睡眠的时候使用可以轻柔舒缓地对眼部肌肤进行呵护，即使肉眼不易觉察到的地方也能重现生机。眼罩内可以根据自己的需要，加入制冷剂或沾有精油的化妆棉等．		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('979','6','1','2','http://www.iface.com.cn/article/1889/','找准原因除黑眼圈2006-01-10','array (\n  \'title\' => \'找准原因除黑眼圈\',\n  \'time\' => \'1401428450\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 据香港《明报》最新报道，一项网络调查显示，近九成男士认为黑眼圈最影响容貌，女性拥有亮丽有神的双眼才性感。可是，眼周肌肤厚度仅为0.04毫米，堪称人体最脆弱的皮肤，只有找准原因才能赶走“熊猫眼”：眼皮过薄。有的人眼周表皮天生较薄，会因为皮下血管颜色显现出来而出现蓝黑色黑眼圈。此类情况需要格外注意眼部保湿、防晒。 </P><P>&nbsp;&nbsp;&nbsp; 血液循环较差。血液循环差、鼻腔过敏、眼睛疲劳等情况都会引发黑眼圈，颜色多为褐色。只有热敷和按摩的方式才能起到明显效果。可在土豆中加少量牛奶，煮熟后捣成泥，敷在脸上20分钟，每周1—2次。 </P><P>&nbsp;&nbsp;&nbsp; 生活习惯不良。熬夜、抽烟、喝酒、吃刺激性食物、情绪困扰、身体状况差等都会产生黑眼圈。除了要改善生活作息与均衡饮食之外，还应尽量保证睡眠质量。 </P><P>&nbsp;&nbsp;&nbsp; 化妆品残留。有些女性不注意眼部卸妆，导致化妆品颜料慢慢渗透到皮肤内部，造成色素沉积型黑眼圈。此类人每晚必须彻底洁面，必要时可到\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('980','6','1','2','http://www.iface.com.cn/article/1888/','日常去黑眼圈美肤方法2006-01-10','array (\n  \'title\' => \'日常去黑眼圈美肤方法\',\n  \'time\' => \'1401428449\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 你有完全无法应付的黑眼圈吗？还是在使用粉底与遮瑕产品时，用完后却有更明显的经验？无论你的肤色为何、有多少瑕疵，创造完美无瑕的肌肤不再是梦，关键就在于基础底妆，除了遮瑕膏，再搭配粉底与蜜粉，就是上妆的基础重点了。 　　 </P><P>&nbsp;&nbsp;&nbsp; 遮瑕膏顾名思义，就是能遮掩瑕疵，而粉底则改善肤色，蜜粉有着定妆与妆效持久的效果，遮瑕、粉底与蜜粉无疑是完美肤色的必要配备，但绝佳的遮瑕技巧更能帮助你呈现柔美肤质，给你完美无瑕、人人称羡的好妆容！ </P><P>&nbsp;&nbsp;&nbsp; 1、选择适合自己肤色的粉底 </P><P>&nbsp;&nbsp;&nbsp; 正确的粉底应让你像没化妆般自然，它不但可以均匀肤色，也是在上其他彩妆前的基础妆底，而且绝对是整体妆容不可或缺的角色，选择粉底，请务必记得选择比自己肤色稍浅一点的粉底色，才能达到贴近本身肤色的妆效。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </P><P>&nbsp;&nbsp;&nbsp; 2、轻推、轻按，正确地使用粉底与遮瑕产品才有效 </P><P>&nbsp;&nbsp;&nbsp; 无论是霜状、液状还是粉饼状的粉底，都要从脸部中央往外推匀粉底，脸部轮廓部份要特别当心，因为这些部位很容易有色差，使用不当还会产生聚粉的现象；此外，一般的遮瑕品干 </P><P>&nbsp;&nbsp;&nbsp; 3、善用蜜粉，让妆容更完美 </P><P>&nbsp;&nbsp;&nbsp; 蜜粉有让妆效持久、防止出油、保持脸色清新的效果；切记不要让蜜粉和粉底的颜色太接近，选择稍浅的颜色可以让整体肤色显得明亮，弱势选择较深的蜜粉颜色，则能让肌肤色泽更为温润。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('984','6','1','1','http://www.iface.com.cn/article/1867/','眼部护理产品挑选方法2006-01-09','array (\n  \'title\' => \'眼部护理产品挑选方法\',\n  \'time\' => \'1401428448\',\n  \'content\' => \'		  <P>&nbsp;　　总会听到有人问，不知道该怎么选择一款合适的眼部保养品，而专柜推销小姐的动情言语更是瞄准了你的荷包，怎样也不如擦亮自己的眼睛，挑一款适合自己的眼部保养品才是正格！ </P><P>　　1.眼部精华液 </P><P>　　功效点评：绝对的高浓缩保养品， 不过这样的眼部保养品一般来说滋润能力通常不强，对于成熟肌肤或是很深的皱纹来说，必须要搭配眼霜或者是凝胶来用，才能起到该有的功效。 </P><P>　　应对问题：具有紧实、修护保湿屏障、加强修护细胞的作用，可以让后续眼部保养品的吸收更有效率。 </P><P>　　使用方法：取米粒大小的分量，用左右无名指腹对揉的时间相对要稍久一些，直到温暖得有融开迹象，再轻轻地由内向外“按”在下眼框骨，中间往眼角处要多“按”一些，直到吸收。 </P><P>　　2.眼部凝胶 </P><P>　　功效点评：高含水量是凝胶类产品的特点，这样的产品最适合夏天或者是油性肌肤使用。 </P><P>　　应对问题：如果你还没有出现眼部的问题，那么最好养成使用眼部凝胶的习惯。同时，要是你有画眼影的习惯，那么之前涂上的眼部凝胶则不仅可以让你眼部肌肤少受彩妆的伤害，更可以让你的彩妆更持久。 </P><P>　　使用方法：每次取一粒“大米”分量，左右无名指腹对揉，在下眼眶骨的地方由内向外(眼尾处)轻推开，再轻轻地采用“点”的方法直到吸收。 </P><P>　　3.眼霜 </P><P>　　功效点评：质地较轻柔的眼霜也是含有油分比例最高的眼部保养品，适合成熟肌肤或夜间使用。但一次使用的量不能太多，否则反倒会加重眼部的负担，油脂粒就是最常见的负担过重的表现。 </P><P>　　应对问题：眼霜的功效性最为多样，能够真正对抗一些眼部的问题，比如斑点、黑眼圈、细纹、浮肿。 </P><P>　　使用方法：用与眼胶同样分量、手势，在眼尾处轻推，并向上提。 </P><P>　　4.眼部凝露 </P><P>　　功效点评：凝露的质地比眼霜轻薄，对于促进眼部循环最为有效，所以可以用来对抗眼部的浮肿和保湿。同时，如果你希望对抗眼部初期的衰老现象，用眼部凝露也是最好的选择。 </P><P>　　应对问题：眼部的干纹、浮肿。 </P><P>　　使用方法：用中指“摸”取一层微量的薄膜，双手无名指与中指的指腹对揉，温热后，“点”在下眼框处，再轻轻地由眼角向眼尾“弹”几圈，直到吸收。 </P><P>　　5.眼膜 </P><P>　　功效点评：眼膜的保湿功效是无人能及的，同时对付眼部的问题，眼膜也是最有SOS效果的解决方案。 </P><P>　　应对问题：不管是眼部浮肿、黑眼圈、还是干纹，眼膜都是最有即时效果的选择。 </P><P>　　使用方法：一般来说，从冰箱中取出眼膜会有效用加分的功效。 </P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('986','6','1','2','http://www.iface.com.cn/article/1865/','眼膜去除黑眼圈2006-01-09','array (\n  \'title\' => \'眼膜去除黑眼圈\',\n  \'time\' => \'1401428447\',\n  \'content\' => \'		  <P>　　眼膜， 眼部肌肤问题的急救措施，但眼膜究竟该怎么用才能令效用升值？市面上的眼膜哪种更好用？我们在这里为你解密： </P><P>　　一、敷眼膜前需要彻底清洁肌肤 </P><P>　　不要管眼睛上是否化了彩妆，彻底地清洁肌肤都是非常必要的，卸妆油这个步骤绝不能跳过。 </P><P>　　二、将眼膜雪藏 </P><P>　　冰冰的眼膜会令浮肿的眼睛得到绝对的舒缓。 </P><P>　　三、敷眼膜之前先热敷 </P><P>　　敷眼膜之前，最好能够先用热毛巾热敷一下眼睛，这样再敷上冰冰的眼膜时，对于眼部的循环会更理想。 </P><P>　　四、敷眼膜要有方向感 </P><P>　　对于布式的眼膜来说，要从眼头向眼尾的方向敷，而乳状的眼膜，也要从眼头涂向眼尾，千万不可以来回涂。 </P><P>　　五、敷眼膜的位置要精准 </P><P>　　眼膜到底敷在哪里呢？建议的最佳距离是眼睛下面3毫米的地方，而且只限于下眼。因为上眼的肌肤比较薄，对营养的吸收能力比较有限。如果要敷在上眼，只限于对抗眼睛浮肿。 </P><P>　　六、敷眼膜的时间 </P><P>　　这要看每一种眼膜的不同要求，但不可以敷过长的时间，否则恐怕会适得其反。 </P><P>　　七、眼霜是眼膜的亲密伙伴 </P><P>　　不是说敷了眼膜就足够了，一定要在敷眼膜之后搽上眼霜，这样才能让眼部肌肤得到更好的滋润，如果单单靠敷眼膜，取下后眼部肌肤会有紧绷感，反倒会催生细纹。 </P><P>　　八、敷眼膜的最佳时机 </P><P>　　a.生理周期后一周——体内雌性激素分泌旺盛，这时敷，最有效 </P><P>　　b.泡澡时——借着热气，加速循环 </P><P>　　c.睡觉前——让养分在你睡觉的时候发挥作用 </P><P>　　九、眼膜不能每天敷 </P><P>　　如果每天敷，会长油脂粒的！此外，更不能敷着眼膜睡觉，否则一旦眼膜中的精华液全部挥发了，会带走肌肤中的水分。 </P><P>　　十、眼膜的多重功效 </P><P>　　你额头的表情纹、眼角的小细纹、干纹都逃不过它的魔力。 </P><P>　　眼睛是最容易说出女人年龄秘密的部位，要好好对待它，小心泄密。 </P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
