INSERT INTO `sl_collection_content` VALUES('769','6','1','1','http://www.iface.com.cn/article/7270/','眉毛化妆技巧2006-03-27','array (\n  \'title\' => \'眉毛化妆技巧\',\n  \'time\' => \'1401428538\',\n  \'content\' => \'		  <P>用具：眉钳、小镊子、眉笔、眉刷、镜子、小剪子、皮肤收敛性水，润肤霜和小棉球等。 </P><P><BR>修眉的主要步骤 </P><P>修眉是一门技巧性很高的技术，既要掌握Cao作技术，又必须认真仔细，才能做出理想的眉形。其主要步骤包括： </P><P>清洁眉毛。对着镜子用小眉刷轻刷双眉，以除去粉剂及皮屑。用惉球蘸酒精或收敛性皮肤水（推荐使用可伶可的俐，好买，相对也较便宜，……我在给人家打广告……||||偶尔用的话就借吧~），擦眉毛及周围，使之清洁。 <BR>用温水浸湿的棉球或热毛巾盖住双眉，使眉毛部位的组织松软。 </P><P>确定眉型。可先用眉笔画出适合自己的眉型，凡留在轮廓线以外的眉毛都是多余的。（下笔一定要清，能看见大概范围即可，再洗的话很麻烦的。） </P><P>调整眉型的长度。把过长的垂直向下生长的眉毛修剪到合适的长度，眉稍留的稍短，越*近眉头越要留的长一些。从眉毛正中到眉尖，除形状不好以外，不宜剪得太短。 </P><P>修\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('770','6','1','1','http://www.iface.com.cn/article/7269/','种睫毛的安全性2006-03-27','array (\n  \'title\' => \'种睫毛的安全性\',\n  \'time\' => \'1401428537\',\n  \'content\' => \'		  　　拥有浓密的睫毛，可为眼睛增添不少神采，于是，一种人工“增长”睫毛的方式－－接睫毛（也称“种睫毛”）成为都市爱美女性的选择。然而，市场上出现越来越多的美睫店，其卫生、安全是否能过关，令人生疑。 <BR>　　<BR>　　近日，在银川市新华商城里有十来家接睫毛的小店，这些小店规模不等，大都标着“韩国美睫，惊喜价”的字样，\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('771','6','1','1','http://www.iface.com.cn/article/7109/','中老年人纹眉术2006-03-23','array (\n  \'title\' => \'中老年人纹眉术\',\n  \'time\' => \'1401428537\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp;&nbsp; 纹眉术的原理是用纹眉器械将各种颜色植染于皮肤表层，长期不褪色、不消失的色彩装饰，维持于皮肤内的一项技术。</P><P>　　纹眉是一项技术性很强的工作，需要专门的器具、消毒设备以及训练有素的化妆技巧。纹眉术也可以说是一项艺术造型术。它并不是简单地用染料在原有眉的位置上添染色彩，也不仅仅只是给断眉、无眉、眉型不佳者重新纹出一条眉。而是通过精湛的操作、艺术的处理为求美者纹出一条“艺术之眉”。通过改变原有的眉型来改善\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('772','6','1','1','http://www.iface.com.cn/article/7092/','珍珠眼部护肤法2006-03-23','array (\n  \'title\' => \'珍珠眼部护肤法\',\n  \'time\' => \'1401428536\',\n  \'content\' => \'		  <P>　　眼睛周围的肌肤是人体皮肤中最敏感的，疲劳、紧张、年龄都会在这儿有所反映。而眼皮又是脸部最容易让人忽视的部位，它比脸颊的皮肤薄４倍。又没有\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('773','6','1','1','http://www.iface.com.cn/article/7071/','眼霜使用小百科2006-03-23','array (\n  \'title\' => \'眼霜使用小百科\',\n  \'time\' => \'1401428536\',\n  \'content\' => \'		  <P>　　谁最需要使用眼霜</P><P>　　从理论上来说，无论年纪大小，都不能忽视眼部肌肤的保养和护理。现代生活的紧张节奏和多姿多彩，使得眼部肌肤开始衰老的年龄有逐渐提前的趋势。</P><P>　　油性皮肤：</P><P>　　皮肤较油的人的确出现皱纹较晚，但是由于眼部周围皮肤皮脂腺和汗腺的分布特别少，所以即使是油性皮肤的人眼周也会有干燥现象产生，容易由于\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('774','6','1','1','http://www.iface.com.cn/article/7069/','眼袋自救DIY2006-03-23','array (\n  \'title\' => \'眼袋自救DIY\',\n  \'time\' => \'1401428536\',\n  \'content\' => \'		  <P>　　一：把一小杯茶放入冰箱中冷冻约15分钟，然后用一小块化妆棉浸在茶中，再把它敷在眼皮上，能减轻\r</p>        \',\n)');
