INSERT INTO `sl_collection_content` VALUES('776','6','1','1','http://www.iface.com.cn/article/7066/','手术去除眼袋的效果怎么样？2006-03-23','array (\n  \'title\' => \'手术去除眼袋的效果怎么样？\',\n  \'time\' => \'1401428535\',\n  \'content\' => \'		  <P>　　经过手术后，眼睑平整，无皱纹，皮肤光泽，而且皮肤切口一般也不会有手术痕迹，少数病人早期会有切口发红，轻度瘢痕增生，一般1-3个月左右即可消失。手术效果至少能维持15年左右。 </P><P>　　需要提醒的是，\r</p>        \',\n)');
