INSERT INTO `sl_collection_content` VALUES('779','6','1','1','http://www.iface.com.cn/article/6895/','怎么消除眼角皱纹2006-03-22','array (\n  \'title\' => \'怎么消除眼角皱纹\',\n  \'time\' => \'1401428534\',\n  \'content\' => \'		  <P>　　紧张、忙碌的生活，常常令都市女性只注重化妆却忽略对皮肤的护理保养。有不少人都认为皮肤按摩、护理很费时间，又麻烦，所以不能持续坚持下去，省去了这一重要环节。其实只要掌握正确的方法，你就能在短时间内进行\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('780','6','1','1','http://www.iface.com.cn/article/6852/','快速消除眼睛肿小妙方2006-03-22','array (\n  \'title\' => \'快速消除眼睛肿小妙方\',\n  \'time\' => \'1401428534\',\n  \'content\' => \'		  &nbsp;&nbsp; 为什么会泡泡眼？　 <BR>　　哭泣、失眠、俯卧、月经来潮前、怀孕、饮食太咸、睡前两小时内喝大量的水，都会造成早上醒来\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('781','6','1','1','http://www.iface.com.cn/article/6851/','眼膜简单自制方法2006-03-22','array (\n  \'title\' => \'眼膜简单自制方法\',\n  \'time\' => \'1401428534\',\n  \'content\' => \'		  &nbsp;&nbsp; 在我们平时食用的蔬菜水果中，有很多都可成为“眼膜”的好原料，经过稍稍的加工，就可以变成眼膜。用这些新鲜的天然品经常做做眼部护理，对眼睛会有很好的护理作用。<BR>　　丝瓜眼膜：丝瓜是护肤的好原料。取未成熟的丝瓜去皮，去籽，捣成泥，涂在眼部，有抗过敏，洁肤，防皱的效果。<BR>　　蜂蜜蛋黄膜：把一个蛋黄加入一匙蜂蜜调匀，再加两滴橄榄油，有润肤防皱之效，每周可做1-2次。<BR>　　牛奶眼膜：先把牛奶放入冰箱冰镇，再用棉片侵冰镇后的脱脂牛奶，敷在眼皮上，每天早晚2次，每次10分钟，可消除\r</p>        \',\n)');
