INSERT INTO `sl_collection_content` VALUES('785','6','1','1','http://www.iface.com.cn/article/6797/','眼霜怎么抹效果好2006-03-21','array (\n  \'title\' => \'眼霜怎么抹效果好\',\n  \'time\' => \'1401428532\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp;&nbsp; 换季时节，皮肤总是处于不滋润的状态，还容易产生一些过敏症状，尤其是眼部肌肤，最为娇嫩，出现问题也最令人头痛。要过个惬意的冬天，眼睛这大关一定要过好!</P><P>&nbsp;&nbsp;&nbsp; 眼霜的妙用</P><P>&nbsp;&nbsp;&nbsp; 眼霜的使用要得当，别以为越多越好，其实肌肤吸收也有限度，顺着内眼角、眼下方、眼尾，上眼皮至眼尾两个方向轻轻抹匀，早晚坚持，不可中断。通常用在拍完化妆水之后。根据需要和季节变化选择，冬天偏重于保湿滋润。恰当使用眼霜再配合适度按摩，效果不同凡响。注意哟!这可是举手之劳哦。</P><P>&nbsp;&nbsp;&nbsp; 适度按摩能促进血液循环，加速新陈代谢，帮助细纹散开，增强皮肤弹性。 <BR></P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('786','6','1','1','http://www.iface.com.cn/article/6776/','纹眼线成功标准2006-03-21','array (\n  \'title\' => \'纹眼线成功标准\',\n  \'time\' => \'1401428532\',\n  \'content\' => \'		  &nbsp;&nbsp;&nbsp;&nbsp; 一般来说，眼线的弧度要自然、圆滑、流畅，上粗下细，比例约为7：3，内窄外宽，深浅适中，方能表现眼睛的深度，烘托出美丽的眼睛；上睫毛浓而长，上眼线颜色可纹深些、粗些，下眼线应细而淡，这样强调上眼线使眼睛显得有成熟感；小眼睛最好只纹上眼线，若上下眼线全纹会使眼睛显得更小；圆眼睛应纹得细长，以增加曲线的长度；细长的眼睛，则应纹得短粗，以增添曲线的弧度。<BR>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('787','6','1','1','http://www.iface.com.cn/article/6773/','画眉、修眉、纹眉2006-03-21','array (\n  \'title\' => \'画眉、修眉、纹眉\',\n  \'time\' => \'1401428532\',\n  \'content\' => \'		  <P>　　面之有眉，犹屋之有宇。 </P><P>　　眉飞色舞，表示兴高采烈的情绪，蹙额皱眉，传递愁苦窘难的信息。以眉作态，称为眉语。“眉语两自然，忽然随风飘”，表达脉脉情意；“怨黛舒还敛，啼红拭复垂”，描绘了失意女性的哀怨愁思。 </P><P>　　所以，女性的峨眉舒卷，被喻为“七情之虹”，双眉的修饰，自然格外受到女性的青睐。 </P><P>　　古代妇女所用画眉的颜料，是一种青黑色的矿物，称为“黛石”，或简称为“黛”。使用时，先将眉毛剃去，然后用黛描绘。 </P><P>　　女性的眉式名目繁多。汉代流行阔而短的“广眉”，浓重如卧蚕，扫除几分妩媚，增添少许明快干练；眉梢向下的“愁眉”，惹人爱怜，略显愁容。五代时期，宫廷中有“御爱眉、小山眉、五岳眉、三峰眉、垂珠眉、月棱眉、分梢眉、涵烟眉、拂云眉、倒晕眉”等10种，宫人们争相效仿。唐代妇女注重修饰，当时眉式有“柳叶眉、桂叶眉、却月眉、八字眉、等。到了宋代，眉式有百种，教坊勾栏中的女子，百日内无一重复。可见，中国古代妇女的眉式趋时翻新、千姿百态，“须教碧玉羞眉黛，莫与红桃作曲尘” </P><P>　　画眉、修眉之风，一直流传至今不衰。</P><P>　　然而，现代眉饰的时尚是纹眉（通常还同时纹眼线、纹唇线）</P><P>　　纹眉是纹身的衍化。通常的做法是用刺纹器械将无毒的颜料植入皮肤的真皮层，使纹好的眉线永久保留，这样就可以免除每日修眉的繁劳。对自然眉型欠雅、眉毛疏落以及特殊需要的女性，纹眉是一种独具魅力的诱惑。</P><P>　　纹眉有术，纹眉制作绝非对原有眉式的重造，而是艺术加工，这项技术犹如在颜\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('788','6','1','1','http://www.iface.com.cn/article/6771/','绣眉要注意自然舒服2006-03-21','array (\n  \'title\' => \'绣眉要注意自然舒服\',\n  \'time\' => \'1401428531\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp;&nbsp; 现在不少女孩子为了让眉毛漂亮而去绣眉，那么在绣眉前要注意哪些事情呢？</P><P>　　绣眉师付华介绍，绣眉前要先设计眉型，通过眉型设计有效地体现出眉毛在\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('789','6','1','1','http://www.iface.com.cn/article/6567/','睫毛的形态与美2006-03-17','array (\n  \'title\' => \'睫毛的形态与美\',\n  \'time\' => \'1401428531\',\n  \'content\' => \'		  <P>　　睫毛生长于睑缘前唇，排列成2-3行，短而弯曲。上睑睫毛多而长，通常有100-150根，长度平均为8-12mm，稍向前上方弯曲生长；下睑睫毛短而少，约50-75根，长度约为6-8mm，稍向前下方弯曲。故当闭眼时上下睫毛并不交织。 </P><P>　　一般人上睑睫毛的倾斜度，睁眼平视状态下，男性为110度-130度的占79．8%，闭眼状态时为140度-160度的占83．5%，女性与男性大致相同。男性下睑睫毛平视时为100度-120度，女性较男性小l0度。上下睑中央部睫毛较长、多，内眦部最短。睫毛毛囊神经丰富，故睫毛很繁感，触动睫毛可引起瞬目反应。有保护作用。毛囊周围有汗腺及皮脂腺，它们的排泄管开口于睫毛毛囊中。睫毛的颜色一般较头发深，也不因年老而变白(偶尔可见数根老年性白睫)，但也可由于某种疾病，如白化病，而成白色。</P><P>　　睫毛的平均寿命为3-5个月，不断更新，一根发育的睫毛，自拔除后，一周即可长出1-2mm，约经10周，可达到原来的长度。儿童的睫毛最长，也最弯曲。在日常生活中，常见一些父母为婴幼儿拔除睫毛，以期长出黑又亮的睫毛，这种作法是没有科学依据的，有时甚至会造成感染等意外，而破坏毛囊，造成睫毛的缺失。</P><P>　　上下睑缘睫毛似排排卫士，排列在睑裂边缘，有遮光，防止灰尘、异物、汗水进入眼内，和眼睑一起对角膜、眼球进行保护的作用，故被称为“眼的哨兵”。</P><P>　　细长、弯曲、乌黑、闪动而富有活力的睫毛对眼型美，以致整个容貌美都具有重要的作用。睫毛排列呈半弧形。睫毛可衬托显示眼睛的轮廓，增添眼睛的神韵。上睑睫毛比下睑睫毛长且密。以黑亮、微向上翘者为美，它已成为人类，尤其是女性\r</p>        \',\n)');
