INSERT INTO `sl_collection_content` VALUES('791','6','1','1','http://www.iface.com.cn/article/6484/','谁最需要使用眼霜2006-03-16','array (\n  \'title\' => \'谁最需要使用眼霜\',\n  \'time\' => \'1401428530\',\n  \'content\' => \'		  <P>　　从理论上来说，无论年纪大小，都不能忽视眼部肌肤的保养和护理。现代生活的紧张节奏和多姿多彩，使得眼部肌肤开始衰老的年龄有逐渐提前的趋势。 </P><P>　　油性皮肤： </P><P>　　皮肤较油的人的确出现皱纹较晚，但是由于眼部周围皮肤皮脂腺和汗腺的分布特别少，所以即使是油性皮肤的人眼周也会有干燥现象产生，容易由于\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('792','6','1','1','http://www.iface.com.cn/article/6324/','纹眼线原则2006-03-14','array (\n  \'title\' => \'纹眼线原则\',\n  \'time\' => \'1401428530\',\n  \'content\' => \'		  &nbsp;&nbsp;&nbsp;&nbsp; 纹眼线不仅起到改变和扩大眼型、增加睫毛浓密感的作用，而且还能使黑眼线与白巩膜形成颜色的鲜明对比，黑白分明，使眼睛显得更加明亮而神采奕奕。纹眼线时应注意：上眼线应纹在睫毛根处，内端细，向外侧逐渐加宽，尾部应有一定角度，稍拉长微翘，以增加眼裂长度。下眼线应纹在睫毛根的内侧，外侧较内侧略宽些，线条一定要细而直。上、下眼线宽窄的比例以7：3为宜。上、下眼线在外眦角部不能连接起来，否则会效果。		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
