INSERT INTO `sl_collection_content` VALUES('794','6','1','1','http://www.iface.com.cn/article/6287/','眼霜与年龄2006-03-14','array (\n  \'title\' => \'眼霜与年龄\',\n  \'time\' => \'1401428529\',\n  \'content\' => \'		  <P>　　其实眼霜和年纪是没有关系的，只和需要有关。很多人问什么时候可以开始用眼霜，我们的意见是17岁就可以了。因为细纹、\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('795','6','1','1','http://www.iface.com.cn/article/6284/','消除浮肿眼睛方法2006-03-14','array (\n  \'title\' => \'消除浮肿眼睛方法\',\n  \'time\' => \'1401428529\',\n  \'content\' => \'		  <P>　　前言：瞧着镜中人，你疑惑自问“我的脸有这么胖吗？”浮肿的脸庞正偷偷泄漏出你不正常作息的秘密。玩了整整一晚，虽然很疲惫，也要坚持给眼部额外的护理，小编这里介绍您两大技巧可以让你看起来不再肿胖：</P><P>　　眼浮肿主要是眼下的皮肤很薄很松导致水分停留在那里。清除的方法：</P><P>　　1、睡前认真清洁眼圈。</P><P>　　2、可用有轻微紧肤性质的冷藏小黄瓜，切片敷在眼皮上休息十分钟。</P><P>　　3、用几个枕头采取高枕高睡法会自然消肿。</P><P>　　4、削成薄片的生薯或压成茸敷眼15分钟也是消肿的有效方法。</P><P>　　用精巧妆容挡住浮肿眼睛</P><P>　　在浮肿的眼部，用暗色的眼影淡描，能辅助眼形深明。</P><P>　　常有人说东方人的脸型扁平，眼睑也多予人浮肿的感觉。若能使用寒色系列(茶色或灰色)的眼影化妆，那么多少能衬托出眼形轮廓的明显度。在这里，茶色和灰色，只是笼统的说法。在更细腻的效果上，应配合自己的条件，选择浓淡色彩合宜的化妆。因为太浓的茶色，会超过本身肌肤的色调；太深的灰色，也会予人沉闷不雅的观感。</P><P>　　正确的化妆法，是先在浮肿的眼睛上使用暗色的眼影制造下陷的感觉，使眼部凹凸分明，轮廓明显。</P><P>　　使用眼影的重点不是随便涂抹，而是利用层次烘托法。</P><P>　　虽说暗色系的眼影，适合用于浮肿的双眼；但随便平面式的 涂抹，并不能产生出良好的效果。必须采用自然的层次烘托技巧， 才能省目。化妆时，使用绵棒、木棒、小毛刷等一点一点地衬托 出层次感，使美目盼兮。(层次晕染不好一样还是肿的哦！)</P><P>　　若实在无法以单色技巧烘托，可再使用同色系的两种颜色，描出浓淡。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('796','6','1','1','http://www.iface.com.cn/article/6283/','眼部消肿按摩法2006-03-14','array (\n  \'title\' => \'眼部消肿按摩法\',\n  \'time\' => \'1401428528\',\n  \'content\' => \'		  <P>　　玩了整整一晚，虽然很疲惫，也要坚持给眼部额外的护理，用棉棒蘸取稀释后的盐水，帮助缓解眼部肌肤的水肿现象。 </P><P>&nbsp;　　Step1 “S”形按摩上眼睑！</P><P>　　棉棒头水平贴于上眼睑的肌肤上，沿眼睑沟，从内侧开始沿“S”形路线，略用力拉抹至太阳穴，将上眼睑的多余水分排开。 </P><P>　　Step2 轻柔压按\r</p>        \',\n)');
