INSERT INTO `sl_collection_content` VALUES('798','6','1','1','http://www.iface.com.cn/article/6281/','眼部保湿除皱法2006-03-14','array (\n  \'title\' => \'眼部保湿除皱法\',\n  \'time\' => \'1401428527\',\n  \'content\' => \'		  <P>　　现代生活节奏快、环境污染、上网时间渐多、睡眠质量不好，这些本来就是困扰着我们眼睛的难题，再加上季节转变，气候、温度、湿度的改变对皮肤都会产生一定的影响，你有没有察觉眼角纹、\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('799','6','1','1','http://www.iface.com.cn/article/6279/','眼贴保养常识2006-03-14','array (\n  \'title\' => \'眼贴保养常识\',\n  \'time\' => \'1401428527\',\n  \'content\' => \'		  <P>A ：为什么眼睛需使用特殊保养品？ <BR>&nbsp;&nbsp;&nbsp; 眼睛周围的皮肤脆弱且复杂，上下眼睑部位的皮肤分为七层，每一层都比脸部的皮肤更薄，更细。此外，这部位的组织结构松散缺乏油脂，因此易肿胀而产生泡眼、\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('800','6','1','1','http://www.iface.com.cn/article/6277/','使用眼膜的方法2006-03-14','array (\n  \'title\' => \'使用眼膜的方法\',\n  \'time\' => \'1401428526\',\n  \'content\' => \'		  <P>　　*彻底清洁后再使用眼膜，保养成分更容易被吸收。 </P><P>　　*把眼膜放进冰箱，加倍的冰凉感受敷起来会更舒爽。</P><P>　　*用后的眼膜还有剩余的精华液不要浪费，涂在抬头纹或同样需要特别照顾的部位。</P><P>　　*敷膜的黄金时间：睡觉前敷用，可更好吸收；运动后，新陈代谢旺盛时吸收加速；生理期后一周，是体内雌激素分泌旺盛的时期，此时敷眼膜效果也会不错！</P><P>　　*大部分眼膜因含有高倍养分精华，建议不要每天敷用。</P><P>　　*敷眼膜时，感到七八分干就最好清除掉，以免带走眼周肌肤水分。 </P><P>　　2.对症下药 </P><P>　　要想使眼角光滑如新，首先要分清自己属于哪种眼纹，对症治疗。 </P><P>　　干纹 通常眼角发干，不做表情时眼角并没有纹路。对付干纹，一定要使用有补水功能的眼霜。 </P><P>　　皱纹 皱纹比干纹要深一些，因此需要使用具有滋润作用的眼霜，像含维生素E、含紫外线过滤剂以及具有预防皮肤老化功效的眼霜。 </P><P>　　表情纹 表情纹，不光在眼角形成，只要做表情，脸上很多地方都会有。治疗表情纹需要使用含抗皱成分、能紧致肌肤、含胶原蛋白成分的眼霜。 \r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('801','6','1','1','http://www.iface.com.cn/article/6275/','如何选择眼霜2006-03-14','array (\n  \'title\' => \'如何选择眼霜\',\n  \'time\' => \'1401428526\',\n  \'content\' => \'		  <P>　　*滋润眼霜：具有较强的保湿功能。尤其适宜秋冬季节和在空调间工作的女性使用。</P><P>　　*抗老化眼霜：具有抗皱及防晒功能。适合夏季和视屏工作者使用。 </P><P>　　*紧实眼霜：富含滋养成分，油性成分高于滋润眼霜，适于黑眼圈、衰老、干性肤质的女性。 </P><P>　　*抗敏眼霜：适宜敏感性肤质的女性。 </P><P>　　促进眼霜吸收的按摩方法 </P><P>　　*首先在眼睛四周均匀地点上眼霜。 </P><P>　　*然后按内眼角、上眼皮、眼尾、外眼角的顺序轻轻按摩，直至肌肤完全吸收。</P><P>　　*在按摩过程中，轻压眼尾、下眼眶，你会感到格外舒服。<BR></P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('802','6','1','1','http://www.iface.com.cn/article/6274/','眼霜早晚分开用2006-03-14','array (\n  \'title\' => \'眼霜早晚分开用\',\n  \'time\' => \'1401428526\',\n  \'content\' => \'		  <P>　　超过25岁的女性眼部问题往往是多重的，这个时候，你需要早晚分开使用不同功效的眼霜，比如早晨使用含有高水分、并有防晒功能的醒肤清爽类眼霜，令眼周肌肤活力尽现，光彩照人；而晚上使用高营养、修复类眼霜，可以很好地补充眼周肌肤的水分和养分流失，令第二天的你神采奕奕。</P><P>　　如何选择眼霜</P><P>　　*滋润眼霜：具有较强的保湿功能。尤其适宜秋冬季节和在空调间工作的女性使用。</P><P>　　*抗老化眼霜：具有抗皱及防晒功能。适合夏季和视屏工作者使用。 </P><P>　　*紧实眼霜：富含滋养成分，油性成分高于滋润眼霜，适于黑眼圈、衰老、干性肤质的女性。 </P><P>　　*抗敏眼霜：适宜敏感性肤质的女性。 </P><P>　　促进眼霜吸收的按摩方法 </P><P>　　*首先在眼睛四周均匀地点上眼霜。 </P><P>　　*然后按内眼角、上眼皮、眼尾、外眼角的顺序轻轻按摩，直至肌肤完全吸收。</P><P>　　*在按摩过程中，轻压眼尾、下眼眶，你会感到格外舒服。 </P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('803','6','1','1','http://www.iface.com.cn/article/6273/','如何去除油脂粒2006-03-14','array (\n  \'title\' => \'如何去除油脂粒\',\n  \'time\' => \'1401428526\',\n  \'content\' => \'		  <P>　　眼周的油脂粒最好待其自然恢复，不要自行去除。如果特别需要处理，建议到专业的\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('804','6','1','1','http://www.iface.com.cn/article/6228/','医学纹眉术2006-03-14','array (\n  \'title\' => \'医学纹眉术\',\n  \'time\' => \'1401428524\',\n  \'content\' => \'		  <P>由于并非所有的人都具有一对自然完美的眉毛，大多需要修饰才富有魅力，于是纹眉术应运而生。</P><P>纹眉术是医学\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('805','6','1','1','http://www.iface.com.cn/article/6209/','不同眉形修饰方式2006-03-14','array (\n  \'title\' => \'不同眉形修饰方式\',\n  \'time\' => \'1401428524\',\n  \'content\' => \'		  <P>　　前眉大多以各种不同的形式分类，如所谓的「一字眉」、「柳叶眉」等， 不过这都不能完全代表眉形的名称，就如同我们提到每种脸形有它的特色，很难 以「圆形」、「方形」表示。 在这儿想要说明的是，以往的眉形设计，只着重在 脸形的搭配，但在讲求「个性化」的今天，除了脸形以外，服装线条的选择、 发型也必须考虑在内，这样的整体感觉更接近自然，也更合乎美感。 不同的眉形 会产生不同的表情，每一种眉形都有不同的角度，光是眉形可以完全改变脸上的表情， 资深的演员更是可以借眉毛传达各种角色而得到观众的赞赏。</P><P>眉形的修饰方式<BR>①用眉毛刷刷眉毛。②用弧度的剪刀剪出一样的长短加以修饰。③由上往下看两边眉，做适当修饰。④夹子是欧美人喜爱的工具，若有充分时间即可一根一根慢慢拔除，但动作要快，否则会很痛。⑤先用温水轻敷并按摩，再用镊子一根一根顺生长方向拔。⑥如果需化妆，最好等10-20分钟后再上妆比较合适。⑦画眉与修饰眉形之前后，均需目测眉形，即使是 专业化妆师，有时也需要以尺、笔等工具辅助测量.⑧以一把尺量眉形前后左右是否有偏差。(用黑色的尺较能看清楚位置)。⑨侧边的角度不要忽略，要看准位置，并重复看左右两边是否匀衡。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
