INSERT INTO `sl_collection_content` VALUES('809','6','1','1','http://www.iface.com.cn/article/6180/','珍珠粉去眼袋面膜2006-03-14','array (\n  \'title\' => \'珍珠粉去眼袋面膜\',\n  \'time\' => \'1401428521\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 取纳米珍珠粉0.15g均匀敷在眼周，用冰袋两个在眼部作冷敷，约３０分钟后，\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('810','6','1','1','http://www.iface.com.cn/article/6157/','美眼与重睑术2006-03-13','array (\n  \'title\' => \'美眼与重睑术\',\n  \'time\' => \'1401428519\',\n  \'content\' => \'		  <P>　　文学上有对眼睛的赞誉之词，如“美目传情”，“眼睛是心灵的窗户”，“黑又亮的大眼睛”等等。拥有一双迷人的眼睛便成为许多爱美人士的梦寐以求。因此，在我国\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('811','6','1','1','http://www.iface.com.cn/article/6152/','眼部皮肤护理方案2006-03-13','array (\n  \'title\' => \'眼部皮肤护理方案\',\n  \'time\' => \'1401428519\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp;&nbsp; 为什么保护眼部皮肤很重要?</P><P>&nbsp;&nbsp;&nbsp; 拥有一双年轻、美丽和动人的眼睛是每个人都向往的。然而，眼睛却是\r</p>        \',\n)');
