INSERT INTO `sl_collection_content` VALUES('814','6','1','1','http://www.iface.com.cn/article/6109/','眼皮下垂的治疗2006-03-13','array (\n  \'title\' => \'眼皮下垂的治疗\',\n  \'time\' => \'1401428516\',\n  \'content\' => \'		  <P>　网友问：大概是由于近视和先天的因素，我的上眼皮有点下垂，眼睛看起来不够大，眼神非常无神，眼角好象下垂的样子，整个人看起来很没有精神，这个是不是可以做手术来纠正？手术以后到完全复原需要多长时间？大约需要多少费用？</P><P>　　大夫答：如果是先天的眼睑下垂是可以手术的，如果是近期出现或者加重的，需要先到医院的神经内科检查有没有其它疾病，才可以手术。这种手术后可以改变你眼睛的外型，和普通的\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('815','6','1','1','http://www.iface.com.cn/article/6106/','眉部的美容2006-03-13','array (\n  \'title\' => \'眉部的美容\',\n  \'time\' => \'1401428516\',\n  \'content\' => \'		  眉部的肌肉主要有额肌，内侧部分额肌与眼轮匝肌相互交织并斜向皱眉肌。额肌的鼻部附着到鼻骨，其余部分的额肌被由帽状腱膜形成的前后鞘包裹。其后鞘向下延续到眶上缘骨膜并参与构成眶隔膜。眉\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('816','6','1','1','http://www.iface.com.cn/article/6084/','眼睛保湿3部曲2006-03-13','array (\n  \'title\' => \'眼睛保湿3部曲\',\n  \'time\' => \'1401428514\',\n  \'content\' => \'		  <P>　　都知道秋冬季节皮肤容易干燥，应注意保湿。其实眼睛也不例外。眼部是最脆弱最易老化的区域，皮肤又薄又敏感，只要没睡好，水喝多一点，隔天马上就有\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('817','6','1','1','http://www.iface.com.cn/article/6074/','眉型修整术2006-03-13','array (\n  \'title\' => \'眉型修整术\',\n  \'time\' => \'1401428514\',\n  \'content\' => \'		  <P>1 四合一无痕粘眉术 <BR>特点:外观无痕迹.不缝针.不拆线.进口粘合胶.术后即可粘水画眉.不影响工作社交活动. <BR>适合人群:纹眉导致眉型不美观.眼角下垂.眉型高低不一.洗眉后留疤痕者.不愿洗眉后重新纹眉者. </P><P>2 失败眉型修复<BR>特点: 外观无痕迹.不缝针.不拆线.进口粘合胶.术后即可粘水画眉.不影响工作社交活动. <BR>适合人群:切眉术后留疤痕者.效果不满意.两侧不对称者.&nbsp; <BR></P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('818','6','1','1','http://www.iface.com.cn/article/6073/','眉弓植入术2006-03-13','array (\n  \'title\' => \'眉弓植入术\',\n  \'time\' => \'1401428514\',\n  \'content\' => \'		  一、美学评价：如果说眼睛是心灵的窗户，那么眉形则是开启这扇窗户的钥匙，眉眼间的整体感更能体现五官的和谐美。<BR>&nbsp;<BR>二、什么样的人适合隆眉弓？<BR>各类单纯的眉弓凹陷、扁平、眉区无立体感者&nbsp; <BR>&nbsp;<BR>三 、手术方法：&nbsp; 局麻下在眉毛内或边缘处做小切口（在眉头或眉尾）进入额骨表面，形成腔穴，放入\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('819','6','1','1','http://www.iface.com.cn/article/6040/','消除眼周油脂粒2006-03-13','array (\n  \'title\' => \'消除眼周油脂粒\',\n  \'time\' => \'1401428514\',\n  \'content\' => \'		  <P>　　为了防患于未然，年纪轻轻的你贪心又不惜血本地买来了极度滋养的眼霜，每天像做功课一样按时使用，结果皮肤正常新陈代谢被破坏，眼周肌肤“营养过剩”；经常化妆的你卸起妆来却草草了事，有时“熊猫眼”还没洗干净就倒头睡去；你常想：眼周肌肤那么脆弱，还是不要“使劲”洗它了吧……突然有一天，你发现下眼睑上长出了星星点点白色的小颗粒！ </P><P>　　简单四招消除眼周油脂粒： </P><P>1.赶快停用营养成分太高的功能性眼霜，改用清透补水的眼部凝露、啫哩。 </P><P>2.使用专门的眼部卸妆液，彻底清除眼部彩妆；即使没有化妆，也用眼部卸妆液轻柔地擦洗眼周肌肤。 </P><P>3.养成睡前洗两次脸的习惯，并用清水彻底冲尽残余，洗后使用棉片蘸取爽肤水进一步清洁眼周。但在清洁过程中不要过度揉搓，避免刺激。 </P><P>4.已经生成的油脂粒最好待其自然恢复，不要自行去除，如果特别需要处理，建议到\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('820','6','1','1','http://www.iface.com.cn/article/6012/','戴隐形眼镜如何化妆2006-03-10','array (\n  \'title\' => \'戴隐形眼镜如何化妆\',\n  \'time\' => \'1401428513\',\n  \'content\' => \'		  &nbsp;&nbsp;&nbsp; 现在配戴隐形眼镜的女性十分普遍，因为褪掉笨重的眼镜框后，能重新展现您迷人的双眸，所以为了使双眼更为明亮美丽外，清洁及保养细节也极重要。 1.化妆前及保养前，就要先戴上隐形眼镜。也就是说在洗脸后就戴上。 2.卸妆前，先将双手洗干净后再将隐形眼镜取下来。 3.避免隐形眼镜上有沾到油脂，容易引起眼睛的疼痛和发炎，所以手部的清洁极为重要。 4.用粉扑或蜜粉时，要轻轻的按及抹，切勿用力扑打，容易将粉末散开而跑到眼睛中，多余的粉可用较大的刷子慢慢的刷下来。 5.涂眼影时，可选择液状的眼线或粉状的铅笔眼线，较不会糊掉。 6.要选择优良的睫毛刷，以不容易脱落的为主，轻轻的刷，小心谨慎，千万别将小刷毛刷掉到眼睛里。 7.使用睫毛膏时，一根一根的慢慢刷，刷完后不要立刻的眨眨眼，最少在刷完后的十秒后，看看睫毛液是否干了，才再自由的眨眼。 8.卸妆时，先洗手，在下隐形眼镜后，再先将卸妆乳液把睫毛膏彻底清洁，最后用清水将眼部清洁卸妆油再洗一遍，直到完全清爽为止。&nbsp; <BR>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('821','6','1','1','http://www.iface.com.cn/article/6011/','眼睑下垂中医疗法2006-03-10','array (\n  \'title\' => \'眼睑下垂中医疗法\',\n  \'time\' => \'1401428513\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; （一）</P><P>&nbsp;&nbsp;&nbsp; 【辨证】脾肾虚损，气血失和，经脉失养。</P><P>&nbsp;&nbsp;&nbsp; 【治法】补脾益肾。</P><P>&nbsp;&nbsp;&nbsp; 【方名】温肾益脾汤。</P><P>&nbsp;&nbsp;&nbsp; 【组成】党参20克，黄芪25克，芡实10克，金樱子10克，巴戟10克，仙茅25克，肉桂5克。</P><P>&nbsp;&nbsp;&nbsp; 【用法】水煎服，每日1剂，日服2次。</P><P>&nbsp;&nbsp;&nbsp; 【出处】李树</P><P>&nbsp;&nbsp;&nbsp; 方。</P><P>&nbsp;&nbsp;&nbsp; （二）</P><P>&nbsp;&nbsp;&nbsp; 【辨证】肾脾气弱，筋脉弛缓，眼胞下垂。</P><P>&nbsp;&nbsp;&nbsp; 【治法】益气补中，健脾助化。</P><P>&nbsp;&nbsp;&nbsp; 【方名】补中益气汤加减。</P><P>&nbsp;&nbsp;&nbsp; 【组成】党参12克，白术10克，茯苓10克，炙甘草6克，黄芪10克，当归10克，广皮3克，升麻3克，桔梗3克，苍术5克，晚蚕砂10克。</P><P>&nbsp;&nbsp;&nbsp; 【用法】水煎服，每日1剂，日服2次。<BR></P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('822','6','1','1','http://www.iface.com.cn/article/6010/','眼睛的保健方法2006-03-10','array (\n  \'title\' => \'眼睛的保健方法\',\n  \'time\' => \'1401428512\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; （1）平时注意营养，多吃新鲜蔬菜，不要偏食。</P><P>&nbsp;&nbsp;&nbsp; （2）看书或报纸时，眼睛与书面保持30公分、45度角的距离，并避免长时间近距离使用眼睛。</P><P>&nbsp;&nbsp;&nbsp; （3）避免在乘车、光线不足或光线强烈的地方看书，看书时光源应均匀地由背后或左斜方投射过来。</P><P>&nbsp;&nbsp;&nbsp; （4）避免使用不洁毛巾或公共冼脸用具，以防感染。</P><P>&nbsp;&nbsp;&nbsp; （5）做到充分睡眠及户外活动，时常集中精神远望。</P><P>&nbsp;&nbsp;&nbsp; （6）定期作视力检查。&nbsp; <BR></P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('823','6','1','1','http://www.iface.com.cn/article/6009/','眼睑清洁方法2006-03-10','array (\n  \'title\' => \'眼睑清洁方法\',\n  \'time\' => \'1401428512\',\n  \'content\' => \'		  &nbsp;&nbsp;&nbsp; 将少许婴儿洗发精倒入脸盆，加入20倍的清水稀释均匀。将沾有稀释洗发精的棉花棒或棉球，搓洗眼睫毛根部，将眼睑缘油脂分泌物除去，左右眼使用不同一支棉花棒或棉球。用清水将外眼睑洗净。若再加以热毛巾敷双眼，效果更佳，每次5-10分钟，每天二次。在睡觉前同时做双眼清洁。&nbsp; <BR>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
