INSERT INTO `sl_collection_content` VALUES('825','6','1','1','http://www.iface.com.cn/article/6007/','纹眉成功标准2006-03-10','array (\n  \'title\' => \'纹眉成功标准\',\n  \'time\' => \'1401428512\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 纹眉后两周观察，属下列情况者，文眉即成功。</P><P>&nbsp;&nbsp;&nbsp; 1.在较远处看，感觉眉形较为漂亮，清秀而有神情，眉毛的颜色浓淡适宜，富于立体感，使整个\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('826','6','1','1','http://www.iface.com.cn/article/6006/','纹眼线的成功标准2006-03-10','array (\n  \'title\' => \'纹眼线的成功标准\',\n  \'time\' => \'1401428511\',\n  \'content\' => \'		  　　一般来说，眼线的弧度要自然、圆滑、流畅，上粗下细，比例约为7：3，内窄外宽，深浅适中，方能表现眼睛的深度，烘托出美丽的眼睛；上睫毛浓而长，上眼线颜色可纹深些、粗些，下眼线应细而淡，这样强调上眼线使眼睛显得有成熟感；小眼睛最好只纹上眼线，若上下眼线全纹会使眼睛显得更小；圆眼睛应纹得细长，以增加曲线的长度；细长的眼睛，则应纹得短粗，以增添曲线的弧度。 		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('827','6','1','1','http://www.iface.com.cn/article/6004/','眉型改变脸部视觉2006-03-10','array (\n  \'title\' => \'眉型改变脸部视觉\',\n  \'time\' => \'1401428511\',\n  \'content\' => \'		  <P>　　眉毛的形状绝对能改变脸部的视觉印象！过细或是过粗都算不能算是优秀的眉型。</P><P>　　步骤1. 先将多余的杂毛剔除 </P><P>　　先将剃刀从发际处开始由上往下剔除</P><P>　　眉毛到发际这个地带很容易长出杂毛一定要在描绘眉型之前剔除干净。先从发际处开始往下剔除至眉毛的上方后停止。 </P><P>　　以由下往上的方式再次将杂毛剃干净</P><P>　　为了避免有些角度无法将杂毛完整的剔除，因此要以由下往上（眉毛→发际）的方向再做一次剔除的动作确保完全清除杂毛。 </P><P>步骤2. 利用剪刀来做修剪 </P><P>　　顺着眉峰的边缘来修剪眉上的杂毛</P><P>　　先将想要的眉型大致框出来之后，将超出眉型上方的杂毛全部剪掉。避免给人一种眉毛参差不齐的感觉。</P><P>　　以水平的方式来修剪眉下的杂毛</P><P>　　使用眉毛刷先将所有的眉毛往下梳，过长的部份就以水平的剪法来做修饰。切记剪刀要小部份小部份的来修剪才是正解。 </P><P>步骤3. 正确描绘眉型教学 </P><P>　　画眉毛首先要注意的重点就是“下笔不要太重”。</P><P>　　先从眉头开始描绘到眉峰的位置，眉头要画的淡一点，到眉峰再开始画的浓一些。</P><P>　　接着是描绘眉峰到眉尾的部份</P><P>　　眉峰到眉尾可以画深一点，但是眉尾不要画超过眼尾的位置。最后还可以再擦上染眉膏让眉毛与发色更加的接近，会比较有整体感。 </P><P>　　最后在眉头＆鼻梁擦上眉粉</P><P>　　想要让眉毛与眼睛更具有立体就要再加上一道程序。只要在眉头到鼻梁擦上淡淡的一层眉影粉制造出阴影感，就能为眼神魅力加分。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
