INSERT INTO `sl_collection_content` VALUES('834','6','1','1','http://www.iface.com.cn/article/5584/','织眉与绣眉的区别2006-03-07','array (\n  \'title\' => \'织眉与绣眉的区别\',\n  \'time\' => \'1401428508\',\n  \'content\' => \'		  <P>　　现在又开始流行织眉的了，不知这种方法与往的绣眉有什么不一样？</P><P>　　专家回复：当然了除了以上所说的以外那么就是不同手法做出来的效果也回不一样的那在工做之前呢我门要根据模特的情况来选择所用的手法</P><P>　　专家回复：我认为没有什么本质上的区别，只是运用的手法不同以及用的工具不同。</P><P>　　用切眉法好不好？ </P><P>　　我的眼皮有些松了，想整一下，用切眉法和作\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('835','6','1','1','http://www.iface.com.cn/article/5527/','眉型再造术2006-03-07','array (\n  \'title\' => \'眉型再造术\',\n  \'time\' => \'1401428508\',\n  \'content\' => \'		  　　 由于年龄的增长渐渐眉毛下垂成八字眉，或纹眉术后导致的眉形欠佳，洗眉引起的颜色不匀等，使得\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('836','6','1','1','http://www.iface.com.cn/article/5497/','何为上下眼睑去皱2006-03-06','array (\n  \'title\' => \'何为上下眼睑去皱\',\n  \'time\' => \'1401428507\',\n  \'content\' => \'		  　　通常当年龄超过45岁后，其上下眼睑会逐渐出现一些皱纹，随年龄增长皱纹会越来越多。我们通过去除上下眼睑多余皮肤的方法消除皱纹叫上下眼睑去皱术。 这种手术可以去除上下眼睑绝大部分的皱纹，同时还能去除眼睑松弛、下垂和老化的皮肤，去除眼睑多余的\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('837','6','1','1','http://www.iface.com.cn/article/5472/','涂眼霜用无名指2006-03-06','array (\n  \'title\' => \'涂眼霜用无名指\',\n  \'time\' => \'1401428507\',\n  \'content\' => \'		  <P>　　用眼霜来保护眼部皮肤是现代女性常用的一种做法。但我们娇弱的眼周肌肤经不起过多的营养和过大的力度，所以正确的使用方法很重要。</P><P>　　首先是眼霜的用量。眼部皮肤极薄，用得太多不但不能吸收，相反还会造成负担，加速衰老。所以每次用绿豆大小的两粒即可。其次要注意眼部的按摩。应顺着内眼角、上眼皮、眼尾、下眼皮做环形按摩，按摩时不要向下用力，应该向上舒展按摩。按摩的时间也不宜太长，控制在3—5分钟。需要注意的是，有些人习惯用食指或中指涂眼霜，其实，食指或中指的力道对于眼部皮肤仍然重了些，容易使皮肤长出皱纹。无名指比较柔软细腻，不会伤害敏感的眼周，所以最好用无名指，并用指肚轻轻按压眼周的穴位，可以有效帮助眼霜吸收。</P><P>　　此外，要注意手的卫生，避免造成眼霜二次污染，尤其是指甲缝要干净。不可抹到眼睑、睫毛或眼内，以免对眼睛造成伤害。<BR></P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
