INSERT INTO `sl_collection_content` VALUES('839','6','1','1','http://www.iface.com.cn/article/5436/','黑眼圈的形成与养护2006-03-06','array (\n  \'title\' => \'黑眼圈的形成与养护\',\n  \'time\' => \'1401428506\',\n  \'content\' => \'		  <P>　　黑眼圈的形成与以下因素有关：睡眠不足，疲劳过度，使眼睑得不到休息，处于紧张收缩状态，该部位的血流量长时间增加，引起眼圈皮下组织血管充盈，从而导致眼圈淤血，滞留下黯黑的阴影；肾气亏损，使两眼缺少精气的滋润，使黑色浮于上，因此眼圈发黑；久病体弱或大病初愈的人，由于眼周围皮下组织薄弱，皮肤易发生色素沉着，并极易显露在上、下眼睑上，出现一层黑圈；月经不调的女性，如功能性子宫出血、原发性痛经、月经提前、错后、经期过长、经量过大等，均会出现黑眼圈。 </P><P>　　黑眼圈形成后应对症下药，请教医生，找出病因，及时治疗；要保持精神愉快，减少精神负担，生活有规律，节制烟酒，保障充足的睡眠，促使气血旺盛，容颜焕发；加强眼部的按摩，改善局部血液循环状态，减少淤血滞留；保持眼部皮肤的营养供应，涂含油分、水分充足的眼霜，使眼部皮肤及皮下组织充满活力；注意从饮食中吸取营养，多吃瘦肉、蛋类、豆制品、花生、黄豆、芝麻、新鲜蔬菜及水果等，富含\r</p>        \',\n)');
