INSERT INTO `sl_collection_content` VALUES('841','6','1','1','http://www.iface.com.cn/article/5356/','眼霜使用后的副作用2006-03-03','array (\n  \'title\' => \'眼霜使用后的副作用\',\n  \'time\' => \'1401428505\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 问：我想知道市面上卖的眼霜，使用后会不会有副作用。用了以后会不会长油脂粒。怎么保护眼周的皮肤？用眼贴膜好不好？</P><P>&nbsp;&nbsp;&nbsp; 答：只要根据自己的皮肤类型选择合适的眼霜是不会出现油脂粒的。一般干性皮肤容易比较早出现细纹，由于皮脂分泌少，皮肤相对比较薄，弹性差造成的。所以选择补充水分的凝胶或比较滋润的霜剂都可以，同时还应该配合含维甲酸或果酸的眼霜交替使用，效果更好。如果本身皮肤比较油，单纯补充水分和营养的凝胶就可以。&nbsp; </P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('842','6','1','1','http://www.iface.com.cn/article/5354/','消除黑眼圈五法2006-03-03','array (\n  \'title\' => \'消除黑眼圈五法\',\n  \'time\' => \'1401428505\',\n  \'content\' => \'		  <P>　　多数人的黑眼圈是后天原因，即因经常熬夜、吸烟、清除眼影妆不彻底或睡觉时枕头太低而形成的。怎样消除掉黑眼圈，兹介绍以下几种方法：</P><P>&nbsp;&nbsp;&nbsp; 一、涂蜂蜜法：在洗脸后勿擦干脸上的水分，让其自然干，然后在眼部周围涂上蜂蜜，先按摩几分种，再等10分种后用清水洗净，水不要擦去使其自然干，涂上面霜即可。</P><P>&nbsp;&nbsp;&nbsp; 二、敷酸奶法：用纱布蘸上些酸奶，敷在眼睛周围，每次十分钟。</P><P>&nbsp;&nbsp;&nbsp; 三、热鸡蛋按摩法：将鸡蛋煮熟后去壳，用小毛巾包裹住，合上双眼用鸡蛋按摩眼睛四周，可加快血液循环。</P><P>&nbsp;&nbsp;&nbsp; 四、苹果片敷眼法：将含汁量多的苹果切片，敷双眼每次15分钟。</P><P>&nbsp;&nbsp;&nbsp; 五、土豆片敷眼法：土豆去皮切成约2厘米的厚片，外敷双眼每次5分钟。 </P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
