INSERT INTO `sl_collection_content` VALUES('845','6','1','1','http://www.iface.com.cn/article/5044/','美目贴使用技巧2006-03-01','array (\n  \'title\' => \'美目贴使用技巧\',\n  \'time\' => \'1401428504\',\n  \'content\' => \'		  　　目前市面上成型的美目贴大多分两种，要么宽而短，要么细而长；颜色上，以透明的居多，此外还有彩色的美目贴，有的还会有珠片的闪亮效果。<BR>&nbsp;<BR>　　不管是哪种美目贴，对原物不做一番修剪直接往单眼皮上一粘，肯定不对。\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('846','6','1','1','http://www.iface.com.cn/article/4913/','纹绣眉毛须知2006-02-27','array (\n  \'title\' => \'纹绣眉毛须知\',\n  \'time\' => \'1401428503\',\n  \'content\' => \'		  <P>　　1．色的调配：<BR>根据发色、肤色、眼球色、年龄、职业配制相应的颜色。 </P><P>　　2．形的设计：<BR>根据脸形、职业、性格、天然条件进行设计一对成功的眉形。</P><P>　　3．专业度：<BR>纹绣眉的技术要求严格，源于纹绣的蔬密度和力度、腕力的配合， 随着天然眉的生长方向一根根纹绣，讲求立体效果，具有虚实感和空间感。</P><P>　　4．纹绣于皮肤组织的关系：<BR>人的皮肤分为三层，由外向内―皮下组织，真皮，表皮。表皮是皮肤最外一层，有保护作用，表皮的生理组织是由外向内分为五层，即角质层、透明层、颗粒层、棘层、基底层，纹绣的位置就在表皮中的颗粒层进行，表皮没有血管，但有许多神经末梢，所以纹绣中不会出血、不红不肿，无需任何防护措施。如果需要保持长久的眉色，可纹绣到棘层和基底层之间的一个位置，千万不能纹绣到真皮层，到了真皮层就会有不良后果出现。 </P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
