INSERT INTO `sl_collection_content` VALUES('848','6','1','1','http://www.iface.com.cn/article/4907/','消除黑眼圈方法2006-02-27','array (\n  \'title\' => \'消除黑眼圈方法\',\n  \'time\' => \'1401428502\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp;&nbsp; 黑眼圈是由于过度疲劳、睡眠不足、烟酒刺激，性生活过度体虚以及大病初愈等因素引起的，有碍\r</p>        \',\n)');
