INSERT INTO `sl_collection_content` VALUES('851','6','1','1','http://www.iface.com.cn/article/4798/','怎样提升下垂眉和眼角2006-02-24','array (\n  \'title\' => \'怎样提升下垂眉和眼角\',\n  \'time\' => \'1401428501\',\n  \'content\' => \'		  &nbsp;&nbsp;&nbsp;&nbsp; 通过做拉皮手术的方法对下垂的眉和眼角会有一个非常大的改变,效果准确持久.但拉皮手术的创伤较大，恢复的时间较，所以有相当一部分人不能接受拉皮手术.现在经过我们医生多年的研究,不断的改进，发现通过眉下缘切口,祛除上眼睑松驰的皮肤对改善下垂松弛的眉毛和眼角效果非常好，而且手术创伤小，恢复快，已普遍为广大求美者所接受。眉上提术的目的,为将下垂的眉梢上提,可在眉下缘或上缘皮肤交界处切除适当的皮肤及皮下组织,调整眉毛的高度和外形。		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('852','6','1','1','http://www.iface.com.cn/article/4767/','让睫毛长长的诀窍2006-02-24','array (\n  \'title\' => \'让睫毛长长的诀窍\',\n  \'time\' => \'1401428501\',\n  \'content\' => \'		  <P>　　眼睛是心灵的窗口，一双明眸也需要翘卷纤长的睫毛去映衬，今天，titi教大家一些小心得。</P><P>　　必备</P><P>　　①一盒维生素E胶丸。推荐上海中洋海洋生物工程股份有限公司东海制药厂出品的花了3.5元。VE胶丸的成分都差不多，记得一定要到药店去买哦！另外，说些小心得，去平价药店2元就买到了。</P><P>　　②橄榄油。不要食用的那种哦。</P><P>　　工具</P><P>　　我强烈推荐唇刷，一般外面小店里7元就能买到。一定要用刷子，否则会满手满眼都是油!最好最好不要用那种伸缩式的唇刷太软，会戳到眼睛里。睫毛刷的话，也不太好，因为不好沾取VE。</P><P>　　步骤</P><P>　　①取出一粒胶丸，用一只牙签扎破，然后挤出一点沾在唇刷上，就开始涂眼睫毛，一定要仔细，眼角睫毛稀疏的地方更不能错过！</P><P>　　②最后在画眼线的部位，也就是睫毛根部涂上，这时胶丸里的液体还剩一大半，就用来涂嘴唇、指甲还有手，都可以的。</P><P>　　③最后将橄榄油用同样的方法涂一遍在睫毛。</P><P>　　特别提示</P><P>　　要早晚涂哦。如果每天坚持，并且动作到位，一般10天就能见效了。祝愿每一个爱美的mm都拥有一双扑闪扑闪的长睫毛。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('853','6','1','1','http://www.iface.com.cn/article/4738/','预防眼袋建议2006-02-24','array (\n  \'title\' => \'预防眼袋建议\',\n  \'time\' => \'1401428501\',\n  \'content\' => \'		  <P>　　1.眼睛周围的皮肤极之薄弱，化妆或卸妆的时候，动作要轻柔，切忌用力拉扯皮肤。</P><P>　　2.画下眼线时以不拉动眼皮为原则，可以用乾粉扑轻按在面上来稳定手的位置，这便不会画错位置了。</P><P>　　3.洗面时，用棉花抹洗眼睛周围的皮肤，比用粗糙的毛巾好。</P><P>　　4.配戴隐形眼镜的时候，不要拉下眼皮，如果想方便地戴上镜片，可轻轻拉高上眼皮。</P><P>　　5.不要养成擦眼睛、眯眼睛、眨眼睛的坏习惯；阳光猛烈的时候要戴上太阳眼镜。</P><P>　　6.切忌减肥、节食，以致营养不良或体重突然下降的现象出现，因为\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('854','6','1','1','http://www.iface.com.cn/article/4737/','赶走眼角细纹方法2006-02-24','array (\n  \'title\' => \'赶走眼角细纹方法\',\n  \'time\' => \'1401428500\',\n  \'content\' => \'		  <P>　　干燥冷冬，发现眼角细纹突然就多出来了。眼部周围的皮肤薄嫩、敏感，在缺水干燥的季节，很容易就产生可怕的皱纹。对于爱美的女性，细微之处的保养可是重中之重哦！姐妹们，让我们齐心协力，一起把眼角细纹赶走……</P><P>　　Point A 选用合适的眼霜</P><P>　　眼部皮肤如此纤薄，所以在选用护理产品时才要更加注意。一般应选用不含油性、含维他命E颗粒、天然植物萃取而成的眼部修护品。这样才能避免刺激眼部周围皮肤，防止水分流失，让肌肤在细心的呵护下，变得紧绷有弹力。<BR>&nbsp;<BR>　　Point B 早晚护理</P><P>　　在干燥的季节，早晚护理眼部，变得尤为重要起来。早晨可选用柔和的啫喱眼部凝露，以年轻活化你的肌肤；到了晚上，使用更有滋养成分的眼部精华液和眼霜，可使你的眼部细肤得到完好的休息与保养。</P><P>　　Point C 按摩改善眼部疲劳</P><P>　　除了使用护理产品之外，适度的按摩也可缓解眼部压力，让肌肤得到应有的休息。OL在工作时，可每隔1-2个小时将眼睛轻闭休息五分钟。将中指轻轻压在眼球上，沿着半球轮廓，缓缓按摩。<BR>&nbsp;<BR>　　Point D 轻柔卸妆</P><P>　　眼部清洁也是关系皮肤细致程度的重要因素。对眼部护理而言，卸妆的方法和步骤也是非常关键的。必须选用柔和无刺激性的卸妆水，才能避免刺伤眼部周围皮肤。在卸妆时，手势一定要细致轻柔。</P><P>　　Point E 饮食养护</P><P>　　猪蹄、猪皮、猪肘、鸡皮、鱼头、鱼鳞汤等富含胶原蛋白的食物，能使细胞变得丰满，从而减少细纹，令肌肤变得光滑富有弹性。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('855','6','1','1','http://www.iface.com.cn/article/4469/','改眉手术会留疤痕吗2006-02-22','array (\n  \'title\' => \'改眉手术会留疤痕吗\',\n  \'time\' => \'1401428500\',\n  \'content\' => \'		  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 改眉手术通常在自身的眉形处做切口,愈后不留任何痕迹，但如果原来的坏眉较宽,需要祛除的组织较多,那么切眉后少部分人会留任何痕迹,这样的顾客一般建议在切眉后最少一月可以采用柔绣的方式来达到一个很完美的效果。<BR>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('856','6','1','1','http://www.iface.com.cn/article/4468/','下垂眉和眼角整容方法2006-02-22','array (\n  \'title\' => \'下垂眉和眼角整容方法\',\n  \'time\' => \'1401428499\',\n  \'content\' => \'		  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 通过做拉皮手术的方法对下垂的眉和眼角会有一个非常大的改变,效果准确持久.但拉皮手术的创伤较大，恢复的时间较，所以有相当一部分人不能接受拉皮手术.现在经过我们医生多年的研究,不断的改进，发现通过眉下缘切口,祛除上眼睑松驰的皮肤对改善下垂松弛的眉毛和眼角效果非常好，而且手术创伤小，恢复快，已普遍为广大求美者所接受。眉上提术的目的,为将下垂的眉梢上提,可在眉下缘或上缘皮肤交界处切除适当的皮肤及皮下组织,调整眉毛的高度和外形. 		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
