INSERT INTO `sl_collection_content` VALUES('859','6','1','1','http://www.iface.com.cn/article/4402/','9种人不适合纹眉纹眼线2006-02-22','array (\n  \'title\' => \'9种人不适合纹眉纹眼线\',\n  \'time\' => \'1401428498\',\n  \'content\' => \'		  <P>　　作为眼科医生，常常遇到因为做了眉和眼纹刺手术而丑容，甚至毁容的患者，所以在这里我们提醒大家，做眉和眼纹刺要谨慎！</P><P>　　眉和眼纹刺手术实质上是一种创伤性皮肤着色术。它是用纹刺器械将颜料植染于皮肤组织内，形成长期不褪色的新的眉形和眼线，俗称纹眉和纹眼线。不是所有的人都适合做这种手术，也不是所有的人都能收到理想的效果。所以，在接受手术之前要全方位了解纹眉和纹眼线。</P><P>　　哪些人适合纹眉纹眼线</P><P>　　眉和眼与容貌和情感的表露有密切关系，所以眉和眼历来都是人们修饰面容的重要部位。传统的画眉和画眼线方法费时又费力，所以就应运而生了纹眉和纹眼线的方法。一般认为适合纹眉和纹眼线的主要有以下几种人：</P><P>　　由于疾病或其他原因引起的眉毛或睫毛脱落。</P><P>　　眉毛或睫毛稀疏、色浅。</P><P>　　外伤或手术引起的眉毛或睫毛缺损、眉中或眼睑睑缘瘢痕。</P><P>　　因职业需要而无时间画眉或画眼线者。</P><P>　　两侧眉型不对称、眉型不理想或对原眉型不满意者。</P><P>　　18岁以上，要求纹眼线者，特别是小眼睛、\r</p>        \',\n)');
