INSERT INTO `sl_collection_content` VALUES('863','6','1','1','http://www.iface.com.cn/article/4116/','眼周保养眼霜很重要2006-02-20','array (\n  \'title\' => \'眼周保养眼霜很重要\',\n  \'time\' => \'1401428497\',\n  \'content\' => \'		  <P>　　Jean 38岁 美术编辑 <BR>　　Jean非常重视眼部肌肤的保养，虽然已近四十，Jean的眼部肌肤却是相当紧实，只是眼角有些小细纹，而眼周下方的黑眼圈，也是她相当在意的困扰。 <BR>　　试用心得： </P><P>　　在分别试用过植村秀β-G活采修护眼霜和CAUDALIE葡萄蔓反转醇眼部精华液之后，Jean表示，植村秀β-G活采修护眼霜的质地相当清爽，一下子就完全被吸收了，但是也因此感觉似乎不够滋润，大概比较适合年轻一点的肌肤使用吧！在试用了一个星期之后，感觉黑眼圈有淡化一点，眼部肌肤也满紧实的。 </P><P>　　至于CAUDALIE葡萄蔓反转醇眼部精华液，在使用时相当好推抹，触感柔滑，眼皮会有一点热热的感觉，滋润度不错，吸收之后肌肤会有紧实、绷绷的感觉，而且保湿度还满持久的。试用一星期后，眼角细纹和黑眼圈似乎都淡化了一点。比较起来，CAUDALIE葡萄蔓反转醇眼部精华液应该比较合乎她的需求。 <BR>　　Yevon 30岁 媒体工作者 <BR>　　因为长时间面对计算机屏幕且常熬夜，所以细纹和黑眼圈却经常与她相随，而轻微的\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('864','6','1','1','http://www.iface.com.cn/article/4100/','预防眼袋新主张2006-02-20','array (\n  \'title\' => \'预防眼袋新主张\',\n  \'time\' => \'1401428496\',\n  \'content\' => \'		  <P>　　 1.眼睛周围的皮肤极之薄弱，化妆或卸妆的时候，动作要轻柔，切忌用力拉扯皮肤。 </P><P>　　2.画下眼线时以不拉动眼皮为原则，为求方便，可以用乾粉扑轻按在面上来稳定手的位置，这便不容易画错位置了。 </P><P>　　3.洗面时，用棉花抹洗眼睛周围的皮肤，比用粗糙的毛巾好。 </P><P>　　4.配戴隐形眼镜的时候，不要拉下眼皮，如果想方便地戴上镜片，可轻轻拉高上眼皮。 </P><P>　　5.不要养成擦眼睛、眯眼睛、眨眼睛的坏习惯；阳光猛烈的时候要戴上太阳眼镜。 </P><P>　　6.切忌减肥、节食，以致营养不良或体重突然下降的现象出现，因为\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('865','6','1','1','http://www.iface.com.cn/article/4098/','滋养眼霜使用小误区2006-02-20','array (\n  \'title\' => \'滋养眼霜使用小误区\',\n  \'time\' => \'1401428496\',\n  \'content\' => \'		  <P>　　1. 25岁之后才要用眼霜 </P><P>　　对于大多数office girl来说，一刻也离不开电脑的工作，被报刊和影视光碟占据的休闲时光，再加上越来越长时间地使用暖气、空调，这样的生活令眼部肌肉疲劳不堪，也许在25岁之前，皱纹就早早地来和你“见面”了。 </P><P>　　2.面霜可以代替眼霜 </P><P>　　眼睛周围的肌肤可不同于其他肌肤，是\r</p>        \',\n)');
