INSERT INTO `sl_collection_content` VALUES('867','6','1','1','http://www.iface.com.cn/article/4075/','你会正确使用眼霜吗2006-02-20','array (\n  \'title\' => \'你会正确使用眼霜吗\',\n  \'time\' => \'1401428495\',\n  \'content\' => \'		  <P>　　25岁是年轻肌肤与老化肌肤的分水岭，老化肌肤的标志就是皱纹生成，而第一条皱纹多生成在眼周。随着使用眼霜人群的逐渐偏低龄化，建议18岁至24岁的年轻女孩也应该养成使用眼霜的习惯。 </P><P>　　STEP1 在早晚洁肤后，用无名指取绿豆大小的眼霜，两个无名指指腹相互揉搓，给眼霜加温，使之更容易被肌肤吸收。 </P><P>　　STEP2 以弹钢琴的方式，均匀地轻轻将眼霜拍打在眼周肌肤上。着重在下眼窝和眼尾至太阳穴的延伸部位多加涂抹。 </P><P>　　STEP3 先从眼部下方，由睛明穴向眼尾轻轻按压。然后从眼部上方，由内向外轻轻按压。 </P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('868','6','1','1','http://www.iface.com.cn/article/4074/','有效消除眼袋好习惯2006-02-20','array (\n  \'title\' => \'有效消除眼袋好习惯\',\n  \'time\' => \'1401428495\',\n  \'content\' => \'		  <P>　　Do　养成早晚用眼霜按摩眼周的习惯。</P><P>　　Don\\\'t　睡前不要吃太咸或喝太多水，枕头太矮也不利。</P><P>　　Do　将木瓜和薄荷泡在热水中，待凉后用绵片吸饱敷在眼下，不仅收细\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('869','6','1','1','http://www.iface.com.cn/article/4072/','眼霜实用小细节2006-02-20','array (\n  \'title\' => \'眼霜实用小细节\',\n  \'time\' => \'1401428495\',\n  \'content\' => \'		  <P>　　眼睛周围的小皱纹和黑眼圈是最能透露女性年龄的因素。再怎么努力，我们也无法掩盖岁月在我们眼周留下来的细微痕迹。记得某一个女艺人说过，饭可不吃，眼霜却不可不用。的确，对女性而言，呵护眼部肌肤是绝对必要的。 </P><P>　　我还年轻，不用着急?</P><P>　　紧绷有弹力、白皙的肌肤是年轻女性的特权。但是您知道吗？女性过了20岁以后，肌肤就开始老化了。‘我还年轻’--这种无知的自信等于您准备无任何戒备地全盘接受老化现象。眼周肌肤是脸部肌肤中最薄、最娇嫩的部分，所以很容易干燥，油脂分泌也较少，其老化速度也比其他部位要快得多。那么该如何护理如此敏感脆弱的眼周肌肤呢？</P><P>&nbsp;</P><P>　　护理 </P><P>　　护理的主要原理就是迅速补水的同时，防止水分流失。用专用眼膜或Pack、修护啫哩、眼霜等产品向眼周提供水分是很重要的一个环节。如果您不习惯于眼霜的粘稠感觉，那么可以用渗透力很强的眼部Essence或修护啫哩类产品。</P><P>　　眼妆用的专用刷应该尽量选择柔软的毛刷，而且上妆时手法也要轻。卸妆时则用眼妆专用的卸妆水。</P><P>　　此外，因为促进皮肤老化的最大敌人是烟，它能加速皱纹的产生，所以如果您想拥有富有弹性的眼部，最好远离烟。</P><P>　　正确的洁肤方法也是很重要的。过于频繁的洗脸反而会破坏皮肤的PH平衡，反之则由脸上残留下来的有害物质导致皱纹的产生。而且，过于深度的洁肤或磨砂膏的使用次数一定要有节制。</P><P>　　抵抗黑眼圈</P><P>　　我们常说的黑眼圈是因为眼周的皮下静脉胀开之后使眼周看起来铁青，这样很容易给人忧郁、病恹恹的感觉。25岁以后经常出现的黑眼圈是因为过度的精神压力和疲惫引起血管循环障碍，使得眼周变得又青又黑。</P><P>　　产生黑眼圈的原因之一，是平时不正确的洗脸方法。一定要养成彻底卸妆的习惯，如果眼线或睫毛膏没洗干净，往往会残留在敏感的眼部肌肤上。所以要用化妆棉沾着眼妆专用卸妆水仔细拭去眼部的彩妆。</P><P>　　原因之二，眼部血液循环不畅通会导致黑眼圈产生。所以，要经常按摩眼周部位，帮助眼部血液循环。用冷、热毛巾交替敷眼，也能促进眼部的血液循环。此外，精神压力大、抽烟、睡眠不足或身体状况欠佳这些都能导致黑眼圈的生成。因此一定要养成有规律、正确的生活习惯。</P><P>　　正确使用眼霜 </P><P>　　涂抹过多的眼霜，反而会产生副作用。分量如黄豆般就已经足够了。为防止细菌滋生，用专用勺来取出眼霜轻轻涂抹于眼部，方向由眼头向眼尾就可以了。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('870','6','1','1','http://www.iface.com.cn/article/4071/','眼部护理经典秘方2006-02-20','array (\n  \'title\' => \'眼部护理经典秘方\',\n  \'time\' => \'1401428494\',\n  \'content\' => \'		  <P>　　岁月的流逝， 恶劣环境的侵蚀， 女人的眼睛也渐渐暗了下来， 那曾经的一池“清泉”在岁月的吸食下日渐干枯，布满皱纹。 </P><P>　　保养出一个细嫩青春的眼部并不是一件容易的事，在保养品不断换代、理念不断更新的前提下，牢记下面的5个经典秘方，做自己的保养专家，一定会让你的眼部比实际年龄年轻10岁。 </P><P>　　1.眼部也用“膜” </P><P>　　要解决恼人的眼角纹、\r</p>        \',\n)');
