INSERT INTO `sl_collection_content` VALUES('872','6','1','1','http://www.iface.com.cn/article/4019/','雷射去除黑眼圈2006-02-17','array (\n  \'title\' => \'雷射去除黑眼圈\',\n  \'time\' => \'1401428493\',\n  \'content\' => \'		  <P>　　所谓黑眼圈就是眼眶部位的眼皮颜色较暗所呈现的外观。黑眼圈与眼皮本身的色素多寡、眼皮内的血管血流颜色、以及光线投射方向等因素有关。&nbsp; </P><P>　　由于眼睑的皮肤厚度是全身最薄的地方，所以皮肤的色素或皮下的血流颜色都容易反映在眼皮表面。此外当光线投射时，会在突出物的背凹处呈现阴影，因此该部位看起来就稍暗。同理，\r</p>        \',\n)');
