INSERT INTO `sl_collection_content` VALUES('874','6','1','1','http://www.iface.com.cn/article/4000/','“种植”假睫毛小心材料过敏2006-02-17','array (\n  \'title\' => \'“种植”假睫毛小心材料过敏\',\n  \'time\' => \'1401428492\',\n  \'content\' => \'		  &nbsp;&nbsp;&nbsp;&nbsp; 漂亮的眼睫毛在人的审美中起着举足轻重的作用，节日期间有不少爱美女士选择去“种植”睫毛。在某报社做记者的小刘最近在\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('875','6','1','1','http://www.iface.com.cn/article/3985/','涂眼霜最好用无名指2006-02-17','array (\n  \'title\' => \'涂眼霜最好用无名指\',\n  \'time\' => \'1401428492\',\n  \'content\' => \'		  <P>　　用眼霜来保护眼部皮肤是现代女性常用的一种做法。但我们娇弱的眼周肌肤经不起过多的营养和过大的力度，所以正确的使用方法很重要。</P><P>　　首先是眼霜的用量。眼部皮肤极薄，用得太多不但不能吸收，相反还会造成负担，加速衰老。所以每次用绿豆大小的两粒即可。其次要注意眼部的按摩。应顺着内眼角、上眼皮、眼尾、下眼皮做环形按摩，按摩时不要向下用力，应该向上舒展按摩。按摩的时间也不宜太长，控制在3—5分钟。需要注意的是，有些人习惯用食指或中指涂眼霜，其实，食指或中指的力道对于眼部皮肤仍然重了些，容易使皮肤长出皱纹。无名指比较柔软细腻，不会伤害敏感的眼周，所以最好用无名指，并用指肚轻轻按压眼周的穴位，可以有效帮助眼霜吸收。</P><P>　　此外，要注意手的卫生，避免造成眼霜二次污染，尤其是指甲缝要干净。不可抹到眼睑、睫毛或眼内，以免对眼睛造成伤害。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('876','6','1','1','http://www.iface.com.cn/article/3922/','单眼皮及双眼皮形成2006-02-17','array (\n  \'title\' => \'单眼皮及双眼皮形成\',\n  \'time\' => \'1401428492\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 单睑，是指上眼睑眉弓下缘到睑缘间皮肤平滑，当睁眼时，无皱襞形成称为单睑，俗称单眼皮。\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('877','6','1','1','http://www.iface.com.cn/article/3921/','睫毛嫁接：眼皮底下危险时尚2006-02-17','array (\n  \'title\' => \'睫毛嫁接：眼皮底下危险时尚\',\n  \'time\' => \'1401428492\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 特别关注 </P><P>&nbsp;&nbsp;&nbsp; 一小滴成分不明的胶水粘上十多根“人造毛”，几十分钟后就在你的眼睛上“嫁接”出美丽动人的睫毛。眼下，“睫毛嫁接”这项\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('878','6','1','1','http://www.iface.com.cn/article/3889/','眼部保养各种方法2006-02-16','array (\n  \'title\' => \'眼部保养各种方法\',\n  \'time\' => \'1401428491\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp;&nbsp; 女人在什么方面最舍得花钱？答案一定是护肤品。而在众多的保养步骤中，眼部是被认为最不容被忽视的。即使一瓶小小的眼霜就相当于脸上涂的所有东西的价钱，爱漂亮、想留住青春的女人还是会不惜一切代价去交换。因为她们知道，第一条细纹很有可能是从眼睛周围开始蔓延开的。如果冬天可以在家用简单的步骤、不高的价钱自制眼部保养品，得到同等于\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('879','6','1','1','http://www.iface.com.cn/article/3870/','眼袋预防与修护2006-02-16','array (\n  \'title\' => \'眼袋预防与修护\',\n  \'time\' => \'1401428491\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; “巧笑倩兮，美目盼兮”是《诗经》里描写我国古代美女眼神的名句。眼睛是五官中最引人注目的焦点，也是整个脸部中最娇柔脆弱的部分，稍不留神，\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('880','6','1','1','http://www.iface.com.cn/article/3869/','眼部皮肤应怎样护理2006-02-16','array (\n  \'title\' => \'眼部皮肤应怎样护理\',\n  \'time\' => \'1401428490\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp;&nbsp; 为什么保护眼部皮肤很重要?</P><P>&nbsp;&nbsp;&nbsp; 拥有一双年轻、美丽和动人的眼睛是每个人都向往的。然而，眼睛却是\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('881','6','1','1','http://www.iface.com.cn/article/3829/','眼霜使用实用问答2006-02-16','array (\n  \'title\' => \'眼霜使用实用问答\',\n  \'time\' => \'1401428490\',\n  \'content\' => \'		  <P>　Q：眼霜是否在25岁后才需要使用？ <BR>　　A：眼霜的使用并不是根据年龄去判断的，要根据个人的肤质、身处的气候、环境等情况去决定使用那种眼部护理产品。如在设有空调的办公室里工作，不但令\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('882','6','1','1','http://www.iface.com.cn/article/3827/','谁最需要使用眼霜2006-02-16','array (\n  \'title\' => \'谁最需要使用眼霜\',\n  \'time\' => \'1401428490\',\n  \'content\' => \'		  <P>　　岁月的流逝， 恶劣环境的侵蚀， 女人的眼睛也渐渐暗了下来， 那曾经的一池“清泉”在岁月的吸食下日渐干枯，布满皱纹。 <BR>　　<BR>　　从理论上来说，无论年纪大小，都不能忽视眼部肌肤的保养和护理。现代生活的紧张节奏和多姿多彩，使得眼部肌肤开始衰老的年龄有逐渐提前的趋势。</P><P>　　什么情况需要使用眼霜呢？</P><P>　　一、油性皮肤：皮肤较油的人的确出现皱纹较晚，但是由于眼部周围皮肤皮脂腺和汗腺的分布特别少，所以即使是油性皮肤的人眼周也会有干燥现象产生，容易由于\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('883','6','1','1','http://www.iface.com.cn/article/3564/','眼部保湿小妙方2006-02-14','array (\n  \'title\' => \'眼部保湿小妙方\',\n  \'time\' => \'1401428490\',\n  \'content\' => \'		  <P>　　一到冬天，陶红特别注意眼部的保湿，因为长时间上妆和北方的气候都更容易让眼角长细纹。除了坚持使用强效补水眼霜外，陶红还喜欢定期敷保湿眼膜，也试过将啫喱状眼膜厚厚地涂在眼周上，都能有效地缓解干纹出现。 </P><P>　　贴士</P><P>　　1.涂抹眼霜时要注意手法，否则会进一步加深眼纹：以无名指沾取适量眼霜，轻轻按压在眼部周围，最后按照内眼角、上眼皮、眼尾、内眼角的次序轻轻打圈按摩五至六次。 <BR>&nbsp;<BR>　　2.眼霜的用量一般为一粒绿豆大小，不宜过多。如果眼部已经长有或容易长油脂粒，请使用啫喱状眼霜。<BR>　　3.眼霜应在柔肤水后、面霜之前涂抹，涂面霜时应避开眼周肌肤。</P><P>　　4.眼霜一般保存在常温下即可。如果已放置到冰箱内保存(低温可加强眼霜的消肿效果)，则不要在再长时间放置在室温下。 </P><P>　　5.若是瓶装的眼霜，最好使用小勺挖取，如果没有小勺，应保持手指的洁净，使用后立即将瓶盖盖紧。 </P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('884','6','1','1','http://www.iface.com.cn/article/3558/','专家谈对付不同眼角细纹2006-02-14','array (\n  \'title\' => \'专家谈对付不同眼角细纹\',\n  \'time\' => \'1401428489\',\n  \'content\' => \'		  <P>　　看到眼角有了皱纹，不少女性都很着急，早晚用眼霜、经常按摩，可是却收效不大。其实，要想使眼角光滑如新，首先要分清自己属于哪种眼纹，然后才能选择不同功效的眼霜来对症治疗。</P><P>　　法国欧莱雅研究院的魏何尼克博士细致地解释了干纹、表情纹、细纹、皱纹的区别。</P><P>　　第一种是干纹 通常眼角发干，不做表情时眼角并没有纹路，对付干纹使用有补水功能的眼霜就可以了。</P><P>　　第二种是细纹 25岁以后的女性都容易产生，它比干纹要深一些，因此需要使用滋润的眼霜，像含维生素E、含紫外线过滤剂以及具有预防皮肤老化功效的眼霜。</P><P>　　第三种是皱纹 是受皮肤老化影响形成的。第四种是表情纹，不光在眼角形成，只要做表情，脸上很多地方都会有。治疗皱纹和表情纹需要使用含抗皱成分，能紧致肌肤、有效支撑皮肤系统的眼霜。像含胶原蛋白、弹性纤维等成分的眼霜都可以提高皮肤的组织密度。不仅如此，魏何尼克博士还提到，如果眼角既有干纹、又有细纹的话，需要早晚分开使用不同功效的眼霜。</P><P>　　一般说来，早晨应该使用含紫外线过滤剂的眼霜，晚上使用具有良好修复功能的眼霜。如果觉得自己判断起来没有把握，可以咨询\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('885','6','1','1','http://www.iface.com.cn/article/3554/','用眼膜去除黑眼圈2006-02-14','array (\n  \'title\' => \'用眼膜去除黑眼圈\',\n  \'time\' => \'1401428489\',\n  \'content\' => \'		  <P>　&nbsp; 眼膜，眼部肌肤问题的急救措施，但眼膜究竟该怎么用才能令效用升值？市面上的眼膜哪种更好用？我们在这里为你解密——<BR>&nbsp;<BR>　　一、敷眼膜前需要彻底清洁肌肤</P><P>　　不要管眼睛上是否化了彩妆，彻底地清洁肌肤都是非常必要的，卸妆油这个步骤绝不能跳过。</P><P>　　二、将眼膜雪藏</P><P>　　冰冰的眼膜会令浮肿的眼睛得到绝对的舒缓。</P><P>　　三、敷眼膜之前先热敷</P><P>　　敷眼膜之前，最好能够先用热毛巾热敷一下眼睛，这样再敷上冰冰的眼膜时，对于眼部的循环会更理想。</P><P>　　四、敷眼膜要有方向感</P><P>　　对于布式的眼膜来说，要从眼头向眼尾的方向敷，而乳状的眼膜，也要从眼头涂向眼尾，千万不可以来回涂。</P><P>　　五、敷眼膜的位置要精准</P><P>　　眼膜到底敷在哪里呢？建议的最佳距离是眼睛下面3毫米的地方，而且只限于下眼。因为上眼的肌肤比较薄，对营养的吸收能力比较有限。如果要敷在上眼，只限于对抗眼睛浮肿。 </P><P>　　六、敷眼膜的时间</P><P>　　这要看每一种眼膜的不同要求，但不可以敷过长的时间，否则恐怕会适得其反。</P><P>　　七、眼霜是眼膜的亲密伙伴</P><P>　　不是说敷了眼膜就足够了，一定要在敷眼膜之后搽上眼霜，这样才能让眼部肌肤得到更好的滋润，如果单单靠敷眼膜，取下后眼部肌肤会有紧绷感，反倒会催生细纹。</P><P>　　八、敷眼膜的最佳时机</P><P>　　a．生理周期后一周——体内雌性激素分泌旺盛，这时敷，最有效</P><P>　　b．泡澡时——借着热气，加速循环</P><P>　　c．睡觉前——让养分在你睡觉的时候发挥作用</P><P>　　九、眼膜不能每天敷</P><P>　　如果每天敷，会长油脂粒的！此外，更不能敷着眼膜睡觉，否则一旦眼膜中的精华液全部挥发了，会带走肌肤中的水分。</P><P>　　十、眼膜的多重功效</P><P>　　你额头的表情纹、眼角的小细纹、干纹都逃不过它的魔力。</P><P>　　眼睛是最容易说出女人年龄秘密的部位，要好好对待它哦，小心泄密.</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('886','6','1','1','http://www.iface.com.cn/article/3507/','眼霜使用与年龄关系2006-02-13','array (\n  \'title\' => \'眼霜使用与年龄关系\',\n  \'time\' => \'1401428488\',\n  \'content\' => \'		  <P>　　其实眼霜和年纪是没有关系的，只和需要有关。很多人问什么时候可以开始用眼霜，我们的意见是17岁就可以了。因为细纹、\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('887','6','1','1','http://www.iface.com.cn/article/3490/','眉毛睫毛-毛发种植术2006-02-13','array (\n  \'title\' => \'眉毛睫毛-毛发种植术\',\n  \'time\' => \'1401428488\',\n  \'content\' => \'		  　　每天早上的必修课：描画眉毛，涂眼睫毛，很多女性都要通过化妆才能获得漂亮的眉形和弯长的睫毛。的确，富有个性的眉毛和扑闪的睫毛给女性平添了几分妩媚与韵味。但是，画上去的眉毛和睫毛总是不太牢固，出汗、下雨或是没有时间化妆时，脸上就黯然失色。 <BR>&nbsp;<BR>　　新一代\r</p>        \',\n)');
