INSERT INTO `sl_collection_content` VALUES('893','6','1','1','http://www.iface.com.cn/article/3413/','绣眉要注意事项2006-02-13','array (\n  \'title\' => \'绣眉要注意事项\',\n  \'time\' => \'1401428486\',\n  \'content\' => \'		  <P>　　现在不少女孩子为了让眉毛漂亮而去绣眉，那么在绣眉前要注意哪些事情呢？ </P><P>　　绣眉师付华介绍，绣眉要根据每个人的容貌、个性、气质绣出各具特色的眉毛，而且还看不出雕琢的痕迹，那才让人看着舒服自然。绣眉前要先设计眉型，通过眉型设计有效地体现出眉毛在\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('894','6','1','1','http://www.iface.com.cn/article/3412/','绣眉与纹眉2006-02-13','array (\n  \'title\' => \'绣眉与纹眉\',\n  \'time\' => \'1401428485\',\n  \'content\' => \'		  <P>　　文眉技术的出现确实解决了一些天生眉形有缺陷、或想改变眉型但又不愿每在花时间画眉的人之烦恼。随着时间的过去，\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('895','6','1','1','http://www.iface.com.cn/article/3410/','怎样正确使用睫毛膏2006-02-13','array (\n  \'title\' => \'怎样正确使用睫毛膏\',\n  \'time\' => \'1401428485\',\n  \'content\' => \'		  <P>　　睫毛膏的种类很多，有金属螺旋状的，有细毛圆圈状的，还有梳子状的，有速干的睫毛膏，也有水容性的。如果是初次使用，最好选用金属螺旋状的，因其使用方便，且不宜褪色。 </P><P>　　涂睫毛膏前先把睫毛卷贴在上 眼皮，然后夹住睫毛，夹好后慢慢把睫毛往上卷，不要用力，以免夹掉睫毛。 </P><P>　　睫毛夹好之后，眼睛稍微往下看，在每根睫毛上涂一点睫毛膏。涂下睫毛时，应把睫毛刷竖立，然后在卷好的睫毛上一根一根地慢慢涂。睫毛膏一般以深色为好，如深褐色、深蓝色等。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('896','6','1','1','http://www.iface.com.cn/article/3406/','轻松去掉黑眼圈2006-02-13','array (\n  \'title\' => \'轻松去掉黑眼圈\',\n  \'time\' => \'1401428485\',\n  \'content\' => \'		  <P>　　有什么便捷的方法去黑眼圈呢？答案就就地取材，用食物，原来有些食物，外敷都有散瘀及促进血液循环作用，不妨一试。</P><P>　　鸡蛋银戒指转眼 </P><P>　　将蛋煲熟，去壳，用毛巾包住，再放纯银戒指。闭上眼睛，在眼部四周转来转去，每边约10次。点解:热力加按摩，可增加眼部血液循环。加埋鸡蛋及纯银的（神奇）作用，有散瘀功用。</P><P>　　马蹄莲藕渣敷眼 </P><P>　　洗净马蹄莲藕，马蹄刮皮，然后将莲藕马蹄切碎。将材料放入榨汗机，再加2杯水搅拌。将水隔渣，然后敷眼10分钟。贴士水可以饮用，双管齐下。临睡前敷效果最好，可以减低日出黑眼圈的机会。莲藕及马蹄以胀身、皮呈光泽及实净为之靓。点解:莲藕及马蹄分别粉质、铁质及蛋白质，有散血去瘀作用。</P><P>　　苹果敷眼 </P><P>　　将苹果切片。紧闭眼睛放上\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('897','6','1','1','http://www.iface.com.cn/article/3404/','巧除鱼尾纹2006-02-13','array (\n  \'title\' => \'巧除鱼尾纹\',\n  \'time\' => \'1401428485\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 一、鸡骨去鱼尾纹 </P><P>　　皮肤缺少了弹性纤维就易形成鱼尾纹。鸡皮及鸡的软骨中含大量的硫酸软骨素，它是弹性纤维中最重要的成分。把吃剩的鸡骨头洗净，和鸡皮放在一起煲汤喝，不仅营养丰富，常喝还能使肌肤细腻，久而之久，鱼尾纹就会减轻了。 </P><P>　　二、啤酒去鱼尾纹 </P><P>　　啤酒中含有大量的维生素B、糖和蛋白质。适量饮用啤酒（每天中餐、晚餐各饮150－250克），可增强体质，减少\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('898','6','1','1','http://www.iface.com.cn/article/3398/','护理眼部要用眼霜2006-02-13','array (\n  \'title\' => \'护理眼部要用眼霜\',\n  \'time\' => \'1401428484\',\n  \'content\' => \'		  <P>　　使用不以年龄划分 </P><P>　　眼霜对于大部分人来说都是必须的。在一些特殊情况下，应及早使用眼霜：其一为极干性皮肤者，极干性皮肤在少女中为数不少，据了解，18~24岁时中性皮肤占大多数，但中性皮肤容易在某些时候呈现偏干或偏油状态。其二为季节因素，很多地方越来越干燥，尤其如今的全球暖冬现象，使很长时间空气湿度越来越小，而暖气、空调器的长时间使用，使\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('899','6','1','1','http://www.iface.com.cn/article/3349/','睫毛能重新长起来2006-02-10','array (\n  \'title\' => \'睫毛能重新长起来\',\n  \'time\' => \'1401428484\',\n  \'content\' => \'		  <P>　　睫毛短而平恐怕成了漂亮mm们的心病了，而时下最最流行的睫毛嫁接便受到了女人们的推崇。如果你也想尝试，我们为你提供了全套的感受体验 。</P><P>　　时下流行的嫁接睫毛是怎么完成的？嫁接的时候会遇到什么样的问题？之后有什么样的感受？怎么能够让你的新“睫毛”更长久地驻留？ </P><P>　　●嫁接睫毛点滴注释</P><P>　　嫁接后的睫毛能够维持多久呢？</P><P>　　一般\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('900','6','1','1','http://www.iface.com.cn/article/3287/','赶走眼角细纹五法2006-02-10','array (\n  \'title\' => \'赶走眼角细纹五法\',\n  \'time\' => \'1401428483\',\n  \'content\' => \'		  　　干燥冷冬，发现眼角细纹突然就多出来了。眼部周围的皮肤薄嫩、敏感，在缺水干燥的季节，很容易就产生可怕的皱纹。对于爱美的女性，细微之处的保养可是重中之重哦！姐妹们，让我们齐心协力，一起把眼角细纹赶走…… <BR>&nbsp;<BR>　　Point A 选用合适的眼霜 <BR>　　眼部皮肤如此纤薄，所以在选用护理产品时才要更加注意。一般应选用不含油性、含维他命E颗粒、天然植物萃取而成的眼部修护品。这样才能避免刺激眼部周围皮肤，防止水分流失，让肌肤在细心的呵护下，变得紧绷有弹力。 <BR>&nbsp;<BR>　　Point B 早晚护理 <BR>　　在干燥的季节，早晚护理眼部，变得尤为重要起来。早晨可选用柔和的啫喱眼部凝露，以年轻活化你的肌肤；到了晚上，使用更有滋养成分的眼部精华液和眼霜，可使你的眼部细肤得到完好的休息与保养。 <BR>&nbsp;<BR>　　Point C 按摩改善眼部疲劳<BR>　　除了使用护理产品之外，适度的按摩也可缓解眼部压力，让肌肤得到应有的休息。OL在工作时，可每隔1-2个小时将眼睛轻闭休息五分钟。将中指轻轻压在眼球上，沿着半球轮廓，缓缓按摩。<BR>&nbsp;<BR>　　Point D 轻柔卸妆 <BR>　　眼部清洁也是关系皮肤细致程度的重要因素。对眼部护理而言，卸妆的方法和步骤也是非常关键的。必须选用柔和无刺激性的卸妆水，才能避免刺伤眼部周围皮肤。在卸妆时，手势一定要细致轻柔。 <BR>&nbsp;<BR>　　Point E 饮食养护 <BR>　　猪蹄、猪皮、猪肘、鸡皮、鱼头、鱼鳞汤等富含胶原蛋白的食物，能使细胞变得丰满，从而减少细纹，令肌肤变得光滑富有弹性。 		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('901','6','1','1','http://www.iface.com.cn/article/3284/','眼睛按摩保健2006-02-10','array (\n  \'title\' => \'眼睛按摩保健\',\n  \'time\' => \'1401428483\',\n  \'content\' => \'		  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 采取坐式或仰卧式均可，将两眼自然闭合。然后依次按摩眼睛周围的穴位。要求取穴准确、手法轻缓，以局部有酸胀感为度。<BR>　　<BR>　　1.揉天应穴：用双手大拇指轻轻揉按天应穴（眉头下面、眼眶外上角处）。<BR>　　<BR>　　2.挤按睛明穴：用一只手的大拇指轻轻揉按睛明穴（鼻根部紧挨两眼内眦处）先向下按，然后又向上挤。<BR>　　<BR>　　3.揉四白穴：用从手食指揉按面颊中央部的四白穴（眼眶下缘正中直下一横指处）。<BR>　　<BR>　　4.按太阳穴、轮刮眼眶：用从手拇指按压太阳穴（眉梢和外眼角的中间向后一横指处），然后用弯屈的食指第二节内侧面轻刮眼眶一圈，由内上-&gt;外上-&gt;外下-&gt;内下，使眼眶周围的攒竹鱼腰、丝竹空、瞳子寥、球后、承泣等穴位受到按摩。对于假性近视、或预防近视眼度数的加深有好处。 		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('902','6','1','1','http://www.iface.com.cn/article/3267/','眼部化妆4忌2006-02-10','array (\n  \'title\' => \'眼部化妆4忌\',\n  \'time\' => \'1401428482\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; ⑴忌无章法。眼妆的化法，应遵循一些固定的基本步骤。第一步是施眼影粉。一般地，眼影粉不能直接抹，应有粉底的基础上施入。涂上以后，要尽量以棉棒匀开使之均匀。第二步是画眼线。画眼线用力要均匀，手不可颤拦，否则会留下弯曲难看的痕迹，犹如画蛇添足。第三步是上睫毛液。睫毛液一次不能上得过多，否则眨眼之时易将睫毛液染到眼皮上。正确的方法是先上一遍，等待干了再上一遍。</P><P>　　⑵忌眼影颜色选择不当。从总体角度来看，以上３步应按部就班依次地进行，不可逆行。在选择化妆品时也应特别注意眼影颜色的选择。银色眼影不太符合东方人的特点。因为东方人眼皮厚、眼眶浅，若再涂上银底的眼影会使眼皮显得更加浮肿。所以最好造反棕色系眼影（暗色）和白色系眼影（明色），高处加亮而凹陷处加暗，这样容易显得有立体感。</P><P>　　⑶忌把小眼睛化成圆形的。小眼睛的女士在眼部化妆过程中，切忌向圆眼方向下功夫。因为，那样会突出原来的缺点，对\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('903','6','1','1','http://www.iface.com.cn/article/3260/','轻松告别眼周脂肪粒2006-02-10','array (\n  \'title\' => \'轻松告别眼周脂肪粒\',\n  \'time\' => \'1401428482\',\n  \'content\' => \'		  <P>　&nbsp;&nbsp;&nbsp; 眼周肌肤尤为娇嫩，所以相对来说更容易浮现小斑点，如果你已经在为这些深色小斑点烦恼不迭的话，不妨尝试一下以下方法，帮您轻松告别这些小斑点。</P><P>&nbsp;&nbsp; 　 方法一：黄瓜眼膜</P><P>&nbsp;&nbsp;&nbsp; 　这款眼膜完全是DIY的，价廉物美，真的很值得尝试。你要做的也很简单，买一根黄瓜，去皮，接下来就看你的刀功了，把黄瓜切片，越薄越好，薄到几乎透明的黄瓜片会很贴服肌肤，而且滋润效果也比厚的来得好很多。如果你刀功确实不行的话，那就试试用刨子刨吧，刨出小薄片来。然后把黄瓜薄片贴在眼周有斑点的地方，闭目养神片刻，揭下黄瓜片即可。由于黄瓜里含有多种氨基酸，Vc含量也很高，所以具有美白和抗氧化的功效。长期使用，效果会很明显的。</P><P>&nbsp;&nbsp;&nbsp; 方法二：美白精华液</P><P>&nbsp;&nbsp;&nbsp; 这个方法简单易行，但自然没有第一种方法廉价。因为你得买一瓶美白精华液，通常比较大的品牌的美白精华液总是\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('904','6','1','1','http://www.iface.com.cn/article/3259/','珍珠粉眼袋法2006-02-10','array (\n  \'title\' => \'珍珠粉眼袋法\',\n  \'time\' => \'1401428482\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 眼睛周围的肌肤是人体皮肤中最敏感的，疲劳、紧张、年龄都会在这儿有所反映。而眼皮又是脸部最容易让人忽视的部位，它比脸颊的皮肤薄４倍。又没有\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('905','6','1','1','http://www.iface.com.cn/article/3258/','眼膜的急救功效2006-02-10','array (\n  \'title\' => \'眼膜的急救功效\',\n  \'time\' => \'1401428482\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp; 现代生活节奏快、环境污染、上网时间渐多、睡眠质量不好使得薄而脆弱的眼睛衰老加快。尽管眼霜可以使眼睛免受眼角纹、\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('906','6','1','1','http://www.iface.com.cn/article/3189/','消除眼部干纹小常识2006-02-09','array (\n  \'title\' => \'消除眼部干纹小常识\',\n  \'time\' => \'1401428481\',\n  \'content\' => \'		  <P>　　你容易长眼周干纹吗？ </P><P>　　□上下班时，要乘1个多小时的空调车 </P><P>　　□办公室里常年有空调 </P><P>　　□代谢循环不是很好，易着凉怕冷，几乎不出汗 </P><P>　　□家里的房间通风不好□常年使用SPF30以上的防晒品□保湿护肤品使用量较少 </P><P>　　□1天8小时以上化妆的时候较多 </P><P>　　□到傍晚时，眼角的小细纹非常明显 </P><P>　　上面这些情况中，若是存在4种以上，你就要特别注意防止干纹的生成了。 </P><P>　　消灭干纹小常识 </P><P>　　Q：眼周为什么容易长干纹？ </P><P>　　A：因为眼部皮肤的皮层非常薄，又缺乏皮脂腺及胶原组织，所以较易受外在环境因素影响而出现各类肌肤问题，如干燥、浮肿、黑眼圈等。</P><P>　　Q：干纹和皱纹有什么关系？ </P><P>　　A：如果加强保湿工作或在湿润的环境中，干纹会消失。但记住，干纹是眼周肌肤缺水的信号，如果不及时护理，会促使眼周长出难以消除的鱼尾纹和表情纹。 </P><P>　　Q：怎样消除眼周干纹？ </P><P>　　A：使用强效保湿眼霜，是最基本的护理方法。极度缺水时，可用眼膜来强化，亦可在眼霜之前使用眼部精华素。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('907','6','1','1','http://www.iface.com.cn/article/3187/','实用眼霜小细节2006-02-09','array (\n  \'title\' => \'实用眼霜小细节\',\n  \'time\' => \'1401428481\',\n  \'content\' => \'		  <P>　　眼睛周围的小皱纹和黑眼圈是最能透露女性年龄的因素。再怎么努力，我们也无法掩盖岁月在我们眼周留下来的细微痕迹。记得某一个女艺人说过，饭可不吃，眼霜却不可不用。的确，对女性而言，呵护眼部肌肤是绝对必要的。 </P><P>　　我还年轻，不用着急?</P><P>　　紧绷有弹力、白皙的肌肤是年轻女性的特权。但是您知道吗？女性过了20岁以后，肌肤就开始老化了。‘我还年轻’--这种无知的自信等于您准备无任何戒备地全盘接受老化现象。眼周肌肤是脸部肌肤中最薄、最娇嫩的部分，所以很容易干燥，油脂分泌也较少，其老化速度也比其他部位要快得多。那么该如何护理如此敏感脆弱的眼周肌肤呢？</P><P>　　护理 </P><P>　　护理的主要原理就是迅速补水的同时，防止水分流失。用专用眼膜或Pack、修护啫哩、眼霜等产品向眼周提供水分是很重要的一个环节。如果您不习惯于眼霜的粘稠感觉，那么可以用渗透力很强的眼部Essence或修护啫哩类产品。</P><P>　　眼妆用的专用刷应该尽量选择柔软的毛刷，而且上妆时手法也要轻。卸妆时则用眼妆专用的卸妆水。</P><P>　　此外，因为促进皮肤老化的最大敌人是烟，它能加速皱纹的产生，所以如果您想拥有富有弹性的眼部，最好远离烟。</P><P>　　正确的洁肤方法也是很重要的。过于频繁的洗脸反而会破坏皮肤的PH平衡，反之则由脸上残留下来的有害物质导致皱纹的产生。而且，过于深度的洁肤或磨砂膏的使用次数一定要有节制。</P><P>　　抵抗黑眼圈</P><P>　　我们常说的黑眼圈是因为眼周的皮下静脉胀开之后使眼周看起来铁青，这样很容易给人忧郁、病恹恹的感觉。25岁以后经常出现的黑眼圈是因为过度的精神压力和疲惫引起血管循环障碍，使得眼周变得又青又黑。</P><P>　　产生黑眼圈的原因之一，是平时不正确的洗脸方法。一定要养成彻底卸妆的习惯，如果眼线或睫毛膏没洗干净，往往会残留在敏感的眼部肌肤上。所以要用化妆棉沾着眼妆专用卸妆水仔细拭去眼部的彩妆。</P><P>　　原因之二，眼部血液循环不畅通会导致黑眼圈产生。所以，要经常按摩眼周部位，帮助眼部血液循环。用冷、热毛巾交替敷眼，也能促进眼部的血液循环。此外，精神压力大、抽烟、睡眠不足或身体状况欠佳这些都能导致黑眼圈的生成。因此一定要养成有规律、正确的生活习惯。</P><P>　　正确使用眼霜 </P><P>　　涂抹过多的眼霜，反而会产生副作用。分量如黄豆般就已经足够了。为防止细菌滋生，用专用勺来取出眼霜轻轻涂抹于眼部，方向由眼头向眼尾就可以了。</P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
