INSERT INTO `sl_collection_content` VALUES('913','6','1','1','http://www.iface.com.cn/article/2938/','睫毛形态与美丽2006-02-07','array (\n  \'title\' => \'睫毛形态与美丽\',\n  \'time\' => \'1401428479\',\n  \'content\' => \'		  <P>　　毛生长于睑缘前唇，排列成2-3行，短而弯曲。上睑睫毛多而长，通常有100-150根，长度平均为8-12mm，稍向前上方弯曲生长；下睑睫毛短而少，约50-75根，长度约为6-8mm，稍向前下方弯曲。故当闭眼时上下睫毛并不交织。一般人上睑睫毛的倾斜度，睁眼平视状态下，男性为110度-130度的占79．8%，闭眼状态时为140度-160度的占83．5%，女性与男性大致相同。男性下睑睫毛平视时为100度-120度，女性较男性小l0度。上下睑中央部睫毛较长、多，内眦部最短。睫毛毛囊神经丰富，故睫毛很繁感，触动睫毛可引起瞬目反应。有保护作用。毛囊周围有汗腺及皮脂腺，它们的排泄管开口于睫毛毛囊中。睫毛的颜色一般较头发深，也不因年老而变白(偶尔可见数根老年性白睫)，但也可由于某种疾病，如白化病，而成白色。</P><P>　　睫毛的平均寿命为3-5个月，不断更新，一根发育的睫毛，自拔除后，一周即可长出1-2mm，约经10周，可达到原来的长度。儿童的睫毛最长，也最弯曲。在日常生活中，常见一些父母为婴幼儿拔除睫毛，以期长出黑又亮的睫毛，这种作法是没有科学依据的，有时甚至会造成感染等意外，而破坏毛囊，造成睫毛的缺失。</P><P>　　上下睑缘睫毛似排排卫士，排列在睑裂边缘，有遮光，防止灰尘、异物、汗水进入眼内，和眼睑一起对角膜、眼球进行保护的作用，故被称为“眼的哨兵”。</P><P>　　细长、弯曲、乌黑、闪动而富有活力的睫毛对眼型美，以致整个容貌美都具有重要的作用。睫毛排列呈半弧形。睫毛可衬托显示眼睛的轮廓，增添眼睛的神韵。上睑睫毛比下睑睫毛长且密。以黑亮、微向上翘者为美，它已成为人类，尤其是女性\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('914','6','1','1','http://www.iface.com.cn/article/2844/','怎样使用眼膜更有效2006-02-06','array (\n  \'title\' => \'怎样使用眼膜更有效\',\n  \'time\' => \'1401428478\',\n  \'content\' => \'		  　　眼膜，眼部肌肤问题的急救措施，但眼膜究竟该怎么用才能令效用升值？市面上的眼膜哪种更好用？我们在这里为你解密—— <BR>　　<BR>　　＊敷眼膜前需要彻底清洁肌肤 <BR>　　<BR>　　不要管眼睛上是否化了彩妆，彻底地清洁肌肤都是非常必要的，卸妆油这个步骤绝不能跳过。 <BR>　　<BR>　　＊将眼膜冷藏 <BR>　　<BR>　　冰冰的眼膜会令浮肿的眼睛得到绝对的舒缓。 <BR>　　<BR>　　＊敷眼膜之前先热敷 <BR>　　<BR>　　敷眼膜之前，最好能够先用热毛巾热敷一下眼睛，这样再敷上冰冰的眼膜时，对于眼部的循环会更理想。 <BR>　　<BR>　　＊敷眼膜要有方向感 <BR>　　<BR>　　对于布式的眼膜来说，要从眼头向眼尾的方向敷，而乳状的眼膜，也要从眼头涂向眼尾，千万不可以来回涂。 <BR>　　<BR>　　＊敷眼膜的位置要精准 <BR>　　<BR>　　眼膜到底敷在哪里呢？建议的最佳距离是眼睛下面3毫米的地方，而且只限于下眼。因为上眼的肌肤比较薄，对营养的吸收能力比较有限。如果要敷在上眼，只限于对抗眼睛浮肿。 <BR>　　<BR>　　＊敷眼膜的时间 <BR>　　<BR>　　这要看每一种眼膜的不同要求，但不可以敷过长的时间，否则恐怕会适得其反。 <BR>　　<BR>　　＊眼霜是眼膜的亲密伙伴 <BR>　　<BR>　　不是说敷了眼膜就足够了，一定要在敷眼膜之后搽上眼霜，这样才能让眼部肌肤得到更好的滋润，如果单单靠敷眼膜，取下后眼部肌肤会有紧绷感，反倒会催生细纹。 <BR>　　<BR>　　＊敷眼膜的最佳时机 <BR>　　<BR>　　a.生理周期后一周——体内雌性激素分泌旺盛，这时敷，最有效 <BR>　　<BR>　　b.泡澡时——借着热气，加速循环 <BR>　　<BR>　　c.睡觉前——让养分在你睡觉的时候发挥作用 <BR>　　<BR>　　＊眼膜不能每天敷 <BR>　　<BR>　　如果每天敷，会长油脂粒的！此外，更不能敷着眼膜睡觉，否则一旦眼膜中的精华液全部挥发了，会带走肌肤中的水分。 <BR>　　<BR>　　＊眼膜的多重功效 <BR>　　<BR>　　你额头的表情纹、眼角的小细纹、干纹都逃不过它的魔力。&nbsp; 		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('915','6','1','1','http://www.iface.com.cn/article/2843/','眼部浮肿:熬夜后护眼有效方法2006-02-06','array (\n  \'title\' => \'眼部浮肿:熬夜后护眼有效方法\',\n  \'time\' => \'1401428478\',\n  \'content\' => \'		  　　眼部浮肿最常发生于早上，因为经过一整夜平卧后，身体的水分容易流向眼部而形成，这情况通常很快可以改善，如果是因为淋巴不畅通而引起的水肿问题便严重得多。 <BR>　　<BR>　　1.清凉感受 <BR>　　<BR>　　当睡眠不足或循环不佳而令眼部出现浮肿时，可使用清爽且具纾缓效果的啫喱眼膜，冰凉的质感能实时消除眼部疲倦及浮肿。早上起床如觉眼睛浮肿可厚厚敷上 Origins Cooling Eye Mask，5 分钟后以海绵抹掉，再薄薄涂一层作整天修护。其它具清凉效果的用品包括：Kenzoki Ice-Cold Eye Cream、Dermalogica Total Eye Care 均有排水及改善血液循环功效。 <BR>　　<BR>　　2.办公室按摩法 <BR>　　<BR>　　长时间坐在办公室，易造成颈部淋巴僵化，令眼部水肿形成。试试把手肘放于桌上，手握拳头在腮下凹陷处转动拳头按摩，淋巴畅通能减少废物在眼皮底层积聚。 <BR>　　<BR>　　3.香熏治疗水肿 <BR>　　<BR>　　利用能纾缓眼睛不适的洋甘菊替过度疲劳的双眸瞬间回复明亮，加上香熏能透过嗅觉神经传送，而天然香熏油可于5分钟直达皮下组织，能加快淋巴及血液循环，提升皮肤并消除浮肿，亦适合需要经常使用计算机的人士使用。<BR>　　<BR>　　　Alqvimia Eye Contour Beauty Extract多种天然香熏成分，更生细胞及刺激胶原蛋白合成。 <BR>　　<BR>　　4.去水肿的香熏成分 <BR>　　<BR>　　天竺葵：新生的部份呈浅绿色，汁液丰富及含大量精油的天竺葵具纾缓与收紧肌肤的功效。 <BR>　　<BR>　　熏衣草：功能繁多的草本植物，能镇静、舒缓、抗毒杀菌、促进细胞再生改善循环。 <BR>　　<BR>　　杜松果：以嗅觉吸收能刺激肾脏功能，排除多余水分及毒素，消除水肿。 <BR>　　<BR>　　紫锥花： 印地安人最先利用紫锥花治疗皮肤伤口，用于\r</p>        \',\n)');
