INSERT INTO `sl_collection_content` VALUES('920','6','1','1','http://www.iface.com.cn/article/2744/','跟黑眼圈说byebye2006-02-05','array (\n  \'title\' => \'跟黑眼圈说byebye\',\n  \'time\' => \'1401428476\',\n  \'content\' => \'		  <DIV>　　熊猫盼盼有双黑眼圈，这是它惹人喜爱的原因之一，不过，你要是有这么一双黑眼圈，恐怕烦恼却会伴着你了。人的皮肤一般有两种颜色：背部较深，腹部较浅。若你的眼部皮肤属背部颜色，那解决黑眼圈的问题实在是有些困难。因为这跟盼盼一样，属于先天的。 <BR>　　 <BR>　　不过，多数人的黑眼圈是后天造成的。因为眼睛周围皮肤过于娇嫩，若不注意日常的护理，特别是涂了眼影卸妆不彻底的话，是很容易造成黑眼圈的。另外，吸烟、睡眠不足也都会让眼睛四周蒙上阴影。值得注意的是，睡觉时枕头太低也不行。 </DIV><DIV>&nbsp;</DIV><DIV>　　当黑眼圈出现时，不必着急烦恼，这里介绍几种消除黑眼圈的方法，不妨一试。 </DIV><DIV>&nbsp;</DIV><DIV>　　1．热鸡蛋按摩：鸡蛋煮熟后去壳，用毛巾包裹住，合上双眼用鸡蛋按摩眼部四周，可加快血液循环。不过注意，用后的鸡蛋恐怕是不能再吃了。 <BR>　　 <BR>　　2．马铃薯片敷眼：马铃薯（长芽的不可使用）去皮洗净，切成约两厘米的厚片，外敷眼部5分钟后，用清水洗净。当然敷过的薯片也是不能再吃了。 <BR>　　 <BR>　　3．苹果片敷眼：苹果洗净切片，敷上眼15分钟后用水洗净。苹果含汁量越高越好。至于用过的苹果片，当然也不能再食用。 <BR>　　 <BR>　　4.泡过后压去茶汁的茶叶袋外敷。 <BR>　　 <BR>　　还有一条需要提醒的是，要想彻底去除黑眼圈，先要去除制造黑眼圈的元凶——熬夜，才是治本的方法。当然，你的黑眼圈若是遗传的，那就另当别论了。</DIV>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('925','6','1','1','http://www.iface.com.cn/article/2638/','计算机族的眼睛保养2006-01-23','array (\n  \'title\' => \'计算机族的眼睛保养\',\n  \'time\' => \'1401428475\',\n  \'content\' => \'		  <P>　　很多人一坐在计算机前面，不管是上网聊天、玩game或是处理公文，常常一坐就是好几个小时，一旦到了一段落时，才觉得自己不但腰酸背痛，而且眼睛也跟着疲劳、酸涩起来，再加上冷气房里的空调，常常使眼睛不自觉的的干涩、发红，如果常此疲劳不加 <BR>以改善的话，不但在外观上会有黑眼圈、白眼球布满血丝等的改变，日久还会造成视力的减退、视神经的不协调等问题。</P><P>　　用眼时的注意事项：</P><P>　　平时使用计算机或看书、看报，最好每30分钟休息个5分钟，站起来走动一下，或看看窗外都可以，把一直注意近距离的视线拉长。</P><P>　　与计算机屏幕的距离不可短于30公分，使用防辐射认证的护目镜，避免辐射线对眼睛的伤害。</P><P>　　若眼睛干涩、发痒，先将眼睛闭起来休息个几分钟，再张开，千万不要用手去柔眼睛。若无改善就必须就医，因为有可能是其它的感染所致。</P><P>　　日常的眼睛保养</P><P>　　多喝水：尤其在有空调的办公室中或是房间里，应特别注意水分的补充，可改善眼睛黏膜干涩状态。</P><P>　　滴眼药水、生理时盐水、人工泪液：有戴隐形眼镜的人常常会靠这类的眼药水来保护眼睛；有些人则是为了防止眼睛干涩，也会在药房自行购买一些眼药水来点，但要注意的是药水的来源，最好还是由医生诊断所开出的，比较保险。因为大部分的眼药水或人工泪液，为了保存方便都会加入防腐剂或杀菌剂，一般人在使用上应该是不会有太大的问题，但若您是过敏性的体质就很难说了。</P><P>　　冷、热敷：在眼睛疲劳的时候可以使用冰敷与热敷交替，但不可冰到或压到眼球，热敷也是一样，一次不超过5分钟，可以配合眼睛上下左右的旋转，，多做几次，可以改善眼睛周围的血循，对因疲劳造成的黑眼圈也有很好的效果。</P><P>　　平时可多吃些含有B-胡萝卜素的食品，如：红萝卜、木瓜、番瓜、绿色蔬菜等，有些人在办公室会泡些枸杞茶、或是决明子茶，这些都是对眼睛很有帮助的东西。</P><P>　　简单的按摩：</P><P>　　眼睛闭上，两手食指按住眼头的位置，轻轻沿着眉骨画到太阳穴，对太阳穴稍加用力按。再由太阳穴往下画到眼头的位置，反复数次。</P><P>　　眼睛闭上，两手食指沿着皮、鼻梁、\r</p>        \',\n)');
INSERT INTO `sl_collection_content` VALUES('935','6','1','1','http://www.iface.com.cn/article/2552/','化妆法隐形眼袋2006-01-20','array (\n  \'title\' => \'化妆法隐形眼袋\',\n  \'time\' => \'1401428470\',\n  \'content\' => \'		  <P>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 上个星期我朋友微微结婚，我去帮她化妆。化妆时她那两个略带黑眼圈的大\r</p>        \',\n)');
