INSERT INTO `sl_collection_content` VALUES('944','6','1','1','http://www.iface.com.cn/article/2383/','护眼宝典2006-01-16','array (\n  \'title\' => \'护眼宝典\',\n  \'time\' => \'1401428465\',\n  \'content\' => \'		  <P>困惑一︰<BR>&nbsp;&nbsp;&nbsp; 每次用完计算机，做完功课，双眼都好痛啊！这样会否变盲？ <BR>解决︰<BR>&nbsp;&nbsp;&nbsp; 这是眼部过度操劳给你的警告，以后当你专注用眼时，最好每隔2小时休息15分钟。这15分钟应该闭上双眼，放松身体，同时可用指腹轻轻按压眼睑，使疲劳得以纾缓；可以的话，可用冷/热毛巾敷眼，这样会感觉舒服一些，亦可减少黑眼圈的形成。<BR>困惑二︰<BR>&nbsp;&nbsp;&nbsp; 听说敷Eye Mask可以去黑眼圈，那一星期敷多少次才足够？<BR>解决︰<BR>&nbsp;&nbsp;&nbsp; 其实Eye Mask的功效也有很多种，消除疲劳、美白、去黑眼圈、去纹等，应选择自己需要的类型使用。Eye Mask一星期敷1-2次便足够，过份敷用可能做成皮肤负担，引起油脂粒或更深的皱纹。<BR>困惑三︰<BR>&nbsp;&nbsp;&nbsp; 化了妆，是否连眼部都要一起卸妆？这样岂不是会太油腻，很容易出油脂粒了吗？<BR>解决︰<BR>&nbsp;&nbsp;&nbsp; 眼部卸妆应该使用专用的卸妆液，这样比较温和，亦较容易卸除如睫毛液这种较难清除的化妆品。<BR>困惑四︰<BR>&nbsp;&nbsp;&nbsp; 睫毛液很难清除干净，大力抹又怕会有皱纹，怎么办？<BR>解决︰<BR>&nbsp;&nbsp;&nbsp; 想温柔又容易地卸除睫毛液，应该先将湿满卸妆液的化妆棉敷在眼上数秒，待卸妆液溶解睫毛液后，才抹拭剩余的残渍，可以用沾上卸妆液的棉花棒，仔细地轻轻擦干净。<BR>困惑五︰<BR>&nbsp;&nbsp;&nbsp; 我的皱纹天生就很深，是否过早衰老的征兆？<BR>解决︰<BR>&nbsp;&nbsp;&nbsp; 有两个原因，第一可能是你皮肤天生缺乏弹性，所以容易有皱纹；第二可能是皮肤干燥引起的细纹。应该使用湿润性高的护眼霜，平时留意避免拭擦眼睛、频密眨眼等小动作。<BR>困惑六︰每次化妆上粉后，眼下面的细纹就变得很明显，是否要用较滋润的粉底？<BR>解决︰可能因为皮肤太过干燥所致，建议可以在化妆前使用保湿力强的打底霜，帮助纾缓及抚平细纹，使粉底更能紧贴肌肤。<BR>困惑七︰<BR>&nbsp;&nbsp;&nbsp; 我双眼很容易长出油脂粒，是否用的眼霜太油腻？<BR>解决︰<BR>&nbsp;&nbsp;&nbsp; 眼部皮肤比较薄弱，本身亦较少油脂分泌，除非极为干燥，否则应该使用清爽型的保养品；尤其是年轻的女孩子，保湿比滋润更重要。<BR>困惑八︰<BR>&nbsp;&nbsp;&nbsp; 我一天睡足八小时，为什么眼圈还是这么黑？<BR>解决︰<BR>&nbsp;&nbsp;&nbsp; 可能因为你天生皮下的黑色素较为活跃，亦可能是眼部血液循环不良所致。平日应多做眼部按摩，以冷热毛巾轮流敷眼，尽量改善眼部血液循环的情况。<BR></P>		  <p style=\"margin-top:20px;float:left;\">\r</p>        \',\n)');
